package hu.bible;

public class hubible19 {

public hubible19() {

putmapbible19_1();
putmapbible19_2();

}

private void putmapbible19_1() {

husuperobject.biblemap.put("b19_1_1", new husuperobject(19,1,1,"Boldog ember az, a ki nem jár gonoszok tanácsán, bûnösök útján meg nem áll, és csúfolódók székében nem ül;"));
husuperobject.biblemap.put("b19_1_2", new husuperobject(19,1,2,"Hanem az Úr törvényében van gyönyörûsége, és az õ törvényérõl gondolkodik éjjel és nappal."));
husuperobject.biblemap.put("b19_1_3", new husuperobject(19,1,3,"És olyan lesz, mint a folyóvizek mellé ültetett fa, a mely idejekorán megadja gyümölcsét, és levele nem hervad el; és minden munkájában jó szerencsés lészen."));
husuperobject.biblemap.put("b19_1_4", new husuperobject(19,1,4,"Nem úgy a gonoszok, hanem, mint a polyva, a mit szétszór a szél."));
husuperobject.biblemap.put("b19_1_5", new husuperobject(19,1,5,"Azért nem állhatnak meg a gonoszok az ítéletben; sem a bûnösök az igazak gyülekezetében."));
husuperobject.biblemap.put("b19_1_6", new husuperobject(19,1,6,"Mert tudja az Úr az igazak útját; a gonoszok útja pedig elvész."));
husuperobject.biblemap.put("b19_2_1", new husuperobject(19,2,1,"Miért dühösködnek a pogányok, és gondolnak hiábavalóságot a népek?"));
husuperobject.biblemap.put("b19_2_2", new husuperobject(19,2,2,"A föld királyai felkerekednek és a fejedelmek együtt tanácskoznak az Úr ellen és az õ felkentje ellen:"));
husuperobject.biblemap.put("b19_2_3", new husuperobject(19,2,3,"Szaggassuk le az õ bilincseiket, és dobjuk le magunkról köteleiket!"));
husuperobject.biblemap.put("b19_2_4", new husuperobject(19,2,4,"Az egekben lakozó neveti, az Úr megcsúfolja õket."));
husuperobject.biblemap.put("b19_2_5", new husuperobject(19,2,5,"Majd szól nékik haragjában, és megrettenti õket gerjedelmében:"));
husuperobject.biblemap.put("b19_2_6", new husuperobject(19,2,6,"Én kentem ám fel az én királyomat a Sionon, az én szent hegyemen!"));
husuperobject.biblemap.put("b19_2_7", new husuperobject(19,2,7,"Törvényül hirdetem: Az Úr mondá nékem: Én fiam vagy te; én ma nemzettelek téged."));
husuperobject.biblemap.put("b19_2_8", new husuperobject(19,2,8,"Kérjed tõlem és odaadom néked a pogányokat örökségül, és birtokodul a föld határait."));
husuperobject.biblemap.put("b19_2_9", new husuperobject(19,2,9,"Összetöröd õket vasvesszõvel: széjjelzúzod õket, mint cserépedényt."));
husuperobject.biblemap.put("b19_2_10", new husuperobject(19,2,10,"Azért, királyok, legyetek eszesek, és okuljatok földnek bírái!"));
husuperobject.biblemap.put("b19_2_11", new husuperobject(19,2,11,"Szolgáljátok az Urat félelemmel, és örüljetek reszketéssel."));
husuperobject.biblemap.put("b19_2_12", new husuperobject(19,2,12,"Csókoljátok a Fiút, hogy meg ne haragudjék és el ne veszszetek az úton, mert hamar felgerjed az õ haragja. Boldogok mindazok, a kik õ benne bíznak!"));
husuperobject.biblemap.put("b19_3_1", new husuperobject(19,3,1,"Dávid zsoltára; fia, Absolon elõl való futásakor."));
husuperobject.biblemap.put("b19_3_2", new husuperobject(19,3,2,"Uram! mennyire megsokasodtak ellenségeim! sokan vannak a reám támadók!"));
husuperobject.biblemap.put("b19_3_3", new husuperobject(19,3,3,"Sokan mondják az én lelkem felõl: Nincs számára segítség Istennél, Szela."));
husuperobject.biblemap.put("b19_3_4", new husuperobject(19,3,4,"De te, oh Uram! paizsom vagy nékem, dicsõségem, az, a ki felmagasztalja az én fejemet."));
husuperobject.biblemap.put("b19_3_5", new husuperobject(19,3,5,"Felszóval kiálték az Úrhoz, és õ meghallgata engemet, az õ szentsége hegyérõl. Szela."));
husuperobject.biblemap.put("b19_3_6", new husuperobject(19,3,6,"Én lefekszem és elalszom; felébredek, mert az Úr támogat engem."));
husuperobject.biblemap.put("b19_3_7", new husuperobject(19,3,7,"Nem félek sok ezernyi néptõl sem, a mely köröskörül felállott ellenem."));
husuperobject.biblemap.put("b19_3_8", new husuperobject(19,3,8,"Kelj fel Uram, tarts meg engem Istenem, mert te verted arczul minden ellenségemet; a gonoszok fogait összetörted. [ (Psalms 3:9) Az Úré a szabadítás; [legyen] a te népeden a te áldásod. Szela. ]"));
husuperobject.biblemap.put("b19_4_1", new husuperobject(19,4,1,"Az éneklõmesternek a neginóthra, Dávid zsoltára."));
husuperobject.biblemap.put("b19_4_2", new husuperobject(19,4,2,"Mikor kiáltok, hallgass meg engem, igazságomnak Istene; szorultságomban tág tért adtál nékem; könyörülj rajtam és halld meg az én imádságomat!"));
husuperobject.biblemap.put("b19_4_3", new husuperobject(19,4,3,"Emberek fiai! Meddig lesz gyalázatban az én dicsõségem? [Meddig] szerettek hiábavalóságot, és kerestek hazugságot? Szela."));
husuperobject.biblemap.put("b19_4_4", new husuperobject(19,4,4,"Tudjátok meg hát, hogy kedveltjévé választott az Úr; meghallja az Úr, ha hozzá kiáltok!"));
husuperobject.biblemap.put("b19_4_5", new husuperobject(19,4,5,"Haragudjatok, de ne vétkezzetek: beszéljetek szívetekkel a ti ágyasházatokban és csillapodjatok! Szela."));
husuperobject.biblemap.put("b19_4_6", new husuperobject(19,4,6,"Igazságnak áldozatával áldozzatok, és bízzatok az Úrban."));
husuperobject.biblemap.put("b19_4_7", new husuperobject(19,4,7,"Sokan mondják: Kicsoda láttat velünk jót? Hozd fel reánk arczodnak világosságát, oh Uram!"));
husuperobject.biblemap.put("b19_4_8", new husuperobject(19,4,8,"Nagyobb örömöt adsz [így] szívembe, mint a mikor sok az õ búzájok és boruk. [ (Psalms 4:9) Békességben fekszem le és legott elaluszom; mert te, Uram, egyedül adsz nékem bátorságos lakozást. ]"));
husuperobject.biblemap.put("b19_5_1", new husuperobject(19,5,1,"Az éneklõmesternek a nehilótra, Dávid zsoltára."));
husuperobject.biblemap.put("b19_5_2", new husuperobject(19,5,2,"Uram, figyelmezz szavaimra; értsd meg az én sóhajtásomat!"));
husuperobject.biblemap.put("b19_5_3", new husuperobject(19,5,3,"Ügyelj az én kiáltásom szavára, én Királyom és én Istenem; mert én hozzád imádkozom!"));
husuperobject.biblemap.put("b19_5_4", new husuperobject(19,5,4,"Uram, jó reggel hallgasd meg az én szómat; jó reggel készülök hozzád és vigyázok."));
husuperobject.biblemap.put("b19_5_5", new husuperobject(19,5,5,"Mert nem olyan Isten vagy te, a ki hamisságban gyönyörködnél; nem lakhatik tenálad gonosz."));
husuperobject.biblemap.put("b19_5_6", new husuperobject(19,5,6,"Nem állhatnak meg szemeid elõtt a kevélyek, gyûlölsz te minden bûnt cselekedõt."));
husuperobject.biblemap.put("b19_5_7", new husuperobject(19,5,7,"Elveszted, a kik hazugságot szólnak; a vérszopó és álnok embert útálja az Úr."));
husuperobject.biblemap.put("b19_5_8", new husuperobject(19,5,8,"Én pedig a te kegyelmed sokaságából házadba mehetek; leborulok szent templomodban a te félelmedben."));
husuperobject.biblemap.put("b19_5_9", new husuperobject(19,5,9,"Uram, vezess engem a te igazságodban az én ellenségeim miatt; egyengesd elõttem a te útadat!"));
husuperobject.biblemap.put("b19_5_10", new husuperobject(19,5,10,"Mert nincsen az õ szájokban egyenesség, belsejök csupa romlottság; nyitott sír az õ torkuk, nyelvökkel hizelkednek."));
husuperobject.biblemap.put("b19_5_11", new husuperobject(19,5,11,"Kárhoztasd õket, oh Isten; essenek el saját tanácsaik által; taszítsd el õket vétkeik sokasága miatt, mert fellázadtak ellened."));
husuperobject.biblemap.put("b19_5_12", new husuperobject(19,5,12,"És majd örülnek mindnyájan, a kik bíznak benned; mindörökké vígadjanak, és te megoltalmazod õket, és örvendeznek te benned, a kik szeretik a te nevedet. [ (Psalms 5:13) Mert te, Uram, megáldod az igazat, körülveszed a te jóvoltoddal, mint egy paizszsal. ]"));
husuperobject.biblemap.put("b19_6_1", new husuperobject(19,6,1,"Az éneklõmesternek a neginóthra, a seminith szerint; Dávid zsoltára."));
husuperobject.biblemap.put("b19_6_2", new husuperobject(19,6,2,"Uram, ne feddj meg engem haragodban, és ne ostorozz engem búsulásodban."));
husuperobject.biblemap.put("b19_6_3", new husuperobject(19,6,3,"Könyörülj rajtam Uram, mert ellankadtam: gyógyíts meg engem Uram, mert megháborodtak csontjaim!"));
husuperobject.biblemap.put("b19_6_4", new husuperobject(19,6,4,"Lelkem is igen megháborodott, és te, oh Uram, míglen?"));
husuperobject.biblemap.put("b19_6_5", new husuperobject(19,6,5,"Térj vissza Uram, mentsd ki lelkemet, segíts meg engem kegyelmedért;"));
husuperobject.biblemap.put("b19_6_6", new husuperobject(19,6,6,"Mert nincs emlékezés rólad a halálban, a seolban kicsoda dicsõít téged?"));
husuperobject.biblemap.put("b19_6_7", new husuperobject(19,6,7,"Elfáradtam sóhajtozásomban, egész éjjel áztattam ágyamat, könyhullatással öntöztem nyoszolyámat."));
husuperobject.biblemap.put("b19_6_8", new husuperobject(19,6,8,"Szemem a bánattól elbágyadt, megvénhedett minden szorongatóm miatt."));
husuperobject.biblemap.put("b19_6_9", new husuperobject(19,6,9,"Távozzatok tõlem mind, ti bûnt cselekedõk, mert meghallgatja az Úr az én siralmam szavát."));
husuperobject.biblemap.put("b19_6_10", new husuperobject(19,6,10,"Meghallgatja az Úr az én könyörgésemet, elfogadja az Úr az én imádságomat. [ (Psalms 6:11) Megszégyenül majd és igen megháborodik minden ellenségem; meghátrálnak és megszégyenülnek hirtelen. ]"));
husuperobject.biblemap.put("b19_7_1", new husuperobject(19,7,1,"Dávid siggajonja, a melyet az Úrhoz énekelt a Benjáminita Kús beszéde miatt."));
husuperobject.biblemap.put("b19_7_2", new husuperobject(19,7,2,"Én Uram Istenem, benned bízom; oltalmazz meg engem minden üldözõmtõl, és szabadíts meg engem,"));
husuperobject.biblemap.put("b19_7_3", new husuperobject(19,7,3,"Hogy szét ne tépje, mint az oroszlán az én lelkemet, szét ne szaggassa, ha nincsen szabadító."));
husuperobject.biblemap.put("b19_7_4", new husuperobject(19,7,4,"Én Uram Istenem, ha cselekedtem ezt, ha hamisság van az én kezeimben."));
husuperobject.biblemap.put("b19_7_5", new husuperobject(19,7,5,"Ha gonoszszal fizettem jó emberemnek, és háborgattam ok nélkül való ellenségemet:"));
husuperobject.biblemap.put("b19_7_6", new husuperobject(19,7,6,"[Akkor] ellenség üldözze lelkemet s érje el és tapodja földre az én életemet, és sujtsa porba az én dicsõségemet. Szela."));
husuperobject.biblemap.put("b19_7_7", new husuperobject(19,7,7,"Kelj fel, Uram, haragodban, emelkedjél fel ellenségeim dühe ellen; serkenj fel mellettem, te, a ki parancsoltál ítéletet!"));
husuperobject.biblemap.put("b19_7_8", new husuperobject(19,7,8,"És népek gyülekezete vegyen téged körül, és felettök térj vissza a magasságba."));
husuperobject.biblemap.put("b19_7_9", new husuperobject(19,7,9,"Az Úr ítéli meg a népeket. Bírálj meg engem Uram, az én igazságom és ártatlanságom szerint!"));
husuperobject.biblemap.put("b19_7_10", new husuperobject(19,7,10,"Szünjék meg, kérlek, a gonoszok rosszasága és erõsítsd meg az igazat; mert az igaz Isten vizsgálja meg a szíveket és veséket."));
husuperobject.biblemap.put("b19_7_11", new husuperobject(19,7,11,"Az én paizsom az Istennél van, a ki megszabadítja az igazszívûeket."));
husuperobject.biblemap.put("b19_7_12", new husuperobject(19,7,12,"Isten igaz biró; és olyan Isten, a ki mindennap haragszik."));
husuperobject.biblemap.put("b19_7_13", new husuperobject(19,7,13,"Ha meg nem tér a [gonosz,] kardját élesíti, kézívét felvonja és felkészíti azt."));
husuperobject.biblemap.put("b19_7_14", new husuperobject(19,7,14,"Halálos eszközöket fordít reá, és megtüzesíti nyilait."));
husuperobject.biblemap.put("b19_7_15", new husuperobject(19,7,15,"Ímé, álnoksággal vajúdik [a gonosz], hamisságot fogan és hazugságot szül."));
husuperobject.biblemap.put("b19_7_16", new husuperobject(19,7,16,"Gödröt ás és mélyre vájja azt; de beleesik a verembe, a mit csinált."));
husuperobject.biblemap.put("b19_7_17", new husuperobject(19,7,17,"Forduljon vissza fejére az, a mit elkövetett, és szálljon feje tetejére az õ erõszakossága. [ (Psalms 7:18) Dicsérem az Urat az õ igazsága szerint, és éneklek a felséges Úr nevének. ]"));
husuperobject.biblemap.put("b19_8_1", new husuperobject(19,8,1,"Az éneklõmesternek a gittithre; Dávid zsoltára."));
husuperobject.biblemap.put("b19_8_2", new husuperobject(19,8,2,"Mi Urunk Istenünk, mily felséges a te neved az egész földön, a ki az egekre helyezted dicsõségedet."));
husuperobject.biblemap.put("b19_8_3", new husuperobject(19,8,3,"A csecsemõk és csecsszopók szájával erõsítetted meg hatalmadat a te ellenségeid miatt, hogy a gyûlölködõt és bosszúállót elnémítsd."));
husuperobject.biblemap.put("b19_8_4", new husuperobject(19,8,4,"Mikor látom egeidet, a te újjaidnak munkáját; a holdat és a csillagokat, a melyeket teremtettél:"));
husuperobject.biblemap.put("b19_8_5", new husuperobject(19,8,5,"Micsoda az ember - [mondom] - hogy megemlékezel róla? és az embernek fia, hogy gondod van reá?"));
husuperobject.biblemap.put("b19_8_6", new husuperobject(19,8,6,"Hiszen kevéssel tetted õt kisebbé az Istennél, és dicsõséggel és tisztességgel megkoronáztad õt!"));
husuperobject.biblemap.put("b19_8_7", new husuperobject(19,8,7,"Úrrá tetted õt kezeid munkáin, mindent lábai alá vetettél;"));
husuperobject.biblemap.put("b19_8_8", new husuperobject(19,8,8,"Juhokat és mindenféle barmot, és még a mezõnek vadait is;"));
husuperobject.biblemap.put("b19_8_9", new husuperobject(19,8,9,"Az ég madarait és a tenger halait, [mindent], a mi a tenger ösvényein jár. [ (Psalms 8:10) Mi Urunk Istenünk, mily felséges a te neved az egész földön! ]"));
husuperobject.biblemap.put("b19_9_1", new husuperobject(19,9,1,"Az éneklõmesternek a múthlabbén szerint; Dávid zsoltára."));
husuperobject.biblemap.put("b19_9_2", new husuperobject(19,9,2,"Dicsérlek Uram teljes szívemmel, hirdetem minden csudatételedet."));
husuperobject.biblemap.put("b19_9_3", new husuperobject(19,9,3,"Örülök és örvendezek tebenned, zengedezem, oh Magasságos, a te nevedet;"));
husuperobject.biblemap.put("b19_9_4", new husuperobject(19,9,4,"Hogy az én ellenségeim meghátráltak, elbuktak és elvesztek a te orczád elõtt;"));
husuperobject.biblemap.put("b19_9_5", new husuperobject(19,9,5,"Hogy véghezvitted ítéletemet és ügyemet: az ítélõ- székben ültél, mint igaz bíró."));
husuperobject.biblemap.put("b19_9_6", new husuperobject(19,9,6,"Megdorgáltad a pogányokat, elvesztetted a gonoszt: nevöket mindörökre kitörölted."));
husuperobject.biblemap.put("b19_9_7", new husuperobject(19,9,7,"Az ellenség megszünt, elpusztult örökre; és a városoknak, a miket feldúltál még az emlékezetök is elveszett."));
husuperobject.biblemap.put("b19_9_8", new husuperobject(19,9,8,"Az Úr pedig örökké trónol, ítéletre készítette el az õ székét."));
husuperobject.biblemap.put("b19_9_9", new husuperobject(19,9,9,"És õ megítéli a világot igazsággal, törvényt tesz a népeknek méltányosan."));
husuperobject.biblemap.put("b19_9_10", new husuperobject(19,9,10,"És lesz az Úr nyomorultak kõvára, kõvár a szükség idején."));
husuperobject.biblemap.put("b19_9_11", new husuperobject(19,9,11,"Azért te benned bíznak, a kik ismerik a te nevedet; mert nem hagytad el, Uram, a kik keresnek téged."));
husuperobject.biblemap.put("b19_9_12", new husuperobject(19,9,12,"Zengjetek az Úrnak, a ki Sionban lakik; hirdessétek a népek között az õ cselekedeteit."));
husuperobject.biblemap.put("b19_9_13", new husuperobject(19,9,13,"Mert számon kéri a [kiontott] vért, megemlékezik rólok, nem feledkezik el a szegények kiáltásáról."));
husuperobject.biblemap.put("b19_9_14", new husuperobject(19,9,14,"Könyörülj rajtam, Uram! lásd meg az én nyomorúságomat, a mely gyûlölõim miatt van, a ki felemelsz engem a halál kapuiból;"));
husuperobject.biblemap.put("b19_9_15", new husuperobject(19,9,15,"Hogy hirdessem minden dicséretedet Sion leányának kapuiban; hadd örvendjek a te szabadításodban."));
husuperobject.biblemap.put("b19_9_16", new husuperobject(19,9,16,"Besülyedtek a pogányok a verembe, a melyet ástak; a hálóban, a melyet elrejtettek, megakadt a lábok."));
husuperobject.biblemap.put("b19_9_17", new husuperobject(19,9,17,"Megismertetett az Úr, ítéletet hozott; a gonoszt annak kezemunkájával ejtette el. Higgajon. Szela."));
husuperobject.biblemap.put("b19_9_18", new husuperobject(19,9,18,"Seolba jutnak a gonoszok, [oda] minden nép, a mely elfeledkezik Istenrõl."));
husuperobject.biblemap.put("b19_9_19", new husuperobject(19,9,19,"Mert a szegény nem lesz végképen elfelejtve, a nyomorultak reménye sem vész el örökre."));
husuperobject.biblemap.put("b19_9_20", new husuperobject(19,9,20,"Kelj fel Uram, ne hatalmasodjék el a halandó; ítéltessenek meg a pogányok te elõtted! [ (Psalms 9:21) Rettentsd meg, Uram, õket; tudják meg a pogányok, hogy halandók õk! Szela. ]"));
husuperobject.biblemap.put("b19_10_1", new husuperobject(19,10,1,"Uram, miért állasz távol? Miért rejtõzöl el a szükség idején?"));
husuperobject.biblemap.put("b19_10_2", new husuperobject(19,10,2,"A gonosznak kevélysége miatt sanyarog a szegény. Essenek foglyul a cseleknek, a miket koholtak."));
husuperobject.biblemap.put("b19_10_3", new husuperobject(19,10,3,"Mert dicsekszik a gonosz az õ lelkének kivánságával, és a fösvény megveti és szidja az Urat."));
husuperobject.biblemap.put("b19_10_4", new husuperobject(19,10,4,"A gonosz az õ haragos kevélységében senkit sem tudakoz; nincs Isten, ez minden gondolatja."));
husuperobject.biblemap.put("b19_10_5", new husuperobject(19,10,5,"Szerencsések az õ útai minden idõben; messze vannak tõle ítéleteid, elfújja minden ellenségét."));
husuperobject.biblemap.put("b19_10_6", new husuperobject(19,10,6,"Azt mondja szívében: Nem rendülök meg soha örökké, mert nem [esem] bajba."));
husuperobject.biblemap.put("b19_10_7", new husuperobject(19,10,7,"Szája telve átkozódással, csalárdsággal és erõszakossággal; nyelve alatt hamisság és álnokság."));
husuperobject.biblemap.put("b19_10_8", new husuperobject(19,10,8,"Az utczák zugaiban lappang, a rejtekhelyeken megöli az ártatlant, szemei lesnek az ügyefogyottra."));
husuperobject.biblemap.put("b19_10_9", new husuperobject(19,10,9,"Leselkedik a rejtekhelyen, leselkedik, mint az oroszlán az õ barlangjában, hogy elragadja a szegényt; elragadja a szegényt, mihelyt hálójába foghatja azt."));
husuperobject.biblemap.put("b19_10_10", new husuperobject(19,10,10,"Lenyomja, tiporja, és erejétõl elesnek az ügyefogyottak."));
husuperobject.biblemap.put("b19_10_11", new husuperobject(19,10,11,"Azt mondja szívében: Elfelejtkezett Isten, elrejtette arczát: nem is látott soha!"));
husuperobject.biblemap.put("b19_10_12", new husuperobject(19,10,12,"Kelj fel Úr-Isten, emeld fel kezedet; ne feledkezzél el a szegényekrõl!"));
husuperobject.biblemap.put("b19_10_13", new husuperobject(19,10,13,"Miért szidja Istent a gonosz? [Miért] mondja szívében: Nem keresed [rajta.]"));
husuperobject.biblemap.put("b19_10_14", new husuperobject(19,10,14,"Te látod [ezt,] mert te megnézed a hamisságot és a fájdalmat, hogy rávessed kezed. Te reád hagyja magát az ügyefogyott, az árvának is te vagy segedelme."));
husuperobject.biblemap.put("b19_10_15", new husuperobject(19,10,15,"Törd össze a gonosznak karját; és keressed a rosszon az õ gonoszságát, míg már nem találsz."));
husuperobject.biblemap.put("b19_10_16", new husuperobject(19,10,16,"Az Úr király mindenha és mindörökké; a pogányok kivesznek az õ földjérõl."));
husuperobject.biblemap.put("b19_10_17", new husuperobject(19,10,17,"A szegények kivánságát meghallgatod, oh Uram! Megerõsíted szívöket, füleiddel figyelmezel,"));
husuperobject.biblemap.put("b19_10_18", new husuperobject(19,10,18,"Hogy ítéletet tégy az árvának és nyomorodottnak, hogy többé már ne rettentsen a földbõl való ember."));
husuperobject.biblemap.put("b19_11_1", new husuperobject(19,11,1,"Az éneklõmesternek; Dávidé. Az Úrban bízom; hogy mondhatjátok az én lelkemnek: fuss a ti hegyetekre, mint a madár?!"));
husuperobject.biblemap.put("b19_11_2", new husuperobject(19,11,2,"Mert ímé, a gonoszok megvonják az íjat, ráillesztették nyilokat az idegre, hogy a sötétségben az igazszívûekre lövöldözzenek."));
husuperobject.biblemap.put("b19_11_3", new husuperobject(19,11,3,"Mikor a fundamentomok is elrontattak, mit cselekedett az igaz?"));
husuperobject.biblemap.put("b19_11_4", new husuperobject(19,11,4,"Az Úr az õ szent templomában, az Úr trónja az egekben; az õ szemei látják, szemöldökei megpróbálják az emberek fiait."));
husuperobject.biblemap.put("b19_11_5", new husuperobject(19,11,5,"Az Úr az igazat megpróbálja, a gonoszt pedig, az álnokság kedvelõjét, gyûlöli az õ lelke."));
husuperobject.biblemap.put("b19_11_6", new husuperobject(19,11,6,"Hálókat hullat a gonoszokra; tûz, kénkõ és égetõ szél az õ osztályrészök!"));
husuperobject.biblemap.put("b19_11_7", new husuperobject(19,11,7,"Mert az Úr igaz; igazságot szeret, az igazak látják az õ orczáját."));
husuperobject.biblemap.put("b19_12_1", new husuperobject(19,12,1,"Az éneklõmesternek a seminithre; Dávid zsoltára."));
husuperobject.biblemap.put("b19_12_2", new husuperobject(19,12,2,"Segíts Uram, mert elfogyott a kegyes, mert eltüntek a hívek az emberek fiai közül."));
husuperobject.biblemap.put("b19_12_3", new husuperobject(19,12,3,"Hamisságot szól egyik a másiknak; hizelkedõ ajakkal kettõs szívbõl szólnak."));
husuperobject.biblemap.put("b19_12_4", new husuperobject(19,12,4,"Vágja ki az Úr mind a hizelkedõ ajkakat, a nyelvet, a mely nagyokat mond."));
husuperobject.biblemap.put("b19_12_5", new husuperobject(19,12,5,"A kik ezt mondják: Nyelvünkkel felülkerekedünk, ajkaink velünk vannak; ki lehetne Úr felettünk?"));
husuperobject.biblemap.put("b19_12_6", new husuperobject(19,12,6,"A szegények elnyomása miatt, a nyomorultak nyögése miatt legott felkelek, azt mondja az Úr; biztosságba helyezem azt, a ki arra vágyik."));
husuperobject.biblemap.put("b19_12_7", new husuperobject(19,12,7,"Az Úr beszédei tiszta beszédek, [mint] földbõl való kohóban megolvasztott ezüst, hétszer megtisztítva."));
husuperobject.biblemap.put("b19_12_8", new husuperobject(19,12,8,"Te Uram, tartsd meg õket; õrizd meg õket e nemzetségtõl örökké. [ (Psalms 12:9) Köröskörül járnak a gonoszok, mihelyt az alávalóság felmagasztaltatik az emberek fiai közt. ]"));
husuperobject.biblemap.put("b19_13_1", new husuperobject(19,13,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_13_2", new husuperobject(19,13,2,"Uram, meddig felejtkezel el rólam végképen? Meddig rejted el orczádat tõlem?"));
husuperobject.biblemap.put("b19_13_3", new husuperobject(19,13,3,"Meddig tanakodjam lelkemben, bánkódjam szívemben naponként? Meddig hatalmaskodik az én ellenségem rajtam?"));
husuperobject.biblemap.put("b19_13_4", new husuperobject(19,13,4,"Nézz ide, felelj nékem, Uram Istenem; világosítsd meg szemeimet, hogy el ne aludjam a halálra;"));
husuperobject.biblemap.put("b19_13_5", new husuperobject(19,13,5,"Hogy ne mondja ellenségem: meggyõztem õt; háborgatóim ne örüljenek, hogy tántorgok."));
husuperobject.biblemap.put("b19_13_6", new husuperobject(19,13,6,"Mert én a te kegyelmedben bíztam, örüljön a szívem a te segítségednek; hadd énekeljek az Úrnak, hogy jót tett velem!"));
husuperobject.biblemap.put("b19_14_1", new husuperobject(19,14,1,"Az éneklõmesternek; Dávidé. Azt mondja a balgatag az õ szívében: Nincs Isten. Megromlottak, útálatosságot cselekedtek; nincs, a ki jót cselekedjék."));
husuperobject.biblemap.put("b19_14_2", new husuperobject(19,14,2,"Az Úr letekintett a mennybõl az emberek fiaira, hogy meglássa, ha van-é értelmes, Istent keresõ?"));
husuperobject.biblemap.put("b19_14_3", new husuperobject(19,14,3,"Mindnyájan elhajlottak; egyetemben elromlottak, nincs, a ki jót cselekedjék, nincsen csak egy sem."));
husuperobject.biblemap.put("b19_14_4", new husuperobject(19,14,4,"Nem tudják-é [ezt] mind a gonosztévõk, a kik megeszik az én népemet, mintha kenyeret ennének, az Urat [pedig] segítségül nem hívják?"));
husuperobject.biblemap.put("b19_14_5", new husuperobject(19,14,5,"Majd rettegnek rettegéssel, mert Isten az igaz nemzetséggel van!"));
husuperobject.biblemap.put("b19_14_6", new husuperobject(19,14,6,"A szegénynek tanácsát kicsúfoljátok, mert az Úr az õ bizodalma."));
husuperobject.biblemap.put("b19_14_7", new husuperobject(19,14,7,"Vajha eljõne Sionból Izráelnek a szabadítás! Mikor az Úr visszahozza népének foglyait, Jákób örül majd és vigad Izráel."));
husuperobject.biblemap.put("b19_15_1", new husuperobject(19,15,1,"Dávid zsoltára."));
husuperobject.biblemap.put("b19_15_2", new husuperobject(19,15,2,"A ki tökéletességben jár, igazságot cselekszik, és igazat szól az õ szívében."));
husuperobject.biblemap.put("b19_15_3", new husuperobject(19,15,3,"Nem rágalmaz nyelvével; nem tesz rosszat felebarátjának, és nem szerez gyalázatot rokonainak."));
husuperobject.biblemap.put("b19_15_4", new husuperobject(19,15,4,"A megbélyegzett útálatos az õ szemeiben, de az Urat félõket tiszteli: a ki kárára esküszik, és meg nem változtatja."));
husuperobject.biblemap.put("b19_15_5", new husuperobject(19,15,5,"Pénzét nem adja uzsorára, és nem vesz el ajándékot az ártatlan ellen. A ki ezeket cselekszi, nem rendül meg soha örökké."));
husuperobject.biblemap.put("b19_16_1", new husuperobject(19,16,1,"Dávid miktámja."));
husuperobject.biblemap.put("b19_16_2", new husuperobject(19,16,2,"Ezt mondom az Úrnak: Én Uram vagy te; feletted való jóm nincsen."));
husuperobject.biblemap.put("b19_16_3", new husuperobject(19,16,3,"A szentekben, a kik e földön vannak és a felségesekben, bennök van minden gyönyörûségem."));
husuperobject.biblemap.put("b19_16_4", new husuperobject(19,16,4,"Megsokasodnak fájdalmaik, a kik más [isten után] sietnek; nem áldozom meg véres italáldozatjokat és nem veszem nevöket ajkaimra."));
husuperobject.biblemap.put("b19_16_5", new husuperobject(19,16,5,"Az Úr az én osztályos részem és poharam; te támogatod az én sorsomat."));
husuperobject.biblemap.put("b19_16_6", new husuperobject(19,16,6,"Az én részem kies helyre esett, nyilván szép örökség jutott nékem."));
husuperobject.biblemap.put("b19_16_7", new husuperobject(19,16,7,"Áldom az Urat, a ki tanácsot adott nékem; még éjjel is oktatnak engem az én veséim."));
husuperobject.biblemap.put("b19_16_8", new husuperobject(19,16,8,"Az Úrra néztem szüntelen; mert jobb kezem felõl van, meg nem rendülök."));
husuperobject.biblemap.put("b19_16_9", new husuperobject(19,16,9,"Azért örül az én szívem és örvendez az én lelkem; testem is biztosságban lakozik."));
husuperobject.biblemap.put("b19_16_10", new husuperobject(19,16,10,"Mert nem hagyod lelkemet a Seolban; nem engeded, hogy a te szented rothadást lásson."));
husuperobject.biblemap.put("b19_16_11", new husuperobject(19,16,11,"Te tanítasz engem az élet ösvényére, teljes öröm van tenálad; a te jobbodon gyönyörûségek vannak örökké."));
husuperobject.biblemap.put("b19_17_1", new husuperobject(19,17,1,"Dávid imádsága."));
husuperobject.biblemap.put("b19_17_2", new husuperobject(19,17,2,"A te orczádtól jõjjön ki ítéletem, a te szemeid hadd lássanak igazat."));
husuperobject.biblemap.put("b19_17_3", new husuperobject(19,17,3,"Megpróbáltad az én szívemet, meglátogattál éjjel; próbáltál engem, nem találtál semmi [rosszat; ha tán] gondoltam [is], nem jött ki a számon."));
husuperobject.biblemap.put("b19_17_4", new husuperobject(19,17,4,"Az emberek cselekedeteinél a te ajkad igéjével vigyáztam az erõszakosnak ösvényeire."));
husuperobject.biblemap.put("b19_17_5", new husuperobject(19,17,5,"Ragaszkodtak lépteim a te ösvényeidhez, nem ingadoztak lábaim."));
husuperobject.biblemap.put("b19_17_6", new husuperobject(19,17,6,"Hívtalak én, mert te felelhetsz nékem, Istenem! Hajtsd hozzám füledet, hallgasd meg az én beszédemet."));
husuperobject.biblemap.put("b19_17_7", new husuperobject(19,17,7,"Mutasd meg csudálatosan a te kegyelmedet, a ki megszabadítod jobboddal a te benned bízókat a támadóktól."));
husuperobject.biblemap.put("b19_17_8", new husuperobject(19,17,8,"Tarts meg engemet, mint szemed fényét; szárnyaid árnyékába rejts el engemet."));
husuperobject.biblemap.put("b19_17_9", new husuperobject(19,17,9,"A gonoszok elõl, a kik pusztítanak engem; ellenségeim elõl, a kik lelkendezve vesznek körül engem."));
husuperobject.biblemap.put("b19_17_10", new husuperobject(19,17,10,"Megkövéredett szívöket elzárták, szájokkal kevélyen szólanak."));
husuperobject.biblemap.put("b19_17_11", new husuperobject(19,17,11,"Körülvettek most minket mentünkben; szemeiket ránk szegzik, hogy földre terítsenek."));
husuperobject.biblemap.put("b19_17_12", new husuperobject(19,17,12,"Hasonlók az oroszlánhoz, a mely zsákmányra szomjaz, és a rejtekhelyen ülõ oroszlánkölyökhöz."));
husuperobject.biblemap.put("b19_17_13", new husuperobject(19,17,13,"Kelj fel, oh Uram! Szállj vele szembe, terítsd le õt, szabadítsd meg lelkemet a gonosztól fegyvereddel;"));
husuperobject.biblemap.put("b19_17_14", new husuperobject(19,17,14,"Az emberektõl, oh Uram, kezeddel, a világ embereitõl! Az õ osztályrészük az életben van; megtöltötted hasukat javaiddal, bõvölködnek fiakkal, a miök pedig marad, gyermekeikre hagyják."));
husuperobject.biblemap.put("b19_17_15", new husuperobject(19,17,15,"Én igazságban nézem a te orczádat, megelégszem a te ábrázatoddal, midõn felserkenek."));
husuperobject.biblemap.put("b19_18_1", new husuperobject(19,18,1,"Az éneklõmesternek, az Úr szolgájától, Dávidtól, a ki az Úrhoz ez ének szavait azon a napon mondotta, a melyen az Úr megszabadította õt minden ellenségének kezébõl, és a Saul kezébõl."));
husuperobject.biblemap.put("b19_18_2", new husuperobject(19,18,2,"És monda: Szeretlek Uram, én erõsségem!"));
husuperobject.biblemap.put("b19_18_3", new husuperobject(19,18,3,"Az Úr az én kõsziklám, váram és szabadítóm; az én Istenem, az én kõsziklám, õ benne bízom: az én paizsom, idvességem szarva, menedékem."));
husuperobject.biblemap.put("b19_18_4", new husuperobject(19,18,4,"Az Úrhoz kiáltok, a ki dicséretre méltó, és megszabadulok ellenségeimtõl."));
husuperobject.biblemap.put("b19_18_5", new husuperobject(19,18,5,"Halál kötelei vettek körül, s az istentelenség árjai rettentettek engem."));
husuperobject.biblemap.put("b19_18_6", new husuperobject(19,18,6,"A Seol kötelei vettek körül; a halál tõrei fogtak meg engem."));
husuperobject.biblemap.put("b19_18_7", new husuperobject(19,18,7,"Szükségemben az Urat hívtam, és az én Istenemhez kiáltottam; szavamat meghallá templomából, és kiáltásom eljutott füleibe."));
husuperobject.biblemap.put("b19_18_8", new husuperobject(19,18,8,"Megindult, megrendült a föld, s a hegyek fundamentomai inogtak; és megindultak, mert haragra gyúlt."));
husuperobject.biblemap.put("b19_18_9", new husuperobject(19,18,9,"Füst szállt fel orrából, és szájából emésztõ tûz; izzó szén gerjedt belõle."));
husuperobject.biblemap.put("b19_18_10", new husuperobject(19,18,10,"Lehajtotta az eget és leszállt, és homály volt lábai alatt."));
husuperobject.biblemap.put("b19_18_11", new husuperobject(19,18,11,"Kérubon haladt és röpült, és a szelek szárnyain suhant."));
husuperobject.biblemap.put("b19_18_12", new husuperobject(19,18,12,"A sötétséget tette rejtekhelyévé; sátora körülötte a sötét felhõk és sûrû fellegek."));
husuperobject.biblemap.put("b19_18_13", new husuperobject(19,18,13,"Az elõtte lévõ fényességbõl felhõin jégesõ tört át és eleven szén."));
husuperobject.biblemap.put("b19_18_14", new husuperobject(19,18,14,"És dörgött az Úr a mennyekben, és a Magasságos zengett; és jégesõ [hullt] és eleven szén."));
husuperobject.biblemap.put("b19_18_15", new husuperobject(19,18,15,"És kibocsátá nyilait és elszéleszté azokat, villámokat szórt és megháborította azokat."));
husuperobject.biblemap.put("b19_18_16", new husuperobject(19,18,16,"És meglátszottak a vizek medrei s megmutatkoztak a világ fundamentomai; a te feddésedtõl, Uram, a te orrod leheletének fuvásától."));
husuperobject.biblemap.put("b19_18_17", new husuperobject(19,18,17,"Lenyúlt a magasból és felvett engem; kivont engem nagy vizekbõl."));
husuperobject.biblemap.put("b19_18_18", new husuperobject(19,18,18,"Megszabadított engem az én erõs ellenségemtõl, s az én gyûlölõimtõl, a kik hatalmasabbak voltak nálamnál."));
husuperobject.biblemap.put("b19_18_19", new husuperobject(19,18,19,"Rám jöttek veszedelmem napján; de az Úr volt az én támaszom."));
husuperobject.biblemap.put("b19_18_20", new husuperobject(19,18,20,"És kivitt engem tágas helyre; kiragadt engem, mert kedvét leli bennem."));
husuperobject.biblemap.put("b19_18_21", new husuperobject(19,18,21,"Az Úr megfizetett nékem igazságom szerint, kezeimnek tisztasága szerint fizetett meg nékem;"));
husuperobject.biblemap.put("b19_18_22", new husuperobject(19,18,22,"Mert megõriztem az Úrnak útait, és gonoszul nem távoztam el az én Istenemtõl."));
husuperobject.biblemap.put("b19_18_23", new husuperobject(19,18,23,"Mert minden ítélete elõttem, és rendeléseit nem hánytam el magamtól."));
husuperobject.biblemap.put("b19_18_24", new husuperobject(19,18,24,"És tökéletes voltam elõtte, õrizkedtem az én vétkemtõl."));
husuperobject.biblemap.put("b19_18_25", new husuperobject(19,18,25,"És megfizetett nékem az Úr az én igazságom szerint; kezeim tisztasága szerint, a mi szemei elõtt van."));
husuperobject.biblemap.put("b19_18_26", new husuperobject(19,18,26,"Az irgalmashoz irgalmas vagy: a tökéleteshez tökéletes vagy."));
husuperobject.biblemap.put("b19_18_27", new husuperobject(19,18,27,"A tisztával tiszta vagy; s a visszáshoz visszás vagy."));
husuperobject.biblemap.put("b19_18_28", new husuperobject(19,18,28,"Mert te megtartod a nyomorult népet, és a kevély szemeket megalázod;"));
husuperobject.biblemap.put("b19_18_29", new husuperobject(19,18,29,"Mert te gyujtod meg az én szövétnekemet; az Úr az én Istenem megvilágosítja az én sötétségemet."));
husuperobject.biblemap.put("b19_18_30", new husuperobject(19,18,30,"Mert általad táboron is átfutok, és az én Istenem által kõfalon is átugrom."));
husuperobject.biblemap.put("b19_18_31", new husuperobject(19,18,31,"Az Istennek útja tökéletes; az Úrnak beszéde tiszta; paizsuk õ mindazoknak, a kik bíznak benne."));
husuperobject.biblemap.put("b19_18_32", new husuperobject(19,18,32,"Mert kicsoda Isten az Úron kivül? És kicsoda kõszikla a mi Istenünkön kivül?"));
husuperobject.biblemap.put("b19_18_33", new husuperobject(19,18,33,"Az Isten, a ki felövez engem erõvel, és tökéletessé teszi útamat:"));
husuperobject.biblemap.put("b19_18_34", new husuperobject(19,18,34,"Olyanná teszi lábamat, mint a szarvasé, és az én magas helyeimre állít engem."));
husuperobject.biblemap.put("b19_18_35", new husuperobject(19,18,35,"Õ tanítja kezemet a harczra, karjaim meghajlítják az érczíjat."));
husuperobject.biblemap.put("b19_18_36", new husuperobject(19,18,36,"És adtad nékem a te idvességednek paizsát, és a te jobbod megszilárdított engem, és a te jóvoltod felmagasztalt engem."));
husuperobject.biblemap.put("b19_18_37", new husuperobject(19,18,37,"Kiszélesítetted lépésemet alattam, és nem tántorogtak lábaim."));
husuperobject.biblemap.put("b19_18_38", new husuperobject(19,18,38,"Üldözöm ellenségeimet és elérem õket, és nem térek vissza, míg meg nem semmisültek."));
husuperobject.biblemap.put("b19_18_39", new husuperobject(19,18,39,"Összetöröm õket, hogy fel sem kelhetnek; lábaim alá hullanak."));
husuperobject.biblemap.put("b19_18_40", new husuperobject(19,18,40,"Mert te öveztél fel engem erõvel a harczra, alám görbeszted az ellenem felkelõket."));
husuperobject.biblemap.put("b19_18_41", new husuperobject(19,18,41,"És megadtad, hogy ellenségeim meghátráltak, és az én gyûlölõimet elpusztíthattam."));
husuperobject.biblemap.put("b19_18_42", new husuperobject(19,18,42,"Kiáltottak, de nem volt szabadító, az Úrhoz és nem felelt nékik."));
husuperobject.biblemap.put("b19_18_43", new husuperobject(19,18,43,"És apróra törtem õket, a milyen a szél elé való por, és megtapodtam õket mint utcza sarát."));
husuperobject.biblemap.put("b19_18_44", new husuperobject(19,18,44,"Megmentettél engem a nép pártoskodásaitól; nemzetek fejévé tettél engem; oly nép szolgál nékem, a melyet nem ismertem."));
husuperobject.biblemap.put("b19_18_45", new husuperobject(19,18,45,"A mint hall a fülök, engedelmeskednek, és idegenek is hizelegnek nékem."));
husuperobject.biblemap.put("b19_18_46", new husuperobject(19,18,46,"Az idegenek elepedtek, és reszketve jõnek elõ zárt helyeikbõl."));
husuperobject.biblemap.put("b19_18_47", new husuperobject(19,18,47,"Él az Úr és áldott az én kõsziklám, magasztaltassék hát az én idvességemnek Istene!"));
husuperobject.biblemap.put("b19_18_48", new husuperobject(19,18,48,"Az Isten, a ki bosszút áll értem, és népeket hajlít alám;"));
husuperobject.biblemap.put("b19_18_49", new husuperobject(19,18,49,"A ki megment engem ellenségeimtõl. Még az ellenem felkelõk fölött is felmagasztalsz engem, az erõszakos embertõl megszabadítasz engem."));
husuperobject.biblemap.put("b19_18_50", new husuperobject(19,18,50,"Azért dicsérlek téged, Uram, a nemzetek között, és éneket zengek a te nevednek. [ (Psalms 18:51) Nagy segítséget ád az õ királyának és irgalmasságot cselekszik az õ felkentjével, Dáviddal és az õ magvával mindörökké. ]"));
husuperobject.biblemap.put("b19_19_1", new husuperobject(19,19,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_19_2", new husuperobject(19,19,2,"Az egek beszélik Isten dicsõségét, és kezeinek munkáját hirdeti az égboltozat."));
husuperobject.biblemap.put("b19_19_3", new husuperobject(19,19,3,"Nap napnak mond beszédet; éj éjnek ad jelentést."));
husuperobject.biblemap.put("b19_19_4", new husuperobject(19,19,4,"Nem [olyan] szó, sem [olyan] beszéd, a melynek hangja nem hallható:"));
husuperobject.biblemap.put("b19_19_5", new husuperobject(19,19,5,"Szózatuk kihat az egész földre, és a világ végére az õ mondásuk. A napnak csinált bennök sátort."));
husuperobject.biblemap.put("b19_19_6", new husuperobject(19,19,6,"Olyan ez, mint egy võlegény, a ki az õ ágyasházából jön ki; örvend, mint egy hõs, hogy futhatja a pályát."));
husuperobject.biblemap.put("b19_19_7", new husuperobject(19,19,7,"Kijövetele az ég [egyik] szélétõl s forgása a [másik] széléig; és nincs semmi, a mi elrejtõzhetnék hevétõl."));
husuperobject.biblemap.put("b19_19_8", new husuperobject(19,19,8,"Az Úrnak törvénye tökéletes, megeleveníti a lelket; az Úrnak bizonyságtétele biztos, bölcscsé teszi az együgyût."));
husuperobject.biblemap.put("b19_19_9", new husuperobject(19,19,9,"Az Úrnak rendelései helyesek, megvidámítják a szívet; az Úrnak parancsolata világos, megvilágosítja a szemeket."));
husuperobject.biblemap.put("b19_19_10", new husuperobject(19,19,10,"Az Úrnak félelme tiszta, megáll mindörökké; az Úrnak ítéletei változhatatlanok s mindenestõl fogva igazságosak."));
husuperobject.biblemap.put("b19_19_11", new husuperobject(19,19,11,"Kivánatosabbak az aranynál, még a sok színaranynál is; és édesebbek a méznél, még a színméznél is."));
husuperobject.biblemap.put("b19_19_12", new husuperobject(19,19,12,"Szolgádat is intik azok; a ki megtartja azokat, nagy jutalma van."));
husuperobject.biblemap.put("b19_19_13", new husuperobject(19,19,13,"Ki veheti észre a tévedéseket? Titkos bûnöktõl tisztíts meg engemet."));
husuperobject.biblemap.put("b19_19_14", new husuperobject(19,19,14,"Tartsd távol a te szolgádat a szándékosoktól; ne uralkodjanak rajtam; akkor ártatlan leszek, és tiszta leszek, sok vétektõl. [ (Psalms 19:15) Legyenek kedvedre valók szájam mondásai, és az én szívem gondolatai elõtted, legyenek, oh Uram, kõsziklám és megváltóm. ]"));
husuperobject.biblemap.put("b19_20_1", new husuperobject(19,20,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_20_2", new husuperobject(19,20,2,"Hallgasson meg téged az Úr a szükség idején; oltalmazzon meg téged a Jákób Istenének neve."));
husuperobject.biblemap.put("b19_20_3", new husuperobject(19,20,3,"Küldjön néked segítséget a szent helyrõl; és a Sionból támogasson téged."));
husuperobject.biblemap.put("b19_20_4", new husuperobject(19,20,4,"Emlékezzék meg minden ételáldozatodról, és égõáldozataidat találja kövéreknek. Szela."));
husuperobject.biblemap.put("b19_20_5", new husuperobject(19,20,5,"Cselekedjék veled szíved szerint, és teljesítse minden szándékodat."));
husuperobject.biblemap.put("b19_20_6", new husuperobject(19,20,6,"Hogy örvendhessünk a te szabadulásodban, és a mi Istenünk nevében zászlót [lobogtassunk:] teljesítse az Úr minden kérésedet!"));
husuperobject.biblemap.put("b19_20_7", new husuperobject(19,20,7,"Most tudom, hogy az Úr megsegíti felkentjét; meghallgatja õt szent egeibõl jobbjának segítõ erejével."));
husuperobject.biblemap.put("b19_20_8", new husuperobject(19,20,8,"Ezek szekerekben, amazok lovakban [bíznak;] mi pedig az Úrnak, a mi Istenünknek nevérõl emlékezünk meg."));
husuperobject.biblemap.put("b19_20_9", new husuperobject(19,20,9,"Azok meghanyatlanak és elesnek; mi pedig felkelünk és megállunk. [ (Psalms 20:10) Uram, segítsd meg a királyt! Hallgasson meg minket, mikor kiáltunk hozzá. ]"));
husuperobject.biblemap.put("b19_21_1", new husuperobject(19,21,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_21_2", new husuperobject(19,21,2,"Uram, a te erõsségedben örül a király, és a te segítségedben felette örvendez."));
husuperobject.biblemap.put("b19_21_3", new husuperobject(19,21,3,"Szívének kivánságát megadtad néki; és ajkainak kérését nem tagadtad meg. Szela."));
husuperobject.biblemap.put("b19_21_4", new husuperobject(19,21,4,"Sõt eléje vitted javaidnak áldásait; szín-arany koronát tettél fejére."));
husuperobject.biblemap.put("b19_21_5", new husuperobject(19,21,5,"Életet kért tõled: adtál néki hosszú idõt, örökkévalót és végtelent."));
husuperobject.biblemap.put("b19_21_6", new husuperobject(19,21,6,"Nagy az õ dicsõsége a te segítséged által; fényt és méltóságot adtál reája."));
husuperobject.biblemap.put("b19_21_7", new husuperobject(19,21,7,"Sõt áldássá tetted õt örökké, megvidámítottad õt színed örömével."));
husuperobject.biblemap.put("b19_21_8", new husuperobject(19,21,8,"Bizony a király bízik az Úrban, és nem inog meg, mert vele a Magasságosnak kegyelme."));
husuperobject.biblemap.put("b19_21_9", new husuperobject(19,21,9,"Megtalálja kezed minden ellenségedet; jobbod megtalálja gyûlölõidet."));
husuperobject.biblemap.put("b19_21_10", new husuperobject(19,21,10,"Tüzes kemenczévé teszed õket megjelenésed idején; az Úr az õ haragjában elnyeli õket és tûz emészti meg õket."));
husuperobject.biblemap.put("b19_21_11", new husuperobject(19,21,11,"Gyümölcsüket kiveszted e földrõl, és magvokat az emberek fiai közül."));
husuperobject.biblemap.put("b19_21_12", new husuperobject(19,21,12,"Mert gonoszságot terveztek ellened, csalárdságot gondoltak, de nem vihetik ki;"));
husuperobject.biblemap.put("b19_21_13", new husuperobject(19,21,13,"Mert meghátráltatod õket, íved húrjait arczuknak feszíted. [ (Psalms 21:14) Emelkedjél fel Uram, a te erõddel, hadd énekeljünk, hadd zengedezzük hatalmadat! ]"));
husuperobject.biblemap.put("b19_22_1", new husuperobject(19,22,1,"Az éneklõmesternek az ajjelethassakhar szerint; Dávid zsoltára."));
husuperobject.biblemap.put("b19_22_2", new husuperobject(19,22,2,"Én Istenem, én Istenem, miért hagytál el engemet? Távol van megtartásomtól jajgatásomnak szava."));
husuperobject.biblemap.put("b19_22_3", new husuperobject(19,22,3,"Én Istenem, kiáltok nappal, de nem hallgatsz meg; éjjel is és nincs nyugodalmam."));
husuperobject.biblemap.put("b19_22_4", new husuperobject(19,22,4,"Pedig te szent vagy, a ki Izráel dícséretei között lakozol."));
husuperobject.biblemap.put("b19_22_5", new husuperobject(19,22,5,"Benned bíztak atyáink; bíztak és te megszabadítottad õket."));
husuperobject.biblemap.put("b19_22_6", new husuperobject(19,22,6,"Hozzád kiáltottak és megmenekültek; benned bíztak és nem szégyenültek meg."));
husuperobject.biblemap.put("b19_22_7", new husuperobject(19,22,7,"De én féreg vagyok s nem férfiú; embereknek csúfja és a nép útálata."));
husuperobject.biblemap.put("b19_22_8", new husuperobject(19,22,8,"A kik engem látnak, mind csúfolkodnak rajtam, félrehúzzák ajkaikat és hajtogatják fejöket:"));
husuperobject.biblemap.put("b19_22_9", new husuperobject(19,22,9,"Az Úrra bízta magát, mentse meg õt; szabadítsa meg õt, hiszen gyönyörködött benne!"));
husuperobject.biblemap.put("b19_22_10", new husuperobject(19,22,10,"Mert te hoztál ki engem az anyám méhébõl, [és ]biztattál engem anyámnak emlõin."));
husuperobject.biblemap.put("b19_22_11", new husuperobject(19,22,11,"Születésem óta a te gondod voltam; anyám méhétõl fogva te voltál Istenem."));
husuperobject.biblemap.put("b19_22_12", new husuperobject(19,22,12,"Ne légy messze tõlem, mert közel a nyomorúság, és nincs, a ki segítsen."));
husuperobject.biblemap.put("b19_22_13", new husuperobject(19,22,13,"Tulkok sokasága kerített be engem, körülfogtak engem Básán bikái."));
husuperobject.biblemap.put("b19_22_14", new husuperobject(19,22,14,"Feltátották rám szájokat, mint a ragadozó és ordító oroszlán."));
husuperobject.biblemap.put("b19_22_15", new husuperobject(19,22,15,"Mint a víz, úgy kiöntettem; csontjaim mind széthullottak; szívem olyan lett, mint a viasz, megolvadt belsõ részeim között."));
husuperobject.biblemap.put("b19_22_16", new husuperobject(19,22,16,"Erõm kiszáradt, mint cserép, nyelvem ínyemhez tapadt, és a halál porába fektetsz engemet."));
husuperobject.biblemap.put("b19_22_17", new husuperobject(19,22,17,"Mert ebek vettek körül engem, a gonoszok serege körülfogott; átlyukasztották kezeimet és lábaimat."));
husuperobject.biblemap.put("b19_22_18", new husuperobject(19,22,18,"Megszámlálhatnám minden csontomat, õk pedig csak néznek [s] bámulnak rám."));
husuperobject.biblemap.put("b19_22_19", new husuperobject(19,22,19,"Megosztoznak ruháimon, és köntösömre sorsot vetnek."));
husuperobject.biblemap.put("b19_22_20", new husuperobject(19,22,20,"De te, Uram, ne légy messze tõlem; én erõsségem, siess segítségemre."));
husuperobject.biblemap.put("b19_22_21", new husuperobject(19,22,21,"Szabadítsd meg lelkemet a kardtól, s az én egyetlenemet a kutyák körmeibõl."));
husuperobject.biblemap.put("b19_22_22", new husuperobject(19,22,22,"Ments meg engem az oroszlán torkából, és a bivalyok szarvai közül hallgass meg engem."));
husuperobject.biblemap.put("b19_22_23", new husuperobject(19,22,23,"Hadd hirdessem nevedet atyámfiainak, és dicsérjelek téged a gyülekezetben."));
husuperobject.biblemap.put("b19_22_24", new husuperobject(19,22,24,"Ti, a kik félitek az Urat, dicsérjétek õt! Jákób minden ivadékai dicsõítsétek õt, és féljétek õt Izráel minden magzata!"));
husuperobject.biblemap.put("b19_22_25", new husuperobject(19,22,25,"Mert nem veti meg és nem útálja meg a szegény nyomorúságát; és nem rejti el az õ orczáját elõle, és mikor kiált hozzá, meghallgatja."));
husuperobject.biblemap.put("b19_22_26", new husuperobject(19,22,26,"Felõled lesz dicséretem a nagy gyülekezetben. Az én fogadásaimat megadom azok elõtt, a kik félik õt."));
husuperobject.biblemap.put("b19_22_27", new husuperobject(19,22,27,"Esznek a nyomorultak és megelégesznek, dicsérik az Urat, a kik õt keresik. Éljen szívetek örökké!"));
husuperobject.biblemap.put("b19_22_28", new husuperobject(19,22,28,"Megemlékeznek és megtérnek az Úrhoz a föld minden határai, és leborul elõtted a pogányok minden nemzetsége."));
husuperobject.biblemap.put("b19_22_29", new husuperobject(19,22,29,"Mert az Úré a királyi hatalom, uralkodik a pogányokon is."));
husuperobject.biblemap.put("b19_22_30", new husuperobject(19,22,30,"Esznek és leborulnak a föld gazdagai mind; õ elõtte hajtanak térdet, a kik a porba hullanak, és a ki életben nem tarthatja lelkét."));
husuperobject.biblemap.put("b19_22_31", new husuperobject(19,22,31,"Õt szolgálják a fiak, az Úrról beszélnek az utódoknak. [ (Psalms 22:32) Eljõnek s hirdetik az õ igazságát az õ utánok való népnek, hogy ezt cselekedte! ]"));
husuperobject.biblemap.put("b19_23_1", new husuperobject(19,23,1,"Dávid zsoltára.  nem szûkölködöm."));
husuperobject.biblemap.put("b19_23_2", new husuperobject(19,23,2,"Fûves legelõkön nyugtat engem, [és] csendes vizekhez terelget engem."));
husuperobject.biblemap.put("b19_23_3", new husuperobject(19,23,3,"Lelkemet megvidámítja, az igazság ösvényein vezet engem az õ nevéért."));
husuperobject.biblemap.put("b19_23_4", new husuperobject(19,23,4,"Még ha a halál árnyékának völgyében járok is, nem félek a gonosztól, mert te velem vagy; a te veszszõd és botod, azok vigasztalnak engem."));
husuperobject.biblemap.put("b19_23_5", new husuperobject(19,23,5,"Asztalt terítesz nékem az én ellenségeim elõtt; elárasztod fejem olajjal; csordultig van a poharam."));
husuperobject.biblemap.put("b19_23_6", new husuperobject(19,23,6,"Bizonyára jóságod és kegyelmed követnek engem életem minden napján, s az Úr házában lakozom hosszú ideig."));
husuperobject.biblemap.put("b19_24_1", new husuperobject(19,24,1,"Dávid zsoltára.  a föld kereksége s annak lakosai."));
husuperobject.biblemap.put("b19_24_2", new husuperobject(19,24,2,"Mert õ alapította azt a tengereken, és a folyókon megerõsítette."));
husuperobject.biblemap.put("b19_24_3", new husuperobject(19,24,3,"Kicsoda megy fel az Úr hegyére? És kicsoda áll meg az õ szent helyén?"));
husuperobject.biblemap.put("b19_24_4", new husuperobject(19,24,4,"Az ártatlan kezû és tiszta szívû, a ki nem adja lelkét hiábavalóságra, és nem esküszik meg csalárdságra."));
husuperobject.biblemap.put("b19_24_5", new husuperobject(19,24,5,"Áldást nyer az Úrtól, és igazságot az idvesség Istenétõl."));
husuperobject.biblemap.put("b19_24_6", new husuperobject(19,24,6,"Ilyen az õt keresõk nemzetsége, a Jákób [nemzetsége,] a kik a te orczádat keresik. Szela."));
husuperobject.biblemap.put("b19_24_7", new husuperobject(19,24,7,"Ti kapuk, emeljétek fel fejeiteket, és emelkedjetek fel ti örökkévaló ajtók; hadd menjen be a dicsõség királya."));
husuperobject.biblemap.put("b19_24_8", new husuperobject(19,24,8,"Kicsoda ez a dicsõség királya? Az erõs és hatalmas Úr, az erõs hadakozó Úr."));
husuperobject.biblemap.put("b19_24_9", new husuperobject(19,24,9,"Ti kapuk, emeljétek fel fejeiteket, és emelkedjetek fel örökkévaló ajtók, hadd menjen be a dicsõség királya!"));
husuperobject.biblemap.put("b19_24_10", new husuperobject(19,24,10,"Kicsoda ez a dicsõség királya? A seregek Ura, õ a dicsõség királya. Szela."));
husuperobject.biblemap.put("b19_25_1", new husuperobject(19,25,1,"Dávidé."));
husuperobject.biblemap.put("b19_25_2", new husuperobject(19,25,2,"Istenem, benned bízom; ne szégyenüljek meg; ne örüljenek rajtam ellenségeim."));
husuperobject.biblemap.put("b19_25_3", new husuperobject(19,25,3,"Senki se szégyenüljön meg, a ki téged vár; szégyenüljenek meg, a kik ok nélkül elpártolnak tõled."));
husuperobject.biblemap.put("b19_25_4", new husuperobject(19,25,4,"Útjaidat, Uram, ismertesd meg velem, ösvényeidre taníts meg engem."));
husuperobject.biblemap.put("b19_25_5", new husuperobject(19,25,5,"Vezess engem a te igazságodban és taníts engem, mert te vagy az én szabadító Istenem, mindennap várlak téged."));
husuperobject.biblemap.put("b19_25_6", new husuperobject(19,25,6,"Emlékezzél meg, Uram, irgalmasságodról és kegyelmedrõl, mert azok öröktõl fogva vannak."));
husuperobject.biblemap.put("b19_25_7", new husuperobject(19,25,7,"Ifjúságomnak vétkeirõl és bûneimrõl ne emlékezzél meg; kegyelmed szerint emlékezzél meg rólam, a te jóvoltodért, Uram!"));
husuperobject.biblemap.put("b19_25_8", new husuperobject(19,25,8,"Jó és igaz az Úr, azért útba igazítja a vétkezõket."));
husuperobject.biblemap.put("b19_25_9", new husuperobject(19,25,9,"Igazságban járatja az alázatosokat, és az õ útjára tanítja meg az alázatosokat."));
husuperobject.biblemap.put("b19_25_10", new husuperobject(19,25,10,"Az Úrnak minden útja kegyelem és hûség azoknak, a kik szövetségét és bizonyságait megtartják."));
husuperobject.biblemap.put("b19_25_11", new husuperobject(19,25,11,"A te nevedért, Uram, bocsásd meg bûnömet, mert sok az."));
husuperobject.biblemap.put("b19_25_12", new husuperobject(19,25,12,"Kicsoda az, a ki féli az Urat? Megmutatja annak az útat, a melyet válaszszon."));
husuperobject.biblemap.put("b19_25_13", new husuperobject(19,25,13,"Annak lelke megmarad a jóban, és magzatja örökli a földet."));
husuperobject.biblemap.put("b19_25_14", new husuperobject(19,25,14,"Az Úr bizodalmas az õt félõkhöz, és szövetségével oktatja õket."));
husuperobject.biblemap.put("b19_25_15", new husuperobject(19,25,15,"Szemeim mindenha az Úrra [néznek,] mert õ húzza ki a tõrbõl lábamat."));
husuperobject.biblemap.put("b19_25_16", new husuperobject(19,25,16,"Tekints reám és könyörülj rajtam, mert árva és szegény vagyok."));
husuperobject.biblemap.put("b19_25_17", new husuperobject(19,25,17,"Eláradtak szívemnek szorongásai, nyomorúságaimból szabadíts meg engem."));
husuperobject.biblemap.put("b19_25_18", new husuperobject(19,25,18,"Lásd meg szegénységemet és gyötrelmemet; bocsásd meg minden bûnömet."));
husuperobject.biblemap.put("b19_25_19", new husuperobject(19,25,19,"Lásd meg ellenségeimet, mert megsokasodtak, és gyilkos gyûlölséggel gyûlölnek engem."));
husuperobject.biblemap.put("b19_25_20", new husuperobject(19,25,20,"Õrizd meg lelkemet és szabadíts meg engem; ne szégyenüljek meg, hogy benned bíztam."));
husuperobject.biblemap.put("b19_25_21", new husuperobject(19,25,21,"Ártatlanság és becsület védelmezzenek meg engem, mert téged várlak."));
husuperobject.biblemap.put("b19_25_22", new husuperobject(19,25,22,"Mentsd ki, Isten, Izráelt minden bajából."));
husuperobject.biblemap.put("b19_26_1", new husuperobject(19,26,1,"Dávidé."));
husuperobject.biblemap.put("b19_26_2", new husuperobject(19,26,2,"Próbálj meg, Uram, és kisérts meg, és vizsgáld meg veséimet és szívemet."));
husuperobject.biblemap.put("b19_26_3", new husuperobject(19,26,3,"Mert kegyelmed szemem elõtt van, és hûségedben járok-kelek."));
husuperobject.biblemap.put("b19_26_4", new husuperobject(19,26,4,"Nem ültem együtt hivalkodókkal, és alattomosokkal nem barátkoztam."));
husuperobject.biblemap.put("b19_26_5", new husuperobject(19,26,5,"Gyûlölöm a rosszak társaságát, és a gonoszokkal együtt nem ülök."));
husuperobject.biblemap.put("b19_26_6", new husuperobject(19,26,6,"Ártatlanságban mosom kezemet, és oltárodat gyakorlom Uram!"));
husuperobject.biblemap.put("b19_26_7", new husuperobject(19,26,7,"Hogy hallatós szóval dicsérjelek téged, és elbeszéljem minden csodatettedet."));
husuperobject.biblemap.put("b19_26_8", new husuperobject(19,26,8,"Uram, szeretem a te házadban való lakozást, és a te dicsõséged hajlékának helyét."));
husuperobject.biblemap.put("b19_26_9", new husuperobject(19,26,9,"Ne sorozd a bûnösökkel együvé lelkemet, sem életemet a vérszopókkal együvé,"));
husuperobject.biblemap.put("b19_26_10", new husuperobject(19,26,10,"A kiknek kezében vétek van, és jobbjuk telve vesztegetéssel."));
husuperobject.biblemap.put("b19_26_11", new husuperobject(19,26,11,"Én pedig ártatlanságban élek; ments meg és könyörülj rajtam."));
husuperobject.biblemap.put("b19_26_12", new husuperobject(19,26,12,"Lábam megáll igazsággal; áldom az Urat a gyülekezetekben."));
husuperobject.biblemap.put("b19_27_1", new husuperobject(19,27,1,"Dávidé."));
husuperobject.biblemap.put("b19_27_2", new husuperobject(19,27,2,"Ha gonoszok jõnek ellenem, hogy testemet egyék: szorongatóim és elleneim - õk botlanak meg és hullanak el."));
husuperobject.biblemap.put("b19_27_3", new husuperobject(19,27,3,"Ha tábor fog körül, nem fél szívem; habár had támad reám, mégis [õ benne] bízom én."));
husuperobject.biblemap.put("b19_27_4", new husuperobject(19,27,4,"Egyet kérek az Úrtól, azért esedezem: hogy lakhassam az Úr házában életemnek minden idejében; hogy nézhessem az Úrnak szépségét és gyönyörködhessem az õ templomában."));
husuperobject.biblemap.put("b19_27_5", new husuperobject(19,27,5,"Bizony elrejt engem az õ hajlékába a veszedelem napján; eltakar engem sátrának rejtekében, sziklára emel fel engem."));
husuperobject.biblemap.put("b19_27_6", new husuperobject(19,27,6,"Most is felül emeli fejemet ellenségeimen, a kik körültem vannak, és én az õ sátorában örömáldozatokkal áldozom, énekelek és zengedezek az Úrnak."));
husuperobject.biblemap.put("b19_27_7", new husuperobject(19,27,7,"Halld meg, Uram, hangomat - hívlak! Irgalmazz nékem és hallgass meg engem!"));
husuperobject.biblemap.put("b19_27_8", new husuperobject(19,27,8,"Helyetted mondja a szívem: Az én orczámat keressétek! A te orczádat keresem, oh Uram!"));
husuperobject.biblemap.put("b19_27_9", new husuperobject(19,27,9,"Ne rejtsd el orczádat elõlem; ne utasítsd el szolgádat haraggal; te voltál segítõm, ne taszíts el és ne hagyj el engem, üdvösségemnek Istene!"));
husuperobject.biblemap.put("b19_27_10", new husuperobject(19,27,10,"Ha atyám és anyám elhagynának is, az Úr magához vesz engem."));
husuperobject.biblemap.put("b19_27_11", new husuperobject(19,27,11,"Taníts meg engem a te útadra, oh Uram! Vezérelj engem egyenes ösvényen, az én üldözõim miatt."));
husuperobject.biblemap.put("b19_27_12", new husuperobject(19,27,12,"Ne adj át engem szorongatóim kivánságának, mert hamis tanúk támadnak ellenem, és erõszakot lihegnek."));
husuperobject.biblemap.put("b19_27_13", new husuperobject(19,27,13,"Bizony hiszem, hogy meglátom az Úr jóságát az élõknek földén!"));
husuperobject.biblemap.put("b19_27_14", new husuperobject(19,27,14,"Várjad az Urat, légy erõs; bátorodjék szíved és várjad az Urat."));
husuperobject.biblemap.put("b19_28_1", new husuperobject(19,28,1,"Dávidé.  ne fordulj el szótlanul tõlem, hogy ne legyek, ha néma maradnál, a sírba szállókhoz hasonló."));
husuperobject.biblemap.put("b19_28_2", new husuperobject(19,28,2,"Halld meg esedezéseimnek szavát, mikor kiáltok hozzád, és mikor felemelem kezeimet a te szentséged lakhelye felé."));
husuperobject.biblemap.put("b19_28_3", new husuperobject(19,28,3,"Ne számlálj engem a hitetlenek és gonosztevõk közé, a kik békességgel szólnak felebarátaikhoz, pedig gonoszság van szívökben."));
husuperobject.biblemap.put("b19_28_4", new husuperobject(19,28,4,"Fizess meg nékik az õ cselekedeteik és igyekezetök rosszasága szerint; kezök munkája szerint fizess meg nékik; add meg nékik jutalmukat!"));
husuperobject.biblemap.put("b19_28_5", new husuperobject(19,28,5,"Minthogy nem figyelnek az Úr cselekedeteire és kezének munkáira, lerontja õket és föl nem építi õket."));
husuperobject.biblemap.put("b19_28_6", new husuperobject(19,28,6,"Áldott az Úr, hogy meghallgatta esedezéseimnek szavát."));
husuperobject.biblemap.put("b19_28_7", new husuperobject(19,28,7,"Az Úr az én erõm és paizsom, õ benne bízott szívem és megsegíttettem; örvend szívem és énekemmel dicsérem õt."));
husuperobject.biblemap.put("b19_28_8", new husuperobject(19,28,8,"Az Úr az õ népének ereje, és az õ fölkentjének megtartó erõssége."));
husuperobject.biblemap.put("b19_28_9", new husuperobject(19,28,9,"Tartsd meg a te népedet és áldd meg a te örökségedet, legeltesd és magasztald fel õket mindörökké!"));
husuperobject.biblemap.put("b19_29_1", new husuperobject(19,29,1,"Dávid zsoltára."));
husuperobject.biblemap.put("b19_29_2", new husuperobject(19,29,2,"Adjátok az Úrnak neve tiszteletét, imádjátok az Urat szent ékességben."));
husuperobject.biblemap.put("b19_29_3", new husuperobject(19,29,3,"Az Úr szava [zeng] a vizek fölött, a dicsõség Istene mennydörög, az Úr ott van a nagy vizek felett."));
husuperobject.biblemap.put("b19_29_4", new husuperobject(19,29,4,"Az Úr szava erõs; az Úr szava fenséges."));
husuperobject.biblemap.put("b19_29_5", new husuperobject(19,29,5,"Az Úr szava czédrusokat tördel, összetöri az Úr a Libánon czédrusait is."));
husuperobject.biblemap.put("b19_29_6", new husuperobject(19,29,6,"És ugrándoztatja azokat, mint a borjút, a Libánont és a Szirjónt, mint a bivalyfiat."));
husuperobject.biblemap.put("b19_29_7", new husuperobject(19,29,7,"Az Úr szava tûzlángokat szór."));
husuperobject.biblemap.put("b19_29_8", new husuperobject(19,29,8,"Az Úr szava megrengeti a pusztát, megrengeti az Úr Kádesnek pusztáját."));
husuperobject.biblemap.put("b19_29_9", new husuperobject(19,29,9,"Az Úr szava megborjaztatja a nõstény szarvasokat, lehántja az erdõket, és az õ hajlékában mindene azt mondja: dicsõ!"));
husuperobject.biblemap.put("b19_29_10", new husuperobject(19,29,10,"Az Úr trónolt az özönvíz felett; így trónol az Úr, mint király, mindörökké."));
husuperobject.biblemap.put("b19_29_11", new husuperobject(19,29,11,"Az Úr ad erõt népének, az Úr megáldja népét békességgel."));
husuperobject.biblemap.put("b19_30_1", new husuperobject(19,30,1,"Dávid zsoltára. Templomszentelési ének."));
husuperobject.biblemap.put("b19_30_2", new husuperobject(19,30,2,"Magasztallak Uram, hogy felemeltél engem, és nem engedted, hogy ellenségeim örüljenek rajtam."));
husuperobject.biblemap.put("b19_30_3", new husuperobject(19,30,3,"Uram, Istenem, hozzád kiáltottam, és te meggyógyítottál engem!"));
husuperobject.biblemap.put("b19_30_4", new husuperobject(19,30,4,"Uram, felhoztad a Seolból az én lelkemet, fölélesztettél a sírbaszállók közül."));
husuperobject.biblemap.put("b19_30_5", new husuperobject(19,30,5,"Zengedezzetek az Úrnak, ti hívei! Dicsõítsétek szent emlékezetét."));
husuperobject.biblemap.put("b19_30_6", new husuperobject(19,30,6,"Mert csak pillanatig [tart] haragja, [de] élethossziglan jóakarata; este bánat száll be [hozzánk], reggelre öröm."));
husuperobject.biblemap.put("b19_30_7", new husuperobject(19,30,7,"Azt mondtam azért én jó állapotomban: Nem rendülhetek meg soha."));
husuperobject.biblemap.put("b19_30_8", new husuperobject(19,30,8,"Uram, jókedvedbõl erõsséget állítottál föl hegyemre; de elrejtéd orczádat, és megroskadtam."));
husuperobject.biblemap.put("b19_30_9", new husuperobject(19,30,9,"Hozzád kiáltok, Uram! Az én Uramnak irgalmáért könyörgök!"));
husuperobject.biblemap.put("b19_30_10", new husuperobject(19,30,10,"Mit használ vérem, ha sírba szállok? Dicsér-e téged a por; hirdeti-é igazságodat?"));
husuperobject.biblemap.put("b19_30_11", new husuperobject(19,30,11,"Hallgass meg, Uram, könyörülj rajtam! Uram, légy segítségem!"));
husuperobject.biblemap.put("b19_30_12", new husuperobject(19,30,12,"Siralmamat vígságra fordítottad, leoldoztad gyászruhámat, körülöveztél örömmel. [ (Psalms 30:13) Hogy zengjen néked és el ne hallgasson felõled a dicséret: Uram, én Istenem, örökké dicsõítlek téged. ]"));
husuperobject.biblemap.put("b19_31_1", new husuperobject(19,31,1,"Az éneklõmesternek, Dávid zsoltára."));
husuperobject.biblemap.put("b19_31_2", new husuperobject(19,31,2,"Te benned bíztam, Uram! Ne szégyenüljek meg soha; igazságoddal szabadíts meg engem."));
husuperobject.biblemap.put("b19_31_3", new husuperobject(19,31,3,"Hajtsd hozzám füledet, hamar szabadíts meg; légy nékem erõs kõszálam, erõdített házam, hogy megtarts engem."));
husuperobject.biblemap.put("b19_31_4", new husuperobject(19,31,4,"Mert kõsziklám és védõváram vagy te; vezess hát engem a te nevedért és vezérelj engemet."));
husuperobject.biblemap.put("b19_31_5", new husuperobject(19,31,5,"Ments ki engem a hálóból, a melyet titkon vetettek nékem; hiszen te vagy az én erõsségem."));
husuperobject.biblemap.put("b19_31_6", new husuperobject(19,31,6,"Kezedre bízom lelkemet, te váltasz meg engemet, oh Uram, hûséges Isten."));
husuperobject.biblemap.put("b19_31_7", new husuperobject(19,31,7,"Gyûlölöm a hazug hiúságok híveit, és az Úrban bízom én."));
husuperobject.biblemap.put("b19_31_8", new husuperobject(19,31,8,"Hadd vigadjak és örüljek a te kegyelmednek, a miért meglátod nyomorúságomat [és] megismered a háborúságokban lelkemet;"));
husuperobject.biblemap.put("b19_31_9", new husuperobject(19,31,9,"És nem rekesztesz be engem ellenség kezébe, [sõt] tágas térre állatod lábaimat."));
husuperobject.biblemap.put("b19_31_10", new husuperobject(19,31,10,"Könyörülj rajtam, Uram, mert szorongattatom; elsenyved a búbánat miatt szemem, lelkem, testem."));
husuperobject.biblemap.put("b19_31_11", new husuperobject(19,31,11,"Mert bánatban enyészik életem, és sóhajtásban [múlnak] éveim; bûnöm miatt roskadoz erõm, és kiasznak csontjaim."));
husuperobject.biblemap.put("b19_31_12", new husuperobject(19,31,12,"Temérdek üldözõm miatt csúfsággá lettem, kivált szomszédaimé, és ismerõseimnek félelmévé; a kik az utczán látnak, elfutnak tõlem."));
husuperobject.biblemap.put("b19_31_13", new husuperobject(19,31,13,"Töröltettem, akár a halott, az emlékezetbõl; olyanná lettem, mint az elroshadt edény."));
husuperobject.biblemap.put("b19_31_14", new husuperobject(19,31,14,"Mert hallottam sokak rágalmát, iszonyatosságot mindenfelõl, a mint együtt tanácskoztak ellenem, és tervezték, hogy elrabolják lelkemet."));
husuperobject.biblemap.put("b19_31_15", new husuperobject(19,31,15,"De én benned bízom, Uram! Azt mondom: Te vagy Istenem."));
husuperobject.biblemap.put("b19_31_16", new husuperobject(19,31,16,"Életem ideje kezedben van: szabadíts meg ellenségeim kezébõl és üldözõimtõl."));
husuperobject.biblemap.put("b19_31_17", new husuperobject(19,31,17,"Világosítsd meg orczádat a te szolgádon, tarts meg engem jóvoltodból."));
husuperobject.biblemap.put("b19_31_18", new husuperobject(19,31,18,"Uram, ne szégyenüljek meg, mivelhogy hívlak téged; a gonoszok szégyenüljenek meg [és] pusztuljanak a Seolba."));
husuperobject.biblemap.put("b19_31_19", new husuperobject(19,31,19,"A hazug ajkak némuljanak el, a melyek vakmerõen szólnak az igaz ellen, kevélységgel és megvetéssel."));
husuperobject.biblemap.put("b19_31_20", new husuperobject(19,31,20,"Mily bõséges a te jóságod, a melyet fentartasz a téged félõknek, [és] megbizonyítasz a te benned bízókon az emberek fiai elõtt."));
husuperobject.biblemap.put("b19_31_21", new husuperobject(19,31,21,"Elrejted õket a te orczádnak rejtekében az emberek zendülései elõl; sátorban õrzöd õket a perpatvarkodó nyelvektõl."));
husuperobject.biblemap.put("b19_31_22", new husuperobject(19,31,22,"Áldott az Úr, hogy csodálatossá tette kegyelmét rajtam, mint egy megerõsített városon!"));
husuperobject.biblemap.put("b19_31_23", new husuperobject(19,31,23,"Én ugyan azt gondoltam ijedtemben: Elvettettem szemeid elõl; de mégis, meghallgattad esedezéseimnek szavát, mikor kiáltottam hozzád."));
husuperobject.biblemap.put("b19_31_24", new husuperobject(19,31,24,"Szeressétek az Urat mind ti õ kedveltjei; a híveket megõrzi az Úr és bõven megfizet a kevélyen cselekvõknek! [ (Psalms 31:25) Legyetek erõsek és bátorodjék a ti szívetek mindnyájan, a kik várjátok az Urat! ]"));
husuperobject.biblemap.put("b19_32_1", new husuperobject(19,32,1,"Dávid tanítása."));
husuperobject.biblemap.put("b19_32_2", new husuperobject(19,32,2,"Boldog ember az, a kinek az Úr bûnt nem tulajdonít, és lelkében csalárdság nincsen."));
husuperobject.biblemap.put("b19_32_3", new husuperobject(19,32,3,"Míg elhallgatám, megavultak csontjaim a napestig való jajgatás miatt."));
husuperobject.biblemap.put("b19_32_4", new husuperobject(19,32,4,"Míg éjjel-nappal rám nehezedék kezed, életerõm ellankadt, mintegy a nyár hevében. Szela."));
husuperobject.biblemap.put("b19_32_5", new husuperobject(19,32,5,"Vétkemet bevallám néked, bûnömet el nem fedeztem. Azt mondtam: Bevallom hamisságomat az Úrnak - és te elvetted rólam bûneimnek terhét. Szela."));
husuperobject.biblemap.put("b19_32_6", new husuperobject(19,32,6,"Azért hozzád fohászkodjék minden kegyes, alkalmas idõben. Bár a nagy vizek áradnának, nem juthatnak azok el õ hozzá."));
husuperobject.biblemap.put("b19_32_7", new husuperobject(19,32,7,"Te vagy oltalmam, te mentesz meg veszedelemtõl; végy körül engem a szabadulás örömével! Szela."));
husuperobject.biblemap.put("b19_32_8", new husuperobject(19,32,8,"Bölcscsé teszlek és megtanítlak téged az útra, a melyen járj; szemeimmel tanácsollak téged."));
husuperobject.biblemap.put("b19_32_9", new husuperobject(19,32,9,"Ne legyetek oktalanok, mint a ló, mint az öszvér, a melyeknek kantárral és zabolával kell szorítani az állát, [mert] nem közelít hozzád."));
husuperobject.biblemap.put("b19_32_10", new husuperobject(19,32,10,"Sok bánata van a gonosznak, de a ki bízik az Úrban, kegyelemmel veszi azt körül."));
husuperobject.biblemap.put("b19_32_11", new husuperobject(19,32,11,"Örüljetek az Úrban, vigadozzatok ti igazak! Örvendezzetek mindnyájan ti egyeneslelkûek!"));
husuperobject.biblemap.put("b19_33_1", new husuperobject(19,33,1,"Örvendezzetek ti igazak, az Úrban; a hívekhez illik a dícséret."));
husuperobject.biblemap.put("b19_33_2", new husuperobject(19,33,2,"Dicsérjétek az Urat cziterával; tízhúrú hárfával zengjetek néki."));
husuperobject.biblemap.put("b19_33_3", new husuperobject(19,33,3,"Énekeljetek néki új éneket, lantoljatok lelkesen, harsogón."));
husuperobject.biblemap.put("b19_33_4", new husuperobject(19,33,4,"Mert az Úr szava igaz, és minden cselekedete hûséges."));
husuperobject.biblemap.put("b19_33_5", new husuperobject(19,33,5,"Szereti az igazságot és törvényt; az Úr kegyelmével telve a föld."));
husuperobject.biblemap.put("b19_33_6", new husuperobject(19,33,6,"Az Úr szavára lettek az egek, és szájának leheletére minden seregök."));
husuperobject.biblemap.put("b19_33_7", new husuperobject(19,33,7,"Összegyûjti a tenger vizeit, mintegy tömlõbe; tárházakba rakja a hullámokat."));
husuperobject.biblemap.put("b19_33_8", new husuperobject(19,33,8,"Féljen az Úrtól mind az egész föld, rettegjen tõle minden földi lakó."));
husuperobject.biblemap.put("b19_33_9", new husuperobject(19,33,9,"Mert õ szólt és meglett, õ parancsolt és elõállott."));
husuperobject.biblemap.put("b19_33_10", new husuperobject(19,33,10,"Az Úr elforgatja a nemzetek tanácsát, meghiúsítja a népek gondolatait."));
husuperobject.biblemap.put("b19_33_11", new husuperobject(19,33,11,"Az Úr tanácsa megáll mindörökké, szívének gondolatai nemzedékrõl-nemzedékre."));
husuperobject.biblemap.put("b19_33_12", new husuperobject(19,33,12,"Boldog nép az, a melynek Istene az Úr, az a nép, a melyet örökségül választott magának."));
husuperobject.biblemap.put("b19_33_13", new husuperobject(19,33,13,"Az égbõl letekint az Úr, látja az emberek minden fiát."));
husuperobject.biblemap.put("b19_33_14", new husuperobject(19,33,14,"Székhelyérõl lenéz a föld minden lakosára."));
husuperobject.biblemap.put("b19_33_15", new husuperobject(19,33,15,"Õ alkotta mindnyájok szivét, [és] jól tudja minden tettöket."));
husuperobject.biblemap.put("b19_33_16", new husuperobject(19,33,16,"Nem szabadul meg a király nagy sereggel; a hõs sem menekül meg nagy erejével;"));
husuperobject.biblemap.put("b19_33_17", new husuperobject(19,33,17,"Megcsal a ló a szabadításban, nagy erejével sem ment meg."));
husuperobject.biblemap.put("b19_33_18", new husuperobject(19,33,18,"Ámde az Úr szemmel tartja az õt félõket, az õ kegyelmében bízókat,"));
husuperobject.biblemap.put("b19_33_19", new husuperobject(19,33,19,"Hogy kimentse lelköket a halálból, és az éhségben [is] eltartsa õket."));
husuperobject.biblemap.put("b19_33_20", new husuperobject(19,33,20,"Lelkünk az Urat várja, segítségünk és paizsunk õ."));
husuperobject.biblemap.put("b19_33_21", new husuperobject(19,33,21,"Csak õ benne vigad a mi szívünk, csak az õ szent nevében bízunk!"));
husuperobject.biblemap.put("b19_33_22", new husuperobject(19,33,22,"Legyen, Uram, a te kegyelmed rajtunk, a miképen bíztunk te benned."));
husuperobject.biblemap.put("b19_34_1", new husuperobject(19,34,1,"Dávidé, mikor elváltoztatta értelmét Abimélek elõtt, és mikor ez elûzte õt és elment."));
husuperobject.biblemap.put("b19_34_2", new husuperobject(19,34,2,"Áldom az Urat minden idõben, dicsérete mindig ajkamon van!"));
husuperobject.biblemap.put("b19_34_3", new husuperobject(19,34,3,"Dicsekedik lelkem az Úrban; [s] hallják ezt a szegények és örülnek."));
husuperobject.biblemap.put("b19_34_4", new husuperobject(19,34,4,"Dicsõítsétek velem az Urat, és magasztaljuk együtt az õ nevét!"));
husuperobject.biblemap.put("b19_34_5", new husuperobject(19,34,5,"Megkerestem az Urat és meghallgatott engem, és minden félelmembõl kimentett engem."));
husuperobject.biblemap.put("b19_34_6", new husuperobject(19,34,6,"A kik õ reá néznek, azok felvidulnak, és arczuk meg nem pirul."));
husuperobject.biblemap.put("b19_34_7", new husuperobject(19,34,7,"Ez a szegény kiáltott, és az Úr meghallgatta, és minden bajából kimentette õt."));
husuperobject.biblemap.put("b19_34_8", new husuperobject(19,34,8,"Az Úr angyala tábort jár az õt félõk körül és kiszabadítja õket."));
husuperobject.biblemap.put("b19_34_9", new husuperobject(19,34,9,"Érezzétek és lássátok meg, hogy jó az Úr! Boldog az az ember, a ki õ benne bízik."));
husuperobject.biblemap.put("b19_34_10", new husuperobject(19,34,10,"Féljétek az Urat, ti szentjei! Mert a kik õt félik, nincs fogyatkozásuk."));
husuperobject.biblemap.put("b19_34_11", new husuperobject(19,34,11,"Az oroszlánok szûkölködnek, éheznek; de a kik az Urat keresik, semmi jót sem nélkülöznek."));
husuperobject.biblemap.put("b19_34_12", new husuperobject(19,34,12,"Jõjjetek fiaim, hallgassatok rám, megtanítlak titeket az Úr félelmére!"));
husuperobject.biblemap.put("b19_34_13", new husuperobject(19,34,13,"Ki az az ember, a kinek tetszik az élet, és szeret napokat, hogy jót láthasson?"));
husuperobject.biblemap.put("b19_34_14", new husuperobject(19,34,14,"Tartóztasd meg nyelvedet a gonosztól, és ajkadat a csalárd beszédtõl."));
husuperobject.biblemap.put("b19_34_15", new husuperobject(19,34,15,"Kerüld a rosszat és cselekedjél jót; keresd a békességet és kövesd azt."));
husuperobject.biblemap.put("b19_34_16", new husuperobject(19,34,16,"Az Úr szemei az igazakon vannak, és az õ fülei azoknak kiáltásán;"));
husuperobject.biblemap.put("b19_34_17", new husuperobject(19,34,17,"Az Úr orczája pedig a gonosztevõkön van, hogy kiirtsa, emlékezetöket a földrõl."));
husuperobject.biblemap.put("b19_34_18", new husuperobject(19,34,18,"[Ha igazak] kiáltnak, az Úr meghallgatja, és minden bajukból kimenti õket."));
husuperobject.biblemap.put("b19_34_19", new husuperobject(19,34,19,"Közel van az Úr a megtört szívekhez, és megsegíti a sebhedt lelkeket."));
husuperobject.biblemap.put("b19_34_20", new husuperobject(19,34,20,"Sok baja van az igaznak, de valamennyibõl kimenti az Úr."));
husuperobject.biblemap.put("b19_34_21", new husuperobject(19,34,21,"Megõrzi minden csontját, egy sem töretik meg azokból."));
husuperobject.biblemap.put("b19_34_22", new husuperobject(19,34,22,"A gonoszt gonoszság öli meg, és meglakolnak, a kik gyûlölik az igazat. [ (Psalms 34:23) Az Úr kimenti az õ szolgái lelkét, és senki meg nem lakol, a ki õ benne bízik. ]"));
husuperobject.biblemap.put("b19_35_1", new husuperobject(19,35,1,"Dávidé.  harczolj a velem harczolókkal."));
husuperobject.biblemap.put("b19_35_2", new husuperobject(19,35,2,"Ragadj paizst és vértet, és kelj föl segítségemre."));
husuperobject.biblemap.put("b19_35_3", new husuperobject(19,35,3,"Szegezz dárdát és rekeszd el üldözõim útját, mondd lelkemnek: Én vagyok segítséged."));
husuperobject.biblemap.put("b19_35_4", new husuperobject(19,35,4,"Szégyen, gyalázat érje azokat, a kik lelkemet keresik; vettessenek hátra és piruljanak, a kik vesztemet koholják."));
husuperobject.biblemap.put("b19_35_5", new husuperobject(19,35,5,"Legyenek olyanok, mint a polyva a szél elõtt; az Úrnak angyala verdesse [õket]."));
husuperobject.biblemap.put("b19_35_6", new husuperobject(19,35,6,"Legyen útjok sötét, csuszamlós, s az Úrnak angyala kergesse õket."));
husuperobject.biblemap.put("b19_35_7", new husuperobject(19,35,7,"Mert ok nélkül vetették elém titkon vont hálójokat, és ok nélkül ástak vermet az én lelkemnek."));
husuperobject.biblemap.put("b19_35_8", new husuperobject(19,35,8,"Érje õt romlás váratlanul, fogja meg hálója, a melyet kivetett, essék belé a veszedelembe."));
husuperobject.biblemap.put("b19_35_9", new husuperobject(19,35,9,"Az én lelkem pedig vigad majd az Úrban, örvendezve szabadításában."));
husuperobject.biblemap.put("b19_35_10", new husuperobject(19,35,10,"Minden tetemem ezt mondja majd: Kicsoda olyan, mint te, Uram?! A ki megszabadítod a nyomorultat a nála erõsebbtõl, a szegényt és szûkölködõt az õ megrablójától."));
husuperobject.biblemap.put("b19_35_11", new husuperobject(19,35,11,"Erõszakos tanúk állnak elõ; azt kérdezik tõlem, a mirõl nem tudok."));
husuperobject.biblemap.put("b19_35_12", new husuperobject(19,35,12,"Jóért roszszal fizetnek meg nékem, megrabolják lelkemet."));
husuperobject.biblemap.put("b19_35_13", new husuperobject(19,35,13,"Pedig én az õ betegségökben gyászba öltöztem, bõjttel gyötörtem lelkemet, imádságom kebelemre vissza-vissza szállt."));
husuperobject.biblemap.put("b19_35_14", new husuperobject(19,35,14,"Mintha barátom, testvérem volna, úgy jártam-keltem [érte;] mintha anyámat siratnám, úgy jártam bútól meghajolva:"));
husuperobject.biblemap.put("b19_35_15", new husuperobject(19,35,15,"Õk pedig örültek az én bukásomon és összegyûltek; összegyûltek ellenem a rágalmazók, tudtom nélkül gyaláztak és nem nyugodtak,"));
husuperobject.biblemap.put("b19_35_16", new husuperobject(19,35,16,"Ingyenélõk léha csúfkodásai közt fogaikat vicsorgatva rám."));
husuperobject.biblemap.put("b19_35_17", new husuperobject(19,35,17,"Oh Uram, meddig nézed? Szabadítsd meg lelkemet tombolásaiktól, az oroszlánkölyköktõl az én egyetlenemet."));
husuperobject.biblemap.put("b19_35_18", new husuperobject(19,35,18,"Dicsérlek a nagy gyülekezetben, az erõs nép között magasztallak téged."));
husuperobject.biblemap.put("b19_35_19", new husuperobject(19,35,19,"Ne örüljenek rajtam az én hazug ellenségeim, méltatlan gyûlölõim se hunyorgassanak rám."));
husuperobject.biblemap.put("b19_35_20", new husuperobject(19,35,20,"Mert nem beszélnek békességet, hanem a kik békességesek e földön, azok ellen álnok dolgokat koholnak."));
husuperobject.biblemap.put("b19_35_21", new husuperobject(19,35,21,"Föltátották rám szájokat, azt mondták: Haha! Haha! Látta a szemünk."));
husuperobject.biblemap.put("b19_35_22", new husuperobject(19,35,22,"Láttad, oh Uram - ne hallgass, oh Uram; ne légy távol tõlem!"));
husuperobject.biblemap.put("b19_35_23", new husuperobject(19,35,23,"Serkenj föl, ébredj ítéletemre, oh Uram, Istenem, az én ügyemért."));
husuperobject.biblemap.put("b19_35_24", new husuperobject(19,35,24,"Ítélj meg engem a te igazságod szerint, oh Uram, Istenem, hogy ne öröljenek rajtam!"));
husuperobject.biblemap.put("b19_35_25", new husuperobject(19,35,25,"Ne mondhassák szívökben: Örülj mi lelkünk! Ne mondhassák: Elnyeltük õt!"));
husuperobject.biblemap.put("b19_35_26", new husuperobject(19,35,26,"Szégyenüljenek meg, piruljanak együttesen, a kik bajomnak örülnek; szégyen és gyalázat borítsa be õket, a kik felfuvalkodtak ellenem."));
husuperobject.biblemap.put("b19_35_27", new husuperobject(19,35,27,"Vigadjanak és örüljenek, a kik kivánják az én igazságomat, hadd mondják mindenkor: Nagy az Úr, a ki kivánja az õ szolgájának békességét."));
husuperobject.biblemap.put("b19_35_28", new husuperobject(19,35,28,"Az én nyelvem pedig hirdetni fogja a te igazságodat, a te dicsõségedet minden napon."));
husuperobject.biblemap.put("b19_36_1", new husuperobject(19,36,1,"Az éneklõmesternek; az Úr szolgájáé, Dávidé."));
husuperobject.biblemap.put("b19_36_2", new husuperobject(19,36,2,"A gonosznak hamissága felõl így gondolkozom szívemben: nincs õ elõtte isten-félelem;"));
husuperobject.biblemap.put("b19_36_3", new husuperobject(19,36,3,"Mert hízeleg néki önmagának, ha bûnét elkövetheti, ha gyûlölködhetik."));
husuperobject.biblemap.put("b19_36_4", new husuperobject(19,36,4,"Szájának beszéde hiábavalóság és hamisság; megszünt bölcs lenni [és] jót cselekedni."));
husuperobject.biblemap.put("b19_36_5", new husuperobject(19,36,5,"Hiábavalóságot gondol ágyában; nem a jó útra áll, [és] nem veti meg a rosszat."));
husuperobject.biblemap.put("b19_36_6", new husuperobject(19,36,6,"Uram, az égig [ér] a te kegyelmességed; a te hûséged a felhõkig!"));
husuperobject.biblemap.put("b19_36_7", new husuperobject(19,36,7,"Igazságod, mint Isten hegyei; ítéleteid, [mint] a nagy mélységek; az embert és barmot te tartod meg, Uram!"));
husuperobject.biblemap.put("b19_36_8", new husuperobject(19,36,8,"Oh Isten, milyen drága a te kegyelmességed; az embernek fiai a te szárnyaidnak árnyékába menekülnek."));
husuperobject.biblemap.put("b19_36_9", new husuperobject(19,36,9,"Dúslakodnak házadnak bõséges javaiban; megitatod õket gyönyörûségeid folyóvizébõl."));
husuperobject.biblemap.put("b19_36_10", new husuperobject(19,36,10,"Mert nálad van az életnek forrása; a te világosságod által látunk világosságot."));
husuperobject.biblemap.put("b19_36_11", new husuperobject(19,36,11,"Terjeszd ki kegyelmességedet a te ismerõidre, és igazságodat az igaz szívûekre."));
husuperobject.biblemap.put("b19_36_12", new husuperobject(19,36,12,"Ne támadjon engem a kevélynek lába, és ne üldözzön engem a gonosznak keze. [ (Psalms 36:13) Hullnak már a gonosztevõk; eltaszíttatnak és nem állhatnak fel! ]"));
husuperobject.biblemap.put("b19_37_1", new husuperobject(19,37,1,"Dávidé."));
husuperobject.biblemap.put("b19_37_2", new husuperobject(19,37,2,"Mert hirtelen levágattatnak, mint a fû, s mint a gyönge növény elfonnyadnak."));
husuperobject.biblemap.put("b19_37_3", new husuperobject(19,37,3,"Bízzál az Úrban és jót cselekedjél; e földön lakozzál és hûséggel élj."));
husuperobject.biblemap.put("b19_37_4", new husuperobject(19,37,4,"Gyönyörködjél az Úrban, és megadja néked szíved kéréseit."));
husuperobject.biblemap.put("b19_37_5", new husuperobject(19,37,5,"Hagyjad az Úrra a te útadat, és bízzál benne, majd õ teljesíti."));
husuperobject.biblemap.put("b19_37_6", new husuperobject(19,37,6,"Felhozza a te igazságodat, mint a világosságot, és a te jogodat, miként a delet."));
husuperobject.biblemap.put("b19_37_7", new husuperobject(19,37,7,"Csillapodjál le az Úrban és várjad õt; ne bosszankodjál arra, a kinek útja szerencsés, [se] arra, a ki álnok tanácsokat követ."));
husuperobject.biblemap.put("b19_37_8", new husuperobject(19,37,8,"Szünj meg a haragtól, hagyd el heveskedésedet; ne bosszankodjál, csak rosszra vinne!"));
husuperobject.biblemap.put("b19_37_9", new husuperobject(19,37,9,"Mert az elvetemültek kivágattatnak; de a kik az Urat várják, öröklik a földet."));
husuperobject.biblemap.put("b19_37_10", new husuperobject(19,37,10,"Egy kevés [idõ] még és nincs gonosz; nézed a helyét és nincsen ott."));
husuperobject.biblemap.put("b19_37_11", new husuperobject(19,37,11,"A szelidek pedig öröklik a földet, és gyönyörködnek nagy békességben."));
husuperobject.biblemap.put("b19_37_12", new husuperobject(19,37,12,"Fondorkodik a gonosz az igaz ellen, és fogait csikorgatja rá:"));
husuperobject.biblemap.put("b19_37_13", new husuperobject(19,37,13,"Az Úr neveti õt, mert látja, hogy eljõ az õ napja."));
husuperobject.biblemap.put("b19_37_14", new husuperobject(19,37,14,"Fegyvert vonnak a gonoszok; felvonják ívöket, hogy a szegényt és nyomorultat elejtsék, [és] leöljék az igazán élõket;"));
husuperobject.biblemap.put("b19_37_15", new husuperobject(19,37,15,"[De] fegyverök saját szívökbe hat, és ívök eltörik."));
husuperobject.biblemap.put("b19_37_16", new husuperobject(19,37,16,"Jobb a kevés az igaznak, mint a sok gonosznak az õ gazdagsága."));
husuperobject.biblemap.put("b19_37_17", new husuperobject(19,37,17,"Mert a gonoszok karja eltörik, de az igazakat támogatja az Úr."));
husuperobject.biblemap.put("b19_37_18", new husuperobject(19,37,18,"Jól tudja az Úr a feddhetetleneknek napjait, és hogy örökségök mindörökké meglesz."));
husuperobject.biblemap.put("b19_37_19", new husuperobject(19,37,19,"Nem szégyenülnek meg a veszedelmes idõben, és jóllaknak az éhség napjaiban."));
husuperobject.biblemap.put("b19_37_20", new husuperobject(19,37,20,"De a gonoszok elvesznek, és az Úrnak ellensége, mint a liget ékessége, elmúlik, füstként múlik el."));
husuperobject.biblemap.put("b19_37_21", new husuperobject(19,37,21,"Kölcsön kér a gonosz és meg nem fizet, de az igaz irgalmas és adakozó."));
husuperobject.biblemap.put("b19_37_22", new husuperobject(19,37,22,"Mert a kiket õ megáld, öröklik a földet, és a kiket õ megátkoz, kivágattatnak azok."));
husuperobject.biblemap.put("b19_37_23", new husuperobject(19,37,23,"Az Úr szilárdítja meg az igaz ember lépteit, és útját kedveli."));
husuperobject.biblemap.put("b19_37_24", new husuperobject(19,37,24,"Ha elesik, nem terül el, mert az Úr támogatja kezével."));
husuperobject.biblemap.put("b19_37_25", new husuperobject(19,37,25,"Gyermek voltam, meg is vénhedtem, de nem láttam, hogy elhagyottá lett volna az igaz, a magzatja pedig kenyérkéregetõvé."));
husuperobject.biblemap.put("b19_37_26", new husuperobject(19,37,26,"Mindennapon irgalmatoskodik és kölcsön ad, és az õ magzatja áldott."));
husuperobject.biblemap.put("b19_37_27", new husuperobject(19,37,27,"Kerüld a rosszat és jót cselekedjél, és megmaradsz mindörökké."));
husuperobject.biblemap.put("b19_37_28", new husuperobject(19,37,28,"Mert az Úr szereti az ítéletet, és el nem hagyja az õ kegyeseit; megõrzi õket mindörökké, a gonoszok magvát pedig kiirtja."));
husuperobject.biblemap.put("b19_37_29", new husuperobject(19,37,29,"Az igazak öröklik a földet, és mindvégig rajta lakoznak."));
husuperobject.biblemap.put("b19_37_30", new husuperobject(19,37,30,"Bölcseséget beszél az igaznak szája, és a nyelve ítéletet szól."));
husuperobject.biblemap.put("b19_37_31", new husuperobject(19,37,31,"Istenének törvénye van szívében, lépései nem ingadoznak."));
husuperobject.biblemap.put("b19_37_32", new husuperobject(19,37,32,"Leselkedik a gonosz az igazra, és halálra keresi azt;"));
husuperobject.biblemap.put("b19_37_33", new husuperobject(19,37,33,"De az Úr nem hagyja azt annak kezében, sem nem kárhoztatja, mikor megítéltetik."));
husuperobject.biblemap.put("b19_37_34", new husuperobject(19,37,34,"Várjad az Urat, õrizd meg az õ útját; és fölmagasztal téged, hogy örököld a földet; és meglátod, a mikor kiirtatnak a gonoszok."));
husuperobject.biblemap.put("b19_37_35", new husuperobject(19,37,35,"Láttam elhatalmasodni a gonoszt és szétterjeszkedett az, mint egy gazdag lombozatú vadfa;"));
husuperobject.biblemap.put("b19_37_36", new husuperobject(19,37,36,"De elmult és ímé nincsen! kerestem, de nem található."));
husuperobject.biblemap.put("b19_37_37", new husuperobject(19,37,37,"Ügyelj a feddhetetlenre, nézd a becsületest, mert a jövendõ a béke emberéé."));
husuperobject.biblemap.put("b19_37_38", new husuperobject(19,37,38,"De a bûnösök mind elvesznek; a gonosznak vége pusztulás."));
husuperobject.biblemap.put("b19_37_39", new husuperobject(19,37,39,"Az igazak segedelme pedig az Úrtól van; õ az õ erõsségök a háborúság idején."));
husuperobject.biblemap.put("b19_37_40", new husuperobject(19,37,40,"Megvédi õket az Úr és megszabadítja õket; megszabadítja õket a gonoszoktól és megsegíti õket, mert õ benne bíznak."));
husuperobject.biblemap.put("b19_38_1", new husuperobject(19,38,1,"Dávid zsoltára emlékeztetõül."));
husuperobject.biblemap.put("b19_38_2", new husuperobject(19,38,2,"Uram, haragodban ne fenyíts meg engem; felgerjedésedben ne ostorozz meg engem!"));
husuperobject.biblemap.put("b19_38_3", new husuperobject(19,38,3,"Mert nyilaid belém akadtak, és kezed rám nehezült."));
husuperobject.biblemap.put("b19_38_4", new husuperobject(19,38,4,"Nincs épség testemben a te haragodtól; nincs békesség csontjaimban vétkeim miatt."));
husuperobject.biblemap.put("b19_38_5", new husuperobject(19,38,5,"Mert bûneim elborítják fejemet; súlyos teherként, erõm felett."));
husuperobject.biblemap.put("b19_38_6", new husuperobject(19,38,6,"Megsenyvedtek, megbûzhödtek sebeim oktalanságom miatt."));
husuperobject.biblemap.put("b19_38_7", new husuperobject(19,38,7,"Lehorgadtam, meggörbedtem nagyon; naponta szomorúan járok."));
husuperobject.biblemap.put("b19_38_8", new husuperobject(19,38,8,"Mert derekam megtelt gyulladással, és testemben semmi ép sincsen."));
husuperobject.biblemap.put("b19_38_9", new husuperobject(19,38,9,"Erõtlen és összetört vagyok nagyon, s szívem keserûsége miatt jajgatok."));
husuperobject.biblemap.put("b19_38_10", new husuperobject(19,38,10,"Uram, elõtted van minden kívánságom, és nincs elõled elrejtve az én nyögésem!"));
husuperobject.biblemap.put("b19_38_11", new husuperobject(19,38,11,"Szívem dobogva ver, elhágy erõm, s szemem világa - az sincs már velem."));
husuperobject.biblemap.put("b19_38_12", new husuperobject(19,38,12,"Szeretteim és barátaim félreállanak csapásomban; rokonaim pedig messze állanak."));
husuperobject.biblemap.put("b19_38_13", new husuperobject(19,38,13,"De tõrt vetnek, a kik életemre törnek, és a kik bajomra törnek; hitványságokat beszélnek, és csalárdságot koholnak mindennap."));
husuperobject.biblemap.put("b19_38_14", new husuperobject(19,38,14,"De én, mint a siket, nem hallok, és olyan vagyok, mint a néma, a ki nem nyitja föl száját."));
husuperobject.biblemap.put("b19_38_15", new husuperobject(19,38,15,"És olyanná lettem, mint az, a ki nem hall, és szájában nincsen ellenmondás."));
husuperobject.biblemap.put("b19_38_16", new husuperobject(19,38,16,"Mert téged vártalak Uram, te hallgass meg Uram, Istenem!"));
husuperobject.biblemap.put("b19_38_17", new husuperobject(19,38,17,"Mert azt gondolom: csak ne örülnének rajtam; mikor lábam ingott, hatalmaskodtak ellenem!"));
husuperobject.biblemap.put("b19_38_18", new husuperobject(19,38,18,"És bizony közel vagyok az eleséshez, és bánatom mindig elõttem van."));
husuperobject.biblemap.put("b19_38_19", new husuperobject(19,38,19,"Sõt bevallom bûneimet, bánkódom vétkem miatt."));
husuperobject.biblemap.put("b19_38_20", new husuperobject(19,38,20,"De ellenségeim élnek, erõsödnek; megsokasodtak hazug gyûlölõim,"));
husuperobject.biblemap.put("b19_38_21", new husuperobject(19,38,21,"És a kik jóért roszszal fizetnek; ellenem törnek, a miért én jóra törekszem."));
husuperobject.biblemap.put("b19_38_22", new husuperobject(19,38,22,"Ne hagyj el Uram Istenem, ne távolodjál el tõlem! [ (Psalms 38:23) Siess segítségemre, oh Uram, én szabadítóm! ]"));
husuperobject.biblemap.put("b19_39_1", new husuperobject(19,39,1,"Az éneklõmesternek Jeduthunnak, Dávid zsoltára."));
husuperobject.biblemap.put("b19_39_2", new husuperobject(19,39,2,"Mondám: nosza vigyázok útaimra, hogy ne vétkezzem nyelvemmel; megzabolázom szájamat, a míg elõttem van a hitetlen."));
husuperobject.biblemap.put("b19_39_3", new husuperobject(19,39,3,"Elnémultam, vesztegléssel hallgattam a jóról, de fájdalmam felzaklatódott."));
husuperobject.biblemap.put("b19_39_4", new husuperobject(19,39,4,"Fölhevült bennem az én szívem, gondolatomban tûz gerjede fel, így szólék [azért] az én nyelvemmel:"));
husuperobject.biblemap.put("b19_39_5", new husuperobject(19,39,5,"Jelentsd meg Uram az én végemet és napjaim mértékét, mennyi az? Hadd tudjam, hogy milyen múlandó vagyok."));
husuperobject.biblemap.put("b19_39_6", new husuperobject(19,39,6,"Ímé tenyérnyivé tetted napjaimat, és az én életem te elõtted, mint a semmi. Bizony merõ hiábavalóság minden ember, akárhogyan áll is! Szela."));
husuperobject.biblemap.put("b19_39_7", new husuperobject(19,39,7,"Bizony árnyékként jár az ember; bizony csak hiába szorgalmatoskodik; rakásra gyûjt, de nem tudja, ki takarítja be azokat!"));
husuperobject.biblemap.put("b19_39_8", new husuperobject(19,39,8,"Most azért, mit reméljek, oh Uram?! Te benned van bizodalmam."));
husuperobject.biblemap.put("b19_39_9", new husuperobject(19,39,9,"Ments ki engem minden álnokságomból; ne tégy engem bolondok csúfjává!"));
husuperobject.biblemap.put("b19_39_10", new husuperobject(19,39,10,"Megnémultam, nem nyitom fel szájamat, mert te cselekedted."));
husuperobject.biblemap.put("b19_39_11", new husuperobject(19,39,11,"Vedd le rólam a te ostorodat; kezed fenyítéke miatt elenyészem én."));
husuperobject.biblemap.put("b19_39_12", new husuperobject(19,39,12,"Mikor a bûn miatt büntetéssel fenyítesz valakit, elemészted, mint moly, az õ szépségét. Bizony merõ hiábavalóság minden ember. Szela."));
husuperobject.biblemap.put("b19_39_13", new husuperobject(19,39,13,"Halld meg Uram az én könyörgésemet, figyelmezzél kiáltásomra, könyhullatásomra ne vesztegelj; mert én jövevény vagyok te nálad, zsellér, mint minden én õsöm. [ (Psalms 39:14) Ne nézz reám, hadd enyhüljek meg, mielõtt elmegyek és nem leszek többé! ]"));
husuperobject.biblemap.put("b19_40_1", new husuperobject(19,40,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_40_2", new husuperobject(19,40,2,"Várván vártam az Urat, és hozzám hajolt, és meghallgatta kiáltásomat."));
husuperobject.biblemap.put("b19_40_3", new husuperobject(19,40,3,"És kivont engem a pusztulás gödrébõl, a sáros fertõbõl, és sziklára állította fel lábamat, megerõsítvén lépteimet."));
husuperobject.biblemap.put("b19_40_4", new husuperobject(19,40,4,"És új éneket adott szájamba, a mi Istenünknek dicséretét; sokan látták és megfélemlettek, és bíztak az Úrban."));
husuperobject.biblemap.put("b19_40_5", new husuperobject(19,40,5,"Boldog ember az, a ki az Úrba vetette bizodalmát, és nem fordul a kevélyekhez és a hazugságra vetemedettekhez!"));
husuperobject.biblemap.put("b19_40_6", new husuperobject(19,40,6,"Sokat cselekedtél te, Uram Istenem, a te csodáiddal és terveiddel mi érettünk; semmi sem hasonlítható hozzád; hirdetném és elbeszélném, [de] többek, semhogy elszámlálhatnám."));
husuperobject.biblemap.put("b19_40_7", new husuperobject(19,40,7,"Véres áldozatot és ételáldozatot nem kedveltél; füleimet fölnyitottad; égõáldozatot és bûnért való áldozatot sem kívántál."));
husuperobject.biblemap.put("b19_40_8", new husuperobject(19,40,8,"Akkor azt mondtam: Ímé jövök; a könyvtekercsben írva van felõlem,"));
husuperobject.biblemap.put("b19_40_9", new husuperobject(19,40,9,"Hogy teljesítsem a te akaratodat; ezt kedvelem, én Istenem, a te törvényed keblem közepette van."));
husuperobject.biblemap.put("b19_40_10", new husuperobject(19,40,10,"Vígan hirdetem az igazságosságot a nagy gyülekezetben; ímé, nem tartom vissza ajkamat, te tudod, óh Uram!"));
husuperobject.biblemap.put("b19_40_11", new husuperobject(19,40,11,"Igazságosságodat nem rejtem el szívemben, elmondom a te hûségedet és segítségedet; nem titkolom el kegyelmedet és igazságodat a nagy gyülekezetben."));
husuperobject.biblemap.put("b19_40_12", new husuperobject(19,40,12,"Te, Uram, ne tartsd vissza tõlem irgalmadat; kegyelmed és igazságod mindig megóvnak engem."));
husuperobject.biblemap.put("b19_40_13", new husuperobject(19,40,13,"Mert bajok vettek engem körül, a melyeknek számuk sincsen; utolértek bûneim, a melyeket végig sem nézhetek; számosabbak a fejem hajszálainál, és a szívem [is] elhagyott engem."));
husuperobject.biblemap.put("b19_40_14", new husuperobject(19,40,14,"Tessék Uram néked, hogy megments engemet; siess Uram segítségemre!"));
husuperobject.biblemap.put("b19_40_15", new husuperobject(19,40,15,"Szégyenüljenek meg és piruljanak mind, a kik életemre törnek, hogy elragadják azt; riadjanak vissza, gyalázat érje, a kik bajomat kívánják."));
husuperobject.biblemap.put("b19_40_16", new husuperobject(19,40,16,"Pusztuljanak el az õ gyalázatosságuk miatt, a kik azt mondják nékem: Hehé, hehé!"));
husuperobject.biblemap.put("b19_40_17", new husuperobject(19,40,17,"Örülnek és örvendeznek majd mindazok, a kik téged keresnek; azt mondják mindenha: Magasztaltassék fel az Úr, a kik szeretik a te szabadításodat. [ (Psalms 40:18) Rólam is, noha én szegény és nyomorult vagyok, az én Uram visel gondot. Te vagy segítségem, szabadítóm, oh Istenem, ne késsél! ]"));
husuperobject.biblemap.put("b19_41_1", new husuperobject(19,41,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_41_2", new husuperobject(19,41,2,"Boldog, a ki a nyomorultra gondol; a veszedelem napján megmenti azt az Úr."));
husuperobject.biblemap.put("b19_41_3", new husuperobject(19,41,3,"Az Úr megõrzi azt és élteti azt; boldog lesz e földön, és nem adhatod oda ellenségei kivánságának."));
husuperobject.biblemap.put("b19_41_4", new husuperobject(19,41,4,"Az Úr megerõsíti õt az õ betegágyán; bármilyen az ágya, megkönnyíted betegségében."));
husuperobject.biblemap.put("b19_41_5", new husuperobject(19,41,5,"Én azt mondtam: Uram kegyelmezz nékem, gyógyítsd meg lelkemet, mert vétkeztem ellened!"));
husuperobject.biblemap.put("b19_41_6", new husuperobject(19,41,6,"Ellenségeim rosszat mondanak felõlem: Mikor hal meg és vész ki a neve?"));
husuperobject.biblemap.put("b19_41_7", new husuperobject(19,41,7,"Ha látogatni jön [be valaki,] hiábavalóságot beszél; szíve álnokságot gyûjt össze magának, kimegy az utczára [és] beszél."));
husuperobject.biblemap.put("b19_41_8", new husuperobject(19,41,8,"Minden gyûlölõm együtt suttog reám, gonoszat koholnak ellenem:"));
husuperobject.biblemap.put("b19_41_9", new husuperobject(19,41,9,"Istennek átka szállott õ reá, s mivelhogy benne fekszik, nem kél fel többé!"));
husuperobject.biblemap.put("b19_41_10", new husuperobject(19,41,10,"Még az én jóakaróm is, a kiben bíztam, a ki kenyeremet ette, fölemelte sarkát ellenem."));
husuperobject.biblemap.put("b19_41_11", new husuperobject(19,41,11,"De te Uram, könyörülj rajtam és emelj föl engemet, hadd fizessek meg nékik!"));
husuperobject.biblemap.put("b19_41_12", new husuperobject(19,41,12,"Abból tudom meg, hogy kedvelsz engemet, ha ellenségem nem ujjong felettem;"));
husuperobject.biblemap.put("b19_41_13", new husuperobject(19,41,13,"Engem pedig feddhetetlenségemben támogatsz, és színed elé állatsz mindenha. [ (Psalms 41:14) Áldott az Úr, Izráelnek Istene öröktõl fogva mindörökké. Ámen, ámen! ]"));
husuperobject.biblemap.put("b19_42_1", new husuperobject(19,42,1,"Az éneklõmesternek; Kóráh fiainak tanítása."));
husuperobject.biblemap.put("b19_42_2", new husuperobject(19,42,2,"Mint a szarvas kivánkozik a folyóvizekre, úgy kivánkozik az én lelkem hozzád, oh Isten!"));
husuperobject.biblemap.put("b19_42_3", new husuperobject(19,42,3,"Szomjuhozik lelkem Istenhez, az élõ Istenhez; mikor mehetek el és jelenhetek meg Isten elõtt?"));
husuperobject.biblemap.put("b19_42_4", new husuperobject(19,42,4,"Könyhullatásom volt kenyerem éjjel és nappal, mikor mindennap azt mondták nékem: Hol van a te Istened?"));
husuperobject.biblemap.put("b19_42_5", new husuperobject(19,42,5,"Mikor ezekrõl emlékezem, megkeseredem lelkemben; mert nagy csoportban vonultam [ezelõtt] és ujjongó örömmel és hálaadással vezettem õket, az ünneplõ sokaságot, az Isten házáig."));
husuperobject.biblemap.put("b19_42_6", new husuperobject(19,42,6,"Miért csüggedsz el lelkem és nyughatatlankodol bennem? Bízzál Istenben, mert még hálát adok én néki az õ orczájának szabadításáért."));
husuperobject.biblemap.put("b19_42_7", new husuperobject(19,42,7,"Istenem! elcsügged bennem az én lelkem; azért emlékezem reád a Jordán és Hermon földjérõl, a Miczár hegyérõl."));
husuperobject.biblemap.put("b19_42_8", new husuperobject(19,42,8,"Örvény örvényt hív elõ zuhatagjaid hangjára; minden vízáradásod és hullámod összecsap fölöttem!"));
husuperobject.biblemap.put("b19_42_9", new husuperobject(19,42,9,"Nappal kiküldte kegyelmét az Úr, éjjel éneke volt velem, imádság az én életem Istenéhez."));
husuperobject.biblemap.put("b19_42_10", new husuperobject(19,42,10,"Hadd mondjam Istennek, az én kõszálamnak: Miért felejtkeztél el rólam? Miért kell gyászban járnom ellenség háborgatása miatt?"));
husuperobject.biblemap.put("b19_42_11", new husuperobject(19,42,11,"Mintha zúzódás volna csontjaimban, mikor gyaláznak engem az én szorongatóim, naponként ezt mondván nékem: Hol van a te Istened? [ (Psalms 42:12) Miért csüggedsz el lelkem, és miért nyughatatlankodol bennem? Bízzál Istenben, mert még hálát adok én néki, az én szabadítómnak és Istenemnek. ]"));
husuperobject.biblemap.put("b19_43_1", new husuperobject(19,43,1,"Ítélj meg engem oh Isten! és oltalmazd meg ügyemet az irgalmatlan nemzetség ellen; az álnok és hamis embertõl szabadíts meg engem."));
husuperobject.biblemap.put("b19_43_2", new husuperobject(19,43,2,"Hiszen te vagy oltalmam Istene, miért vetettél hát meg engemet? Miért kell gyászban járnom ellenség háborgatása miatt?"));
husuperobject.biblemap.put("b19_43_3", new husuperobject(19,43,3,"Küldd el világosságodat és igazságodat, azok vezessenek engem; vigyenek el a te szent hegyedre és hajlékaidba."));
husuperobject.biblemap.put("b19_43_4", new husuperobject(19,43,4,"Hadd menjek be Isten oltárához, vígasságos örömömnek Istenéhez, és hadd dicsérjelek téged cziterával, Isten, én Istenem!"));
husuperobject.biblemap.put("b19_43_5", new husuperobject(19,43,5,"Miért csüggedsz el lelkem, miért nyughatatlankodol bennem? Bízzál Istenben, mert még hálát adok én néki, az én szabadítómnak és Istenemnek."));
husuperobject.biblemap.put("b19_44_1", new husuperobject(19,44,1,"Az éneklõmesternek; a Kóráh fiainak tanítása."));
husuperobject.biblemap.put("b19_44_2", new husuperobject(19,44,2,"Oh Isten! füleinkkel hallottuk, atyáink beszélték el nékünk a dolgot, a melyet napjaikban, a hajdankor napjaiban cselekedtél."));
husuperobject.biblemap.put("b19_44_3", new husuperobject(19,44,3,"Nemzeteket ûztél te ki saját kezeddel, õket pedig beplántáltad; népeket törtél össze, õket pedig kiterjesztetted."));
husuperobject.biblemap.put("b19_44_4", new husuperobject(19,44,4,"Mert nem az õ fegyverökkel szereztek földet, és nem az õ karjok segített nékik; hanem a te jobbod, a te karod és a te orczád világossága, mert kedvelted õket."));
husuperobject.biblemap.put("b19_44_5", new husuperobject(19,44,5,"Te magad vagy az én királyom oh Isten! Rendelj segítséget Jákóbnak!"));
husuperobject.biblemap.put("b19_44_6", new husuperobject(19,44,6,"Általad verjük le szorongatóinkat; a te neveddel tapodjuk le támadóinkat."));
husuperobject.biblemap.put("b19_44_7", new husuperobject(19,44,7,"Mert nem az ívemben bízom, és kardom sem védelmez meg engem;"));
husuperobject.biblemap.put("b19_44_8", new husuperobject(19,44,8,"Hanem te szabadítasz meg minket szorongatóinktól, és gyûlölõinket te szégyeníted meg."));
husuperobject.biblemap.put("b19_44_9", new husuperobject(19,44,9,"Dicsérjük Istent mindennap, és mindörökké magasztaljuk nevedet. Szela."));
husuperobject.biblemap.put("b19_44_10", new husuperobject(19,44,10,"Mégis megvetettél, meggyaláztál minket, és nem vonulsz ki seregeinkkel."));
husuperobject.biblemap.put("b19_44_11", new husuperobject(19,44,11,"Megfutamítottál minket szorongatóink elõtt, és a kik gyûlölnek minket, fosztogattak magoknak."));
husuperobject.biblemap.put("b19_44_12", new husuperobject(19,44,12,"Oda dobtál minket vágó-juhok gyanánt, és szétszórtál minket a nemzetek között."));
husuperobject.biblemap.put("b19_44_13", new husuperobject(19,44,13,"Eladtad a te népedet nagy olcsón, és nem becsülted az árát magasra."));
husuperobject.biblemap.put("b19_44_14", new husuperobject(19,44,14,"Csúfságul vetettél oda minket szomszédainknak, gúnyra és nevetségre a körültünk levõknek."));
husuperobject.biblemap.put("b19_44_15", new husuperobject(19,44,15,"Példabeszédül vetettél oda a pogányoknak, fejcsóválásra a népeknek."));
husuperobject.biblemap.put("b19_44_16", new husuperobject(19,44,16,"Gyalázatom naponta elõttem van, és orczám szégyene elborít engem."));
husuperobject.biblemap.put("b19_44_17", new husuperobject(19,44,17,"A csúfolók és káromlók szaváért, az ellenség és a bosszúálló miatt."));
husuperobject.biblemap.put("b19_44_18", new husuperobject(19,44,18,"Mindez utolért minket, mégsem feledtünk el téged, és nem szegtük meg a te frigyedet."));
husuperobject.biblemap.put("b19_44_19", new husuperobject(19,44,19,"Nem pártolt el tõled a mi szívünk, sem lépésünk nem tért le a te ösvényedrõl:"));
husuperobject.biblemap.put("b19_44_20", new husuperobject(19,44,20,"Noha kiûztél minket a sakálok helyére, és reánk borítottad a halál árnyékát."));
husuperobject.biblemap.put("b19_44_21", new husuperobject(19,44,21,"Ha elfeledtük volna Istenünk nevét, és kiterjesztettük volna kezünket idegen istenhez:"));
husuperobject.biblemap.put("b19_44_22", new husuperobject(19,44,22,"Nemde kifürkészte volna ezt Isten? Mert õ jól ismeri a szívnek titkait."));
husuperobject.biblemap.put("b19_44_23", new husuperobject(19,44,23,"Bizony te éretted gyilkoltak minket mindennapon; tekintettek bennünket, mint vágó-juhokat."));
husuperobject.biblemap.put("b19_44_24", new husuperobject(19,44,24,"Serkenj fel! Miért alszol Uram?! Kelj fel, ne vess el [minket] örökké!"));
husuperobject.biblemap.put("b19_44_25", new husuperobject(19,44,25,"Miért rejted el orczádat, és felejted el nyomorúságunkat és háborúságunkat?"));
husuperobject.biblemap.put("b19_44_26", new husuperobject(19,44,26,"Bizony porba hanyatlik lelkünk, a földhöz tapad testünk. [ (Psalms 44:27) Kelj fel a mi segítségünkre, ments meg minket a te kegyelmedért! ]"));
husuperobject.biblemap.put("b19_45_1", new husuperobject(19,45,1,"Az éneklõmesternek a sosannimra, Kóráh fiainak tanítása; ének a szerelmetesrõl."));
husuperobject.biblemap.put("b19_45_2", new husuperobject(19,45,2,"Fölbuzog szívem szép beszédre. Mondom: mûvem a királynak szól. Nyelvem gyors írónak tolla."));
husuperobject.biblemap.put("b19_45_3", new husuperobject(19,45,3,"Szebb, szebb vagy az ember fiainál, kedvesség ömledez ajakidon, azért áldott meg az Isten örökké."));
husuperobject.biblemap.put("b19_45_4", new husuperobject(19,45,4,"Kösd derekadra kardodat vitéz! Dicsõségedet és ékességedet."));
husuperobject.biblemap.put("b19_45_5", new husuperobject(19,45,5,"És ékességedben haladj diadallal az igazságért, a szelidségért [és] jogért, és rettenetesre tanítson meg téged a te jobb kezed."));
husuperobject.biblemap.put("b19_45_6", new husuperobject(19,45,6,"Nyilaid élesek; népek hullanak alád; a király ellenségeinek szívében."));
husuperobject.biblemap.put("b19_45_7", new husuperobject(19,45,7,"Trónod oh Isten örökkévaló; igazságnak pálczája a te királyságodnak pálczája."));
husuperobject.biblemap.put("b19_45_8", new husuperobject(19,45,8,"Szereted az igazságot, gyûlölöd a gonoszságot, azért kent fel Isten, a te Istened öröm olajával társaid fölé."));
husuperobject.biblemap.put("b19_45_9", new husuperobject(19,45,9,"Mirrha, áloe, kácziaillatú minden öltözeted; elefántcsont palotából zeneszóval vidámítnak téged."));
husuperobject.biblemap.put("b19_45_10", new husuperobject(19,45,10,"Királyok leányai a te ékességeid; jobb kezed felõl királyné áll ofiri aranyban."));
husuperobject.biblemap.put("b19_45_11", new husuperobject(19,45,11,"Halld csak leány, nézd csak; hajtsd ide füledet! Feledd el népedet és az atyád házát."));
husuperobject.biblemap.put("b19_45_12", new husuperobject(19,45,12,"Szépségedet a király kivánja; hiszen urad õ, hódolj hát néki!"));
husuperobject.biblemap.put("b19_45_13", new husuperobject(19,45,13,"Tyrus leánya is, a nép dúsai, ajándékkal hizelegnek néked."));
husuperobject.biblemap.put("b19_45_14", new husuperobject(19,45,14,"Csupa ékesség a király leánya bent, vont aranyból van a ruhája."));
husuperobject.biblemap.put("b19_45_15", new husuperobject(19,45,15,"Hímes öltözetben viszik a királyhoz, szûzek [vonulnak] utána, az õ társnõi; néked hozzák õket."));
husuperobject.biblemap.put("b19_45_16", new husuperobject(19,45,16,"Bevezetik õket örömmel, vígsággal; bemennek a király palotájába."));
husuperobject.biblemap.put("b19_45_17", new husuperobject(19,45,17,"Atyáid helyett fiaid lesznek, megteszed õket fejedelmekké mind az egész földön. [ (Psalms 45:18) Hadd hirdessem a te nevedet nemzedékrõl nemzedékre; örökkön örökké dicsérnek majd téged a népek! ]"));
husuperobject.biblemap.put("b19_46_1", new husuperobject(19,46,1,"Az éneklõmesternek, a Kóráh fiainak éneke, a halamothra."));
husuperobject.biblemap.put("b19_46_2", new husuperobject(19,46,2,"Isten a mi oltalmunk és erõsségünk! igen bizonyos segítség a nyomorúságban."));
husuperobject.biblemap.put("b19_46_3", new husuperobject(19,46,3,"Azért nem félünk, ha elváltoznék is a föld, ha hegyek omlanának is a tenger közepébe:"));
husuperobject.biblemap.put("b19_46_4", new husuperobject(19,46,4,"Zúghatnak, tajtékozhatnak hullámai; hegyek rendülhetnek meg háborgásától. Szela."));
husuperobject.biblemap.put("b19_46_5", new husuperobject(19,46,5,"Forrásainak árja megörvendezteti Isten városát, a Felségesnek szent hajlékait."));
husuperobject.biblemap.put("b19_46_6", new husuperobject(19,46,6,"Az Isten õ közepette van, nem rendül meg; megsegíti Isten virradatkor."));
husuperobject.biblemap.put("b19_46_7", new husuperobject(19,46,7,"Nemzetek zajongnak, országok mozognak; kiereszti hangját, megszeppen a föld."));
husuperobject.biblemap.put("b19_46_8", new husuperobject(19,46,8,"A Seregek Ura velünk van, Jákób Istene a mi várunk. Szela."));
husuperobject.biblemap.put("b19_46_9", new husuperobject(19,46,9,"Jõjjetek, lássátok az Úr tetteit, a ki pusztaságokat szerez a földön;"));
husuperobject.biblemap.put("b19_46_10", new husuperobject(19,46,10,"Hadakat némít el a föld széléig; ívet tör, kopját ront, hadi szekereket éget el tûzben."));
husuperobject.biblemap.put("b19_46_11", new husuperobject(19,46,11,"Csendesedjetek és ismerjétek el, hogy én vagyok az Isten! Felmagasztaltatom a nemzetek közt, felmagasztaltatom a földön. [ (Psalms 46:12) A Seregek Ura velünk van, Jákób Istene a mi várunk! Szela. ]"));
husuperobject.biblemap.put("b19_47_1", new husuperobject(19,47,1,"Az éneklõmesternek, a Kóráh fiainak zsoltára."));
husuperobject.biblemap.put("b19_47_2", new husuperobject(19,47,2,"Ti népek mind tapsoljatok, harsogjatok Istennek vígságos szóval."));
husuperobject.biblemap.put("b19_47_3", new husuperobject(19,47,3,"Mert az Úr felséges, rettenetes; nagy király az egész földön."));
husuperobject.biblemap.put("b19_47_4", new husuperobject(19,47,4,"Alánk veti a népeket, a nemzeteket lábaink alá."));
husuperobject.biblemap.put("b19_47_5", new husuperobject(19,47,5,"Kiválasztja nékünk örökségünket, Jákób dicsõségét, a kit szeret. Szela."));
husuperobject.biblemap.put("b19_47_6", new husuperobject(19,47,6,"Felvonul Isten harsona- szónál, kürtzengés közt az Úr."));
husuperobject.biblemap.put("b19_47_7", new husuperobject(19,47,7,"Énekeljetek Istennek, énekeljetek; énekeljetek királyunknak, énekeljetek!"));
husuperobject.biblemap.put("b19_47_8", new husuperobject(19,47,8,"Mert az egész föld királya az Isten: énekeljetek bölcseséggel."));
husuperobject.biblemap.put("b19_47_9", new husuperobject(19,47,9,"Isten uralkodik a nemzetek fölött; Isten ott ül az õ szentségének trónján. [ (Psalms 47:10) Népek fejedelmei gyülekeztek össze, mint Ábrahám Istenének népe, mert Istené a földnek pajzsai; magasságos õ igen! ]"));
husuperobject.biblemap.put("b19_48_1", new husuperobject(19,48,1,"A Kóráh fiainak zsoltáréneke."));
husuperobject.biblemap.put("b19_48_2", new husuperobject(19,48,2,"Nagy az Úr és igen dicséretes a mi Istenünknek városában, az õ szentséges hegyén."));
husuperobject.biblemap.put("b19_48_3", new husuperobject(19,48,3,"Szépen emelkedik az egész föld öröme, a Sion hegye, a szélsõ észak felé, a nagy királynak városa."));
husuperobject.biblemap.put("b19_48_4", new husuperobject(19,48,4,"Isten van az õ palotáiban, ismeretes ott, mint menedék."));
husuperobject.biblemap.put("b19_48_5", new husuperobject(19,48,5,"Mert ímé, a királyok összegyûltek, de tovatüntek együttesen."));
husuperobject.biblemap.put("b19_48_6", new husuperobject(19,48,6,"Meglátták õk, legott elcsodálkoztak; megijedtek, elriadtak."));
husuperobject.biblemap.put("b19_48_7", new husuperobject(19,48,7,"Rémület fogta el ott õket, fájdalom, a milyen a szülõasszonyé;"));
husuperobject.biblemap.put("b19_48_8", new husuperobject(19,48,8,"A keleti széllel összezúzod Tarsis hajóit."));
husuperobject.biblemap.put("b19_48_9", new husuperobject(19,48,9,"A miként hallottuk, akként láttuk a Seregek Urának városában, a mi Istenünk városában; örökre megerõsítette azt az Isten! Szela."));
husuperobject.biblemap.put("b19_48_10", new husuperobject(19,48,10,"A te kegyelmedrõl elmélkedünk oh Isten a te templomodnak belsejében."));
husuperobject.biblemap.put("b19_48_11", new husuperobject(19,48,11,"A milyen a neved oh Isten, olyan a te dicséreted a föld határáig; igazsággal teljes a te jobbod."));
husuperobject.biblemap.put("b19_48_12", new husuperobject(19,48,12,"Örül Sion hegye, ujjonganak Júda leányai a te ítéletedért."));
husuperobject.biblemap.put("b19_48_13", new husuperobject(19,48,13,"Vegyétek körül a Siont, kerüljétek meg azt, számláljátok meg tornyait."));
husuperobject.biblemap.put("b19_48_14", new husuperobject(19,48,14,"Jól nézzétek meg sánczait, járjátok be palotáit, hogy elmondhassátok a jövendõ nemzedéknek: [ (Psalms 48:15) Bizony ez az Isten a mi Istenünk mindörökké, õ vezet minket mindhalálig! ]"));
husuperobject.biblemap.put("b19_49_1", new husuperobject(19,49,1,"Az éneklõmesternek, a Kóráh fiainak zsoltára."));
husuperobject.biblemap.put("b19_49_2", new husuperobject(19,49,2,"Halljátok meg ezt mind ti népek, figyeljetek mind ti, e világ lakói!"));
husuperobject.biblemap.put("b19_49_3", new husuperobject(19,49,3,"Akár közemberek fiai, akár fõemberek fiai, együtt a gazdag és szegény."));
husuperobject.biblemap.put("b19_49_4", new husuperobject(19,49,4,"Az én szájam bölcsességet beszél, szívemnek elmélkedése tudomány."));
husuperobject.biblemap.put("b19_49_5", new husuperobject(19,49,5,"Példabeszédre hajtom fülemet, hárfaszóval nyitom meg mesémet."));
husuperobject.biblemap.put("b19_49_6", new husuperobject(19,49,6,"Miért féljek a gonoszság napjain, mikor nyomorgatóim bûne vesz körül,"));
husuperobject.biblemap.put("b19_49_7", new husuperobject(19,49,7,"A kik gazdagságukban bíznak, és nagy vagyonukkal dicsekesznek?"));
husuperobject.biblemap.put("b19_49_8", new husuperobject(19,49,8,"Senki sem válthatja meg atyjafiát, nem adhat érte váltságdíjat Istennek."));
husuperobject.biblemap.put("b19_49_9", new husuperobject(19,49,9,"Minthogy lelköknek váltsága drága, abba kell hagynia örökre;"));
husuperobject.biblemap.put("b19_49_10", new husuperobject(19,49,10,"Még ha örökké élne is és nem látná meg a sírgödört."));
husuperobject.biblemap.put("b19_49_11", new husuperobject(19,49,11,"De meglátja! A bölcsek is meghalnak; együtt vész el bolond és ostoba, és gazdagságukat másoknak hagyják."));
husuperobject.biblemap.put("b19_49_12", new husuperobject(19,49,12,"Gondolatjok [ez:] az õ házok örökkévaló, lakóhelyeik nemzedékrõl- nemzedékre [szállnak,] nevöket hangoztatják a földön."));
husuperobject.biblemap.put("b19_49_13", new husuperobject(19,49,13,"Pedig az ember, még ha tisztességben van, sem marad meg; hasonlít a barmokhoz, a melyeket levágnak."));
husuperobject.biblemap.put("b19_49_14", new husuperobject(19,49,14,"Ez az õ sorsuk bolondság nékik; de azért gyönyörködnek szavokban az õ követõik. Szela."));
husuperobject.biblemap.put("b19_49_15", new husuperobject(19,49,15,"Mint juhok, a Seolra vettetnek, a halál legelteti õket, és az igazak uralkodnak rajtok reggel; alakjokat elemészti a Seol, távol az õ lakásuktól."));
husuperobject.biblemap.put("b19_49_16", new husuperobject(19,49,16,"Csak Isten válthatja ki lelkemet a Seol kezébõl, mikor [az] megragad engem. Szela."));
husuperobject.biblemap.put("b19_49_17", new husuperobject(19,49,17,"Ne félj, ha valaki meggazdagszik, ha megöregbül házának dicsõsége;"));
husuperobject.biblemap.put("b19_49_18", new husuperobject(19,49,18,"Mert semmit sem vihet el magával, ha meghal; dicsõsége nem száll le utána."));
husuperobject.biblemap.put("b19_49_19", new husuperobject(19,49,19,"Ha életében áldottnak vallja is magát, s ha dicsérnek is téged, hogy jól tettél magaddal:"));
husuperobject.biblemap.put("b19_49_20", new husuperobject(19,49,20,"[Mégis] az õ atyáinak nemzetségéhez jut, a kik soha sem látnak világosságot. [ (Psalms 49:21) Az ember, még ha tisztességben van is, de nincs okossága: hasonlít a barmokhoz, a melyeket levágnak. ]"));
husuperobject.biblemap.put("b19_50_1", new husuperobject(19,50,1,"Asáf zsoltára."));
husuperobject.biblemap.put("b19_50_2", new husuperobject(19,50,2,"A Sionról, a melynek szépsége tökéletes, fényeskedik Isten."));
husuperobject.biblemap.put("b19_50_3", new husuperobject(19,50,3,"Eljön a mi Istenünk és nem hallgat; emésztõ tûz van elõtte, s körülte erõs forgószél."));
husuperobject.biblemap.put("b19_50_4", new husuperobject(19,50,4,"Hívja az egeket onnan felül, és a földet, hogy megítélje népét:"));
husuperobject.biblemap.put("b19_50_5", new husuperobject(19,50,5,"Gyûjtsétek elém kegyeseimet, a kik áldozattal erõsítik szövetségemet!"));
husuperobject.biblemap.put("b19_50_6", new husuperobject(19,50,6,"És az egek kijelentik az õ igazságát, mert az Isten biró. Szela."));
husuperobject.biblemap.put("b19_50_7", new husuperobject(19,50,7,"Hallgass én népem, hadd szóljak! Te Izráel, hadd tegyek bizonyságot rólad; Isten vagyok én, a te Istened."));
husuperobject.biblemap.put("b19_50_8", new husuperobject(19,50,8,"Nem feddlek én téged áldozataidért, és hogy égõáldozataid szüntelen elõttem vannak."));
husuperobject.biblemap.put("b19_50_9", new husuperobject(19,50,9,"[De] nem fogadhatok el tulkot a te házadból, vagy bakokat a te aklaidból;"));
husuperobject.biblemap.put("b19_50_10", new husuperobject(19,50,10,"Mert enyém az erdõnek minden vadja, a barmok az ezernyi hegyeken."));
husuperobject.biblemap.put("b19_50_11", new husuperobject(19,50,11,"Ismerem a hegyeknek minden szárnyasát, és a mezõ állatai [tudva vannak] nálam."));
husuperobject.biblemap.put("b19_50_12", new husuperobject(19,50,12,"Ha megéhezném, nem mondanám meg néked, mert enyém e világ és ennek mindene."));
husuperobject.biblemap.put("b19_50_13", new husuperobject(19,50,13,"Avagy eszem-é én a bikák húsát, és a bakoknak vérét iszom-é?"));
husuperobject.biblemap.put("b19_50_14", new husuperobject(19,50,14,"Hálával áldozzál az Istennek, és teljesítsd a felségesnek fogadásidat!"));
husuperobject.biblemap.put("b19_50_15", new husuperobject(19,50,15,"És hívj segítségül engem a nyomorúság idején, én megszabadítlak téged és te dicsõítesz engem."));
husuperobject.biblemap.put("b19_50_16", new husuperobject(19,50,16,"A gonosznak pedig ezt mondja Isten: Miért beszélsz te rendeléseimrõl, és veszed szádra az én szövetségemet?"));
husuperobject.biblemap.put("b19_50_17", new husuperobject(19,50,17,"Hiszen te gyûlölöd a fenyítést, és hátad mögé veted rendelésimet!"));
husuperobject.biblemap.put("b19_50_18", new husuperobject(19,50,18,"Ha lopót látsz, mellé adod magad, és ha paráznákat, társalkodol velök."));
husuperobject.biblemap.put("b19_50_19", new husuperobject(19,50,19,"A szádat gonoszságra tátod, és a nyelved csalárdságot szõ."));
husuperobject.biblemap.put("b19_50_20", new husuperobject(19,50,20,"Leülsz és felebarátodra beszélsz, anyád fiát is megszidalmazod."));
husuperobject.biblemap.put("b19_50_21", new husuperobject(19,50,21,"Ezeket teszed és én hallgassak? Azt gondolod, olyan vagyok, mint te? Megfeddelek téged, és elédbe sorozom [azokat.]"));
husuperobject.biblemap.put("b19_50_22", new husuperobject(19,50,22,"Értsétek meg ezt, ti Istent felejtõk, hogy el ne ragadjalak menthetetlenül:"));
husuperobject.biblemap.put("b19_50_23", new husuperobject(19,50,23,"A ki hálával áldozik, az dicsõít engem, és a ki az útra vigyáz, annak mutatom meg Istennek szabadítását."));
husuperobject.biblemap.put("b19_51_1", new husuperobject(19,51,1,"Az éneklõmesternek; Dávid zsoltára;"));
husuperobject.biblemap.put("b19_51_2", new husuperobject(19,51,2,"Mikor õ hozzá ment Nátán, a próféta, minekutána Bethsabéval vétkezett."));
husuperobject.biblemap.put("b19_51_3", new husuperobject(19,51,3,"Könyörülj rajtam én Istenem a te kegyelmességed szerint; irgalmasságodnak sokasága szerint töröld el az én bûneimet!"));
husuperobject.biblemap.put("b19_51_4", new husuperobject(19,51,4,"Egészen moss ki engemet az én álnokságomból, és az én vétkeimbõl tisztíts ki engemet;"));
husuperobject.biblemap.put("b19_51_5", new husuperobject(19,51,5,"Mert ismerem az én bûneimet, és az én vétkem szüntelen elõttem [forog.]"));
husuperobject.biblemap.put("b19_51_6", new husuperobject(19,51,6,"Egyedül te ellened vétkeztem, és cselekedtem azt, a mi gonosz a te szemeid elõtt; hogy igaz légy beszédedben, és tiszta ítéletedben."));
husuperobject.biblemap.put("b19_51_7", new husuperobject(19,51,7,"Ímé én vétekben fogantattam, és bûnben melengetett engem az anyám."));
husuperobject.biblemap.put("b19_51_8", new husuperobject(19,51,8,"Ímé te az igazságban gyönyörködöl, a mely a vesékben van, és bensõmben bölcseségre tanítasz engem."));
husuperobject.biblemap.put("b19_51_9", new husuperobject(19,51,9,"Tisztíts meg engem izsóppal, és tiszta leszek; moss meg engemet, és fehérebb leszek a hónál."));
husuperobject.biblemap.put("b19_51_10", new husuperobject(19,51,10,"Hallass örömet és vígasságot velem, hogy örvendezzenek csontjaim, a melyeket összetörtél."));
husuperobject.biblemap.put("b19_51_11", new husuperobject(19,51,11,"Rejtsd el orczádat az én vétkeimtõl, és töröld el minden álnokságomat."));
husuperobject.biblemap.put("b19_51_12", new husuperobject(19,51,12,"Tiszta szívet teremts bennem, oh Isten, és az erõs lelket újítsd meg bennem."));
husuperobject.biblemap.put("b19_51_13", new husuperobject(19,51,13,"Ne vess el engem a te orczád elõl, és a te szent lelkedet ne vedd el tõlem."));
husuperobject.biblemap.put("b19_51_14", new husuperobject(19,51,14,"Add vissza nékem a te szabadításodnak örömét, és engedelmesség lelkével támogass engem."));
husuperobject.biblemap.put("b19_51_15", new husuperobject(19,51,15,"Hadd tanítsam a bûnösöket a te útaidra, hogy a vétkezõk megtérjenek hozzád."));
husuperobject.biblemap.put("b19_51_16", new husuperobject(19,51,16,"Szabadíts meg engemet a vérontástól, oh Isten, szabadításomnak Istene! hogy harsogja nyelvem a te igazságodat."));
husuperobject.biblemap.put("b19_51_17", new husuperobject(19,51,17,"Uram, nyisd meg az én ajakimat, hogy hirdesse szájam a te dicséretedet."));
husuperobject.biblemap.put("b19_51_18", new husuperobject(19,51,18,"Mert nem kivánsz te véresáldozatot, hogy adnék azt, égõáldozatban sem gyönyörködöl."));
husuperobject.biblemap.put("b19_51_19", new husuperobject(19,51,19,"Isten elõtt [kedves] áldozatok: a töredelmes lélek; a töredelmes és bûnbánó szívet oh Isten nem veted te meg! [ (Psalms 51:20) Tégy jól a te kegyelmedbõl a Sionnal; és építsd meg Jeruzsálem kõfalait. ] [ (Psalms 51:21) Akkor kedvesek lesznek elõtted az igazságnak áldozatai; az égõ és egész áldozat: akkor a te oltárodon áldoznak néked tulkokkal. ]"));
husuperobject.biblemap.put("b19_52_1", new husuperobject(19,52,1,"Az éneklõmesternek; Dávid tanítása;"));
husuperobject.biblemap.put("b19_52_2", new husuperobject(19,52,2,"Mikor az Idumeus Dóeg eljött és hírt vitt Saulnak, és ezt mondá néki: Dávid az Akhimélek házába ment be."));
husuperobject.biblemap.put("b19_52_3", new husuperobject(19,52,3,"Mit dicsekedel gonoszságban, oh te magabíró? Az Istennek kegyelme szüntelen való!"));
husuperobject.biblemap.put("b19_52_4", new husuperobject(19,52,4,"Nyelved ártalmakon elmélkedik, s olyan mint az éles olló, te álnokságnak mestere!"));
husuperobject.biblemap.put("b19_52_5", new husuperobject(19,52,5,"Szereted a gonoszt inkább, hogy nem a jót, és a hazugságot inkább, mint igazságot szólni. Szela."));
husuperobject.biblemap.put("b19_52_6", new husuperobject(19,52,6,"Szeretsz minden ártalmas beszédet, [és] az álnok nyelvet."));
husuperobject.biblemap.put("b19_52_7", new husuperobject(19,52,7,"Meg is ront az Isten téged, teljesen eltakarít, kigyomlál téged a te hajlékodból, és kiszaggat téged az élõk földérõl. Szela."));
husuperobject.biblemap.put("b19_52_8", new husuperobject(19,52,8,"És látják [ezt] az igazak, és félnek, és nevetnek rajta:"));
husuperobject.biblemap.put("b19_52_9", new husuperobject(19,52,9,"Ímé az a férfiú, a ki nem Istent fogadta erõsségévé, hanem az õ gazdagságának sokaságában bízott, és ereje az õ gonoszságában volt! [ (Psalms 52:10) Én pedig mint zöldelõ olajfa Isten házában, bízom Isten kegyelmében mind örökkön örökké. ] [ (Psalms 52:11) Áldlak téged örökké, hogy [így] cselekedtél; nevedben remélek, mert jóságos [vagy,] a te híveid elõtt. ]"));
husuperobject.biblemap.put("b19_53_1", new husuperobject(19,53,1,"Az éneklõmesternek a mahalathra, Dávid tanítása."));
husuperobject.biblemap.put("b19_53_2", new husuperobject(19,53,2,"Ezt mondta a balgatag az õ szívében: Nincs Isten. Megromlottak és útálatos hamisságot cselekedtek, nincs a ki jót cselekedjék."));
husuperobject.biblemap.put("b19_53_3", new husuperobject(19,53,3,"Isten letekint a mennybõl az emberek fiaira, hogy meglássa, ha van-é értelmes, Istent keresõ?"));
husuperobject.biblemap.put("b19_53_4", new husuperobject(19,53,4,"Mindnyájan elhajlottak, és valamennyien megromlottak, nincsen a ki jót cselekedjék, nincsen csak egy is."));
husuperobject.biblemap.put("b19_53_5", new husuperobject(19,53,5,"Avagy nincs értelem a hamisságnak cselekvõiben, a kik az én népemet megeszik, mintha kenyeret ennének, a kik az Istent segítségül nem hívják?"));
husuperobject.biblemap.put("b19_53_6", new husuperobject(19,53,6,"Ott félnek [nagy] félelemmel, a hol nincsen félelem; mert az Isten elszéleszti azoknak tetemeit, a kik tábort járnak ellened; megszégyeníted azokat, mert az Isten megveti õket. [ (Psalms 53:7) Oh, vajha eljönne Sionból Izráelnek a szabadítás! Mikor az Úr visszahozza az õ népének foglyait, örül majd Jákób és vigad Izráel! ]"));
husuperobject.biblemap.put("b19_54_1", new husuperobject(19,54,1,"Az éneklõmesternek, hangszerekkel; Dávid tanítása;"));
husuperobject.biblemap.put("b19_54_2", new husuperobject(19,54,2,"Mikor a Zifeusok eljöttek, és azt mondák Saulnak: Nem mi nálunk lappang-é Dávid?"));
husuperobject.biblemap.put("b19_54_3", new husuperobject(19,54,3,"Isten, a te neveddel szabadíts meg engemet, és a te hatalmasságoddal állj bosszút értem!"));
husuperobject.biblemap.put("b19_54_4", new husuperobject(19,54,4,"Isten, hallgasd meg az én imádságomat, figyelmezz az én szájam beszédeire."));
husuperobject.biblemap.put("b19_54_5", new husuperobject(19,54,5,"Mert idegenek támadtak ellenem, és kegyetlenek keresik lelkemet, a kik nem is gondolnak Istenre. Szela."));
husuperobject.biblemap.put("b19_54_6", new husuperobject(19,54,6,"Ímé, Isten segítõm nékem, az Úr az én lelkemnek támogatója."));
husuperobject.biblemap.put("b19_54_7", new husuperobject(19,54,7,"Bosszút áll az utánam leselkedõkön; a te igazságod által rontsd meg õket. [ (Psalms 54:8) Kész szívvel áldozom néked: áldom a te nevedet, Uram, mert jó. ] [ (Psalms 54:9) Mert minden nyomorúságból megszabadított engem, s megpihentette szemeimet ellenségeimen. ]"));
husuperobject.biblemap.put("b19_55_1", new husuperobject(19,55,1,"Az éneklõmesternek, hangszerekkel; Dávid tanítása."));
husuperobject.biblemap.put("b19_55_2", new husuperobject(19,55,2,"Hallgasd meg, Isten, az én imádságomat, és ne rejtsd el magadat az én könyörgésem elõl;"));
husuperobject.biblemap.put("b19_55_3", new husuperobject(19,55,3,"Figyelmezz én reám és hallgass meg engemet; mert keseregve bolyongok és jajgatok!"));
husuperobject.biblemap.put("b19_55_4", new husuperobject(19,55,4,"Az ellenségnek szaváért [és] a hitetlenek nyomorgatásáért: mert hazugságot hárítanak reám, és [nagy] dühösséggel ellenkeznek velem."));
husuperobject.biblemap.put("b19_55_5", new husuperobject(19,55,5,"Az én szívem reszket bennem, és a halál félelmei körülvettek engem."));
husuperobject.biblemap.put("b19_55_6", new husuperobject(19,55,6,"Félelem és rettegés esett én reám, és borzadály vett körül engem."));
husuperobject.biblemap.put("b19_55_7", new husuperobject(19,55,7,"Mondám: Vajha szárnyam volna, mint a galambnak! Elrepülnék és nyugodnám."));
husuperobject.biblemap.put("b19_55_8", new husuperobject(19,55,8,"Ímé, messze elmennék és a pusztában lakoznám. Szela."));
husuperobject.biblemap.put("b19_55_9", new husuperobject(19,55,9,"Sietnék kiszabadulni e sebes szélbõl, e forgószélbõl."));
husuperobject.biblemap.put("b19_55_10", new husuperobject(19,55,10,"Rontsd meg Uram, [és] oszlasd meg az õ nyelvöket; mert erõszakot és háborgást látok a városban."));
husuperobject.biblemap.put("b19_55_11", new husuperobject(19,55,11,"Nappal és éjjel körüljárják azt annak kõfalainál, bent hamisság és ártalom van abban."));
husuperobject.biblemap.put("b19_55_12", new husuperobject(19,55,12,"Veszedelem van bensejében; s nem távozik annak terérõl a zsarnokság és csalárdság."));
husuperobject.biblemap.put("b19_55_13", new husuperobject(19,55,13,"Mert nem ellenség szidalmazott engem, hisz [azt] elszenvedném; nem gyûlölõm emelte fel magát ellenem, hiszen elrejtettem volna magamat az elõl:"));
husuperobject.biblemap.put("b19_55_14", new husuperobject(19,55,14,"Hanem te, hozzám hasonló halandó, én barátom és ismerõsöm,"));
husuperobject.biblemap.put("b19_55_15", new husuperobject(19,55,15,"A kik együtt édes bizalomban éltünk; az Isten házába jártunk a tömegben."));
husuperobject.biblemap.put("b19_55_16", new husuperobject(19,55,16,"A halál vegye õket körül, elevenen szálljanak a Seolba; mert gonoszság van lakásukban, kebelökben."));
husuperobject.biblemap.put("b19_55_17", new husuperobject(19,55,17,"Én az Istenhez kiáltok, és az Úr megszabadít engem."));
husuperobject.biblemap.put("b19_55_18", new husuperobject(19,55,18,"Estve, reggel és délben panaszkodom és sóhajtozom, és õ meghallja az én szómat."));
husuperobject.biblemap.put("b19_55_19", new husuperobject(19,55,19,"Megszabadítja lelkemet békességre a rám támadó hadtól, mert sokan vannak ellenem."));
husuperobject.biblemap.put("b19_55_20", new husuperobject(19,55,20,"Meghallja Isten és megfelel nékik, (mivelhogy õ eleitõl fogva trónol, Szela), a kik nem akarnak megváltozni és nem félik az Istent."));
husuperobject.biblemap.put("b19_55_21", new husuperobject(19,55,21,"Kezeit felemelte a vele békességben lévõkre; megszegte az õ szövetségét."));
husuperobject.biblemap.put("b19_55_22", new husuperobject(19,55,22,"A vajnál simább az õ szája, pedig szívében háborúság van; lágyabbak beszédei az olajnál, pedig éles szablyák azok."));
husuperobject.biblemap.put("b19_55_23", new husuperobject(19,55,23,"Vessed az Úrra a te terhedet, õ gondot visel rólad, és nem engedi, hogy valamikor ingadozzék az igaz. [ (Psalms 55:24) Te, Isten, a veszedelem vermébe taszítod õket; a vérszopó és álnok emberek életüknek felét sem élik meg; én pedig te benned bízom. ]"));
husuperobject.biblemap.put("b19_56_1", new husuperobject(19,56,1,"Az éneklõmesternek a Jónathelem rehokimra; Dávidnak miktámja; mikor megragadták õt a filiszteusok Gáthban."));
husuperobject.biblemap.put("b19_56_2", new husuperobject(19,56,2,"Könyörülj rajtam Istenem, mert halandó tátog ellenem és mindennap hadakozván, nyomorgat engem!"));
husuperobject.biblemap.put("b19_56_3", new husuperobject(19,56,3,"Ellenségeim minden napon tátognak reám: bizony sokan hadakoznak ellenem, oh magasságos [Isten!]"));
husuperobject.biblemap.put("b19_56_4", new husuperobject(19,56,4,"Mikor félnem kellene is, én bízom te benned."));
husuperobject.biblemap.put("b19_56_5", new husuperobject(19,56,5,"Isten által dicsekedem az õ igéjével; az Istenben bizom, nem félek; ember mit árthatna nékem?"));
husuperobject.biblemap.put("b19_56_6", new husuperobject(19,56,6,"Minden nap elforgatják beszédeimet; minden gondolatjok ellenem van, ártalomra."));
husuperobject.biblemap.put("b19_56_7", new husuperobject(19,56,7,"Egybegyûlnek, elrejtõznek, sarkaimat lesik, mert kivánják az én lelkemet."));
husuperobject.biblemap.put("b19_56_8", new husuperobject(19,56,8,"Gonoszsággal menekedhetnének? Haraggal rontsd meg, oh Isten, a népeket!"));
husuperobject.biblemap.put("b19_56_9", new husuperobject(19,56,9,"Bujdosásomnak számát jól tudod: szedd tömlõdbe könnyeimet! Avagy nem tudod-é azoknak számát?"));
husuperobject.biblemap.put("b19_56_10", new husuperobject(19,56,10,"Meghátrálnak majd ellenségeim, mikor kiáltok; így tudom meg, hogy velem van az Isten."));
husuperobject.biblemap.put("b19_56_11", new husuperobject(19,56,11,"Dicsérem Istent, az õ ígéretéért, dicsérem az Urat az õ igéretéért."));
husuperobject.biblemap.put("b19_56_12", new husuperobject(19,56,12,"Istenben bízom, nem félek; ember mit árthatna nékem?"));
husuperobject.biblemap.put("b19_56_13", new husuperobject(19,56,13,"Tartozom, oh Isten, az én néked tett fogadásaimmal; megadom néked a hálaáldozatokat; [ (Psalms 56:14) Mert megszabadítottad lelkemet a haláltól, bizony az én lábaimat az eleséstõl; hogy járjak Isten elõtt az életnek világosságában. ]"));
husuperobject.biblemap.put("b19_57_1", new husuperobject(19,57,1,"Az éneklõmesternek az altashétre; Dávid miktámja; mikor Saul elõl a barlangba menekült."));
husuperobject.biblemap.put("b19_57_2", new husuperobject(19,57,2,"Könyörülj rajtam, oh Isten könyörülj rajtam, mert benned bízik az én lelkem; és szárnyaid árnyékába menekülök, a míg elvonulnak a veszedelmek."));
husuperobject.biblemap.put("b19_57_3", new husuperobject(19,57,3,"A magasságos Istenhez kiáltok; Istenhez, a ki jót végez felõlem."));
husuperobject.biblemap.put("b19_57_4", new husuperobject(19,57,4,"Elküld a mennybõl és megtart engem: meggyalázza az engem elnyelõt. Szela. Elküldi Isten az õ kegyelmét és hûségét."));
husuperobject.biblemap.put("b19_57_5", new husuperobject(19,57,5,"Az én lelkem oroszlánok között van, tûzokádók között fekszem; emberek között, a kiknek foguk dárda és nyilak, nyelvök pedig éles szablya."));
husuperobject.biblemap.put("b19_57_6", new husuperobject(19,57,6,"Magasztaltassál fel az egek felett, oh Isten! Mind az egész földön legyen a te dicsõséged!"));
husuperobject.biblemap.put("b19_57_7", new husuperobject(19,57,7,"Hálót készítettek lábaimnak, lelkem meggörnyedett; vermet ástak én elõttem, de õk estek abba. Szela."));
husuperobject.biblemap.put("b19_57_8", new husuperobject(19,57,8,"Kész az én szívem, oh Isten, kész az én szívem; hadd énekeljek és zengedezzek!"));
husuperobject.biblemap.put("b19_57_9", new husuperobject(19,57,9,"Serkenj fel én dicsõségem, serkenj fel te lant és hárfa, hadd költsem fel a hajnalt!"));
husuperobject.biblemap.put("b19_57_10", new husuperobject(19,57,10,"Hálát adok néked, én Uram, a népek között, és zengedezek néked a nemzetek között."));
husuperobject.biblemap.put("b19_57_11", new husuperobject(19,57,11,"Mert nagy az egekig a te kegyelmed, és a felhõkig a te hûséged. [ (Psalms 57:12) Magasztaltassál fel az egek felett, oh Isten! Mind az egész földön legyen a te dicsõséged! ]"));
husuperobject.biblemap.put("b19_58_1", new husuperobject(19,58,1,"Az éneklõmesternek az altashétre; Dávid miktámja."));
husuperobject.biblemap.put("b19_58_2", new husuperobject(19,58,2,"Avagy valóban a néma igazságot szólaltatjátok-é meg? Avagy igazán ítéltek-é ti embernek fiai?"));
husuperobject.biblemap.put("b19_58_3", new husuperobject(19,58,3,"Sõt inkább hamisságot forgattok a ti szívetekben! a ti kezeiteknek hamisságát méritek e földön."));
husuperobject.biblemap.put("b19_58_4", new husuperobject(19,58,4,"Eltértek a gonoszok fogantatásuk óta; tévelygenek a hazugok anyjok méhétõl kezdve."));
husuperobject.biblemap.put("b19_58_5", new husuperobject(19,58,5,"Mérgök olyan, mint a kígyónak mérge; mint a siket áspisé, a mely füleit bedugja."));
husuperobject.biblemap.put("b19_58_6", new husuperobject(19,58,6,"A mely nem hallja a bûbájosoknak szavát, sem a bûvölõét, a ki bûbájakban jártas."));
husuperobject.biblemap.put("b19_58_7", new husuperobject(19,58,7,"Isten, rontsd meg az õ fogaikat az õ szájokban; az oroszlánoknak zápfogait törd össze, Uram!"));
husuperobject.biblemap.put("b19_58_8", new husuperobject(19,58,8,"Olvadjanak el, folyjanak széllyel, mint a víz; ha felteszi nyilait, legyenek tompultak azok."));
husuperobject.biblemap.put("b19_58_9", new husuperobject(19,58,9,"Legyenek mint a csiga, a mely szétfolyván, elmúlik; mint az aszszonynak idétlen szülötte, a mely nem látta a napot."));
husuperobject.biblemap.put("b19_58_10", new husuperobject(19,58,10,"Mielõtt megéreznék fazekaitok a tövist, mind nyersen, mind égõn elragadja azt a forgószél."));
husuperobject.biblemap.put("b19_58_11", new husuperobject(19,58,11,"Örül az igaz, mikor látja a bosszúállást; lábait mossa a gonosznak vérében. [ (Psalms 58:12) És azt mondja az ember: Bizonyára van jutalma az igaznak; bizony van ítélõ Isten e földön! ]"));
husuperobject.biblemap.put("b19_59_1", new husuperobject(19,59,1,"Az éneklõmesternek az altashétre. Dávid miktámja; midõn [embereket ]külde Saul, és õrizék az õ házát, hogy megöljék õt."));
husuperobject.biblemap.put("b19_59_2", new husuperobject(19,59,2,"Szabadíts meg engemet az én ellenségeimtõl, Istenem; a reám támadóktól ments meg engemet!"));
husuperobject.biblemap.put("b19_59_3", new husuperobject(19,59,3,"Szabadíts meg engemet a gonosztevõktõl, és a vérontó emberek ellen tarts meg engemet;"));
husuperobject.biblemap.put("b19_59_4", new husuperobject(19,59,4,"Mert ímé lelkem után leselkednek, egybegyûltek ellenem az erõsek; a nélkül, hogy hibás vagy vétkes volnék, Uram!"));
husuperobject.biblemap.put("b19_59_5", new husuperobject(19,59,5,"Bûnöm nélkül egybegyûlnek és készülnek [ellenem]: serkenj fel elõmbe és lásd meg [ezeket!]"));
husuperobject.biblemap.put("b19_59_6", new husuperobject(19,59,6,"Te, oh Uram, Seregek Istene, Izráel Istene, serkenj fel! Büntesd meg mind e pogányokat, ne könyörülj senkin, a ki hamisságot cselekszik. Szela."));
husuperobject.biblemap.put("b19_59_7", new husuperobject(19,59,7,"Estenden megjelennek, ordítnak, mint az eb; körüljárják a várost."));
husuperobject.biblemap.put("b19_59_8", new husuperobject(19,59,8,"Ímé, szájokkal csácsognak, ajkaikon szablyák vannak: hisz, [úgy mond], kicsoda hallja meg?"));
husuperobject.biblemap.put("b19_59_9", new husuperobject(19,59,9,"Te pedig, Uram, neveted õket, és megcsúfolod mind e pogány népet."));
husuperobject.biblemap.put("b19_59_10", new husuperobject(19,59,10,"Hatalmá[val szemben] te reád vigyázok; mert Isten az én váram."));
husuperobject.biblemap.put("b19_59_11", new husuperobject(19,59,11,"Elõmbe jön az én kegyelmes Istenem; látnom engedi Isten az én ellenségeim [romlását.]"));
husuperobject.biblemap.put("b19_59_12", new husuperobject(19,59,12,"Ne öld meg õket, hogy népem meg ne felejtkezzék; bujdosókká tedd õket a te hatalmaddal, és alázd meg õket Uram, mi paizsunk!"));
husuperobject.biblemap.put("b19_59_13", new husuperobject(19,59,13,"Szájuknak vétke az õ ajkaiknak beszéde, fogattassanak meg kevélységükben; mert csak átkot és hazugságot szólnak."));
husuperobject.biblemap.put("b19_59_14", new husuperobject(19,59,14,"Veszítsd el õket búsulásodban, veszítsd el õket, hogy ne legyenek; és tudják meg, hogy Isten uralkodik a Jákób fölött, mind a földnek határáig. Szela."));
husuperobject.biblemap.put("b19_59_15", new husuperobject(19,59,15,"Estenden megjelennek, ordítnak, mint az eb, körüljárják a várost."));
husuperobject.biblemap.put("b19_59_16", new husuperobject(19,59,16,"Étel után barangolnak, és ha nem laknak jól, virrasztanak."));
husuperobject.biblemap.put("b19_59_17", new husuperobject(19,59,17,"Én pedig éneklem a te hatalmadat, és reggelenkint zengem a te kegyelmességedet; mert váram voltál és menedékem az én nyomorúságom napján. [ (Psalms 59:18) Én erõsségem! Te néked éneklek, mert Isten az én váram: õ az én kegyelmes Istenem! ]"));
husuperobject.biblemap.put("b19_60_1", new husuperobject(19,60,1,"Az éneklõmesternek a susanheduthra, Dávidnak tanító miktámja;"));
husuperobject.biblemap.put("b19_60_2", new husuperobject(19,60,2,"Mikor harczolt a mesopotámiai szirusokkal és a czóbai szirusokkal; és visszafordult Joáb és megverte az Edomitákat a Sóvölgyben, tizenkétezeret."));
husuperobject.biblemap.put("b19_60_3", new husuperobject(19,60,3,"Isten, elvetettél minket, elszélesztettél minket; megharagudtál, hozz vissza minket!"));
husuperobject.biblemap.put("b19_60_4", new husuperobject(19,60,4,"Megrendítetted ez országot, ketté szakasztottad; építsd meg romlásait, mert megindult."));
husuperobject.biblemap.put("b19_60_5", new husuperobject(19,60,5,"A te népeddel nehéz dolgokat láttattál: bódító borral itattál minket."));
husuperobject.biblemap.put("b19_60_6", new husuperobject(19,60,6,"Adtál a téged félõknek zászlót, melyet felemeljenek az igazságért. Szela."));
husuperobject.biblemap.put("b19_60_7", new husuperobject(19,60,7,"Hogy megszabaduljanak a te kedveltjeid: segíts jobboddal és hallgass meg minket!"));
husuperobject.biblemap.put("b19_60_8", new husuperobject(19,60,8,"Az õ szent helyén mondotta Isten: Örvendezek, kiosztom Sikemet és kimérem a Szukkót völgyét:"));
husuperobject.biblemap.put("b19_60_9", new husuperobject(19,60,9,"Enyim Gileád és enyim Manasse, Efraim az én fejemnek oltalma: Júda az én törvény-rendelõm."));
husuperobject.biblemap.put("b19_60_10", new husuperobject(19,60,10,"Moáb az én mosdómedenczém, Edomra vetem az én sarumat; te Filisztea nékem örülj!"));
husuperobject.biblemap.put("b19_60_11", new husuperobject(19,60,11,"Kicsoda vezet engem az erõs városba? Kicsoda kisért el Edomig engem?"));
husuperobject.biblemap.put("b19_60_12", new husuperobject(19,60,12,"Nem te-é, oh Isten, a ki megvetettél minket, s nem vonultál ki, oh Isten, a mi seregeinkkel? [ (Psalms 60:13) Segíts ki minket a nyomorúságból, mert emberi segítség hiábavaló. ] [ (Psalms 60:14) Istennel gyõzedelmet nyerünk, s õ tapodja el ellenségeinket. ]"));
husuperobject.biblemap.put("b19_61_1", new husuperobject(19,61,1,"Az éneklõmesternek hangszerre: Dávidé."));
husuperobject.biblemap.put("b19_61_2", new husuperobject(19,61,2,"Hallgasd meg, oh Isten, az én kiáltásomat; figyelmezzél az én könyörgésemre."));
husuperobject.biblemap.put("b19_61_3", new husuperobject(19,61,3,"E föld szélérõl kiáltok te hozzád; mert szívem elepedt: Vígy el engem [innen] a sziklára, a hova én nem jutok."));
husuperobject.biblemap.put("b19_61_4", new husuperobject(19,61,4,"Mert te vagy az én menedékem, s erõs tornyom az ellenség ellen."));
husuperobject.biblemap.put("b19_61_5", new husuperobject(19,61,5,"Hadd lakozzam a te sátorodban mindörökké; hadd meneküljek a te szárnyaid árnyéka alá! Szela."));
husuperobject.biblemap.put("b19_61_6", new husuperobject(19,61,6,"Mert te, oh Isten, meghallgattad az én fogadásaimat; a te neved tisztelõinek örökségét megadtad nékem."));
husuperobject.biblemap.put("b19_61_7", new husuperobject(19,61,7,"Adj napokat a király napjaihoz, esztendeit nemzedékrõl nemzedékre [nyujtsd.]"));
husuperobject.biblemap.put("b19_61_8", new husuperobject(19,61,8,"Isten elõtt lakozzék örökké; kegyelmedet és hûségedet rendeld ki, hogy õrizzék meg õt. [ (Psalms 61:9) Így éneklem majd a te nevedet szüntelen, hogy beteljesítsem az én fogadásaimat minden napon. ]"));
husuperobject.biblemap.put("b19_62_1", new husuperobject(19,62,1,"Az éneklõmesternek, Jedutun szerint; Dávid zsoltára."));
husuperobject.biblemap.put("b19_62_2", new husuperobject(19,62,2,"Csak Istenben nyugoszik meg lelkem; tõle van az én szabadulásom."));
husuperobject.biblemap.put("b19_62_3", new husuperobject(19,62,3,"Csak õ az én kõsziklám és szabadulásom; õ az én oltalmam, azért nem rendülök meg felettébb."));
husuperobject.biblemap.put("b19_62_4", new husuperobject(19,62,4,"Meddig támadtok még egy ember ellen; [meddig] törtök ellene valamennyien, mint meghanyatlott fal és dûlõ kerítés ellen?"));
husuperobject.biblemap.put("b19_62_5", new husuperobject(19,62,5,"Csak arról tanácskoznak, mimódon vessék õt le méltóságából; szeretik a hazugságot; szájukkal áldanak, szívükben átkoznak. Szela."));
husuperobject.biblemap.put("b19_62_6", new husuperobject(19,62,6,"Csak Istenben nyugodjál meg lelkem, mert tõle van reménységem."));
husuperobject.biblemap.put("b19_62_7", new husuperobject(19,62,7,"Csak õ az én kõsziklám és szabadulásom; õ az én oltalmam, azért nem rendülök meg."));
husuperobject.biblemap.put("b19_62_8", new husuperobject(19,62,8,"Istennél van szabadulásom és dicsõségem; az én erõs kõsziklám, az én menedékem Istenben van."));
husuperobject.biblemap.put("b19_62_9", new husuperobject(19,62,9,"Bízzatok õ benne mindenkor, ti népek; öntsétek ki elõtte szíveteket; Istn a mi menedékünk. Szela."));
husuperobject.biblemap.put("b19_62_10", new husuperobject(19,62,10,"Bizony hiábavalók a közembernek fiai és hazugok a fõembernek fiai; ha mérõserpenyõbe vettetnek, mind alábbvalók a semminél."));
husuperobject.biblemap.put("b19_62_11", new husuperobject(19,62,11,"Ne bízzatok zsarolt javakban, és rablott jószággal ne kevélykedjetek; a vagyonban, ha nõ, ne bizakodjatok;"));
husuperobject.biblemap.put("b19_62_12", new husuperobject(19,62,12,"Egyszer szólott az Isten, kétszer hallottam ugyanazt, hogy a hatalom az Istené. [ (Psalms 62:13) Tiéd Uram a kegyelem is. Bizony te fizetsz meg mindenkinek az õ cselekedete szerint! ]"));
husuperobject.biblemap.put("b19_63_1", new husuperobject(19,63,1,"Dávid zsoltára, mikor a Júda pusztájában volt."));
husuperobject.biblemap.put("b19_63_2", new husuperobject(19,63,2,"Isten! én Istenem vagy te, jó reggel kereslek téged; téged szomjúhoz lelkem, téged sóvárog testem a kiaszott, elepedt földön, a melynek nincs vize;"));
husuperobject.biblemap.put("b19_63_3", new husuperobject(19,63,3,"Hogy láthassalak téged a szent helyen, szemlélvén a te hatalmadat és dicsõségedet."));
husuperobject.biblemap.put("b19_63_4", new husuperobject(19,63,4,"Hiszen a te kegyelmed jobb az életnél: az én ajakim hadd dicsérjenek téged."));
husuperobject.biblemap.put("b19_63_5", new husuperobject(19,63,5,"Áldanálak ezért életem fogytáig; a te nevedben emelném fel kezeimet."));
husuperobject.biblemap.put("b19_63_6", new husuperobject(19,63,6,"Mintha zsírral és kövérséggel telnék meg lelkem, mikor víg ajakkal dicsérhet téged az én szájam!"));
husuperobject.biblemap.put("b19_63_7", new husuperobject(19,63,7,"Ha reád gondolok ágyamban: õrváltásról õrváltásra rólad elmélkedem;"));
husuperobject.biblemap.put("b19_63_8", new husuperobject(19,63,8,"Mert segítségem voltál, és a te szárnyaidnak árnyékában örvendeztem."));
husuperobject.biblemap.put("b19_63_9", new husuperobject(19,63,9,"Ragaszkodik hozzád az én lelkem; a te jobbod megtámogat engem."));
husuperobject.biblemap.put("b19_63_10", new husuperobject(19,63,10,"Azok pedig, a kik veszedelemre keresik lelkemet, a föld mélységeibe jutnak."));
husuperobject.biblemap.put("b19_63_11", new husuperobject(19,63,11,"Szablya martalékaiul esnek el, és a rókáknak lesznek eledelei. [ (Psalms 63:12) A király pedig örvendezni fog Istenben; dicséri õt mindaz, a ki õ reá esküszik; mert bedugatik a hazugok szája. ]"));
husuperobject.biblemap.put("b19_64_1", new husuperobject(19,64,1,"Az éneklõmesternek; Dávid zsoltára."));
husuperobject.biblemap.put("b19_64_2", new husuperobject(19,64,2,"Hallgasd meg, Isten, az én szómat, mikor panaszkodom; az ellenségtõl való félelemtõl mentsd meg éltemet."));
husuperobject.biblemap.put("b19_64_3", new husuperobject(19,64,3,"Rejts el engem a rosszakaróknak tanácsa elõl, a gonosztevõknek gyülekezetétõl."));
husuperobject.biblemap.put("b19_64_4", new husuperobject(19,64,4,"A kik megélesítik nyelvöket, mint a szablyát; irányozzák nyilokat, keserû beszédöket."));
husuperobject.biblemap.put("b19_64_5", new husuperobject(19,64,5,"Hogy lövöldözzék titkon az ártatlant; nagy hirtelenséggel lövöldözik azt, és nem félnek."));
husuperobject.biblemap.put("b19_64_6", new husuperobject(19,64,6,"Megátalkodottak gonosz szándékukban; megegyeztek, hogy tõrt vetnek titkon, mondják: ki látja õket?"));
husuperobject.biblemap.put("b19_64_7", new husuperobject(19,64,7,"Álnokságokat koholnak; a kikoholt tervet végrehajták; mindenikök keble és szíve kikutathatatlan."));
husuperobject.biblemap.put("b19_64_8", new husuperobject(19,64,8,"De meglövi õket az Isten; hirtelen nyíl üt rajtok sebet."));
husuperobject.biblemap.put("b19_64_9", new husuperobject(19,64,9,"És megejtik õket, a nyelvök lesz ellenök; iszonyodik mindenki, a ki õket látja."));
husuperobject.biblemap.put("b19_64_10", new husuperobject(19,64,10,"Akkor megfélemlenek mind az emberek; hirdetni fogják Istennek dolgát, és megértik cselekedetét. [ (Psalms 64:11) Örvendeni fog az igaz Istenben, és hozzá menekül; és dicsekedni fognak minden egyenesszívûek. ]"));
husuperobject.biblemap.put("b19_65_1", new husuperobject(19,65,1,"Az éneklõmesternek; zsoltár; Dávid éneke."));
husuperobject.biblemap.put("b19_65_2", new husuperobject(19,65,2,"Tied a hódolat, a dicséret, oh Isten, a Sionon; és néked teljesítik [ott] a fogadást."));
husuperobject.biblemap.put("b19_65_3", new husuperobject(19,65,3,"Oh könyörgést meghallgató, hozzád folyamodik minden test."));
husuperobject.biblemap.put("b19_65_4", new husuperobject(19,65,4,"Bûneim erõt vettek rajtam; vétkeinket te bocsásd meg."));
husuperobject.biblemap.put("b19_65_5", new husuperobject(19,65,5,"Boldog az, a kit te kiválasztasz és magadhoz fogadsz, hogy lakozzék a te tornáczaidban; hadd teljesedjünk meg a te házadnak javaival, a te templomodnak szentségével!"));
husuperobject.biblemap.put("b19_65_6", new husuperobject(19,65,6,"Csodálatos dolgokat szólasz nékünk a te igazságodban, idvességünknek Istene; e föld minden szélének és a messze tengernek bizodalma;"));
husuperobject.biblemap.put("b19_65_7", new husuperobject(19,65,7,"A ki hegyeket épít erejével, körül van övezve hatalommal;"));
husuperobject.biblemap.put("b19_65_8", new husuperobject(19,65,8,"A ki lecsillapítja a tengerek zúgását, habjaik zúgását, és a népek háborgását."));
husuperobject.biblemap.put("b19_65_9", new husuperobject(19,65,9,"Félnek is jeleidtõl a szélek lakói; a napkelet és nyugot határait megörvendezteted."));
husuperobject.biblemap.put("b19_65_10", new husuperobject(19,65,10,"Meglátogatod a földet és elárasztod; nagyon meggazdagítod azt. Istennek folyója tele van vizekkel; gabonát szerzesz nékik, mert úgy rendelted azt."));
husuperobject.biblemap.put("b19_65_11", new husuperobject(19,65,11,"Megitatod barázdáit, göröngyeit meglapítod; záporesõvel meglágyítod azt, termését megáldod."));
husuperobject.biblemap.put("b19_65_12", new husuperobject(19,65,12,"Megkoronázod az esztendõt jóvoltoddal, és a te nyomdokaidon kövérség fakad;"));
husuperobject.biblemap.put("b19_65_13", new husuperobject(19,65,13,"Csepegnek a puszta legelõi és a halmokat vígság övezi. [ (Psalms 65:14) A legelõk megtelnek juhokkal, és a völgyeket gabona borítja; örvendeznek és énekelnek. ]"));
husuperobject.biblemap.put("b19_66_1", new husuperobject(19,66,1,"Az éneklõmesternek; zsoltár, ének."));
husuperobject.biblemap.put("b19_66_2", new husuperobject(19,66,2,"Énekeljétek az õ nevének dicsõségét; dicsõítsétek az õ dicséretét!"));
husuperobject.biblemap.put("b19_66_3", new husuperobject(19,66,3,"Mondjátok Istennek: Mily csudálatosak a te mûveid: a te hatalmad nagy volta miatt hízelegnek néked ellenségeid."));
husuperobject.biblemap.put("b19_66_4", new husuperobject(19,66,4,"Az egész föld leborul elõtted; énekel néked, énekli a te nevedet. Szela."));
husuperobject.biblemap.put("b19_66_5", new husuperobject(19,66,5,"Jõjjetek és lássátok az Isten dolgait; csudálatosak az õ cselekedetei az emberek fiain."));
husuperobject.biblemap.put("b19_66_6", new husuperobject(19,66,6,"A tengert szárazzá változtatta, a folyamon gyalog mentek át: ott örvendeztünk õ benne."));
husuperobject.biblemap.put("b19_66_7", new husuperobject(19,66,7,"A ki uralkodik az õ hatalmával örökké, szemmel tartja a pogányokat, hogy az engedetlenek fel ne fuvalkodjanak magukban. Szela."));
husuperobject.biblemap.put("b19_66_8", new husuperobject(19,66,8,"Áldjátok népek a mi Istenünket, és hallassátok az õ dicséretének szavát."));
husuperobject.biblemap.put("b19_66_9", new husuperobject(19,66,9,"A ki megeleveníti lelkünket, s nem engedi, hogy lábaink megtántorodjanak."));
husuperobject.biblemap.put("b19_66_10", new husuperobject(19,66,10,"Mert megpróbáltál minket, oh Isten, megtisztítottál, a mint tisztítják az ezüstöt."));
husuperobject.biblemap.put("b19_66_11", new husuperobject(19,66,11,"Hálóba vittél be minket, megszorítottad derekainkat."));
husuperobject.biblemap.put("b19_66_12", new husuperobject(19,66,12,"Embert ültettél fejünkre, tûzbe-vízbe jutottunk: de kihoztál bennünket bõségre."));
husuperobject.biblemap.put("b19_66_13", new husuperobject(19,66,13,"Elmegyek házadba égõáldozatokkal, lefizetem néked fogadásaimat,"));
husuperobject.biblemap.put("b19_66_14", new husuperobject(19,66,14,"A melyeket ajakim igértek és szájam mondott nyomorúságomban."));
husuperobject.biblemap.put("b19_66_15", new husuperobject(19,66,15,"Hízlalt juhokat áldozom néked égõáldozatul, kosok jóillatú áldozatával; ökröket bakokkal együtt áldozom néked. Szela."));
husuperobject.biblemap.put("b19_66_16", new husuperobject(19,66,16,"Jõjjetek el és halljátok meg, hadd beszélem el minden istenfélõnek: miket cselekedett az én lelkemmel!"));
husuperobject.biblemap.put("b19_66_17", new husuperobject(19,66,17,"Hozzá kiálték az én szájammal, és magasztalás volt nyelvem alatt."));
husuperobject.biblemap.put("b19_66_18", new husuperobject(19,66,18,"Ha hamisságra néztem volna szívemben, meg nem hallgatott volna az én Uram."));
husuperobject.biblemap.put("b19_66_19", new husuperobject(19,66,19,"Ámde meghallgatott Isten, figyelmezett könyörgésem szavára."));
husuperobject.biblemap.put("b19_66_20", new husuperobject(19,66,20,"Áldott az Isten, a ki nem vetette meg könyörgésemet, és kegyelmét [nem vonta meg] tõlem."));
husuperobject.biblemap.put("b19_67_1", new husuperobject(19,67,1,"Az éneklõmesternek, hangszerekkel; zsoltár; ének."));
husuperobject.biblemap.put("b19_67_2", new husuperobject(19,67,2,"Az Isten könyörüljön rajtunk és áldjon meg minket; világosítsa meg az õ orczáját rajtunk. Szela."));
husuperobject.biblemap.put("b19_67_3", new husuperobject(19,67,3,"Hogy megismerjék e földön a te útadat, minden nép közt a te szabadításodat."));
husuperobject.biblemap.put("b19_67_4", new husuperobject(19,67,4,"Dicsérnek téged a népek, oh Isten, dicsérnek téged a népek mindnyájan."));
husuperobject.biblemap.put("b19_67_5", new husuperobject(19,67,5,"Örvendnek és vígadnak a nemzetek, mert igazsággal ítéled a népeket, és a nemzeteket e földön te igazgatod. Szela."));
husuperobject.biblemap.put("b19_67_6", new husuperobject(19,67,6,"Dicsérnek téged a népek, oh Isten, dicsérnek téged a népek mindnyájan."));
husuperobject.biblemap.put("b19_67_7", new husuperobject(19,67,7,"A föld megadta az õ gyümölcsét: megáld minket az Isten, a mi Istenünk; [ (Psalms 67:8) Megáld minket az Isten, és féli õt a földnek minden határa! ]"));
husuperobject.biblemap.put("b19_68_1", new husuperobject(19,68,1,"Az éneklõmesternek; Dávid zsoltára, éneke."));
husuperobject.biblemap.put("b19_68_2", new husuperobject(19,68,2,"Felkél az Isten, elszélednek ellenségei; és elfutnak elõle az õ gyûlölõi."));
husuperobject.biblemap.put("b19_68_3", new husuperobject(19,68,3,"A mint a füst elszéled, úgy széleszted el õket; a mint elolvad a viasz a tûz elõtt, úgy vesznek el a gonoszok Isten elõl;"));
husuperobject.biblemap.put("b19_68_4", new husuperobject(19,68,4,"Az igazak pedig örvendeznek és vígadnak az Isten elõtt, és ujjongnak örömmel."));
husuperobject.biblemap.put("b19_68_5", new husuperobject(19,68,5,"Énekeljetek Istennek, zengedezzetek az õ nevének; csináljatok útat annak, a ki jön a pusztákon át, a kinek Jah a neve, és örüljetek elõtte."));
husuperobject.biblemap.put("b19_68_6", new husuperobject(19,68,6,"Árváknak atyja, özvegyeknek bírája az Isten az õ szentséges hajlékában."));
husuperobject.biblemap.put("b19_68_7", new husuperobject(19,68,7,"Isten hozza vissza a számûzötteket, kihozza boldogságra a foglyokat; csak az engedetlenek lakoznak sivatag helyen."));
husuperobject.biblemap.put("b19_68_8", new husuperobject(19,68,8,"Oh Isten, mikor kivonultál a te néped elõtt, mikor a pusztába beléptél: Szela."));
husuperobject.biblemap.put("b19_68_9", new husuperobject(19,68,9,"A föld reng vala, az egek is csepegnek vala Isten elõtt, ez a Sinai hegy is az Isten elõtt, az Izráel Istene elõtt."));
husuperobject.biblemap.put("b19_68_10", new husuperobject(19,68,10,"Bõ záport hintesz vala, oh Isten, a te örökségedre, s a lankadót megújítod vala."));
husuperobject.biblemap.put("b19_68_11", new husuperobject(19,68,11,"Benne tanyázott a te gyülekezeted: te szerzéd jóvoltodból a szegénynek, oh Isten!"));
husuperobject.biblemap.put("b19_68_12", new husuperobject(19,68,12,"Az Úr ad vala szólniok az örömhírt vivõ asszonyok nagy csapatának."));
husuperobject.biblemap.put("b19_68_13", new husuperobject(19,68,13,"A seregek királyai futnak, futnak: s a házi asszony zsákmányt osztogat."));
husuperobject.biblemap.put("b19_68_14", new husuperobject(19,68,14,"Ha cserények között hevertek is: [olyanok lesztek, mint] a galambnak szárnyai, a melyeket ezüst borít, vagy [mint] vitorla-tollai, a melyek színarany fényûek."));
husuperobject.biblemap.put("b19_68_15", new husuperobject(19,68,15,"Mikor a Mindenható szétszórta benne a királyokat, [mintha] hó esett [volna] a Salmonon."));
husuperobject.biblemap.put("b19_68_16", new husuperobject(19,68,16,"Isten hegye a Básán hegye; sok halmú hegy a Básán hegye;"));
husuperobject.biblemap.put("b19_68_17", new husuperobject(19,68,17,"Mit kevélykedtek ti sok halmú hegyek? Ezt a hegyet választotta Isten lakóhelyéül; bizony [ezen] lakozik az Úr mindörökké!"));
husuperobject.biblemap.put("b19_68_18", new husuperobject(19,68,18,"Az Isten szekere húszezer, ezer meg ezer; az Úr közöttük van, mint a Sinai [hegyen] az õ szent [hajléká]ban."));
husuperobject.biblemap.put("b19_68_19", new husuperobject(19,68,19,"Felmentél a magasságba, foglyokat vezettél, adományokat fogadtál emberekben: még a pártütõk is [ide jönnek] lakni, oh Uram Isten!"));
husuperobject.biblemap.put("b19_68_20", new husuperobject(19,68,20,"Áldott legyen az Úr! Napról-napra gondoskodik rólunk a mi szabadításunk Istene! Szela."));
husuperobject.biblemap.put("b19_68_21", new husuperobject(19,68,21,"Ez a mi Istenünk a szabadításnak Istene, és az Úr Isten az, a ki megszabadít a haláltól."));
husuperobject.biblemap.put("b19_68_22", new husuperobject(19,68,22,"Csak Isten ronthatja meg az õ ellenségeinek fejét, a bûneiben járónak üstökös koponyáját."));
husuperobject.biblemap.put("b19_68_23", new husuperobject(19,68,23,"Azt mondta vala az Úr: Básánból visszahozlak, a tenger mélységébõl is kihozlak,"));
husuperobject.biblemap.put("b19_68_24", new husuperobject(19,68,24,"Hogy lábadat veresre fessed a vérben, ebeidnek nyelve az ellenségbõl lakomázzék."));
husuperobject.biblemap.put("b19_68_25", new husuperobject(19,68,25,"Látták a te bevonulásodat, oh Isten! Az én Istenem, királyom bevonulását a szentélybe."));
husuperobject.biblemap.put("b19_68_26", new husuperobject(19,68,26,"Elõl mennek vala az éneklõk, utánok a húrpengetõk, középen a doboló leányok."));
husuperobject.biblemap.put("b19_68_27", new husuperobject(19,68,27,"A gyülekezetekben áldjátok az Istent, az Urat áldjátok, ti Izráel magvából valók!"));
husuperobject.biblemap.put("b19_68_28", new husuperobject(19,68,28,"Ott a kis Benjámin, a ki uralkodik rajtok, a Júda fejedelmei és az õ gyülekezetök; a Zebulon fejedelmei [és] a Nafthali fejedelmei."));
husuperobject.biblemap.put("b19_68_29", new husuperobject(19,68,29,"Istened rendelte el a te hatalmadat: erõsítsd meg, oh Isten, azt, a mit számunkra készítettél!"));
husuperobject.biblemap.put("b19_68_30", new husuperobject(19,68,30,"A te Jeruzsálem felett álló hajlékodból királyok hoznak majd néked ajándékokat."));
husuperobject.biblemap.put("b19_68_31", new husuperobject(19,68,31,"Fenyítsd meg a nádasnak vadját, a bikák csordáját a népek tulkaival egybe, a kik ezüst-rudakkal terpeszkednek; szórd szét a népeket, a kik a háborúban gyönyörködnek."));
husuperobject.biblemap.put("b19_68_32", new husuperobject(19,68,32,"Eljõnek majd a fõemberek Égyiptomból; Szerecsenország hamar kinyujtja kezeit Istenhez."));
husuperobject.biblemap.put("b19_68_33", new husuperobject(19,68,33,"E földnek országai mind énekeljetek Istennek: zengjetek dicséretet az Úrnak! Szela."));
husuperobject.biblemap.put("b19_68_34", new husuperobject(19,68,34,"A ki kezdettõl fogva az egek egein ül; ímé, [onnét] szól nagy kemény szóval."));
husuperobject.biblemap.put("b19_68_35", new husuperobject(19,68,35,"Tegyetek tisztességet Istennek, a kinek dicsõsége az Izráelen és az õ hatalma a felhõkben van. [ (Psalms 68:36) Rettenetes vagy, oh Isten, a te szent hajlékodból; az Izráelnek Istene ád erõt és hatalmat a népnek. Áldott legyen az Isten! ]"));
husuperobject.biblemap.put("b19_69_1", new husuperobject(19,69,1,"Az éneklõmesternek a sósannimra; Dávidé."));
husuperobject.biblemap.put("b19_69_2", new husuperobject(19,69,2,"Szabadíts meg engemet, oh Isten, mert a vizek lelkemig hatottak."));
husuperobject.biblemap.put("b19_69_3", new husuperobject(19,69,3,"Mély sárba estem be, hol meg nem állhatok; feneketlen örvénybe jutottam, és az áradat elborít engem."));
husuperobject.biblemap.put("b19_69_4", new husuperobject(19,69,4,"Elfáradtam a kiáltásban, kiszáradt a torkom; szemeim elbágyadtak, várván Istenemet."));
husuperobject.biblemap.put("b19_69_5", new husuperobject(19,69,5,"Többen vannak fejem hajszálainál, a kik ok nélkül gyûlölnek engem; hatalmasok a vesztemre törõk, a kik ellenségeim alap nélkül; a mit nem ragadtam el, azt kell megfizetnem!"));
husuperobject.biblemap.put("b19_69_6", new husuperobject(19,69,6,"Oh Isten, te tudod az én balgatagságomat, és az én bûneim nyilván vannak te elõtted:"));
husuperobject.biblemap.put("b19_69_7", new husuperobject(19,69,7,"Ne szégyenüljenek meg miattam, a kik te benned remélnek, Uram, Seregeknek Ura! Ne pironkodjanak miattam, a kik téged keresnek, oh Izráelnek Istene!"));
husuperobject.biblemap.put("b19_69_8", new husuperobject(19,69,8,"Mert te éretted viselek gyalázatot, [és] borítja pironság az én orczámat."));
husuperobject.biblemap.put("b19_69_9", new husuperobject(19,69,9,"Atyámfiai elõtt idegenné lettem, és anyám fiai elõtt jövevénynyé."));
husuperobject.biblemap.put("b19_69_10", new husuperobject(19,69,10,"Mivel a te házadhoz való féltõ szeretet emészt engem, a te gyalázóidnak gyalázásai hullanak reám."));
husuperobject.biblemap.put("b19_69_11", new husuperobject(19,69,11,"Ha sírok és bõjtöléssel [gyötröm] lelkemet, az is gyalázatomra válik."));
husuperobject.biblemap.put("b19_69_12", new husuperobject(19,69,12,"Ha gyászruhába öltözöm, akkor példabeszédül vagyok nékik."));
husuperobject.biblemap.put("b19_69_13", new husuperobject(19,69,13,"A kapuban ülõk rólam szólanak, és a borozók rólam énekelnek."));
husuperobject.biblemap.put("b19_69_14", new husuperobject(19,69,14,"Én pedig néked könyörgök, oh Uram; jókedvednek idején, oh Isten, a te kegyelmed sokaságához képest hallgass meg engem a te megszabadító hûségeddel."));
husuperobject.biblemap.put("b19_69_15", new husuperobject(19,69,15,"Ments ki engem az iszapból, hogy el ne sülyedjek; hadd szabaduljak meg gyûlölõimtõl és a feneketlen vizekbõl;"));
husuperobject.biblemap.put("b19_69_16", new husuperobject(19,69,16,"Hogy el ne borítson a vizek árja, és el ne nyeljen az örvény, és a veremnek szája be ne záruljon felettem!"));
husuperobject.biblemap.put("b19_69_17", new husuperobject(19,69,17,"Hallgass meg engem, Uram, mert jó a te kegyelmességed! A te irgalmasságodnak sokasága szerint tekints én reám;"));
husuperobject.biblemap.put("b19_69_18", new husuperobject(19,69,18,"És ne rejtsd el orczádat a te szolgádtól; mert szorongattatom nagyon: siess, hallgass meg engem!"));
husuperobject.biblemap.put("b19_69_19", new husuperobject(19,69,19,"Légy közel az én lelkemhez és váltsd meg azt; az én ellenségeimért szabadíts meg engem."));
husuperobject.biblemap.put("b19_69_20", new husuperobject(19,69,20,"Te tudod az én gyalázatomat, szégyenemet és pirulásomat; jól ismered minden szorongatómat."));
husuperobject.biblemap.put("b19_69_21", new husuperobject(19,69,21,"A gyalázat megtörte szívemet és beteggé lettem; várok vala részvétre, de hiába; vigasztalókra, de nem találék."));
husuperobject.biblemap.put("b19_69_22", new husuperobject(19,69,22,"Sõt ételemben mérget adnak vala, és szomjúságomban eczettel itatnak vala engem."));
husuperobject.biblemap.put("b19_69_23", new husuperobject(19,69,23,"Legyen az õ asztalok elõttök tõrré, és a bátorságosoknak hálóvá."));
husuperobject.biblemap.put("b19_69_24", new husuperobject(19,69,24,"Setétüljenek meg az õ szemeik, hogy ne lássanak; és az õ derekukat tedd mindenkorra roskataggá."));
husuperobject.biblemap.put("b19_69_25", new husuperobject(19,69,25,"Öntsd ki a te haragodat reájok, és a te haragodnak búsulása érje utól õket."));
husuperobject.biblemap.put("b19_69_26", new husuperobject(19,69,26,"Legyen az õ palotájok puszta, és az õ hajlékukban ne legyen lakos;"));
husuperobject.biblemap.put("b19_69_27", new husuperobject(19,69,27,"Mert a kit te megvertél, azt üldözik, és a tõled sujtottak fájdalmát szólják meg."));
husuperobject.biblemap.put("b19_69_28", new husuperobject(19,69,28,"Szedd össze álnokságaikat, és a te igazságodra ne jussanak el."));
husuperobject.biblemap.put("b19_69_29", new husuperobject(19,69,29,"Töröltessenek ki az élõk könyvébõl, és az igazak közé ne irattassanak."));
husuperobject.biblemap.put("b19_69_30", new husuperobject(19,69,30,"Engem pedig, a ki nyomorult és szenvedõ vagyok, emeljen fel, oh Isten, a te segedelmed!"));
husuperobject.biblemap.put("b19_69_31", new husuperobject(19,69,31,"Dicsérem az Istennek nevét énekkel, és magasztalom hálaadással."));
husuperobject.biblemap.put("b19_69_32", new husuperobject(19,69,32,"És kedvesebb lesz az Úr elõtt az ökörnél, a szarvas és hasadt körmû tuloknál."));
husuperobject.biblemap.put("b19_69_33", new husuperobject(19,69,33,"Látják [ezt] majd a szenvedõk és örülnek; ti Istent keresõk, elevenedjék a ti szívetek!"));
husuperobject.biblemap.put("b19_69_34", new husuperobject(19,69,34,"Mert meghallgatja az Úr a szegényeket, és az õ foglyait nem veti meg."));
husuperobject.biblemap.put("b19_69_35", new husuperobject(19,69,35,"Dicsérjék õt az egek és a föld; a tengerek és a mi csak mozog azokban!"));
husuperobject.biblemap.put("b19_69_36", new husuperobject(19,69,36,"Mert megtartja Isten a Siont, és megépíti Júdának városait; és ott lakoznak majd és bírni fogják azt. [ (Psalms 69:37) És az õ szolgáinak maradékai öröklik azt, és abban laknak majd, a kik szeretik az õ nevét. ]"));
husuperobject.biblemap.put("b19_70_1", new husuperobject(19,70,1,"Az éneklõmesternek, Dávidtól, emlékeztetésre."));
husuperobject.biblemap.put("b19_70_2", new husuperobject(19,70,2,"Isten, az én szabadításomra, Uram, az én segítségemre siess!"));
husuperobject.biblemap.put("b19_70_3", new husuperobject(19,70,3,"Szégyenüljenek meg és piruljanak, a kik életemre törnek; riadjanak vissza és gyalázat érje õket, a kik bajomat kivánják."));
husuperobject.biblemap.put("b19_70_4", new husuperobject(19,70,4,"Hátráljanak meg gyalázatosságuk miatt, a kik azt mondják nékem: Hehé, hehé!"));
husuperobject.biblemap.put("b19_70_5", new husuperobject(19,70,5,"Örülnek és örvendeznek majd benned mindazok, a kik keresnek tégedet, és ezt mondják majd szüntelen, a kik szeretik a te szabadításodat: Magasztaltassék fel az Isten! [ (Psalms 70:6) Én pedig szegény és nyomorult vagyok: siess hozzám, oh Isten; segedelmem és szabadítóm vagy te Uram: ne késsél! ]"));
husuperobject.biblemap.put("b19_71_1", new husuperobject(19,71,1,"Te benned bízom, Uram! Ne szégyenüljek meg soha."));
husuperobject.biblemap.put("b19_71_2", new husuperobject(19,71,2,"A te igazságod szerint ments meg és szabadíts meg engem; hajtsd hozzám füledet és tarts meg engem."));
husuperobject.biblemap.put("b19_71_3", new husuperobject(19,71,3,"Légy sziklaváram, a hova menekülhessek szüntelen; rendelkezzél megtartásom felõl, mert kõszálam és erõsségem vagy te."));
husuperobject.biblemap.put("b19_71_4", new husuperobject(19,71,4,"Én Istenem, szabadíts meg engem a gonosznak kezébõl; a hamisnak és kegyetlennek markából!"));
husuperobject.biblemap.put("b19_71_5", new husuperobject(19,71,5,"Mert te vagy az én reménységem, oh Uram, Istenem, én bizodalmam gyermekségemtõl fogva!"));
husuperobject.biblemap.put("b19_71_6", new husuperobject(19,71,6,"Reád támaszkodom születésem óta; anyámnak méhébõl te vontál ki engem; rólad szól az én dicséretem szüntelen."));
husuperobject.biblemap.put("b19_71_7", new husuperobject(19,71,7,"Mintegy csudává lettem sokaknak; de te vagy az én erõs bizodalmam."));
husuperobject.biblemap.put("b19_71_8", new husuperobject(19,71,8,"Megtelik szájam dicséreteddel, minden napon a te dicsõségeddel."));
husuperobject.biblemap.put("b19_71_9", new husuperobject(19,71,9,"Ne vess el engem az én vénségemnek idején; mikor elfogy az én erõm, ne hagyj el engem!"));
husuperobject.biblemap.put("b19_71_10", new husuperobject(19,71,10,"Mert felõlem szólanak elleneim, és a kik életemre törnek, együtt tanácskoznak,"));
husuperobject.biblemap.put("b19_71_11", new husuperobject(19,71,11,"Mondván: Az Isten elhagyta õt! Kergessétek és fogjátok meg, mert nincs, a ki megszabadítsa."));
husuperobject.biblemap.put("b19_71_12", new husuperobject(19,71,12,"Oh Isten, ne távozzál el tõlem! Én Istenem, siess segítségemre!"));
husuperobject.biblemap.put("b19_71_13", new husuperobject(19,71,13,"Szégyenüljenek meg és enyészszenek el életemnek ellenségei; borítsa szégyen és gyalázat azokat, a kik vesztemre törnek!"));
husuperobject.biblemap.put("b19_71_14", new husuperobject(19,71,14,"Én pedig szüntelen reménylek, és szaporítom minden te dicséretedet."));
husuperobject.biblemap.put("b19_71_15", new husuperobject(19,71,15,"Szájam beszéli a te igazságodat, minden nap a te szabadításodat, mert számát sem tudom."));
husuperobject.biblemap.put("b19_71_16", new husuperobject(19,71,16,"Az Úr Istennek nagy tetteivel járok; csak a te igazságodról emlékezem!"));
husuperobject.biblemap.put("b19_71_17", new husuperobject(19,71,17,"Oh Isten, gyermekségemtõl tanítottál engem; és mind mostanig hirdetem a te csudadolgaidat."));
husuperobject.biblemap.put("b19_71_18", new husuperobject(19,71,18,"Vénségemig és megõszülésemig se hagyj el engem, oh Isten, hogy hirdessem a te karodat e nemzetségnek, és minden következendõnek a te nagy tetteidet."));
husuperobject.biblemap.put("b19_71_19", new husuperobject(19,71,19,"Hisz a te igazságod, oh Isten, felhat az égig, mert nagyságos dolgokat cselekedtél; kicsoda hasonló te hozzád, oh Isten?!"));
husuperobject.biblemap.put("b19_71_20", new husuperobject(19,71,20,"A ki sok bajt és nyomorúságot éreztettél velünk, [de] ismét megelevenítesz, és a föld mélységébõl ismét felhozol minket."));
husuperobject.biblemap.put("b19_71_21", new husuperobject(19,71,21,"Megsokasítod az én nagyságomat; hozzám fordulsz [és] megvigasztalsz engem."));
husuperobject.biblemap.put("b19_71_22", new husuperobject(19,71,22,"Én is tisztellek téged lanttal a te hûségedért, én Istenem! Éneklek néked hárfával, oh Izráelnek szentje!"));
husuperobject.biblemap.put("b19_71_23", new husuperobject(19,71,23,"Örvendeznek az én ajakim, hogy énekelhetek néked, és lelkem is, a melyet megváltottál."));
husuperobject.biblemap.put("b19_71_24", new husuperobject(19,71,24,"Nyelvem is minden napon hirdeti a te igazságodat, mert megszégyenültek és gyalázattal illettettek, a kik vesztemre törnek."));
husuperobject.biblemap.put("b19_72_1", new husuperobject(19,72,1,"Salamoné."));
husuperobject.biblemap.put("b19_72_2", new husuperobject(19,72,2,"Hadd ítélje népedet igazsággal, és a te szegényeidet méltányossággal."));
husuperobject.biblemap.put("b19_72_3", new husuperobject(19,72,3,"Teremjenek a hegyek békességet a népnek, és a halmok igazságot."));
husuperobject.biblemap.put("b19_72_4", new husuperobject(19,72,4,"Legyen birája a nép szegényeinek, segítsen a szûkölködõnek fiain, és törje össze az erõszakoskodót."));
husuperobject.biblemap.put("b19_72_5", new husuperobject(19,72,5,"Féljenek téged, a míg a nap áll és a meddig a hold fénylik, nemzedékrõl nemzedékre."));
husuperobject.biblemap.put("b19_72_6", new husuperobject(19,72,6,"Szálljon alá, mint esõ a rétre, mint zápor, a mely megöntözi a földet."));
husuperobject.biblemap.put("b19_72_7", new husuperobject(19,72,7,"Virágozzék az õ idejében az igaz és a béke teljessége, a míg nem lesz a hold."));
husuperobject.biblemap.put("b19_72_8", new husuperobject(19,72,8,"És uralkodjék egyik tengertõl a másik tengerig, és a [nagy] folyamtól a föld határáig."));
husuperobject.biblemap.put("b19_72_9", new husuperobject(19,72,9,"Boruljanak le elõtte a pusztalakók, és nyalják ellenségei a port."));
husuperobject.biblemap.put("b19_72_10", new husuperobject(19,72,10,"Tarsis és a szigetek királyai hozzanak ajándékot; Seba és Szeba királyai adománynyal járuljanak elé."));
husuperobject.biblemap.put("b19_72_11", new husuperobject(19,72,11,"Hajoljanak meg elõtte mind a királyok, és minden nemzet szolgáljon néki."));
husuperobject.biblemap.put("b19_72_12", new husuperobject(19,72,12,"Mert megszabadítja a kiáltó szûkölködõt; a nyomorultat, a kinek nincs segítõje."));
husuperobject.biblemap.put("b19_72_13", new husuperobject(19,72,13,"Könyörül a szegényen és szûkölködõn, s a szûkölködõk lelkét megszabadítja;"));
husuperobject.biblemap.put("b19_72_14", new husuperobject(19,72,14,"Az elnyomástól és erõszaktól megmenti lelköket, és vérök drága az õ szemében."));
husuperobject.biblemap.put("b19_72_15", new husuperobject(19,72,15,"És éljen õ és adjanak néki Seba aranyából; imádkozzanak érte szüntelen, és áldják õt minden napon."));
husuperobject.biblemap.put("b19_72_16", new husuperobject(19,72,16,"Bõ gabona legyen az országban a hegyek tetején is; rengjen gyümölcse, mint a Libanon, s viruljon a városok népe, mint a földnek füve."));
husuperobject.biblemap.put("b19_72_17", new husuperobject(19,72,17,"Tartson neve mindörökké; viruljon neve, míg a nap lesz; vele áldják magokat mind a nemzetek, és magasztalják õt."));
husuperobject.biblemap.put("b19_72_18", new husuperobject(19,72,18,"Áldott az Úr Isten, Izráelnek Istene, a ki csudadolgokat cselekszik egyedül!"));
husuperobject.biblemap.put("b19_72_19", new husuperobject(19,72,19,"Áldott legyen az õ dicsõséges neve mindörökké, és teljék be dicsõségével az egész föld. Ámen! Ámen!"));
husuperobject.biblemap.put("b19_72_20", new husuperobject(19,72,20,"Itt végzõdnek Dávidnak, az Isai fiának könyörgései."));
husuperobject.biblemap.put("b19_73_1", new husuperobject(19,73,1,"Aszáf zsoltára."));
husuperobject.biblemap.put("b19_73_2", new husuperobject(19,73,2,"De én?! Már-már meghanyatlottak lábaim; és kis híjja, hogy lépteim el nem iszamodtak."));
husuperobject.biblemap.put("b19_73_3", new husuperobject(19,73,3,"Mert irígykedtem a kevélyekre, látván a gonoszok jó szerencséjét."));
husuperobject.biblemap.put("b19_73_4", new husuperobject(19,73,4,"Mert halálukig nincsenek kínjaik, és az õ erejök állandó."));
husuperobject.biblemap.put("b19_73_5", new husuperobject(19,73,5,"A halandók nyomorúságában nincs részök, és az emberekkel nem ostoroztatnak."));
husuperobject.biblemap.put("b19_73_6", new husuperobject(19,73,6,"Ezért nyakuknak ékessége kevélység, ruha gyanánt erõszak borítja õket."));
husuperobject.biblemap.put("b19_73_7", new husuperobject(19,73,7,"A kövérség miatt kinn ülnek az õ szemeik, elméjök gondolatjai csaponganak."));
husuperobject.biblemap.put("b19_73_8", new husuperobject(19,73,8,"Gúnyolódnak és gonoszságot szólnak; elnyomásról beszélnek fennhéjázással."));
husuperobject.biblemap.put("b19_73_9", new husuperobject(19,73,9,"Az égre tátogatják szájokat, és nyelvök eljárja a földet."));
husuperobject.biblemap.put("b19_73_10", new husuperobject(19,73,10,"Azért fordul az õ népe ide, hogy tele [pohár] vizet szürcsölnek;"));
husuperobject.biblemap.put("b19_73_11", new husuperobject(19,73,11,"És mondják: Mint tudhatná ezt az Isten, s van-é a Magasságosban értelem?"));
husuperobject.biblemap.put("b19_73_12", new husuperobject(19,73,12,"Ímé, ezek gonoszok, és örök biztonságban vagyont gyûjtenek!"));
husuperobject.biblemap.put("b19_73_13", new husuperobject(19,73,13,"Bizony hiába tartottam én tisztán szívemet, és mostam ártatlanságban kezeimet;"));
husuperobject.biblemap.put("b19_73_14", new husuperobject(19,73,14,"Mert nyomorgattatom minden napon, és ostoroztatom minden reggel!"));
husuperobject.biblemap.put("b19_73_15", new husuperobject(19,73,15,"Ha azt mondom: Ilyen módon szólok: Ímé, a te fiaid nemzedékét árulom el."));
husuperobject.biblemap.put("b19_73_16", new husuperobject(19,73,16,"Gondolkodom, hogy ezt megérthessem; de nehéz dolog ez szemeimben."));
husuperobject.biblemap.put("b19_73_17", new husuperobject(19,73,17,"Mígnem bemenék az Isten szent helyébe: megértém azoknak sorsát."));
husuperobject.biblemap.put("b19_73_18", new husuperobject(19,73,18,"Bizony síkos földön helyezted el õket; pusztaságokra vetetted ki õket."));
husuperobject.biblemap.put("b19_73_19", new husuperobject(19,73,19,"Mind elpusztulnak egy szempillantásban! Elvesznek, elenyésznek a rettegéstõl."));
husuperobject.biblemap.put("b19_73_20", new husuperobject(19,73,20,"Mint álmot, ha felserkenünk: te Uram, ha felserkensz, [úgy ]veted meg képöket."));
husuperobject.biblemap.put("b19_73_21", new husuperobject(19,73,21,"Hogyha keseregne szívem, és háborognának veséim:"));
husuperobject.biblemap.put("b19_73_22", new husuperobject(19,73,22,"Akkor balgatag és tudatlan volnék én, oktalan állat volnék te irántad."));
husuperobject.biblemap.put("b19_73_23", new husuperobject(19,73,23,"De én mindenkor veled vagyok, te fogod az én jobb kezemet."));
husuperobject.biblemap.put("b19_73_24", new husuperobject(19,73,24,"Tanácsoddal igazgatsz engem, és azután dicsõségbe fogadsz be engem."));
husuperobject.biblemap.put("b19_73_25", new husuperobject(19,73,25,"Kicsodám van az egekben? Náladnál egyébben nem gyönyörködöm e földön!"));
husuperobject.biblemap.put("b19_73_26", new husuperobject(19,73,26,"Ha elfogyatkozik is testem és szívem: szívemnek kõsziklája és az én örökségem te vagy, oh Isten, mindörökké!"));
husuperobject.biblemap.put("b19_73_27", new husuperobject(19,73,27,"Mert ímé, a kik eltávoznak tõled, elvesznek; mind kiirtod azokat, a kik elhajolnak tõled."));
husuperobject.biblemap.put("b19_73_28", new husuperobject(19,73,28,"De én? Isten közelsége oly igen jó nékem. Az Úr Istenben vetem reménységemet, hogy hirdessem minden te cselekedetedet."));
husuperobject.biblemap.put("b19_74_1", new husuperobject(19,74,1,"Aszáf tanítása."));
husuperobject.biblemap.put("b19_74_2", new husuperobject(19,74,2,"Emlékezzél meg a te gyülekezetedrõl, a melyet régen szerzettél és a melyet megváltottál: a te örökségednek részérõl, a Sion hegyérõl, a melyen lakozol!"));
husuperobject.biblemap.put("b19_74_3", new husuperobject(19,74,3,"Lépj fel a teljes pusztaságba; mindent tönkre tett az ellenség a szent helyen!"));
husuperobject.biblemap.put("b19_74_4", new husuperobject(19,74,4,"Támadóid a te gyülekezeted hajlékában ordítanak: jeleiket tûzték fel jelekké."));
husuperobject.biblemap.put("b19_74_5", new husuperobject(19,74,5,"Úgy tünnek fel, mint mikor valaki fejszéjét emelgeti az erdõnek sûrû fáira."));
husuperobject.biblemap.put("b19_74_6", new husuperobject(19,74,6,"Faragványait már mind összetördelték: fejszékkel és põrölyökkel."));
husuperobject.biblemap.put("b19_74_7", new husuperobject(19,74,7,"Szent helyedet lángba borították; neved hajlékát földig megfertõztették."));
husuperobject.biblemap.put("b19_74_8", new husuperobject(19,74,8,"Ezt mondották szívökben: Dúljuk fel õket mindenestõl! Felgyújtották Istennek minden hajlékát az országban."));
husuperobject.biblemap.put("b19_74_9", new husuperobject(19,74,9,"Jeleinket nem látjuk, próféta nincs többé, és nincs közöttünk, a ki tudná: meddig tart [ez?]"));
husuperobject.biblemap.put("b19_74_10", new husuperobject(19,74,10,"Meddig szidalmaz, oh Isten, a sanyargató? Örökké gyalázza-é az ellenség a te nevedet?"));
husuperobject.biblemap.put("b19_74_11", new husuperobject(19,74,11,"Miért húzod vissza kezedet, jobbodat? [Vond] ki kebeledbõl: végezz!"));
husuperobject.biblemap.put("b19_74_12", new husuperobject(19,74,12,"Pedig Isten az én királyom eleitõl fogva, a ki szabadításokat mível e föld közepette."));
husuperobject.biblemap.put("b19_74_13", new husuperobject(19,74,13,"Te hasítottad ketté a tengert erõddel; te törted össze a czethalak fejeit a vizekben."));
husuperobject.biblemap.put("b19_74_14", new husuperobject(19,74,14,"Te rontottad meg a leviathánnak fejét, s adtad azt eledelül a pusztai népnek."));
husuperobject.biblemap.put("b19_74_15", new husuperobject(19,74,15,"Te fakasztottad fel a forrást és patakot, te száraztottad meg az örök folyókat."));
husuperobject.biblemap.put("b19_74_16", new husuperobject(19,74,16,"Tiéd a nappal, az éjszaka is tiéd; te formáltad a világosságot és a napot."));
husuperobject.biblemap.put("b19_74_17", new husuperobject(19,74,17,"Te szabtad meg a földnek minden határát: a nyarat és a telet te formáltad."));
husuperobject.biblemap.put("b19_74_18", new husuperobject(19,74,18,"Emlékezzél meg errõl: ellenség szidalmazta az Urat, s bolond nép káromolta a te nevedet."));
husuperobject.biblemap.put("b19_74_19", new husuperobject(19,74,19,"Ne adjad a fenevadnak a te gerliczédnek lelkét; szegényeidnek gyülekezetérõl ne feledkezzél meg végképen!"));
husuperobject.biblemap.put("b19_74_20", new husuperobject(19,74,20,"Tekints a szövetségre; mert telve vannak e földnek rejtekhelyei zsaroló tanyákkal."));
husuperobject.biblemap.put("b19_74_21", new husuperobject(19,74,21,"A megrontott ne térjen szégyenvallással vissza; a nyomorult és szûkölködõ dicsérje a te nevedet."));
husuperobject.biblemap.put("b19_74_22", new husuperobject(19,74,22,"Kelj fel, oh Isten, és védd a te ügyedet; emlékezzél meg a te gyaláztatásodról, a melylyel naponként illet téged a bolond!"));
husuperobject.biblemap.put("b19_74_23", new husuperobject(19,74,23,"Ne felejtkezzél el ellenségeidnek szaváról, és az ellened támadók háborgatásáról, a mely szüntelen nevekedik!"));
husuperobject.biblemap.put("b19_75_1", new husuperobject(19,75,1,"Az éneklõmesternek, az altashétre, Aszáf zsoltára, ének."));
husuperobject.biblemap.put("b19_75_2", new husuperobject(19,75,2,"Tisztelünk téged, oh Isten, tisztelünk; neved közel van, hirdetik csodatetteid."));
husuperobject.biblemap.put("b19_75_3", new husuperobject(19,75,3,"Ha megszabom a határidõt, én méltányosan ítélek."));
husuperobject.biblemap.put("b19_75_4", new husuperobject(19,75,4,"A föld és annak minden lakosa elcsügged; én erõsítem meg annak oszlopait. Szela."));
husuperobject.biblemap.put("b19_75_5", new husuperobject(19,75,5,"A kérkedõknek azt mondom: Ne kérkedjetek; és a gonoszoknak: Ne emeljetek szarvat!"));
husuperobject.biblemap.put("b19_75_6", new husuperobject(19,75,6,"Ne emeljétek magasra szarvatokat, ne szóljatok megkeményedett nyakkal;"));
husuperobject.biblemap.put("b19_75_7", new husuperobject(19,75,7,"Mert nem napkelettõl, sem napnyugattól, s nem is a puszta felõl [támad] a felmagasztalás;"));
husuperobject.biblemap.put("b19_75_8", new husuperobject(19,75,8,"Hanem Isten a biró, a ki egyet megaláz, mást felmagasztal!"));
husuperobject.biblemap.put("b19_75_9", new husuperobject(19,75,9,"Mert pohár van az Úr kezében, bortól pezseg, nedvvel tele; ha tölt belõle, még seprejét is iszsza és szopja a föld minden gonosztevõje."));
husuperobject.biblemap.put("b19_75_10", new husuperobject(19,75,10,"Én pedig hirdetem [ezt] mindörökké, és éneket mondok a Jákób Istenének. [ (Psalms 75:11) És a gonoszoknak szarvait mind letördelem; az igaznak szarvai pedig felmagasztaltatnak. ]"));

}

private void putmapbible19_2() {

husuperobject.biblemap.put("b19_76_1", new husuperobject(19,76,1,"Az éneklõmesternek hangszerekkel; Aszáf zsoltára, ének."));
husuperobject.biblemap.put("b19_76_2", new husuperobject(19,76,2,"Ismeretes az Isten Júdában, nagy az õ neve Izráelben."));
husuperobject.biblemap.put("b19_76_3", new husuperobject(19,76,3,"Mert hajléka van Sálemben, és lakhelye Sionban."));
husuperobject.biblemap.put("b19_76_4", new husuperobject(19,76,4,"Ott törte össze a kézív villámait, paizst, szablyát és a hadat. Szela."));
husuperobject.biblemap.put("b19_76_5", new husuperobject(19,76,5,"Ragyogó vagy te, felségesebb, mint a zsákmányadó hegyek."));
husuperobject.biblemap.put("b19_76_6", new husuperobject(19,76,6,"Kifosztattak a bátor szívûek, álmukat aluszszák, és minden hõs kezének ereje veszett."));
husuperobject.biblemap.put("b19_76_7", new husuperobject(19,76,7,"A te dorgálásodtól, oh Jákób Istene, megzsibbadt mind szekér, mind ló."));
husuperobject.biblemap.put("b19_76_8", new husuperobject(19,76,8,"Te, te rettenetes vagy, és ki állhat meg orczád elõtt, mikor haragszol?"));
husuperobject.biblemap.put("b19_76_9", new husuperobject(19,76,9,"Az egekbõl jelentetted ki ítéletedet; a föld megrettent és elcsendesedett,"));
husuperobject.biblemap.put("b19_76_10", new husuperobject(19,76,10,"Mikor felkelt Isten az ítéletre, hogy megszabadítsa a föld minden nyomorultját! Szela."));
husuperobject.biblemap.put("b19_76_11", new husuperobject(19,76,11,"Mert az emberek haragja megdicsõít téged, miután felövezed végsõ haragodat."));
husuperobject.biblemap.put("b19_76_12", new husuperobject(19,76,12,"Tegyetek fogadást és adjátok meg azokat az Úrnak, a ti Isteneteknek; mindnyájan, a kik õ körülte laknak, hozzanak ajándékot a Rettenetesnek. [ (Psalms 76:13) Mert a fejedelmek gõgjét megtöri, rettenetes a föld királyaihoz. ]"));
husuperobject.biblemap.put("b19_77_1", new husuperobject(19,77,1,"Az éneklõmesternek, Jedutunnak; Aszáfé, zsoltár."));
husuperobject.biblemap.put("b19_77_2", new husuperobject(19,77,2,"Szavamat Istenhez [emelem] és kiáltok; szavamat Istenhez [emelem], hogy figyelmezzen reám."));
husuperobject.biblemap.put("b19_77_3", new husuperobject(19,77,3,"Nyomorúságom idején az Urat keresem; kezem feltartom éjjel szünetlenül; lelkem nem akar vigasztalást bevenni."));
husuperobject.biblemap.put("b19_77_4", new husuperobject(19,77,4,"Istenrõl emlékezem és sóhajtok; róla gondolkodom, de elepedt az én lelkem. Szela."));
husuperobject.biblemap.put("b19_77_5", new husuperobject(19,77,5,"Szemeimet ébren tartod; hánykolódom, de nem szólhatok."));
husuperobject.biblemap.put("b19_77_6", new husuperobject(19,77,6,"Elmélkedem a régi napokról, a hajdankor éveirõl."));
husuperobject.biblemap.put("b19_77_7", new husuperobject(19,77,7,"Megemlékezem éjjel az én énekeimrõl; szívemben elgondolkodom és azt kutatja lelkem:"));
husuperobject.biblemap.put("b19_77_8", new husuperobject(19,77,8,"Avagy mindörökké elvet-é az Úr? és nem lesz-é többé jóakaró?"));
husuperobject.biblemap.put("b19_77_9", new husuperobject(19,77,9,"Avagy végképen elfogyott-é az õ kegyelme? vagy megszûnik-é igérete nemzedékrõl nemzedékre?"));
husuperobject.biblemap.put("b19_77_10", new husuperobject(19,77,10,"Avagy elfelejtkezett-é könyörülni Isten? avagy elzárta-é haragjában az õ irgalmát? Szela."));
husuperobject.biblemap.put("b19_77_11", new husuperobject(19,77,11,"És mondám: Ez az én betegségem, hogy a Fölségesnek jobbja megváltozott."));
husuperobject.biblemap.put("b19_77_12", new husuperobject(19,77,12,"Megemlékezem az Úrnak cselekedeteirõl, sõt megemlékezem hajdani csodáidról;"));
husuperobject.biblemap.put("b19_77_13", new husuperobject(19,77,13,"És elmélkedem minden cselekedetedrõl, és tetteidrõl gondolkozom."));
husuperobject.biblemap.put("b19_77_14", new husuperobject(19,77,14,"Oh Isten, a te utad szentséges; kicsoda olyan nagy Isten, mint az Isten?"));
husuperobject.biblemap.put("b19_77_15", new husuperobject(19,77,15,"Te vagy az Isten, a ki csodát mívelsz; megmutattad a népek között a te hatalmadat."));
husuperobject.biblemap.put("b19_77_16", new husuperobject(19,77,16,"Megváltottad népedet karoddal a Jákób és a József fiait. Szela."));
husuperobject.biblemap.put("b19_77_17", new husuperobject(19,77,17,"Láttak téged a vizek, oh Isten, láttak téged a vizek és megfélemlének; a mélységek is megrázkódának."));
husuperobject.biblemap.put("b19_77_18", new husuperobject(19,77,18,"A felhõk vizet ömlesztének; megzendülének a fellegek, és a te nyílaid széllyel futkostanak."));
husuperobject.biblemap.put("b19_77_19", new husuperobject(19,77,19,"Mennydörgésed zúgott a forgószélben; villámlásaid megvilágosították a mindenséget; megrázkódott és megindult a föld."));
husuperobject.biblemap.put("b19_77_20", new husuperobject(19,77,20,"Utad a tengeren volt és ösvényed a nagy vizeken; és nyomaid nem látszottak meg. [ (Psalms 77:21) Vezetted mint nyájat, a te népedet, Mózesnek és Áronnak kezével. ]"));
husuperobject.biblemap.put("b19_78_1", new husuperobject(19,78,1,"Aszáf tanítása.  hajtsátok füleiteket számnak beszédeire."));
husuperobject.biblemap.put("b19_78_2", new husuperobject(19,78,2,"Megnyitom az én számat példabeszédre; rejtett dolgokat szólok a régi idõbõl."));
husuperobject.biblemap.put("b19_78_3", new husuperobject(19,78,3,"A miket hallottunk és tudunk; és a miket atyáink beszéltek nékünk,"));
husuperobject.biblemap.put("b19_78_4", new husuperobject(19,78,4,"Nem titkoljuk el azokat az õ fiaiktól; a jövõ nemzedéknek is elbeszéljük az Úr dicséretét, hatalmát és csodáit, a melyeket cselekedett."));
husuperobject.biblemap.put("b19_78_5", new husuperobject(19,78,5,"Mert bizonyságot állított Jákóbban, és törvényt rendelt Izráelben; a melyek felõl megparancsolta atyáinknak, hogy megtanítsák azokra fiaikat;"));
husuperobject.biblemap.put("b19_78_6", new husuperobject(19,78,6,"Hogy megtudja [azokat] a jövõ nemzedék, a fiak, a kik születnek; és felkeljenek és hirdessék [azokat] fiaiknak;"));
husuperobject.biblemap.put("b19_78_7", new husuperobject(19,78,7,"Hogy Istenbe vessék reménységüket és el ne felejtkezzenek Isten dolgairól, hanem az õ parancsolatait megtartsák."));
husuperobject.biblemap.put("b19_78_8", new husuperobject(19,78,8,"Hogy ne legyenek olyanok, mint apáik: szilaj és makacs nemzedék, olyan nemzedék, a melynek szíve nem volt szilárd, és lelke sem volt hû Isten iránt."));
husuperobject.biblemap.put("b19_78_9", new husuperobject(19,78,9,"Efraim fiai, a fegyveres íjászok hátat fordítottak az ütközet napján;"));
husuperobject.biblemap.put("b19_78_10", new husuperobject(19,78,10,"Nem õrizték meg az Isten szövetségét, és nem akartak járni az õ törvényében;"));
husuperobject.biblemap.put("b19_78_11", new husuperobject(19,78,11,"Sõt elfelejtkeztek az õ tetteirõl, csodáiról, a melyeket mutatott nékik."));
husuperobject.biblemap.put("b19_78_12", new husuperobject(19,78,12,"Apáik elõtt csodát mívelt Égyiptom földjén, a Czoán mezején."));
husuperobject.biblemap.put("b19_78_13", new husuperobject(19,78,13,"Ketté választotta a tengert s átvitte õket; és felállította a vizeket fal gyanánt."));
husuperobject.biblemap.put("b19_78_14", new husuperobject(19,78,14,"Vezette õket nappal felhõben, és egész éjen át tûznek világosságában."));
husuperobject.biblemap.put("b19_78_15", new husuperobject(19,78,15,"Sziklákat hasított meg a pusztában, és inniok adott bõségesen, akárcsak a mélységes vizekbõl."));
husuperobject.biblemap.put("b19_78_16", new husuperobject(19,78,16,"Patakokat fakasztott a kõsziklából, és folyamok módjára vizeket ömlesztett:"));
husuperobject.biblemap.put("b19_78_17", new husuperobject(19,78,17,"Mégis folyvást vétkeztek ellene, és haragították a Felségest a pusztában;"));
husuperobject.biblemap.put("b19_78_18", new husuperobject(19,78,18,"És megkísérték Istent az õ szívökben, enni valót kérvén az õ kivánságuk szerint."));
husuperobject.biblemap.put("b19_78_19", new husuperobject(19,78,19,"És szólának Isten ellen, mondván: Avagy tudna-é Isten asztalt teríteni a pusztában?"));
husuperobject.biblemap.put("b19_78_20", new husuperobject(19,78,20,"Ímé, megcsapta a kõsziklát és víz ömlött és patakok özönlöttek; de vajjon tud-é kenyeret is adni? avagy készíthet-é húst az õ népének?"));
husuperobject.biblemap.put("b19_78_21", new husuperobject(19,78,21,"Meghallotta az Úr és megharagudott ezért, és tûz gyulladt fel Jákób ellen, és harag gerjedt fel Izráel ellen;"));
husuperobject.biblemap.put("b19_78_22", new husuperobject(19,78,22,"Mert nem hittek Istenben, és nem bíztak az õ segedelmében,"));
husuperobject.biblemap.put("b19_78_23", new husuperobject(19,78,23,"És ráparancsolt a felhõkre ott fenn, és az egek ajtait megnyitotta."));
husuperobject.biblemap.put("b19_78_24", new husuperobject(19,78,24,"És hullatott reájuk mannát eledelül, és mennyei gabonát adott nékik."));
husuperobject.biblemap.put("b19_78_25", new husuperobject(19,78,25,"Angyalok kenyerét ette az ember, bõséggel vetett nékik eleséget,"));
husuperobject.biblemap.put("b19_78_26", new husuperobject(19,78,26,"Megindítá a keleti szelet az egekben, és elhozá erejével a déli szelet;"));
husuperobject.biblemap.put("b19_78_27", new husuperobject(19,78,27,"És hullata rájuk annyi húst, mint a por, és annyi madarat, mint a tenger fövénye."));
husuperobject.biblemap.put("b19_78_28", new husuperobject(19,78,28,"És leszállítá azokat az õ táboruk közepére, az õ sátoraikhoz köröskörül."));
husuperobject.biblemap.put("b19_78_29", new husuperobject(19,78,29,"Evének azért és igen megelégedének, és a mit kivántak, azt hozá nékik."));
husuperobject.biblemap.put("b19_78_30", new husuperobject(19,78,30,"Még fel sem hagytak a kivánságukkal; az étel még a szájukban vala:"));
husuperobject.biblemap.put("b19_78_31", new husuperobject(19,78,31,"Mikor az Isten haragja felgerjede ellenök, és fõbbjeik közül [sokakat] megöle, és Izráelnek ifjait levágá;"));
husuperobject.biblemap.put("b19_78_32", new husuperobject(19,78,32,"Mindamellett is újra vétkezének, és nem hivének az õ csodadolgaiban."));
husuperobject.biblemap.put("b19_78_33", new husuperobject(19,78,33,"Azért hiábavalóságban töltette el napjaikat, éveiket pedig rettegésben."));
husuperobject.biblemap.put("b19_78_34", new husuperobject(19,78,34,"Ha ölte õket, hozzá fordultak, megtértek és Istent keresék."));
husuperobject.biblemap.put("b19_78_35", new husuperobject(19,78,35,"És eszökbe vevék, hogy Isten az õ sziklájok, és a felséges Isten az õ megváltójok;"));
husuperobject.biblemap.put("b19_78_36", new husuperobject(19,78,36,"És hízelkedének néki szájokkal, nyelvökkel pedig hazudozának néki."));
husuperobject.biblemap.put("b19_78_37", new husuperobject(19,78,37,"De szívök nem volt tökéletes iránta, és nem voltak hûségesek az õ szövetségéhez;"));
husuperobject.biblemap.put("b19_78_38", new husuperobject(19,78,38,"Õ azonban irgalmas és bûnbocsátó, nem semmisít meg, sõt sokszor elfordítja haragját, és nem önti ki teljes búsulását."));
husuperobject.biblemap.put("b19_78_39", new husuperobject(19,78,39,"Azért eszébe vevé, hogy test õk, [és olyanok, mint] az ellebbenõ szél, a mely nem tér vissza."));
husuperobject.biblemap.put("b19_78_40", new husuperobject(19,78,40,"Hányszor keserítették õt a pusztában, [hányszor] illették fájdalommal a kietlenben?!"));
husuperobject.biblemap.put("b19_78_41", new husuperobject(19,78,41,"És újra kísértették az Istent, és ingerelték Izráel szentjét."));
husuperobject.biblemap.put("b19_78_42", new husuperobject(19,78,42,"Nem emlékeztek meg az õ kezérõl, [sem] a napról, a melyen megváltotta õket a nyomorgatótól;"));
husuperobject.biblemap.put("b19_78_43", new husuperobject(19,78,43,"Midõn kitûzte jeleit Égyiptomban, és csodáit a Czoán mezején."));
husuperobject.biblemap.put("b19_78_44", new husuperobject(19,78,44,"És vérré változtatta folyóikat, hogy nem ihatták patakjaikat."));
husuperobject.biblemap.put("b19_78_45", new husuperobject(19,78,45,"Legyeket bocsáta reájok, a melyek emészték õket, és békát, a mely pusztítá õket."));
husuperobject.biblemap.put("b19_78_46", new husuperobject(19,78,46,"Odaadta termésöket a szöcskének, s munkájuk gyümölcsét a sáskának."));
husuperobject.biblemap.put("b19_78_47", new husuperobject(19,78,47,"Jégesõvel pusztítá el szõlõjüket, s figefáikat kõesõvel."));
husuperobject.biblemap.put("b19_78_48", new husuperobject(19,78,48,"Odaveté barmaikat a jégesõnek, marháikat pedig a mennyköveknek."));
husuperobject.biblemap.put("b19_78_49", new husuperobject(19,78,49,"Rájok bocsátá haragjának tüzét, mérgét, búsulását és a szorongatást: a gonosz angyalok seregét."));
husuperobject.biblemap.put("b19_78_50", new husuperobject(19,78,50,"Utat tört haragjának, s nem tartotta meg a haláltól lelköket, és életöket döghalálnak veté."));
husuperobject.biblemap.put("b19_78_51", new husuperobject(19,78,51,"És megöle minden elsõszülöttet Égyiptomban, az erõ zsengéjét Khám sátoraiban."));
husuperobject.biblemap.put("b19_78_52", new husuperobject(19,78,52,"Elindítá mint juhokat, az õ népét, s vezeté õket, mint nyájat a pusztában."));
husuperobject.biblemap.put("b19_78_53", new husuperobject(19,78,53,"És vezeté õket biztonságban, és nem félének, ellenségeiket pedig elborítá a tenger."));
husuperobject.biblemap.put("b19_78_54", new husuperobject(19,78,54,"És bevivé õket az õ szent határába, arra a hegyre, a melyet szerzett az õ jobbkezével."));
husuperobject.biblemap.put("b19_78_55", new husuperobject(19,78,55,"És kiûzé elõlük a pogányokat, és elosztá nékik az örökséget sorsvetéssel; és letelepíté azok sátoraiban az Izráel törzseit."));
husuperobject.biblemap.put("b19_78_56", new husuperobject(19,78,56,"De megkisérték és megharagíták a magasságos Istent, és nem õrizék meg bizonyságait;"));
husuperobject.biblemap.put("b19_78_57", new husuperobject(19,78,57,"Elfordulának ugyanis és hûtlenek levének, mint apáik; visszafelé fordulának, mint a csalfa kézív."));
husuperobject.biblemap.put("b19_78_58", new husuperobject(19,78,58,"Haragra ingerelték õt magaslataikkal, és bosszantották faragott bálványaikkal."));
husuperobject.biblemap.put("b19_78_59", new husuperobject(19,78,59,"Meghallá ezt Isten és felgerjede; és az Izráelt felette megútálá."));
husuperobject.biblemap.put("b19_78_60", new husuperobject(19,78,60,"És elveté magától Silói hajlékát, a sátort, a melyben lakott vala az emberek között;"));
husuperobject.biblemap.put("b19_78_61", new husuperobject(19,78,61,"Sõt fogságba viteté erejét, dicsõségét pedig ellenség kezébe."));
husuperobject.biblemap.put("b19_78_62", new husuperobject(19,78,62,"És fegyver alá rekeszté az õ népét; és az õ öröksége ellen felgerjede."));
husuperobject.biblemap.put("b19_78_63", new husuperobject(19,78,63,"Ifjait tûz emészté meg, és szüzei nem énekeltettek meg."));
husuperobject.biblemap.put("b19_78_64", new husuperobject(19,78,64,"Papjai fegyver miatt hullottak el, és özvegyei nem végezheték a siratást."));
husuperobject.biblemap.put("b19_78_65", new husuperobject(19,78,65,"Akkor felserkene az Úr, mintegy álomból; mint hõs, a ki bortól vigadoz;"));
husuperobject.biblemap.put("b19_78_66", new husuperobject(19,78,66,"És visszaveré ellenségeit; s örök gyalázatot vete reájok."));
husuperobject.biblemap.put("b19_78_67", new husuperobject(19,78,67,"Azután megútálá a József sátorát, és nem választá Efraim törzsét;"));
husuperobject.biblemap.put("b19_78_68", new husuperobject(19,78,68,"Hanem a Júda törzsét választá; a Sion hegyét, a melyet szeret."));
husuperobject.biblemap.put("b19_78_69", new husuperobject(19,78,69,"És megépíté szent helyét, mint egy magas [vár]at; mint a földet, a melyet örök idõre fundált."));
husuperobject.biblemap.put("b19_78_70", new husuperobject(19,78,70,"És kiválasztá Dávidot, az õ szolgáját, és elhozá õt a juhok aklaiból."));
husuperobject.biblemap.put("b19_78_71", new husuperobject(19,78,71,"A szoptatós juhok mellõl hozá el õt, hogy legeltesse Jákóbot, az õ népét, és Izráelt, az õ örökségét."));
husuperobject.biblemap.put("b19_78_72", new husuperobject(19,78,72,"És legelteté õket szívének tökéletessége szerint, és vezeté õket bölcs kezeivel."));
husuperobject.biblemap.put("b19_79_1", new husuperobject(19,79,1,"Aszáf zsoltára."));
husuperobject.biblemap.put("b19_79_2", new husuperobject(19,79,2,"Szolgáid holttestét az ég madarainak adták eledelül, szenteid húsát a föld vadjainak."));
husuperobject.biblemap.put("b19_79_3", new husuperobject(19,79,3,"Ontották véröket, mint a vizet Jeruzsálem körül, s nem volt, a ki eltemette volna õket."));
husuperobject.biblemap.put("b19_79_4", new husuperobject(19,79,4,"Gyalázattá lettünk szomszédaink elõtt, csúfságul és nevetségül a körültünk lakóknak."));
husuperobject.biblemap.put("b19_79_5", new husuperobject(19,79,5,"Meddig haragszol Uram, szüntelen? meddig gerjedez féltõ szerelmed, mint a tûz?"));
husuperobject.biblemap.put("b19_79_6", new husuperobject(19,79,6,"Ontsd ki haragodat a pogányokra, a kik nem ismernek téged, és az országokra, a melyek nem hívják segítségül a te nevedet;"));
husuperobject.biblemap.put("b19_79_7", new husuperobject(19,79,7,"Mert megemésztették Jákóbot, és hajlékát elpusztították."));
husuperobject.biblemap.put("b19_79_8", new husuperobject(19,79,8,"Ne emlékezzél meg rovásunkra elõdeink vétkérõl; siess elénk irgalmasságoddal, mert megnyomorodunk nagyon."));
husuperobject.biblemap.put("b19_79_9", new husuperobject(19,79,9,"Segíts meg bennünket, szabadító Istenünk, a te nevednek dicsõségéért; ments meg minket és bocsásd meg vétkeinket a te nevedért."));
husuperobject.biblemap.put("b19_79_10", new husuperobject(19,79,10,"Minek mondanák a pogányok: Hol az õ Istenök? Legyen nyilvánvaló a pogányokon szemeink láttára a te szolgáid kiontott véréért való bosszúállásod."));
husuperobject.biblemap.put("b19_79_11", new husuperobject(19,79,11,"Jusson elõdbe a foglyok könyörgése; karod hatalmával tartsd meg a halálnak eme fiait;"));
husuperobject.biblemap.put("b19_79_12", new husuperobject(19,79,12,"És fizess meg szomszédaink keblébe hétszeresen a gyalázatért, a melylyel illettek téged, oh Uram!"));
husuperobject.biblemap.put("b19_79_13", new husuperobject(19,79,13,"Mi pedig, a te néped és a te legelõd nyája, hálát adunk néked mindörökké, s nemzedékrõl-nemzedékre hirdetjük a te dicséretedet!"));
husuperobject.biblemap.put("b19_80_1", new husuperobject(19,80,1,"Az éneklõmesternek a sosannim-éduthra; Aszáf zsoltára."));
husuperobject.biblemap.put("b19_80_2", new husuperobject(19,80,2,"Oh Izráelnek pásztora, hallgass meg, a ki vezérled Józsefet, mint juhnyájat; a ki Kérubokon ülsz, jelenj meg fényeddel!"));
husuperobject.biblemap.put("b19_80_3", new husuperobject(19,80,3,"Efraim, Benjámin és Manasse elõtt támaszd fel a te hatalmadat, és jõjj el, hogy szabadíts meg minket!"));
husuperobject.biblemap.put("b19_80_4", new husuperobject(19,80,4,"Oh Isten, állíts helyre minket, és világoltasd a te orczádat, hogy megszabaduljunk."));
husuperobject.biblemap.put("b19_80_5", new husuperobject(19,80,5,"Seregeknek Ura, Istene: meddig haragszol a te népednek könyörgésére?"));
husuperobject.biblemap.put("b19_80_6", new husuperobject(19,80,6,"Könyhullatásnak kenyerével éteted õket, s könyhullatások árjával itatod meg õket."));
husuperobject.biblemap.put("b19_80_7", new husuperobject(19,80,7,"Perpatvarrá tevél minket szomszédaink között, és a mi ellenségeink csúfkodnak rajtunk."));
husuperobject.biblemap.put("b19_80_8", new husuperobject(19,80,8,"Seregek Istene, állíts helyre minket; világoltasd a te orczádat, hogy megszabaduljunk!"));
husuperobject.biblemap.put("b19_80_9", new husuperobject(19,80,9,"Égyiptomból szõlõt hozál ki, kiûzéd a pogányokat és azt elültetéd."));
husuperobject.biblemap.put("b19_80_10", new husuperobject(19,80,10,"Helyet egyengettél elõtte, és gyökeret eresztett, és ellepé a földet."));
husuperobject.biblemap.put("b19_80_11", new husuperobject(19,80,11,"Hegyeket fogott el az árnyéka, és a vesszei [olyanok lettek, mint] az Isten czédrusfái."));
husuperobject.biblemap.put("b19_80_12", new husuperobject(19,80,12,"Sarjait a tengerig ereszté, és hajtásait a folyamig."));
husuperobject.biblemap.put("b19_80_13", new husuperobject(19,80,13,"Miért rontottad el annak gyepûit, hogy szaggathassa minden járókelõ?"));
husuperobject.biblemap.put("b19_80_14", new husuperobject(19,80,14,"Pusztítja azt a vaddisznó, és legeli a mezei vad."));
husuperobject.biblemap.put("b19_80_15", new husuperobject(19,80,15,"Oh Seregek Istene! kérlek, térj vissza, tekints alá az egekbõl és lásd és tekintsd meg e szõlõtõt!"));
husuperobject.biblemap.put("b19_80_16", new husuperobject(19,80,16,"És a csemetét, a mit jobbod ültetett, a sarjat, melyet felneveltél!"));
husuperobject.biblemap.put("b19_80_17", new husuperobject(19,80,17,"Elégett a tûzben, levágatott; arczod haragjától elvesznek."));
husuperobject.biblemap.put("b19_80_18", new husuperobject(19,80,18,"Legyen a te kezed a te jobbodnak férfián, és az embernek fián, a kit megerõsítettél magadnak,"));
husuperobject.biblemap.put("b19_80_19", new husuperobject(19,80,19,"Hogy el ne térjünk tõled. Eleveníts meg minket és imádjuk a te nevedet. [ (Psalms 80:20) Seregek Ura, Istene! állíts helyre minket; világoltasd a te orczádat, hogy megszabaduljunk! ]"));
husuperobject.biblemap.put("b19_81_1", new husuperobject(19,81,1,"Az éneklõmesternek, a gittithre. Aszáfé."));
husuperobject.biblemap.put("b19_81_2", new husuperobject(19,81,2,"Örvendezzetek Istennek, a mi erõsségünknek; ujjongjatok a Jákób Istenének!"));
husuperobject.biblemap.put("b19_81_3", new husuperobject(19,81,3,"Dalt zengjetek és dobot pergessetek, gyönyörû hárfát cziterával együtt."));
husuperobject.biblemap.put("b19_81_4", new husuperobject(19,81,4,"Fújjatok kürtöt új holdra, holdtöltekor, a mi ünnepünk napján;"));
husuperobject.biblemap.put("b19_81_5", new husuperobject(19,81,5,"Mert végzett dolog ez Izráelnél, a Jákób Istenének rendelése."));
husuperobject.biblemap.put("b19_81_6", new husuperobject(19,81,6,"Bizonyságul tette õ a József nemzetségében, a mikor kijött Égyiptom földe ellen. Nyelvet hallék [ott,] a mit nem tudtam."));
husuperobject.biblemap.put("b19_81_7", new husuperobject(19,81,7,"Megszabadítottam a tehertõl az õ vállát, kezei megmenekültek a kosártól."));
husuperobject.biblemap.put("b19_81_8", new husuperobject(19,81,8,"A nyomorúságban segítségül hívtál és én megszabadítottalak téged; meghallgattalak téged a mennydörgésnek rejtekében; megpróbáltalak téged a versengések vizénél. Szela."));
husuperobject.biblemap.put("b19_81_9", new husuperobject(19,81,9,"Hallgass én népem, hadd tegyek bizonyságot ellened! Oh Izráel, ha te meghallgatnál engem!"));
husuperobject.biblemap.put("b19_81_10", new husuperobject(19,81,10,"Ne legyen te nálad idegen isten, és az idegen isten elõtt meg ne hajolj!"));
husuperobject.biblemap.put("b19_81_11", new husuperobject(19,81,11,"Én, az Úr vagyok a te Istened, a ki kihoztalak téged Égyiptom földérõl: nyisd szét a te szájad és betöltöm azt."));
husuperobject.biblemap.put("b19_81_12", new husuperobject(19,81,12,"De nem hallgatott népem az én szómra, és Izráel nem engedelmeskedett nékem."));
husuperobject.biblemap.put("b19_81_13", new husuperobject(19,81,13,"Ott hagytam azért õt szívöknek keménységében, hogy járjanak a magok tanácsa szerint."));
husuperobject.biblemap.put("b19_81_14", new husuperobject(19,81,14,"Oh, ha az én népem hallgatna reám, [s] Izráel az én utaimon járna!"));
husuperobject.biblemap.put("b19_81_15", new husuperobject(19,81,15,"Legott megaláznám ellenségeit, s szorongatói ellen fordítanám kezem."));
husuperobject.biblemap.put("b19_81_16", new husuperobject(19,81,16,"Az Úrnak gyûlölõi hízelegnének néki, és örökkévaló volna az õ idejök. [ (Psalms 81:17) És õ megelégítené õt java búzával, és sziklából folyó mézzel töltenélek be téged! ]"));
husuperobject.biblemap.put("b19_82_1", new husuperobject(19,82,1,"Aszáf zsoltára."));
husuperobject.biblemap.put("b19_82_2", new husuperobject(19,82,2,"Meddig ítéltek még hamisan, és emelitek a gonoszok személyét? Szela."));
husuperobject.biblemap.put("b19_82_3", new husuperobject(19,82,3,"Ítéljetek a szegénynek és árvának; a nyomorultnak és elnyomottnak adjatok igazságot!"));
husuperobject.biblemap.put("b19_82_4", new husuperobject(19,82,4,"Mentsétek meg a szegényt és szûkölködõt; a gonoszok kezébõl szabadítsátok ki."));
husuperobject.biblemap.put("b19_82_5", new husuperobject(19,82,5,"Nem tudnak, nem értenek, setétségben járnak; a földnek minden fundamentoma inog."));
husuperobject.biblemap.put("b19_82_6", new husuperobject(19,82,6,"Én mondottam: Istenek vagytok ti és a Felségesnek fiai ti mindnyájan:"));
husuperobject.biblemap.put("b19_82_7", new husuperobject(19,82,7,"Mindamellett meghaltok, mint a közember, és elhullotok, mint akármely fõember."));
husuperobject.biblemap.put("b19_82_8", new husuperobject(19,82,8,"Kelj fel, oh Isten, ítéld meg a földet, mert néked jutnak örökségül minden népek."));
husuperobject.biblemap.put("b19_83_1", new husuperobject(19,83,1,"Ének; Aszáf zsoltára."));
husuperobject.biblemap.put("b19_83_2", new husuperobject(19,83,2,"Isten, ne vesztegelj, ne hallgass és ne nyugodjál, Isten!"));
husuperobject.biblemap.put("b19_83_3", new husuperobject(19,83,3,"Mert ímé, háborognak ellenségeid, s gyûlölõid fejöket emelik."));
husuperobject.biblemap.put("b19_83_4", new husuperobject(19,83,4,"Néped ellen álnok tanácsot gondolnak s védenczeid ellen terveket szõnek."));
husuperobject.biblemap.put("b19_83_5", new husuperobject(19,83,5,"Ezt mondják: Jertek, veszessük el õket, hogy ne legyenek nemzet, hogy ne emlegessék többé Izráel nevét!"));
husuperobject.biblemap.put("b19_83_6", new husuperobject(19,83,6,"Mert tanácskoztak együtt, egy szívvel; szövetséget kötöttek ellened:"));
husuperobject.biblemap.put("b19_83_7", new husuperobject(19,83,7,"Az Edomiták és Ismáeliták sátrai, a Moábiták és Hagarénusok;"));
husuperobject.biblemap.put("b19_83_8", new husuperobject(19,83,8,"A Gebaliták, Ammoniták és Amálekiták, a Filiszteusok Tyrus lakosaival együtt."));
husuperobject.biblemap.put("b19_83_9", new husuperobject(19,83,9,"Az asszir is szövetkezett velök, segítõjévé lettek a Lót fiainak. Szela."));
husuperobject.biblemap.put("b19_83_10", new husuperobject(19,83,10,"Úgy bánj velök, mint Midjánnal, mint Siserával, mint Jábinnal a Kison patakjánál!"));
husuperobject.biblemap.put("b19_83_11", new husuperobject(19,83,11,"A kik elvesztek vala Endornál, [és] a föld szemetjévé lõnek."));
husuperobject.biblemap.put("b19_83_12", new husuperobject(19,83,12,"Tedd õket, fejedelmöket olyanokká, mint Orebet s mint Zeébet, Zebahot és Szalmunát, minden felkentjökkel,"));
husuperobject.biblemap.put("b19_83_13", new husuperobject(19,83,13,"A kik ezt mondták: Foglaljuk el magunknak az Isten hajlékait!"));
husuperobject.biblemap.put("b19_83_14", new husuperobject(19,83,14,"Én Istenem! Tedd õket olyanokká, a milyen a porfelhõ, [és ]a milyen a polyva a szél elõtt;"));
husuperobject.biblemap.put("b19_83_15", new husuperobject(19,83,15,"Olyanokká, mint a tûz, a mely meggyújtja az erdõt, és mint a láng, a mely elégeti a hegyeket."));
husuperobject.biblemap.put("b19_83_16", new husuperobject(19,83,16,"Így kergesd õket a te szélvészeddel, és forgószeleddel így rettentsd õket!"));
husuperobject.biblemap.put("b19_83_17", new husuperobject(19,83,17,"Töltsd el orczájukat gyalázattal, hogy keressék Uram a te nevedet!"));
husuperobject.biblemap.put("b19_83_18", new husuperobject(19,83,18,"Szégyenüljenek meg és rémüljenek el örökké, és piruljanak és pusztuljanak, [ (Psalms 83:19) Hogy megtudják, hogy te, a kinek neve Jehova, egymagad vagy felséges [Isten] az egész földön. ]"));
husuperobject.biblemap.put("b19_84_1", new husuperobject(19,84,1,"Az éneklõmesternek, a gittitre; Kóráh fiainak zsoltára."));
husuperobject.biblemap.put("b19_84_2", new husuperobject(19,84,2,"Mily szerelmetesek a te hajlékaid, Seregeknek Ura!"));
husuperobject.biblemap.put("b19_84_3", new husuperobject(19,84,3,"Kivánkozik, sõt emésztõdik lelkem az Úrnak tornáczai után; szívem és testem ujjongnak az élõ Isten felé."));
husuperobject.biblemap.put("b19_84_4", new husuperobject(19,84,4,"A veréb is talál házat, és a fecske is fészket magának, a hová fiait helyezhesse, - a te oltáraidnál, oh Seregeknek Ura, én Királyom és én Istenem!"));
husuperobject.biblemap.put("b19_84_5", new husuperobject(19,84,5,"Boldogok, a kik lakoznak a te házadban, dicsérhetnek téged szüntelen! Szela."));
husuperobject.biblemap.put("b19_84_6", new husuperobject(19,84,6,"Boldog ember az, a kinek te vagy erõssége, [s] a te ösvényeid vannak szívében."));
husuperobject.biblemap.put("b19_84_7", new husuperobject(19,84,7,"Átmenvén a Siralom völgyén, forrássá teszik azt; bizony áldással borítja el korai esõ."));
husuperobject.biblemap.put("b19_84_8", new husuperobject(19,84,8,"Erõrõl erõre jutnak, [míg] megjelennek Isten elõtt a Sionon."));
husuperobject.biblemap.put("b19_84_9", new husuperobject(19,84,9,"Uram, Seregeknek Istene! hallgasd meg az én könyörgésemet; hallgasd meg Jákóbnak Istene! Szela."));
husuperobject.biblemap.put("b19_84_10", new husuperobject(19,84,10,"Mi paizsunk! Tekints alá, oh Isten, és lásd meg a te felkented orczáját!"));
husuperobject.biblemap.put("b19_84_11", new husuperobject(19,84,11,"Mert jobb egy nap a te tornáczaidban, hogysem ezer [másutt;] inkább akarnék az én Istenem házának küszöbén ülni, hogysem lakni a gonosznak sátorában!"));
husuperobject.biblemap.put("b19_84_12", new husuperobject(19,84,12,"Mert nap és paizs az Úr Isten; kegyelmet és dicsõséget ád az Úr, nem vonja meg a jót azoktól, a kik ártatlanul élnek. [ (Psalms 84:13) Seregeknek Ura! Boldog ember az, a ki bízik benned. ]"));
husuperobject.biblemap.put("b19_85_1", new husuperobject(19,85,1,"Az éneklõmesternek, Kóráh fiainak zsoltára."));
husuperobject.biblemap.put("b19_85_2", new husuperobject(19,85,2,"Jóakarattal voltál Uram a te földedhez. Visszahoztad a Jákób [nemzetségébõl ] való foglyokat."));
husuperobject.biblemap.put("b19_85_3", new husuperobject(19,85,3,"Elengedted népednek álnokságát, elfedezted minden bûnüket. Szela."));
husuperobject.biblemap.put("b19_85_4", new husuperobject(19,85,4,"Elhárítottad [róluk] minden búsulásod, elfordítottad haragod gerjedezését."));
husuperobject.biblemap.put("b19_85_5", new husuperobject(19,85,5,"Hozz vissza bennünket szabadításunk Istene, és szüntesd meg ellenünk való bosszankodásodat!"));
husuperobject.biblemap.put("b19_85_6", new husuperobject(19,85,6,"Avagy mindörökké haragszol-é ránk? Nemzedékrõl nemzedékre tartod-é haragod?"));
husuperobject.biblemap.put("b19_85_7", new husuperobject(19,85,7,"Avagy nem elevenítesz-é meg minket ismét, hogy néped örvendezzen benned?"));
husuperobject.biblemap.put("b19_85_8", new husuperobject(19,85,8,"Mutasd meg nékünk Uram a te kegyelmedet, és a te szabadításodat adjad mi nékünk!"));
husuperobject.biblemap.put("b19_85_9", new husuperobject(19,85,9,"Hadd halljam meg: mit szól az Úr Isten! Kétségnélkül békességet szól az õ népének és kegyeltjeinek, hogy vissza ne térjenek a bolondságra."));
husuperobject.biblemap.put("b19_85_10", new husuperobject(19,85,10,"Bizonyára közel van az õ szabadítása az õt félõkhöz, hogy dicsõség lakozzék a mi földünkön."));
husuperobject.biblemap.put("b19_85_11", new husuperobject(19,85,11,"Irgalmasság és hûség összetalálkoznak, igazság és békesség csókolgatják egymást."));
husuperobject.biblemap.put("b19_85_12", new husuperobject(19,85,12,"Hûség sarjad a földbõl, és igazság tekint alá az égbõl."));
husuperobject.biblemap.put("b19_85_13", new husuperobject(19,85,13,"Az Úr is megadja a jót, és földünk is megtermi gyümölcsét. [ (Psalms 85:14) Igazság jár elõtte és követi õt az õ lépéseinek útján. ]"));
husuperobject.biblemap.put("b19_86_1", new husuperobject(19,86,1,"Dávid imádsága."));
husuperobject.biblemap.put("b19_86_2", new husuperobject(19,86,2,"Tartsd meg életemet, mert kegyes vagyok én; mentsd meg én Istenem a te szolgádat, a ki bízik benned."));
husuperobject.biblemap.put("b19_86_3", new husuperobject(19,86,3,"Könyörülj én rajtam Uram, mert hozzád kiáltok minden napon!"));
husuperobject.biblemap.put("b19_86_4", new husuperobject(19,86,4,"Vidámítsd meg a te szolgádnak lelkét, mert hozzád emelem fel Uram lelkemet."));
husuperobject.biblemap.put("b19_86_5", new husuperobject(19,86,5,"Mert te Uram jó vagy és kegyelmes, és nagy irgalmasságú mindazokhoz, a kik hozzád kiáltanak."));
husuperobject.biblemap.put("b19_86_6", new husuperobject(19,86,6,"Figyelmezzél Uram az én imádságomra, és hallgasd meg az én könyörgésemnek szavát!"));
husuperobject.biblemap.put("b19_86_7", new husuperobject(19,86,7,"Nyomorúságomnak idején hozzád kiáltok, mert te meghallgatsz engem."));
husuperobject.biblemap.put("b19_86_8", new husuperobject(19,86,8,"Nincsen Uram hozzád hasonló az istenek között, és nincsenek hasonlók a te munkáidhoz!"));
husuperobject.biblemap.put("b19_86_9", new husuperobject(19,86,9,"Eljõnek a népek mind, a melyeket alkottál, és leborulnak elõtted Uram, és dicsõítik a te nevedet."));
husuperobject.biblemap.put("b19_86_10", new husuperobject(19,86,10,"Mert nagy vagy te és csodadolgokat mívelsz; csak te vagy Isten egyedül!"));
husuperobject.biblemap.put("b19_86_11", new husuperobject(19,86,11,"Mutasd meg nékem a te útadat, hogy járhassak a te igazságodban, [és] teljes szívvel féljem nevedet."));
husuperobject.biblemap.put("b19_86_12", new husuperobject(19,86,12,"Dicsérlek téged Uram, Istenem, teljes szívembõl, és dicsõítem a te nevedet örökké!"));
husuperobject.biblemap.put("b19_86_13", new husuperobject(19,86,13,"Mert nagy én rajtam a te kegyelmed, és kiszabadítottad lelkemet a mélységes pokolból."));
husuperobject.biblemap.put("b19_86_14", new husuperobject(19,86,14,"Isten! Kevélyek támadtak fel ellenem, és kegyetlenek serege keresi lelkemet, [a kik] meg sem gondolnak téged."));
husuperobject.biblemap.put("b19_86_15", new husuperobject(19,86,15,"De te Uram, könyörülõ és irgalmas Isten vagy, késedelmes a haragra, nagy kegyelmû és igazságú!"));
husuperobject.biblemap.put("b19_86_16", new husuperobject(19,86,16,"Tekints reám és könyörülj rajtam! Add a te erõdet a te szolgádnak, és szabadítsd meg a te szolgálóleányodnak fiát!"));
husuperobject.biblemap.put("b19_86_17", new husuperobject(19,86,17,"Adj jelt nékem javamra, hogy lássák az én gyûlölõim és szégyenüljenek meg, a mikor te Uram megsegítesz és megvigasztalsz engem."));
husuperobject.biblemap.put("b19_87_1", new husuperobject(19,87,1,"Ének. A Kóráh fiainak zsoltára."));
husuperobject.biblemap.put("b19_87_2", new husuperobject(19,87,2,"Szereti az Úr Sionnak kapuit, jobban mint Jákóbnak minden hajlékát."));
husuperobject.biblemap.put("b19_87_3", new husuperobject(19,87,3,"Dicsõséges dolgokat beszélnek felõled, te Istennek városa! Szela."));
husuperobject.biblemap.put("b19_87_4", new husuperobject(19,87,4,"Elõszámlálom Égyiptomot és Bábelt, mint ismerõimet. Ímé Filisztea és Tyrus Kússal együtt: ez ott született."));
husuperobject.biblemap.put("b19_87_5", new husuperobject(19,87,5,"És ezt mondják a Sion felõl: Mind ez, mind amaz ott született, és õ, a Felséges, erõsíti azt."));
husuperobject.biblemap.put("b19_87_6", new husuperobject(19,87,6,"Az Úr beírván, feljegyzi a népet: ez ott született! Szela."));
husuperobject.biblemap.put("b19_87_7", new husuperobject(19,87,7,"És tánczolva énekelik: minden forrásaim te benned vannak."));
husuperobject.biblemap.put("b19_88_1", new husuperobject(19,88,1,"Ének. A Kóráh fiainak zsoltára. Az éneklõmesternek a Mahalath- lehannóthra. Az Ezrahita Hémán tanítása."));
husuperobject.biblemap.put("b19_88_2", new husuperobject(19,88,2,"Uram, szabadításomnak Istene! Nappal kiáltok, éjjelente elõtted vagyok:"));
husuperobject.biblemap.put("b19_88_3", new husuperobject(19,88,3,"Jusson elõdbe imádságom, hajtsad füled az én kiáltozásomra!"));
husuperobject.biblemap.put("b19_88_4", new husuperobject(19,88,4,"Mert betelt a lelkem nyomorúságokkal, és életem a Seolig jutott."));
husuperobject.biblemap.put("b19_88_5", new husuperobject(19,88,5,"Hasonlatossá lettem a sírba szállókhoz; olyan vagyok, mint az erejevesztett ember."));
husuperobject.biblemap.put("b19_88_6", new husuperobject(19,88,6,"A holtak közt van az én helyem, mint a megölteknek, a kik koporsóban feküsznek, a kikrõl többé nem emlékezel, mert elszakasztattak a te kezedtõl."));
husuperobject.biblemap.put("b19_88_7", new husuperobject(19,88,7,"Mély sírba vetettél be engem, sötétségbe, örvények közé."));
husuperobject.biblemap.put("b19_88_8", new husuperobject(19,88,8,"A te haragod reám nehezedett, és minden haboddal nyomtál engem. Szela."));
husuperobject.biblemap.put("b19_88_9", new husuperobject(19,88,9,"Elszakasztottad ismerõseimet tõlem, útálattá tettél elõttök engem; berekesztettem és ki nem jöhetek."));
husuperobject.biblemap.put("b19_88_10", new husuperobject(19,88,10,"Szemem megsenyvedett a nyomorúság miatt; kiáltalak téged Uram minden napon, hozzád terjengetem kezeimet."));
husuperobject.biblemap.put("b19_88_11", new husuperobject(19,88,11,"Avagy a holtakkal teszel-é csodát? Felkelnek-é vajjon az árnyak, hogy dicsérjenek téged? Szela."));
husuperobject.biblemap.put("b19_88_12", new husuperobject(19,88,12,"Beszélik-é a koporsóban a te kegyelmedet, hûségedet a pusztulás helyén?"));
husuperobject.biblemap.put("b19_88_13", new husuperobject(19,88,13,"Megtudhatják-é a sötétségben a te csodáidat, és igazságodat a feledékenység földén?"));
husuperobject.biblemap.put("b19_88_14", new husuperobject(19,88,14,"De én hozzád rimánkodom, Uram, és jó reggel elédbe jut az én imádságom:"));
husuperobject.biblemap.put("b19_88_15", new husuperobject(19,88,15,"Miért vetsz el hát Uram engem, [és] rejted el orczádat én tõlem?"));
husuperobject.biblemap.put("b19_88_16", new husuperobject(19,88,16,"Nyomorult és holteleven vagyok ifjúságomtól kezdve; viselem a te rettentéseidet, roskadozom."));
husuperobject.biblemap.put("b19_88_17", new husuperobject(19,88,17,"Általmentek rajtam a te búsulásaid; a te szorongatásaid elemésztettek engem."));
husuperobject.biblemap.put("b19_88_18", new husuperobject(19,88,18,"Körülvettek engem, mint a vizek egész napon; együttesen körülöveztek engem. [ (Psalms 88:19) Elszakasztottál tõlem barátot és rokont; ismerõseim a - setétség. ]"));
husuperobject.biblemap.put("b19_89_1", new husuperobject(19,89,1,"Az Ezrahita Ethán tanítása."));
husuperobject.biblemap.put("b19_89_2", new husuperobject(19,89,2,"Az Úrnak kegyelmességét hadd énekeljem örökké! Nemzetségrõl nemzetségre hirdetem a te hûséges voltodat az én számmal!"));
husuperobject.biblemap.put("b19_89_3", new husuperobject(19,89,3,"Mert azt mondom: Örökké megáll a te kegyelmességed, és megerõsíted a te hûséges voltodat az egekben, [mondván:]"));
husuperobject.biblemap.put("b19_89_4", new husuperobject(19,89,4,"Szövetséget kötöttem az én választottammal, megesküdtem Dávidnak, az én szolgámnak:"));
husuperobject.biblemap.put("b19_89_5", new husuperobject(19,89,5,"Mindörökké megerõsítem a te magodat, és nemzetségrõl nemzetségre megépítem a te királyi székedet. Szela."));
husuperobject.biblemap.put("b19_89_6", new husuperobject(19,89,6,"És az egek dicsérik a te csodadolgodat Uram; a te hûséges voltodat is a szentek gyülekezetében."));
husuperobject.biblemap.put("b19_89_7", new husuperobject(19,89,7,"Mert a felhõkben kicsoda hasonlatos az Úrhoz, [s ki] olyan, mint az Úr, az istenek fiai között?"));
husuperobject.biblemap.put("b19_89_8", new husuperobject(19,89,8,"Igen rettenetes Isten [õ] a szentek gyûlésében, és félelmetes mindazokra, a kik körülte vannak."));
husuperobject.biblemap.put("b19_89_9", new husuperobject(19,89,9,"Uram, Seregeknek Istene! Kicsoda olyan erõs, mint te vagy Uram? És a te hûséges voltod körülvesz téged."));
husuperobject.biblemap.put("b19_89_10", new husuperobject(19,89,10,"Te uralkodol a tengernek kevélységén; mikor az õ habjai felemelkednek, te csendesíted le azokat."));
husuperobject.biblemap.put("b19_89_11", new husuperobject(19,89,11,"Te rontád meg Égyiptomot mintegy átdöföttet; erõs karoddal elszélesztetted ellenségeidet."));
husuperobject.biblemap.put("b19_89_12", new husuperobject(19,89,12,"Tieid az egek, a föld is a tied: e világot minden benne valóval te fundáltad."));
husuperobject.biblemap.put("b19_89_13", new husuperobject(19,89,13,"Az északot és a délt te teremtetted, a Thábor és a Hermon a te nevednek örvendeznek."));
husuperobject.biblemap.put("b19_89_14", new husuperobject(19,89,14,"A te karod hatalommal teljes, a te kezed erõs, a te jobbod méltóságos."));
husuperobject.biblemap.put("b19_89_15", new husuperobject(19,89,15,"Igazság és jogosság a te királyi székednek alapja; kegyelem és hûség jár a te orczád elõtt."));
husuperobject.biblemap.put("b19_89_16", new husuperobject(19,89,16,"Boldog nép az, a mely megérti a kürt szavát; a te orczádnak világosságánál jár ez, oh Uram!"));
husuperobject.biblemap.put("b19_89_17", new husuperobject(19,89,17,"A te nevedben örvendeznek egész nap; és a te igazságodban felmagasztaltatnak."));
husuperobject.biblemap.put("b19_89_18", new husuperobject(19,89,18,"Mert az õ erejöknek ékessége te vagy; a te jóakaratoddal emeled fel a mi szarvunkat is."));
husuperobject.biblemap.put("b19_89_19", new husuperobject(19,89,19,"Mert az Úr a mi paizsunk, és Izráelnek Szentje a mi királyunk."));
husuperobject.biblemap.put("b19_89_20", new husuperobject(19,89,20,"Akkor látásban szóltál a te kegyeltednek, és mondád: Segítséget adtam a vitéznek, felmagasztaltam a népbõl választottat;"));
husuperobject.biblemap.put("b19_89_21", new husuperobject(19,89,21,"Megtaláltam Dávidot, az én szolgámat; szent olajommal kentem fel õt,"));
husuperobject.biblemap.put("b19_89_22", new husuperobject(19,89,22,"A kivel állandóan vele lesz az én kezem, sõt az én karom erõsíti meg õt."));
husuperobject.biblemap.put("b19_89_23", new husuperobject(19,89,23,"Nem nyomhatja õt el az ellenség, és a gonosz ember sem nyomorgatja meg õt;"));
husuperobject.biblemap.put("b19_89_24", new husuperobject(19,89,24,"Mert õ elõtte rontom meg az õ szorongatóit, és verem meg az õ gyûlölõit."));
husuperobject.biblemap.put("b19_89_25", new husuperobject(19,89,25,"És vele lesz az én hûségem és kegyelmem, és az én nevemmel magasztaltatik fel az õ szarva."));
husuperobject.biblemap.put("b19_89_26", new husuperobject(19,89,26,"És rávetem az õ kezét a tengerre, és az õ jobbját a folyóvizekre."));
husuperobject.biblemap.put("b19_89_27", new husuperobject(19,89,27,"Õ így szólít engem: Atyám vagy te; én Istenem és szabadításom kõsziklája!"));
husuperobject.biblemap.put("b19_89_28", new husuperobject(19,89,28,"Én meg elsõszülöttemmé teszem õt [és] felebbvalóvá a föld királyainál."));
husuperobject.biblemap.put("b19_89_29", new husuperobject(19,89,29,"Örökké megtartom néki az én kegyelmemet, és az én szövetségem bizonyos [marad] õ vele."));
husuperobject.biblemap.put("b19_89_30", new husuperobject(19,89,30,"És az õ magvát örökkévalóvá teszem, és az õ királyi székét, mint az egeknek napjait."));
husuperobject.biblemap.put("b19_89_31", new husuperobject(19,89,31,"Ha az õ fiai elhagyják az én törvényemet, és nem járnak az én végzéseim szerint;"));
husuperobject.biblemap.put("b19_89_32", new husuperobject(19,89,32,"Ha az én rendeléseimet megtörik, és meg nem tartják az én parancsolatimat:"));
husuperobject.biblemap.put("b19_89_33", new husuperobject(19,89,33,"Akkor vesszõvel látogatom meg az õ bûnöket, és vereségekkel az õ álnokságukat;"));
husuperobject.biblemap.put("b19_89_34", new husuperobject(19,89,34,"De az én kegyelmemet nem vonom meg tõle, és az én hûséges voltomban nem hazudom."));
husuperobject.biblemap.put("b19_89_35", new husuperobject(19,89,35,"Nem töröm meg az én szövetségemet, és a mi kijött az én számból, el nem változtatom."));
husuperobject.biblemap.put("b19_89_36", new husuperobject(19,89,36,"Megesküdtem egyszer az én szentségemre: vajjon megcsalhatnám-é Dávidot?"));
husuperobject.biblemap.put("b19_89_37", new husuperobject(19,89,37,"Az õ magva örökké megmarad, és az õ királyi széke olyan elõttem, mint a nap."));
husuperobject.biblemap.put("b19_89_38", new husuperobject(19,89,38,"Megáll örökké, mint a hold, és bizonyos, mint a felhõben lévõ bizonyság. Szela."));
husuperobject.biblemap.put("b19_89_39", new husuperobject(19,89,39,"De te [mégis] elvetetted és megútáltad [õt,] és megharagudtál a te felkentedre."));
husuperobject.biblemap.put("b19_89_40", new husuperobject(19,89,40,"Felbontottad a te szolgáddal [kötött] szövetséget, földre tiportad az õ koronáját."));
husuperobject.biblemap.put("b19_89_41", new husuperobject(19,89,41,"Lerontottad az õ kõfalait mind; romokká tetted erõsségeit."));
husuperobject.biblemap.put("b19_89_42", new husuperobject(19,89,42,"Zsákmányolták õt mind az úton járók; gyalázattá lõn az õ szomszédai elõtt."));
husuperobject.biblemap.put("b19_89_43", new husuperobject(19,89,43,"Felmagasztaltad az õ szorongatóinak jobbját, és megvidámítottad minden ellenségét."));
husuperobject.biblemap.put("b19_89_44", new husuperobject(19,89,44,"Még fegyverének élét is elvetted, és nem segítetted õt a harczban."));
husuperobject.biblemap.put("b19_89_45", new husuperobject(19,89,45,"Eltörlötted az õ fényességét, és az õ királyi székét a földre vetetted."));
husuperobject.biblemap.put("b19_89_46", new husuperobject(19,89,46,"Az õ ifjúságának napjait megrövidítetted, gyalázatot borítottál reá. Szela."));
husuperobject.biblemap.put("b19_89_47", new husuperobject(19,89,47,"Meddig rejtegeted még magad, oh Uram, szüntelen, [és] ég a te haragod, mint a tûz?"));
husuperobject.biblemap.put("b19_89_48", new husuperobject(19,89,48,"Emlékezzél meg rólam: mily [rövid] az élet! Mily semmire teremtetted te mind az embernek fiait!"));
husuperobject.biblemap.put("b19_89_49", new husuperobject(19,89,49,"Kicsoda oly erõs, hogy éljen és ne lásson halált [s] megszabadítsa magát a Seolnak kezébõl? Szela."));
husuperobject.biblemap.put("b19_89_50", new husuperobject(19,89,50,"Hol van a te elõbbi kegyelmességed, Uram? Megesküdtél Dávidnak a te hûséges voltodra!"));
husuperobject.biblemap.put("b19_89_51", new husuperobject(19,89,51,"Emlékezzél meg Uram a te szolgáidnak gyalázatjokról! hogy sok népnek [gyalázatját] hordozom keblemben,"));
husuperobject.biblemap.put("b19_89_52", new husuperobject(19,89,52,"A melyekkel gyaláztak a te ellenségeid Uram, a melyekkel gyalázták a te felkentednek lépéseit. [ (Psalms 89:53) Áldott legyen az Úr mindörökké! Ámen és Ámen. ]"));
husuperobject.biblemap.put("b19_90_1", new husuperobject(19,90,1,"Mózesnek, az Isten emberének imádsága."));
husuperobject.biblemap.put("b19_90_2", new husuperobject(19,90,2,"Minekelõtte hegyek lettek és föld és világ formáltaték, öröktõl fogva mindörökké te vagy Isten."));
husuperobject.biblemap.put("b19_90_3", new husuperobject(19,90,3,"Te visszatéríted a halandót a porba, és ezt mondod: Térjetek vissza embernek fiai!"));
husuperobject.biblemap.put("b19_90_4", new husuperobject(19,90,4,"Mert ezer esztendõ annyi elõtted, mint a tegnapi nap, a mely elmúlt, és mint egy õrjárási idõ éjjel."));
husuperobject.biblemap.put("b19_90_5", new husuperobject(19,90,5,"Elragadod õket; [olyanokká] lesznek, [mint az] álom; mint a fû, a mely reggel sarjad;"));
husuperobject.biblemap.put("b19_90_6", new husuperobject(19,90,6,"Reggel virágzik és sarjad, [és] estvére elhervad és megszárad."));
husuperobject.biblemap.put("b19_90_7", new husuperobject(19,90,7,"Bizony megemésztetünk a te haragod által, és a te búsulásod miatt megromlunk!"));
husuperobject.biblemap.put("b19_90_8", new husuperobject(19,90,8,"Elédbe vetetted a mi álnokságainkat; titkos bûneinket a te orczádnak világa elé."));
husuperobject.biblemap.put("b19_90_9", new husuperobject(19,90,9,"Bizony elmúlik minden mi napunk a te bosszúállásod miatt; megemésztjük a mi esztendeinket, mint a beszédet."));
husuperobject.biblemap.put("b19_90_10", new husuperobject(19,90,10,"A mi esztendeinknek napjai hetven esztendõ, vagy ha feljebb, nyolczvan esztendõ, és nagyobb részök nyomorúság és fáradság, a mely gyorsan tovatünik, mintha repülnénk."));
husuperobject.biblemap.put("b19_90_11", new husuperobject(19,90,11,"Ki tudhatja a te haragodnak erejét, és a te félelmetességed szerint való bosszúállásodat?"));
husuperobject.biblemap.put("b19_90_12", new husuperobject(19,90,12,"Taníts minket úgy számlálni napjainkat, hogy bölcs szívhez jussunk."));
husuperobject.biblemap.put("b19_90_13", new husuperobject(19,90,13,"Térj vissza Uram! meddig késel? és könyörülj a te szolgáidon."));
husuperobject.biblemap.put("b19_90_14", new husuperobject(19,90,14,"Jó reggel elégíts meg minket a te kegyelmeddel, hogy örvendezzünk és vígadjunk minden mi idõnkben."));
husuperobject.biblemap.put("b19_90_15", new husuperobject(19,90,15,"Vidámíts meg minket a mi nyomorúságunk napjaihoz képest, az esztendõkhöz képest, a melyekben gonoszt láttunk."));
husuperobject.biblemap.put("b19_90_16", new husuperobject(19,90,16,"Láttassék meg a te mûved a te szolgáidon, és a te dicsõséged azoknak fiain."));
husuperobject.biblemap.put("b19_90_17", new husuperobject(19,90,17,"És legyen az Úrnak, a mi Istenünknek jó kedve mi rajtunk, és a mi kezünknek munkáját tedd állandóvá nékünk, és a mi kezünknek munkáját tedd állandóvá!"));
husuperobject.biblemap.put("b19_91_1", new husuperobject(19,91,1,"Aki a Felségesnek rejtekében lakozik, a Mindenhatónak árnyékában nyugoszik az."));
husuperobject.biblemap.put("b19_91_2", new husuperobject(19,91,2,"Azt mondom az Úrnak: Én oltalmam, váram, Istenem õ benne bízom!"));
husuperobject.biblemap.put("b19_91_3", new husuperobject(19,91,3,"Mert õ szabadít meg téged a madarásznak tõrébõl, a veszedelmes dögvésztõl."));
husuperobject.biblemap.put("b19_91_4", new husuperobject(19,91,4,"Tollaival fedez be téged, és szárnyai alatt lészen oltalmad; paizs és pánczél az õ hûsége."));
husuperobject.biblemap.put("b19_91_5", new husuperobject(19,91,5,"Nem félhetsz az éjszakai ijesztéstõl, a repülõ nyíltól nappal;"));
husuperobject.biblemap.put("b19_91_6", new husuperobject(19,91,6,"A dögvésztõl, a mely a homályban jár; a döghaláltól, a mely délben pusztít."));
husuperobject.biblemap.put("b19_91_7", new husuperobject(19,91,7,"Elesnek mellõled ezeren, és jobb kezed felõl tízezeren; és hozzád nem is közelít."));
husuperobject.biblemap.put("b19_91_8", new husuperobject(19,91,8,"Bizony szemeiddel nézed és meglátod a gonoszoknak megbüntetését!"));
husuperobject.biblemap.put("b19_91_9", new husuperobject(19,91,9,"Mert [azt mondtad] te: Az Úr az én oltalmam; a Felségest választottad a te hajlékoddá:"));
husuperobject.biblemap.put("b19_91_10", new husuperobject(19,91,10,"Nem illet téged a veszedelem, és csapás nem közelget a sátorodhoz;"));
husuperobject.biblemap.put("b19_91_11", new husuperobject(19,91,11,"Mert az õ angyalainak parancsolt felõled, hogy õrizzenek téged minden útadban."));
husuperobject.biblemap.put("b19_91_12", new husuperobject(19,91,12,"Kézen hordoznak téged, hogy meg ne üssed lábadat a kõbe."));
husuperobject.biblemap.put("b19_91_13", new husuperobject(19,91,13,"Oroszlánon és áspiskígyón jársz, megtaposod az oroszlánkölyköt és a sárkányt."));
husuperobject.biblemap.put("b19_91_14", new husuperobject(19,91,14,"Mivelhogy ragaszkodik hozzám, megszabadítom õt, felmagasztalom õt, mert ismeri az én nevemet!"));
husuperobject.biblemap.put("b19_91_15", new husuperobject(19,91,15,"Segítségül hív engem, ezért meghallgatom õt; vele vagyok háborúságában: megmentem és megdicsõítem õt."));
husuperobject.biblemap.put("b19_91_16", new husuperobject(19,91,16,"Hosszú élettel elégítem meg õt, és megmutatom néki az én szabadításomat."));
husuperobject.biblemap.put("b19_92_1", new husuperobject(19,92,1,"Zsoltár, ének szombat napra."));
husuperobject.biblemap.put("b19_92_2", new husuperobject(19,92,2,"Jó dolog dicsérni az Urat, és éneket mondani a te nevednek, oh Felséges!"));
husuperobject.biblemap.put("b19_92_3", new husuperobject(19,92,3,"Hirdetni jó reggel a te kegyelmedet, és éjjelente a te hûséges voltodat."));
husuperobject.biblemap.put("b19_92_4", new husuperobject(19,92,4,"Tíz húrú hegedûvel és lanttal, hárfán való zengedezéssel."));
husuperobject.biblemap.put("b19_92_5", new husuperobject(19,92,5,"Mert megvidámítottál engem Uram a te cselekedeteddel, a te kezednek mûveiben örvendezem."));
husuperobject.biblemap.put("b19_92_6", new husuperobject(19,92,6,"Mely nagyok Uram a te mûveid, igen mélységesek a te gondolataid!"));
husuperobject.biblemap.put("b19_92_7", new husuperobject(19,92,7,"A balgatag ember nem tudja, a bolond pedig nem érti meg ezt:"));
husuperobject.biblemap.put("b19_92_8", new husuperobject(19,92,8,"Hogy mikor felsarjaznak a gonoszok, mint a fû, és virágoznak mind a hamisság cselekedõk, mindörökké elveszszenek õk;"));
husuperobject.biblemap.put("b19_92_9", new husuperobject(19,92,9,"Te pedig Uram, magasságos vagy örökké!"));
husuperobject.biblemap.put("b19_92_10", new husuperobject(19,92,10,"Mert ímé, a te ellenségeid elvesznek, [és ]elszélednek mind a hamisság cselekedõk!"));
husuperobject.biblemap.put("b19_92_11", new husuperobject(19,92,11,"De magasra növeszted az én szarvamat, mint az egyszarvúét; elárasztatom csillogó olajjal."));
husuperobject.biblemap.put("b19_92_12", new husuperobject(19,92,12,"És legeltetem szememet az én ellenségeimen, és az ellenem támadó gonosztevõkön mulat majd a fülem."));
husuperobject.biblemap.put("b19_92_13", new husuperobject(19,92,13,"Az igaz virágzik, mint a pálmafa, növekedik, mint a czédrus a Libánonon."));
husuperobject.biblemap.put("b19_92_14", new husuperobject(19,92,14,"Plánták [õk] az Úrnak házában; a mi Istenünknek tornáczaiban virágzanak."));
husuperobject.biblemap.put("b19_92_15", new husuperobject(19,92,15,"Még a vén korban is gyümölcsöznek; kövérek és zöldellõk lesznek; [ (Psalms 92:16) Hogy hirdessék, hogy igazságos az Úr, az én kõsziklám, és hogy nincsen hamisság benne! ]"));
husuperobject.biblemap.put("b19_93_1", new husuperobject(19,93,1,"Uralkodik az Úr, méltóságot öltözött fel; felöltözött az Úr: hatalmat övezett magára; megerõsítette a földet is, hogy meg ne induljon."));
husuperobject.biblemap.put("b19_93_2", new husuperobject(19,93,2,"Állandó a te királyi széked eleitõl kezdve; öröktõl fogva vagy te!"));
husuperobject.biblemap.put("b19_93_3", new husuperobject(19,93,3,"A folyóvizek Uram, a folyóvizek zúgnak, a folyóvizek hullámokat hánynak;"));
husuperobject.biblemap.put("b19_93_4", new husuperobject(19,93,4,"A nagy vizek zúgásainál, a tengernek felséges morajlásánál felségesebb az Úr a magasságban."));
husuperobject.biblemap.put("b19_93_5", new husuperobject(19,93,5,"A te bizonyságaid igen bizonyosak, a te házadat illeti Uram szentség, napok hosszáig!"));
husuperobject.biblemap.put("b19_94_1", new husuperobject(19,94,1,"Uram, bosszúállásnak Istene! Bosszúállásnak Istene, jelenj meg!"));
husuperobject.biblemap.put("b19_94_2", new husuperobject(19,94,2,"Emelkedjél fel te, földnek birája, fizess meg a kevélyeknek!"));
husuperobject.biblemap.put("b19_94_3", new husuperobject(19,94,3,"A hitetlenek, Uram, meddig még, meddig örvendeznek még a hitetlenek?"));
husuperobject.biblemap.put("b19_94_4", new husuperobject(19,94,4,"Piszkolódnak, keményen szólnak; kérkednek mindnyájan a hamisság cselekedõi."));
husuperobject.biblemap.put("b19_94_5", new husuperobject(19,94,5,"A te népedet Uram tapossák, és nyomorgatják a te örökségedet."));
husuperobject.biblemap.put("b19_94_6", new husuperobject(19,94,6,"Az özvegyet és jövevényt megölik, az árvákat is fojtogatják."));
husuperobject.biblemap.put("b19_94_7", new husuperobject(19,94,7,"És ezt mondják: Nem látja az Úr, és nem veszi észre a Jákób Istene!"));
husuperobject.biblemap.put("b19_94_8", new husuperobject(19,94,8,"Eszméljetek ti bolondok a nép között! És ti balgatagok, mikor tértek eszetekre?"));
husuperobject.biblemap.put("b19_94_9", new husuperobject(19,94,9,"A ki a fület plántálta, avagy nem hall-é? És a ki a szemet formálta, avagy nem lát-é?"));
husuperobject.biblemap.put("b19_94_10", new husuperobject(19,94,10,"A ki megfeddi a népeket, avagy nem fenyít-é meg? Õ, a ki az embert tudományra tanítja:"));
husuperobject.biblemap.put("b19_94_11", new husuperobject(19,94,11,"Az Úr tudja az embernek gondolatjait, hogy azok hiábavalók."));
husuperobject.biblemap.put("b19_94_12", new husuperobject(19,94,12,"Boldog ember az, a kit te megfeddesz Uram, és a kit megtanítasz a te törvényedre;"));
husuperobject.biblemap.put("b19_94_13", new husuperobject(19,94,13,"Hogy nyugalmat adj annak a veszedelem napján, míg megásták a vermet a hitetlennek!"));
husuperobject.biblemap.put("b19_94_14", new husuperobject(19,94,14,"Bizony nem veti el az Úr az õ népét, és el nem hagyja az õ örökségét!"));
husuperobject.biblemap.put("b19_94_15", new husuperobject(19,94,15,"Mert igazságra fordul vissza az ítélet, és utána mennek mind az igazszívûek."));
husuperobject.biblemap.put("b19_94_16", new husuperobject(19,94,16,"Kicsoda támad fel én mellettem a gonoszok ellen? Kicsoda áll mellém a hamisság cselekedõk ellen?"));
husuperobject.biblemap.put("b19_94_17", new husuperobject(19,94,17,"Ha az Úr nem lett volna segítségül nékem: már-már ott lakoznék lelkem a csendességben."));
husuperobject.biblemap.put("b19_94_18", new husuperobject(19,94,18,"Mikor azt mondtam: Az én lábam eliszamodott: a te kegyelmed, Uram, megtámogatott engem."));
husuperobject.biblemap.put("b19_94_19", new husuperobject(19,94,19,"Mikor megsokasodtak bennem az én aggódásaim: a te vígasztalásaid megvidámították az én lelkemet."));
husuperobject.biblemap.put("b19_94_20", new husuperobject(19,94,20,"Van-é köze te hozzád a hamisság székének, a mely nyomorúságot szerez törvény színe alatt?"));
husuperobject.biblemap.put("b19_94_21", new husuperobject(19,94,21,"Egybegyülekeznek az igaznak lelke ellen, és elkárhoztatják az ártatlannak vérét."));
husuperobject.biblemap.put("b19_94_22", new husuperobject(19,94,22,"De kõváram lõn én nékem az Úr, és az én Istenem az én oltalmamnak kõsziklája;"));
husuperobject.biblemap.put("b19_94_23", new husuperobject(19,94,23,"És visszafordítja reájok az õ álnokságukat, és az õ gonoszságukkal veszti el õket; elveszti õket az Úr, a mi Istenünk."));
husuperobject.biblemap.put("b19_95_1", new husuperobject(19,95,1,"Jõjjetek el, örvendezzünk az Úrnak; vígadozzunk a mi szabadításunk kõsziklájának!"));
husuperobject.biblemap.put("b19_95_2", new husuperobject(19,95,2,"Menjünk elébe hálaadással; vígadozzunk néki zengedezésekkel."));
husuperobject.biblemap.put("b19_95_3", new husuperobject(19,95,3,"Mert nagy Isten az Úr, és nagy király minden istenen felül."));
husuperobject.biblemap.put("b19_95_4", new husuperobject(19,95,4,"A kinek kezében vannak a földnek mélységei, és a hegyeknek magasságai is az övéi."));
husuperobject.biblemap.put("b19_95_5", new husuperobject(19,95,5,"A kié a tenger, és õ alkotta is azt, és a szárazföldet is az õ kezei formálták."));
husuperobject.biblemap.put("b19_95_6", new husuperobject(19,95,6,"Jõjjetek, hajoljunk meg, boruljunk le; essünk térdre az Úr elõtt, a mi alkotónk elõtt!"));
husuperobject.biblemap.put("b19_95_7", new husuperobject(19,95,7,"Mert õ a mi Istenünk, mi pedig az õ legelõjének népei és az õ kezének juhai vagyunk; vajha ma hallanátok az õ szavát."));
husuperobject.biblemap.put("b19_95_8", new husuperobject(19,95,8,"Ne keményítsétek meg a ti szíveteket, mint Meribáhnál, mint Maszszáh napján a pusztában:"));
husuperobject.biblemap.put("b19_95_9", new husuperobject(19,95,9,"A hol megkisértettek engem a ti atyáitok; próbára tettek engem, jóllehet látták az én cselekedetemet."));
husuperobject.biblemap.put("b19_95_10", new husuperobject(19,95,10,"Negyven esztendeig bosszankodtam [e] nemzetségen, és mondám: Tévelygõ szívû nép õk, és nem tudják õk az én útamat!"));
husuperobject.biblemap.put("b19_95_11", new husuperobject(19,95,11,"A kiknek megesküdtem haragomban: Nem mennek be az én nyugalmam [helyére.]"));
husuperobject.biblemap.put("b19_96_1", new husuperobject(19,96,1,"Énekeljetek az Úrnak új éneket; énekelj az Úrnak te egész föld!"));
husuperobject.biblemap.put("b19_96_2", new husuperobject(19,96,2,"Énekeljetek az Úrnak, áldjátok az õ nevét; hirdessétek napról-napra az õ szabadítását."));
husuperobject.biblemap.put("b19_96_3", new husuperobject(19,96,3,"Beszéljétek a népek között az õ dicsõségét, minden nemzet között az õ csodadolgait;"));
husuperobject.biblemap.put("b19_96_4", new husuperobject(19,96,4,"Mert nagy az Úr és igen dicséretes, rettenetes minden isten felett."));
husuperobject.biblemap.put("b19_96_5", new husuperobject(19,96,5,"Mert a nemzeteknek minden istene bálvány, az Úr pedig egeket alkotott."));
husuperobject.biblemap.put("b19_96_6", new husuperobject(19,96,6,"Ékesség és fenség van elõtte; tisztesség és méltóság az õ szent helyén."));
husuperobject.biblemap.put("b19_96_7", new husuperobject(19,96,7,"Adjatok az Úrnak népeknek nemzetségei: adjatok az Úrnak dicsõséget és tisztességet!"));
husuperobject.biblemap.put("b19_96_8", new husuperobject(19,96,8,"Adjátok az Úrnak neve dicsõségét; hozzatok ajándékot és jõjjetek be az õ tornáczaiba!"));
husuperobject.biblemap.put("b19_96_9", new husuperobject(19,96,9,"Hajoljatok meg az Úr elõtt szent ékességben; rettegjen elõtte az egész föld!"));
husuperobject.biblemap.put("b19_96_10", new husuperobject(19,96,10,"Mondjátok a népek között: Az Úr uralkodik; megerõsítette a földet, hogy meg ne induljon; õ ítéli meg a népeket igazsággal."));
husuperobject.biblemap.put("b19_96_11", new husuperobject(19,96,11,"Örüljenek az egek és örvendezzen a föld; harsogjon a tenger és minden benne való!"));
husuperobject.biblemap.put("b19_96_12", new husuperobject(19,96,12,"Viduljon a mezõ és minden, a mi rajta van; örvend akkor az erdõ minden fája is,"));
husuperobject.biblemap.put("b19_96_13", new husuperobject(19,96,13,"Az Úrnak orczája elõtt, mert eljön, mert eljön, hogy megítélje e földet. Megítéli majd a világot igazsággal, és a népeket az õ hûségével."));
husuperobject.biblemap.put("b19_97_1", new husuperobject(19,97,1,"Az Úr uralkodik, örüljön a föld; örvendezzenek a temérdek szigetek."));
husuperobject.biblemap.put("b19_97_2", new husuperobject(19,97,2,"Felhõ és homályosság van körülte; igazság és jogosság az õ székének erõssége."));
husuperobject.biblemap.put("b19_97_3", new husuperobject(19,97,3,"Tûz jár elõtte, és köröskörül elégeti az õ szorongatóit."));
husuperobject.biblemap.put("b19_97_4", new husuperobject(19,97,4,"Megvilágosítják az õ villámai a világot; látja és megretteg a föld."));
husuperobject.biblemap.put("b19_97_5", new husuperobject(19,97,5,"A hegyek, mint a viasz megolvadnak az Úr elõtt, az egész földnek Ura elõtt."));
husuperobject.biblemap.put("b19_97_6", new husuperobject(19,97,6,"Az egek hirdetik az õ igazságát, és minden nép látja az õ dicsõségét."));
husuperobject.biblemap.put("b19_97_7", new husuperobject(19,97,7,"Megszégyenülnek mind a faragott képek szolgái, a kik bálványokkal dicsekednek; meghajolnak elõtte mind az istenek."));
husuperobject.biblemap.put("b19_97_8", new husuperobject(19,97,8,"Hallotta és örvendeze Sion, és örülének Júdának leányai a te ítéleteidnek Uram!"));
husuperobject.biblemap.put("b19_97_9", new husuperobject(19,97,9,"Mert te felséges vagy Uram az egész földön, és igen felmagasztaltattál minden isten felett!"));
husuperobject.biblemap.put("b19_97_10", new husuperobject(19,97,10,"A kik szeretitek az Urat, gyûlöljétek a gonoszt! Megõrzi õ az õ kegyeltjeinek lelkét; a gonoszok kezébõl megszabadítja õket."));
husuperobject.biblemap.put("b19_97_11", new husuperobject(19,97,11,"Világosság támad fel az igazra, és az egyenesszívûekre öröm."));
husuperobject.biblemap.put("b19_97_12", new husuperobject(19,97,12,"Örüljetek igazak az Úrban, és tiszteljétek az õ szentséges emlékezetét!"));
husuperobject.biblemap.put("b19_98_1", new husuperobject(19,98,1,"Zsoltár.  megsegítette õt az õ jobbkeze és az õ szentséges karja."));
husuperobject.biblemap.put("b19_98_2", new husuperobject(19,98,2,"Tudtul adta az Úr az õ szabadítását; a népek elõtt megjelentette az õ igazságát."));
husuperobject.biblemap.put("b19_98_3", new husuperobject(19,98,3,"Megemlékezett az õ kegyelmérõl és Izráel házához való hûségérõl; látták a föld határai mind a mi Istenünknek szabadítását."));
husuperobject.biblemap.put("b19_98_4", new husuperobject(19,98,4,"Vígan énekelj az Úrnak te egész föld; harsanjatok fel, örvendezzetek és zengedezzetek!"));
husuperobject.biblemap.put("b19_98_5", new husuperobject(19,98,5,"Zengedezzetek az Úrnak hárfával, hárfával és hangos énekléssel;"));
husuperobject.biblemap.put("b19_98_6", new husuperobject(19,98,6,"Trombitákkal és kürtzengéssel vígadozzatok a király, az Úr elõtt!"));
husuperobject.biblemap.put("b19_98_7", new husuperobject(19,98,7,"Harsogjon a tenger és minden benne való, a világ és a kik lakoznak benne."));
husuperobject.biblemap.put("b19_98_8", new husuperobject(19,98,8,"A folyóvizek tapsoljanak, a hegyek együttesen örvendezzenek"));
husuperobject.biblemap.put("b19_98_9", new husuperobject(19,98,9,"Az Úr elõtt, mert eljön megítélni a földet; megítéli a világot igazsággal és a népeket méltányossággal."));
husuperobject.biblemap.put("b19_99_1", new husuperobject(19,99,1,"Az Úr uralkodik, reszkessenek a népek; Kérubokon ül, remegjen a föld!"));
husuperobject.biblemap.put("b19_99_2", new husuperobject(19,99,2,"Nagy az Úr a Sionon, és magasságos õ minden nép felett."));
husuperobject.biblemap.put("b19_99_3", new husuperobject(19,99,3,"Tiszteljék a te nagy és rettenetes nevedet, - szent az!"));
husuperobject.biblemap.put("b19_99_4", new husuperobject(19,99,4,"És tisztesség a királynak, a ki szereti a jogosságot! Te megerõsítetted az egyenességet; jogosságot és igazságot szereztél Jákóbban."));
husuperobject.biblemap.put("b19_99_5", new husuperobject(19,99,5,"Magasztaljátok az Urat, a mi Istenünket, és boruljatok le az õ lábainak zsámolya elé; szent õ!"));
husuperobject.biblemap.put("b19_99_6", new husuperobject(19,99,6,"Mózes és Áron az õ papjaival, és Sámuel az õ nevét segítségül hívókkal egybe, segítségül hívják vala az Urat, és meghallgatá õket."));
husuperobject.biblemap.put("b19_99_7", new husuperobject(19,99,7,"Felhõ-oszlopban szólt vala hozzájok; megõrizték az õ bizonyságtételét és rendeletét, a melyet adott vala nékik."));
husuperobject.biblemap.put("b19_99_8", new husuperobject(19,99,8,"Uram, mi Istenünk! Te meghallgattad õket, kegyelmes Isten voltál hozzájok; de bosszúálló az õ hiábavalóságaik miatt."));
husuperobject.biblemap.put("b19_99_9", new husuperobject(19,99,9,"Magasztaljátok az Urat, a mi Istenünket, és boruljatok le az õ szent hegyén; mert szent az Úr, a mi Istenünk!"));
husuperobject.biblemap.put("b19_100_1", new husuperobject(19,100,1,"Hálaadó zsoltár."));
husuperobject.biblemap.put("b19_100_2", new husuperobject(19,100,2,"Szolgáljatok az Úrnak örvendezéssel; menjetek eléje vígassággal."));
husuperobject.biblemap.put("b19_100_3", new husuperobject(19,100,3,"Tudjátok meg, hogy az Úr az Isten; õ alkotott minket és nem magunk; az õ népe és az õ legelõinek juhai vagyunk."));
husuperobject.biblemap.put("b19_100_4", new husuperobject(19,100,4,"Menjetek be az õ kapuin hálaadással, tornáczaiba dicséretekkel; adjatok hálákat néki, áldjátok az õ nevét!"));
husuperobject.biblemap.put("b19_100_5", new husuperobject(19,100,5,"Mert jó az Úr, örökkévaló az õ kegyelme, és nemzedékrõl nemzedékre való az õ hûsége!"));
husuperobject.biblemap.put("b19_11_1", new husuperobject(19,11,1,"Dávid zsoltára.  te néked zengek éneket, Uram!"));
husuperobject.biblemap.put("b19_11_2", new husuperobject(19,11,2,"Gondom van a tökéletes útra: mikor jössz el hozzám? Szívemnek tökéletessége szerint járok én az én házamban."));
husuperobject.biblemap.put("b19_11_3", new husuperobject(19,11,3,"Nem vetem a szemem hiábavaló dologra; a pártoskodók cselekedetét gyûlölöm: nincs köze hozzám."));
husuperobject.biblemap.put("b19_11_4", new husuperobject(19,11,4,"A csalárd szív távol van én tõlem, gonoszt nem ismerek."));
husuperobject.biblemap.put("b19_11_5", new husuperobject(19,11,5,"A ki titkon rágalmazza az õ felebarátját, elvesztem azt; a nagyralátót és a kevélyszívût, azt el nem szenvedem."));
husuperobject.biblemap.put("b19_11_6", new husuperobject(19,11,6,"Szemmel tartom a föld hûségeseit, hogy mellettem lakozzanak; a tökéletesség útjában járó, az szolgál engem."));
husuperobject.biblemap.put("b19_11_7", new husuperobject(19,11,7,"Nem lakozik az én házamban, a ki csalárdságot mível; a ki hazugságot szól, nem állhat meg szemeim elõtt."));
husuperobject.biblemap.put("b19_11_8", new husuperobject(19,11,8,"Reggelenként elvesztem e földnek latrait, hogy kigyomláljak az Úrnak városából minden gonosztevõt."));
husuperobject.biblemap.put("b19_12_1", new husuperobject(19,12,1,"A nyomorultnak imádsága, a mikor eleped és kiönti panaszát az Úr elé."));
husuperobject.biblemap.put("b19_12_2", new husuperobject(19,12,2,"Uram, hallgasd meg az én imádságomat, és kiáltásom jusson te hozzád!"));
husuperobject.biblemap.put("b19_12_3", new husuperobject(19,12,3,"Ne rejtsd el a te orczádat tõlem; mikor szorongatnak engem, hajtsd hozzám a te füledet; mikor kiáltok, hamar hallgass meg engem!"));
husuperobject.biblemap.put("b19_12_4", new husuperobject(19,12,4,"Mert elenyésznek az én napjaim, mint a füst, és csontjaim, mint valami tûzhely, üszkösök."));
husuperobject.biblemap.put("b19_12_5", new husuperobject(19,12,5,"Letaroltatott és megszáradt, mint a fû az én szívem; még kenyerem megevésérõl is elfelejtkezem."));
husuperobject.biblemap.put("b19_12_6", new husuperobject(19,12,6,"Nyögésemnek szavától csontom a húsomhoz ragadt."));
husuperobject.biblemap.put("b19_12_7", new husuperobject(19,12,7,"Hasonló vagyok a pusztai pelikánhoz; olyanná lettem, mint a bagoly a romokon."));
husuperobject.biblemap.put("b19_12_8", new husuperobject(19,12,8,"Virrasztok és olyan vagyok, mint a magános madár a háztetõn."));
husuperobject.biblemap.put("b19_12_9", new husuperobject(19,12,9,"Minden napon gyaláznak engem ellenségeim, csúfolóim esküsznek én reám."));
husuperobject.biblemap.put("b19_12_10", new husuperobject(19,12,10,"Bizony a port eszem kenyér gyanánt, és italomat könyekkel vegyítem,"));
husuperobject.biblemap.put("b19_12_11", new husuperobject(19,12,11,"A te felindulásod és búsulásod miatt; mert felemeltél engem és földhöz vertél engem."));
husuperobject.biblemap.put("b19_12_12", new husuperobject(19,12,12,"Napjaim olyanok, mint a megnyúlt árnyék; magam pedig, mint a fû, megszáradtam."));
husuperobject.biblemap.put("b19_12_13", new husuperobject(19,12,13,"De te Uram örökké megmaradsz, és a te emlékezeted nemzetségrõl nemzetségre [áll.]"));
husuperobject.biblemap.put("b19_12_14", new husuperobject(19,12,14,"Te kelj fel, könyörülj a Sionon! Mert ideje, hogy könyörülj rajta, mert eljött a megszabott idõ."));
husuperobject.biblemap.put("b19_12_15", new husuperobject(19,12,15,"Mert kedvelik a te szolgáid annak köveit, és a porát is kímélik."));
husuperobject.biblemap.put("b19_12_16", new husuperobject(19,12,16,"És félik a népek az Úrnak nevét, és e földnek minden királya a te dicsõségedet;"));
husuperobject.biblemap.put("b19_12_17", new husuperobject(19,12,17,"Mivelhogy az Úr megépítette a Siont, megláttatta magát az õ dicsõségében."));
husuperobject.biblemap.put("b19_12_18", new husuperobject(19,12,18,"Oda fordult a gyámoltalanok imádsága felé, és azoknak imádságát meg nem útálta."));
husuperobject.biblemap.put("b19_12_19", new husuperobject(19,12,19,"Irattassék meg ez a következõ nemzedéknek, és a teremtendõ nép dicsérni fogja az Urat."));
husuperobject.biblemap.put("b19_12_20", new husuperobject(19,12,20,"Mert alátekintett az õ szentségének magaslatáról; a mennyekbõl a földre nézett le az Úr."));
husuperobject.biblemap.put("b19_12_21", new husuperobject(19,12,21,"Hogy meghallja a fogolynak nyögését, [és] hogy feloldozza a halálnak fiait."));
husuperobject.biblemap.put("b19_12_22", new husuperobject(19,12,22,"Hogy hirdessék a Sionon az Úrnak nevét, és az õ dicséretét Jeruzsálemben."));
husuperobject.biblemap.put("b19_12_23", new husuperobject(19,12,23,"Mikor egybegyûlnek a népek mindnyájan, és az országok, hogy szolgáljanak az Úrnak."));
husuperobject.biblemap.put("b19_12_24", new husuperobject(19,12,24,"Megsanyargatta az én erõmet ez útban, megrövidítette napjaimat."));
husuperobject.biblemap.put("b19_12_25", new husuperobject(19,12,25,"Ezt mondám: Én Istenem! Ne vígy el engem az én napjaimnak felén; a te esztendeid nemzedékek nemzedékéig [tartanak.]"));
husuperobject.biblemap.put("b19_12_26", new husuperobject(19,12,26,"Régente fundáltad a földet, s az egek is a te kezednek munkája."));
husuperobject.biblemap.put("b19_12_27", new husuperobject(19,12,27,"Azok elvesznek, de te megmaradsz; mindazok elavulnak, mint a ruha; mint az öltözetet, elváltoztatod azokat, és elváltoznak."));
husuperobject.biblemap.put("b19_12_28", new husuperobject(19,12,28,"De te ugyanaz vagy, és a te esztendeid el nem fogynak. [ (Psalms 102:29) A te szolgáidnak fiai megmaradnak, és az õ magvok erõsen megáll elõtted. ]"));
husuperobject.biblemap.put("b19_13_1", new husuperobject(19,13,1,"A Dávidé."));
husuperobject.biblemap.put("b19_13_2", new husuperobject(19,13,2,"Áldjad én lelkem az Urat, és el ne feledkezzél semmi jótéteményérõl."));
husuperobject.biblemap.put("b19_13_3", new husuperobject(19,13,3,"A ki megbocsátja minden bûnödet, meggyógyítja minden betegségedet."));
husuperobject.biblemap.put("b19_13_4", new husuperobject(19,13,4,"A ki megváltja életedet a koporsótól; kegyelemmel és irgalmassággal koronáz meg téged."));
husuperobject.biblemap.put("b19_13_5", new husuperobject(19,13,5,"A ki jóval tölti be a te ékességedet, [és] megújul a te ifjúságod, mint a sasé."));
husuperobject.biblemap.put("b19_13_6", new husuperobject(19,13,6,"Igazságot cselekszik az Úr, és ítéletet minden elnyomottal."));
husuperobject.biblemap.put("b19_13_7", new husuperobject(19,13,7,"Megismertette az õ útait Mózessel; Izráel fiaival az õ cselekedeteit."));
husuperobject.biblemap.put("b19_13_8", new husuperobject(19,13,8,"Könyörülõ és irgalmas az Úr, késedelmes a haragra és nagy kegyelmû."));
husuperobject.biblemap.put("b19_13_9", new husuperobject(19,13,9,"Nem feddõdik minduntalan, és nem tartja meg haragját örökké."));
husuperobject.biblemap.put("b19_13_10", new husuperobject(19,13,10,"Nem bûneink szerint cselekszik velünk, és nem fizet nékünk a mi álnokságaink szerint."));
husuperobject.biblemap.put("b19_13_11", new husuperobject(19,13,11,"Mert a milyen magas az ég a földtõl, olyan nagy az õ kegyelme az õt félõk iránt."));
husuperobject.biblemap.put("b19_13_12", new husuperobject(19,13,12,"A milyen távol van a napkelet a napnyugattól, olyan messze veti el tõlünk a mi vétkeinket."));
husuperobject.biblemap.put("b19_13_13", new husuperobject(19,13,13,"A milyen könyörülõ az atya a fiakhoz, olyan könyörülõ az Úr az õt félõk iránt."));
husuperobject.biblemap.put("b19_13_14", new husuperobject(19,13,14,"Mert õ tudja a mi formáltatásunkat; megemlékezik róla, hogy por vagyunk."));
husuperobject.biblemap.put("b19_13_15", new husuperobject(19,13,15,"Az embernek napjai olyanok, mint a fû, úgy virágzik, mint a mezõnek virága."));
husuperobject.biblemap.put("b19_13_16", new husuperobject(19,13,16,"Hogyha általmegy rajta a szél, nincsen többé, és az õ helye sem ismeri azt többé."));
husuperobject.biblemap.put("b19_13_17", new husuperobject(19,13,17,"De az Úr kegyelme öröktõl fogva való és örökkévaló az õt félõkön, és az õ igazsága a fiaknak fiain;"));
husuperobject.biblemap.put("b19_13_18", new husuperobject(19,13,18,"Azokon, a kik megtartják az õ szövetségét és megemlékeznek az õ parancsolatjairól, hogy azokat megcselekedjék."));
husuperobject.biblemap.put("b19_13_19", new husuperobject(19,13,19,"Az Úr a mennyekbe helyheztette az õ székét és az õ uralkodása mindenre kihat."));
husuperobject.biblemap.put("b19_13_20", new husuperobject(19,13,20,"Áldjátok az Urat õ angyalai, ti hatalmas erejûek, a kik teljesítitek az õ rendeletét, hallgatván az õ rendeletének szavára."));
husuperobject.biblemap.put("b19_13_21", new husuperobject(19,13,21,"Áldjátok az Urat minden õ serege: õ szolgái, akaratának teljesítõi!"));
husuperobject.biblemap.put("b19_13_22", new husuperobject(19,13,22,"Áldjátok az Urat minden õ teremtményei, az õ uralkodásának minden helyén! Áldjad én lelkem az Urat!"));
husuperobject.biblemap.put("b19_14_1", new husuperobject(19,14,1,"Áldjad én lelkem az Urat! Uram én Istenem, nagy vagy te igen, ékességet és fenséget öltöztél magadra!"));
husuperobject.biblemap.put("b19_14_2", new husuperobject(19,14,2,"A ki körülvette magát világossággal, mint egy öltözettel, és kiterjesztette az egeket, mint egy kárpitot;"));
husuperobject.biblemap.put("b19_14_3", new husuperobject(19,14,3,"A ki vizeken építi fel az õ palotáját, a felhõket rendeli az õ szekerévé, jár a szeleknek szárnyain;"));
husuperobject.biblemap.put("b19_14_4", new husuperobject(19,14,4,"A ki a szeleket teszi követeivé, a lángoló tüzet szolgáivá."));
husuperobject.biblemap.put("b19_14_5", new husuperobject(19,14,5,"Õ fundálta a földet az õ oszlopain, nem mozdul az meg soha örökké."));
husuperobject.biblemap.put("b19_14_6", new husuperobject(19,14,6,"Vízáradattal, mint egy ruhával borítottad be azt, a hegyek felett is vizek állottak vala."));
husuperobject.biblemap.put("b19_14_7", new husuperobject(19,14,7,"Egy kiáltásodtól eloszlának, és mennydörgésednek szavától szétriadának."));
husuperobject.biblemap.put("b19_14_8", new husuperobject(19,14,8,"Hegyek emelkedének fel és völgyek szállának alá arra a helyre, a melyet fundáltál nékik."));
husuperobject.biblemap.put("b19_14_9", new husuperobject(19,14,9,"Határt vetettél, a melyet át nem hágnak, nem térnek vissza a földnek elborítására."));
husuperobject.biblemap.put("b19_14_10", new husuperobject(19,14,10,"A ki elbocsátja a forrásokat a völgyekbe, hogy folydogáljanak a hegyek között;"));
husuperobject.biblemap.put("b19_14_11", new husuperobject(19,14,11,"Megitassák a mezõnek minden állatát; a vadszamarak is megoltsák szomjúságukat."));
husuperobject.biblemap.put("b19_14_12", new husuperobject(19,14,12,"Mellettök lakoznak az égnek madarai, az ágak közül hangicsálnak."));
husuperobject.biblemap.put("b19_14_13", new husuperobject(19,14,13,"A ki megöntözi a hegyeket az õ palotájából; a te munkáidnak gyümölcsébõl megelégíttetik a föld."));
husuperobject.biblemap.put("b19_14_14", new husuperobject(19,14,14,"A ki füvet sarjaszt a barmoknak és növényeket az embereknek hasznára, hogy eledelt vegyenek a földbõl,"));
husuperobject.biblemap.put("b19_14_15", new husuperobject(19,14,15,"És bort, a mely megvidámítja a halandónak szívét, fényesebbé teszi az orczát az olajnál; és kenyeret, a mely megerõsíti a halandónak szívét."));
husuperobject.biblemap.put("b19_14_16", new husuperobject(19,14,16,"Megelégíttetnek az Úrnak fái, a Libánonnak czédrusai, a melyeket plántált;"));
husuperobject.biblemap.put("b19_14_17", new husuperobject(19,14,17,"A melyeken madarak fészkelnek: az eszterág, a melynek a cziprusok a háza."));
husuperobject.biblemap.put("b19_14_18", new husuperobject(19,14,18,"A magas hegyek a vadkecskéknek, a sziklák hörcsögöknek menedéke."));
husuperobject.biblemap.put("b19_14_19", new husuperobject(19,14,19,"Teremtett holdat ünnepeknek mutatására; a napot, a mely lenyugovását tudja."));
husuperobject.biblemap.put("b19_14_20", new husuperobject(19,14,20,"Szerzett setétséget, hogy éjszaka legyen, a melyben szétjárjanak a mezõnek összes vadai;"));
husuperobject.biblemap.put("b19_14_21", new husuperobject(19,14,21,"Az oroszlánkölykök, a melyek ordítanak a prédáért, sürgetvén Istentõl eledelöket."));
husuperobject.biblemap.put("b19_14_22", new husuperobject(19,14,22,"Ha felkél a nap, elrejtõznek és hajlékaikban heverésznek;"));
husuperobject.biblemap.put("b19_14_23", new husuperobject(19,14,23,"Az ember munkájára megy ki, és az õ dolgára mind estvéig."));
husuperobject.biblemap.put("b19_14_24", new husuperobject(19,14,24,"Mily számtalanok a te mûveid, Uram! Mindazokat bölcsen alkottad meg, és betelt a föld a te gazdagságoddal."));
husuperobject.biblemap.put("b19_14_25", new husuperobject(19,14,25,"Ez a nagy és széles tenger! Itt vannak benne a megszámlálhatatlan csúszók; apró állatok nagyokkal együtt."));
husuperobject.biblemap.put("b19_14_26", new husuperobject(19,14,26,"Amott gályák járnak [s] czethal, a melyet azért formáltál, hogy játszadozzék benne."));
husuperobject.biblemap.put("b19_14_27", new husuperobject(19,14,27,"Mindazok te reád néznek, hogy megadjad eledelüket alkalmas idõben."));
husuperobject.biblemap.put("b19_14_28", new husuperobject(19,14,28,"Adsz nékik [és] õk takarnak; megnyitod kezedet, és megtelnek a te jóvoltoddal."));
husuperobject.biblemap.put("b19_14_29", new husuperobject(19,14,29,"Elfordítod orczádat, megháborodnak; elveszed a lelköket, kimulnak és porrá lesznek újra."));
husuperobject.biblemap.put("b19_14_30", new husuperobject(19,14,30,"Kibocsátod a te lelkedet, megújulnak, és újjá teszed a földnek színét."));
husuperobject.biblemap.put("b19_14_31", new husuperobject(19,14,31,"Legyen az Úrnak dicsõség örökké; örvendezzen az Úr az õ teremtményeiben;"));
husuperobject.biblemap.put("b19_14_32", new husuperobject(19,14,32,"A ki, ha rátekint e földre, megrendül az; megilleti a hegyeket, és füstölögnek azok."));
husuperobject.biblemap.put("b19_14_33", new husuperobject(19,14,33,"Éneklek az Úrnak egész életemben; zengedezek az én Istenemnek, a míg vagyok!"));
husuperobject.biblemap.put("b19_14_34", new husuperobject(19,14,34,"Legyen kedves néki az én rebegésem; örvendezem én az Úrban;"));
husuperobject.biblemap.put("b19_14_35", new husuperobject(19,14,35,"Veszszenek el a bûnösök a földrõl, és a hitetlenek ne legyenek többé! Áldjad én lelkem az Urat; dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_15_1", new husuperobject(19,15,1,"Magasztaljátok az Urat, hívjátok segítségül az õ nevét, hirdessétek a népek között az õ cselekedeteit!"));
husuperobject.biblemap.put("b19_15_2", new husuperobject(19,15,2,"Énekeljetek néki, zengedezzetek néki, beszéljétek el minden õ csodatételét."));
husuperobject.biblemap.put("b19_15_3", new husuperobject(19,15,3,"Dicsekedjetek az õ szent nevével; örvendezzen azoknak a szívök, a kik keresik az Urat."));
husuperobject.biblemap.put("b19_15_4", new husuperobject(19,15,4,"Kivánjátok az Urat és az õ erejét; keressétek az õ orczáját szüntelen."));
husuperobject.biblemap.put("b19_15_5", new husuperobject(19,15,5,"Emlékezzetek meg az õ csodáiról, a melyeket cselekedett; jeleirõl és az õ szájának ítéleteirõl."));
husuperobject.biblemap.put("b19_15_6", new husuperobject(19,15,6,"Oh Ábrahámnak, az õ szolgájának magva; oh Jákóbnak, az õ választottának fiai!"));
husuperobject.biblemap.put("b19_15_7", new husuperobject(19,15,7,"Õ, az Úr a mi Istenünk, az egész földre [kihat] az õ ítélete."));
husuperobject.biblemap.put("b19_15_8", new husuperobject(19,15,8,"Megemlékezik az õ szövetségérõl mindörökké; az õ rendeletérõl, a melyet megszabott ezer nemzetségiglen;"));
husuperobject.biblemap.put("b19_15_9", new husuperobject(19,15,9,"A melyet kötött Ábrahámmal, és az õ Izsáknak tett esküvésérõl."));
husuperobject.biblemap.put("b19_15_10", new husuperobject(19,15,10,"És odaállatta azt Jákóbnak szabályul, Izráelnek örök szövetségül,"));
husuperobject.biblemap.put("b19_15_11", new husuperobject(19,15,11,"Mondván: Néked adom Kanaán földét, sors szerint való örökségetekül."));
husuperobject.biblemap.put("b19_15_12", new husuperobject(19,15,12,"Mikor még csekély számmal valának, igen kevesen és [mintegy ]zsellérek abban,"));
husuperobject.biblemap.put("b19_15_13", new husuperobject(19,15,13,"És egyik nemzettõl a másikhoz bujdosának, egyik országból a másik néphez:"));
husuperobject.biblemap.put("b19_15_14", new husuperobject(19,15,14,"Nem engedé, hogy valaki nyomorgassa õket, sõt királyokat is megfenyített miattok, [mondván:]"));
husuperobject.biblemap.put("b19_15_15", new husuperobject(19,15,15,"Meg ne illessétek az én felkentjeimet, és az én prófétáimnak ne ártsatok!"));
husuperobject.biblemap.put("b19_15_16", new husuperobject(19,15,16,"Mikor éhséget idéze elõ a földön; [és] a kenyérnek minden botját eltöré,"));
husuperobject.biblemap.put("b19_15_17", new husuperobject(19,15,17,"Elküldött elõttük egy férfiút, Józsefet, a ki rabul adatott vala el;"));
husuperobject.biblemap.put("b19_15_18", new husuperobject(19,15,18,"A lábait békóba szorították, õ maga vasban járt vala,"));
husuperobject.biblemap.put("b19_15_19", new husuperobject(19,15,19,"Mindazideig, a míg szava beteljesedett. Az Úr beszéde megpróbálta õt."));
husuperobject.biblemap.put("b19_15_20", new husuperobject(19,15,20,"Elküldött a király és feloldotta õt, a népeken uralkodó, és szabaddá tette õt;"));
husuperobject.biblemap.put("b19_15_21", new husuperobject(19,15,21,"Úrrá tevé õt az õ házán, és uralkodóvá minden jószágán;"));
husuperobject.biblemap.put("b19_15_22", new husuperobject(19,15,22,"Hogy fõembereit tetszése szerint kötöztetheté, és véneit is bölcsességre taníthatá."));
husuperobject.biblemap.put("b19_15_23", new husuperobject(19,15,23,"És beméne Izráel Égyiptomba, s Jákób a Khám földén zsellérkedék."));
husuperobject.biblemap.put("b19_15_24", new husuperobject(19,15,24,"És igen megszaporítá az õ népét, és erõsebbé tevé elnyomóinál."));
husuperobject.biblemap.put("b19_15_25", new husuperobject(19,15,25,"Elváltoztatá azoknak szívét, hogy gyûlöljék az õ népét, [és ] álnokul cselekedjenek az õ szolgáival."));
husuperobject.biblemap.put("b19_15_26", new husuperobject(19,15,26,"Elküldte Mózest, az õ szolgáját, és Áront, a kit választott vala."));
husuperobject.biblemap.put("b19_15_27", new husuperobject(19,15,27,"Elvégezék azok között az õ jeleit, és a csodákat a Khám földén."));
husuperobject.biblemap.put("b19_15_28", new husuperobject(19,15,28,"Sötétséget bocsátott és elsötétítette [azt, ]és azok nem engedetlenkedtek az õ rendeleteinek."));
husuperobject.biblemap.put("b19_15_29", new husuperobject(19,15,29,"Vizeiket vérré változtatá, és megölé az õ halaikat."));
husuperobject.biblemap.put("b19_15_30", new husuperobject(19,15,30,"Földjük békáktól hemzsege, [még] a királyuk termeiben [is.]"));
husuperobject.biblemap.put("b19_15_31", new husuperobject(19,15,31,"Szólt, és támadának legyek és szúnyogok minden õ határukon."));
husuperobject.biblemap.put("b19_15_32", new husuperobject(19,15,32,"Adott nékik esõ gyanánt jégesõt, [és] lángoló tüzet a földjökre."));
husuperobject.biblemap.put("b19_15_33", new husuperobject(19,15,33,"És elvevé szõlõjüket és fügefájokat, és széttördelé határuknak élõ fáit."));
husuperobject.biblemap.put("b19_15_34", new husuperobject(19,15,34,"Szólt és támada sáska, és megszámlálhatatlan cserebogár."));
husuperobject.biblemap.put("b19_15_35", new husuperobject(19,15,35,"És megemészte minden növényt az õ földjökön, és az õ szántóföldjöknek gyümölcsét megemészté."));
husuperobject.biblemap.put("b19_15_36", new husuperobject(19,15,36,"És megöle minden elsõszülöttet földjökön, minden erejöknek zsengéjét."));
husuperobject.biblemap.put("b19_15_37", new husuperobject(19,15,37,"És kihozá õket ezüsttel és arannyal, és nemzetségeikben nem volt beteges."));
husuperobject.biblemap.put("b19_15_38", new husuperobject(19,15,38,"Örült Égyiptom, mikor kijövének, mert a tõlök való félelem megszállta õket."));
husuperobject.biblemap.put("b19_15_39", new husuperobject(19,15,39,"Felhõt terjeszte ki, hogy befedezze [õket,] és tüzet, hogy világítson éjjel."));
husuperobject.biblemap.put("b19_15_40", new husuperobject(19,15,40,"Könyörgött és fürjeket hoza, és mennyei kenyérrel elégítette meg õket."));
husuperobject.biblemap.put("b19_15_41", new husuperobject(19,15,41,"Megnyitotta a kõsziklát és víz zúdula ki, folyóként futott a sivatagon."));
husuperobject.biblemap.put("b19_15_42", new husuperobject(19,15,42,"Mert megemlékezett az õ szentséges igéretérõl, a [melyet tõn] Ábrahámnak, az õ szolgájának."));
husuperobject.biblemap.put("b19_15_43", new husuperobject(19,15,43,"Kihozá azért az õ népét örömmel, [és] az õ választottait vígassággal."));
husuperobject.biblemap.put("b19_15_44", new husuperobject(19,15,44,"És nékik adá a pogányok földét, és öröklék a népek fáradságos szerzeményét."));
husuperobject.biblemap.put("b19_15_45", new husuperobject(19,15,45,"Azért, hogy megtartsák az õ rendeleteit, és törvényeit megõrizzék. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_16_1", new husuperobject(19,16,1,"Dicsérjétek az Urat.  mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_16_2", new husuperobject(19,16,2,"Ki beszélhetné el az Úr nagy tetteit? és jelenthetné ki minden dicsõségét?"));
husuperobject.biblemap.put("b19_16_3", new husuperobject(19,16,3,"Boldog, a ki megtartja a törvényt, [és] igazán cselekszik minden idõben."));
husuperobject.biblemap.put("b19_16_4", new husuperobject(19,16,4,"Emlékezzél reám, Uram, népedhez való jóságodért; jõjj el hozzám szabadításoddal,"));
husuperobject.biblemap.put("b19_16_5", new husuperobject(19,16,5,"Hogy láthassam választottaidhoz való jóvoltodat, [és] örvendezhessek néped örömében; hogy dicsekedjem a te örökségeddel!"));
husuperobject.biblemap.put("b19_16_6", new husuperobject(19,16,6,"Vétkeztünk atyáinkkal együtt; bûnösök, gonoszok valánk."));
husuperobject.biblemap.put("b19_16_7", new husuperobject(19,16,7,"Atyáink nem értették meg Égyiptomban csodáidat, nem emlegették meg kegyelmed nagyságát, hanem daczoskodtak a tengernél, a veres tengernél."));
husuperobject.biblemap.put("b19_16_8", new husuperobject(19,16,8,"De õ megsegíté õket az õ nevéért, hogy megismertesse a maga erejét."));
husuperobject.biblemap.put("b19_16_9", new husuperobject(19,16,9,"Rákiálta a veres tengerre és kiszáradt, s úgy vivé õket a mélységeken, mint egy síkon."));
husuperobject.biblemap.put("b19_16_10", new husuperobject(19,16,10,"És kisegíté õket a gyûlölõ kezébõl; kimentette õket ellenség kezébõl."));
husuperobject.biblemap.put("b19_16_11", new husuperobject(19,16,11,"Szorongatóikat víz borította el, egy sem maradt meg belõlük."));
husuperobject.biblemap.put("b19_16_12", new husuperobject(19,16,12,"És hittek az õ beszédeinek, [és] énekelték az õ dicséretét."));
husuperobject.biblemap.put("b19_16_13", new husuperobject(19,16,13,"Hirtelen elfeledék cselekedeteit; nem várák az õ tanácsát!"));
husuperobject.biblemap.put("b19_16_14", new husuperobject(19,16,14,"Epekedés epeszté õket a pusztában, és próbára tevék Istent a sivatagon."));
husuperobject.biblemap.put("b19_16_15", new husuperobject(19,16,15,"És megadá nékik, a mit kivántak; és ösztövérséget bocsáta lelkökbe."));
husuperobject.biblemap.put("b19_16_16", new husuperobject(19,16,16,"És irigységre indulának Mózes ellen a táborban, az Úr szentje, Áron ellen."));
husuperobject.biblemap.put("b19_16_17", new husuperobject(19,16,17,"Megnyilt a föld és elnyelé Dátánt, és beborítá Abirám seregét."));
husuperobject.biblemap.put("b19_16_18", new husuperobject(19,16,18,"És tûz gyulladt fel azok seregében, láng égeté el a gonoszokat."));
husuperobject.biblemap.put("b19_16_19", new husuperobject(19,16,19,"Borjút csináltak a Hóreb alatt, és hajlongtak az öntött bálvány elõtt."));
husuperobject.biblemap.put("b19_16_20", new husuperobject(19,16,20,"Felcserélték az õ dicsõségöket: ökörnek képével, a mely füvet eszik."));
husuperobject.biblemap.put("b19_16_21", new husuperobject(19,16,21,"Elfeledkezének Istenrõl, szabadítójokról, a ki nagy dolgokat mûvelt Égyiptomban,"));
husuperobject.biblemap.put("b19_16_22", new husuperobject(19,16,22,"Csodákat a Khám országában, félelmetes dolgokat a veres tenger mellett."));
husuperobject.biblemap.put("b19_16_23", new husuperobject(19,16,23,"Gondolta, hogy kipusztítja õket; de Mózes, az õ választottja, elébe állott a résre, hogy elfordítsa haragját, hogy el ne veszítse [õket.]"));
husuperobject.biblemap.put("b19_16_24", new husuperobject(19,16,24,"És becsmérelték a kivánatos földet, nem hittek az õ igéretének."));
husuperobject.biblemap.put("b19_16_25", new husuperobject(19,16,25,"És morgolódtak sátraikban, és nem hallgattak az Úr szavára."));
husuperobject.biblemap.put("b19_16_26", new husuperobject(19,16,26,"De õ felemelé kezét reájok, hogy lesújtsa õket a pusztában;"));
husuperobject.biblemap.put("b19_16_27", new husuperobject(19,16,27,"S hogy a pogányok közé dobja magvaikat, és szétszórja õket a tartományokban."));
husuperobject.biblemap.put("b19_16_28", new husuperobject(19,16,28,"Majd hozzácsapódtak a Baál-Peorhoz, és ették a holtak áldozatait."));
husuperobject.biblemap.put("b19_16_29", new husuperobject(19,16,29,"És felingerelték cselekedeteikkel, és zúdult reájok a csapás."));
husuperobject.biblemap.put("b19_16_30", new husuperobject(19,16,30,"Ekkor felállott Fineás és ítélt; és a csapásnak vége lõn."));
husuperobject.biblemap.put("b19_16_31", new husuperobject(19,16,31,"És igazságul tulajdoníttaték néki firól-fira mindörökké."));
husuperobject.biblemap.put("b19_16_32", new husuperobject(19,16,32,"Megharagíták a Meribáh vizeinél is, és baja támadt Mózesnek miattok,"));
husuperobject.biblemap.put("b19_16_33", new husuperobject(19,16,33,"Mert megkeseríték az õ szívét, és gondatlanul szólt ajkaival."));
husuperobject.biblemap.put("b19_16_34", new husuperobject(19,16,34,"Nem irtották ki a népeket sem, a mint utasította õket az Úr."));
husuperobject.biblemap.put("b19_16_35", new husuperobject(19,16,35,"Sõt összeelegyedtek a pogányokkal, és eltanulták cselekedeteiket."));
husuperobject.biblemap.put("b19_16_36", new husuperobject(19,16,36,"És tisztelték azoknak bálványait, és tõrré levének azok reájok."));
husuperobject.biblemap.put("b19_16_37", new husuperobject(19,16,37,"És feláldozák fiaikat és leányaikat az ördögöknek,"));
husuperobject.biblemap.put("b19_16_38", new husuperobject(19,16,38,"És ártatlan vért ontának: fiaik és leányaik vérét, a kiket Kanaán bálványainak áldoztak, és megfertõzteték a föld öldökléssel."));
husuperobject.biblemap.put("b19_16_39", new husuperobject(19,16,39,"És tisztátalanokká lõnek cselekedeteikben, és paráznákká tetteikben."));
husuperobject.biblemap.put("b19_16_40", new husuperobject(19,16,40,"De felgyúlt az Úr haragja népe ellen, és megútálta az õ örökségét."));
husuperobject.biblemap.put("b19_16_41", new husuperobject(19,16,41,"És odaadá õket pogányok kezébe, és gyûlölõik uralkodtak rajtok."));
husuperobject.biblemap.put("b19_16_42", new husuperobject(19,16,42,"És sanyargatták õket ellenségeik, és görnyedtek azoknak hatalma alatt!"));
husuperobject.biblemap.put("b19_16_43", new husuperobject(19,16,43,"Számtalanszor megmentette õket, de õk felháboríták szándékaikkal, és mélyebben merültek bûneikbe."));
husuperobject.biblemap.put("b19_16_44", new husuperobject(19,16,44,"De reájok tekintett a nyomorúság napján, mikor meghallgatá rimánkodásukat;"));
husuperobject.biblemap.put("b19_16_45", new husuperobject(19,16,45,"És megemlékezett velök kötött szövetségérõl, és nagy kegyelmessége szerint megengesztelõdék."));
husuperobject.biblemap.put("b19_16_46", new husuperobject(19,16,46,"És könyörületességre indítá irántok mindazokat, a kik õket fogva elvivék."));
husuperobject.biblemap.put("b19_16_47", new husuperobject(19,16,47,"Segíts meg minket, Urunk Istenünk, és gyûjts össze minket a pogányok közül, hogy dicsõítsük a te szent nevedet, és dicsekedjünk a te dicséreteddel."));
husuperobject.biblemap.put("b19_16_48", new husuperobject(19,16,48,"Áldott legyen az Úr, Izráel Istene örökkön örökké, és minden nép mondja: Ámen. Dicsérjétek az Urat."));
husuperobject.biblemap.put("b19_17_1", new husuperobject(19,17,1,"Magasztaljátok az Urat, mert jó, mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_17_2", new husuperobject(19,17,2,"[Ezt] mondják az Úrnak megváltottai, a kiket megváltott a szorongatónak kezébõl;"));
husuperobject.biblemap.put("b19_17_3", new husuperobject(19,17,3,"És a kiket összegyûjtött a [különbözõ] földekrõl: napkelet és napnyugot felõl, északról és a tenger felõl."));
husuperobject.biblemap.put("b19_17_4", new husuperobject(19,17,4,"Bujdostak a pusztában, a sivatagban; lakó-város felé utat nem találtak vala."));
husuperobject.biblemap.put("b19_17_5", new husuperobject(19,17,5,"Éhesek és szomjasok valának; lelkök is elepedt bennök."));
husuperobject.biblemap.put("b19_17_6", new husuperobject(19,17,6,"De az Úrhoz kiáltának szorultságukban; sanyarúságukból megmenté õket."));
husuperobject.biblemap.put("b19_17_7", new husuperobject(19,17,7,"És vezeté õket egyenes útra, hogy lakó-városhoz juthassanak."));
husuperobject.biblemap.put("b19_17_8", new husuperobject(19,17,8,"Adjanak hálát az Úrnak az õ kegyelméért, és az ember[ek] fiai iránt való csodadolgaiért,"));
husuperobject.biblemap.put("b19_17_9", new husuperobject(19,17,9,"Hogy megelégíté a szomjúhozó lelket, és az éhezõ lelket betölté jóval!"));
husuperobject.biblemap.put("b19_17_10", new husuperobject(19,17,10,"A kik setétségben és a halálnak árnyékában ülnek, megkötöztetvén nyomorúsággal és vassal;"));
husuperobject.biblemap.put("b19_17_11", new husuperobject(19,17,11,"Mert ellenszegültek az Isten beszédének, és a Felségesnek tanácsát megútálták;"));
husuperobject.biblemap.put("b19_17_12", new husuperobject(19,17,12,"Azért megalázta az õ szívöket nyomorúsággal: elestek és nem volt segítségök."));
husuperobject.biblemap.put("b19_17_13", new husuperobject(19,17,13,"De az Úrhoz kiáltának szorultságukban, sanyarúságukból kiszabadítá õket."));
husuperobject.biblemap.put("b19_17_14", new husuperobject(19,17,14,"Kihozá õket a setétségbõl és a halálnak árnyékából, köteleiket pedig elszaggatá."));
husuperobject.biblemap.put("b19_17_15", new husuperobject(19,17,15,"Adjanak hálát az Úrnak az õ kegyelméért, és az ember[ek] fiai iránt való csodadolgaiért,"));
husuperobject.biblemap.put("b19_17_16", new husuperobject(19,17,16,"Hogy összetöré az ércz-kapukat, és a vas-zárakat letördelé!"));
husuperobject.biblemap.put("b19_17_17", new husuperobject(19,17,17,"A balgatagok az õ gonoszságuknak útjáért, és az õ hamisságukért nyomorgattattak."));
husuperobject.biblemap.put("b19_17_18", new husuperobject(19,17,18,"Minden étket útála az õ lelkök, és a halál kapujához közelgetének."));
husuperobject.biblemap.put("b19_17_19", new husuperobject(19,17,19,"De az Úrhoz kiáltának szorultságukban: sanyarúságukból kiszabadította õket."));
husuperobject.biblemap.put("b19_17_20", new husuperobject(19,17,20,"Kibocsátá az õ szavát és meggyógyítá õket, és kimenté õket az õ vermeikbõl."));
husuperobject.biblemap.put("b19_17_21", new husuperobject(19,17,21,"Adjanak hálát az Úrnak az õ kegyelméért, és az ember[ek] fiai iránt való csodadolgaiért,"));
husuperobject.biblemap.put("b19_17_22", new husuperobject(19,17,22,"És áldozzanak hálaadásnak áldozataival, és hirdessék az õ cselekedeteit örvendezéssel!"));
husuperobject.biblemap.put("b19_17_23", new husuperobject(19,17,23,"A kik hajókon tengerre szállnak, [és] a nagy vizeken kalmárkodnak,"));
husuperobject.biblemap.put("b19_17_24", new husuperobject(19,17,24,"Azok látták az Úrnak dolgait, és az õ csodáit a mélységben."));
husuperobject.biblemap.put("b19_17_25", new husuperobject(19,17,25,"Szólott ugyanis és szélvészt támaszta, a mely felduzzasztá a habokat."));
husuperobject.biblemap.put("b19_17_26", new husuperobject(19,17,26,"Az égig emelkedének, a fenékig sülyedének; lelkök elolvada az inségben."));
husuperobject.biblemap.put("b19_17_27", new husuperobject(19,17,27,"Szédülének és tántorgának, mint a részeg, és minden bölcsességöknek esze vész vala."));
husuperobject.biblemap.put("b19_17_28", new husuperobject(19,17,28,"De az Úrhoz kiáltának az õ szorultságukban, és sanyarúságukból kivezeté õket."));
husuperobject.biblemap.put("b19_17_29", new husuperobject(19,17,29,"Megállítá a szélvészt, hogy csillapodjék, és megcsendesedtek a habok."));
husuperobject.biblemap.put("b19_17_30", new husuperobject(19,17,30,"És örülének, hogy lecsillapodtak vala, és vezérlé õket az õ kivánságuknak partjára."));
husuperobject.biblemap.put("b19_17_31", new husuperobject(19,17,31,"Adjanak hálát az Úrnak az õ kegyelméért, és az ember[ek] fiai iránt való csodadolgaiért!"));
husuperobject.biblemap.put("b19_17_32", new husuperobject(19,17,32,"És magasztalják fel õt a népnek gyülekezetében, és dicsérjék õt a vének ülésében!"));
husuperobject.biblemap.put("b19_17_33", new husuperobject(19,17,33,"Folyóvizeket tett vala pusztává, és vízforrásokat szárazzá;"));
husuperobject.biblemap.put("b19_17_34", new husuperobject(19,17,34,"Gyümölcstermõ földet meddõ földdé, a rajta lakó népnek gonoszsága miatt."));
husuperobject.biblemap.put("b19_17_35", new husuperobject(19,17,35,"Pusztaságot tett vala álló tavakká, és kiaszott földet vízforrásokká."));
husuperobject.biblemap.put("b19_17_36", new husuperobject(19,17,36,"És telepített oda éhezõket, hogy lakó-városokat építsenek."));
husuperobject.biblemap.put("b19_17_37", new husuperobject(19,17,37,"És mezõket vetének be és szõlõket plántálának, hogy hasznos gyümölcsöt szerezzenek."));
husuperobject.biblemap.put("b19_17_38", new husuperobject(19,17,38,"És megáldá õket és igen megszaporodának, és barmaikat sem kevesbítette meg."));
husuperobject.biblemap.put("b19_17_39", new husuperobject(19,17,39,"De megkevesedtek és meggörnyedtek vala ínség, nyomorúság és keserûség miatt."));
husuperobject.biblemap.put("b19_17_40", new husuperobject(19,17,40,"Gyalázatot zúdított a fejedelmekre, és bujdostatta õket út nélkül való kietlenben."));
husuperobject.biblemap.put("b19_17_41", new husuperobject(19,17,41,"De felemelé a nyomorultat az ínségbõl, és hasonlóvá tette a nemzetségeket a juhnyájhoz."));
husuperobject.biblemap.put("b19_17_42", new husuperobject(19,17,42,"Látják az igazak és örvendeznek, és minden gonoszság megtartóztatja az õ száját."));
husuperobject.biblemap.put("b19_17_43", new husuperobject(19,17,43,"A bölcs, az eszébe veszi ezeket, és meggondolják az Úrnak kegyelmességét!"));
husuperobject.biblemap.put("b19_18_1", new husuperobject(19,18,1,"Ének. Dávid zsoltára."));
husuperobject.biblemap.put("b19_18_2", new husuperobject(19,18,2,"Kész az én szívem, oh Isten, hadd énekeljek és zengedezzek; az én dicsõségem is [kész.]"));
husuperobject.biblemap.put("b19_18_3", new husuperobject(19,18,3,"Serkenj fel te lant és hárfa, hadd keltsem fel a hajnalt!"));
husuperobject.biblemap.put("b19_18_4", new husuperobject(19,18,4,"Hálát adok néked a népek között Uram, és zengedezek néked a nemzetek között!"));
husuperobject.biblemap.put("b19_18_5", new husuperobject(19,18,5,"Mert nagy, egek felett való a te kegyelmed, és a felhõkig ér a te hûséges voltod!"));
husuperobject.biblemap.put("b19_18_6", new husuperobject(19,18,6,"Magasztaltassál fel, oh Isten, az egek felett, és dicsõséged legyen az egész földön!"));
husuperobject.biblemap.put("b19_18_7", new husuperobject(19,18,7,"Hogy megszabaduljanak a te szeretteid, segíts a te jobb kezeddel és hallgass meg engem!"));
husuperobject.biblemap.put("b19_18_8", new husuperobject(19,18,8,"Az õ szentélyében szólott az Isten: Örvendezek, hogy eloszthatom Sikhemet, és felmérhetem Sukkothnak völgyét."));
husuperobject.biblemap.put("b19_18_9", new husuperobject(19,18,9,"Enyém Gileád, enyém Manassé; Efraim az én fejemnek védelme, Júda az én törvényrendelõm."));
husuperobject.biblemap.put("b19_18_10", new husuperobject(19,18,10,"Moáb az én mosdómedenczém, Edomra az én saruimat vetem, Filistea felett kaczagok."));
husuperobject.biblemap.put("b19_18_11", new husuperobject(19,18,11,"Kicsoda visz el engem a kerített városba? kicsoda vezérel engem Edomig?"));
husuperobject.biblemap.put("b19_18_12", new husuperobject(19,18,12,"Nem te vagy-é, oh Isten, a ki megvetettél minket, hogy ki ne menj, oh Isten, a mi seregeinkkel?"));
husuperobject.biblemap.put("b19_18_13", new husuperobject(19,18,13,"Adj szabadulást nékünk az ellenségtõl, mert hiábavaló az emberi segítség! [ (Psalms 108:14) Istennel hatalmasan cselekszünk, és õ megtapodja ellenségeinket. ]"));
husuperobject.biblemap.put("b19_19_1", new husuperobject(19,19,1,"Az éneklõmesternek, Dávidé; zsoltár."));
husuperobject.biblemap.put("b19_19_2", new husuperobject(19,19,2,"Mert a gonosznak szája és az álnokságnak szája felnyilt ellenem, hazug nyelvvel beszélnek én velem."));
husuperobject.biblemap.put("b19_19_3", new husuperobject(19,19,3,"És körülvesznek engem gyûlölséges beszédekkel, és ostromolnak engem ok nélkül."));
husuperobject.biblemap.put("b19_19_4", new husuperobject(19,19,4,"Szeretetemért ellenkeznek velem, én pedig imádkozom."));
husuperobject.biblemap.put("b19_19_5", new husuperobject(19,19,5,"Roszszal fizetnek nékem a jóért, és gyûlölséggel az én szeretetemért."));
husuperobject.biblemap.put("b19_19_6", new husuperobject(19,19,6,"Állíts fölibe gonoszt, és vádló álljon az õ jobb keze felõl."));
husuperobject.biblemap.put("b19_19_7", new husuperobject(19,19,7,"Mikor törvénykezik, mint gonosz jõjjön ki; még az imádsága is bûnné legyen."));
husuperobject.biblemap.put("b19_19_8", new husuperobject(19,19,8,"Életének napjai kevesek legyenek, és a hivatalát más foglalja el."));
husuperobject.biblemap.put("b19_19_9", new husuperobject(19,19,9,"Fiai legyenek árvákká, a felesége pedig özvegygyé."));
husuperobject.biblemap.put("b19_19_10", new husuperobject(19,19,10,"És bujdossanak az õ fiai és kolduljanak, és elpusztult helyeiktõl távol keressenek [eledelt.]"));
husuperobject.biblemap.put("b19_19_11", new husuperobject(19,19,11,"Foglalja le minden jószágát az uzsorás, és idegenek ragadozzák el szerzeményét."));
husuperobject.biblemap.put("b19_19_12", new husuperobject(19,19,12,"Ne legyen néki, a ki kegyelmet mutasson [iránta,] és ne legyen, a ki könyörüljön az õ árváin!"));
husuperobject.biblemap.put("b19_19_13", new husuperobject(19,19,13,"Veszszen ki az õ maradéka; a második nemzedékben töröltessék el a nevök!"));
husuperobject.biblemap.put("b19_19_14", new husuperobject(19,19,14,"Atyáinak álnoksága emlékezetben legyen az Úr elõtt, és anyjának bûne el ne töröltessék!"));
husuperobject.biblemap.put("b19_19_15", new husuperobject(19,19,15,"Mindenkor az Úr elõtt legyenek, és emlékezetök is veszszen ki e földrõl,"));
husuperobject.biblemap.put("b19_19_16", new husuperobject(19,19,16,"A miatt, hogy nem gondolt arra, hogy kegyelmet gyakoroljon és üldözte a szegény és nyomorult embert, és a megkeseredett szívût, hogy megölje."));
husuperobject.biblemap.put("b19_19_17", new husuperobject(19,19,17,"Mivelhogy szerette az átkot, azért érte el õt; és mivel nem volt kedve az áldáshoz, azért távozék az el õ tõle."));
husuperobject.biblemap.put("b19_19_18", new husuperobject(19,19,18,"Úgy öltözte fel az átkot, mint a ruháját, azért ment beléje, mint a víz, és az õ csontjaiba, mint az olaj."));
husuperobject.biblemap.put("b19_19_19", new husuperobject(19,19,19,"Legyen az néki palástul, a melybe beburkolódzik, és övül, a melylyel mindenkor övezze magát."));
husuperobject.biblemap.put("b19_19_20", new husuperobject(19,19,20,"Ez legyen jutalmok az Úrtól az én vádolóimnak, és a kik rosszat beszélnek az én lelkemre."));
husuperobject.biblemap.put("b19_19_21", new husuperobject(19,19,21,"De te, én Uram, Istenem, bánj velem a te nevedért; mivelhogy jó a te kegyelmed, szabadíts meg engem!"));
husuperobject.biblemap.put("b19_19_22", new husuperobject(19,19,22,"Mert szegény és nyomorult vagyok én, még a szívem is megsebesíttetett én bennem."));
husuperobject.biblemap.put("b19_19_23", new husuperobject(19,19,23,"Úgy hanyatlom el, mint az árnyék az õ megnyúlásakor; ide s tova hányattatom, mint a sáska."));
husuperobject.biblemap.put("b19_19_24", new husuperobject(19,19,24,"Térdeim tántorognak az éhségtõl, és testem megfogyatkozott a kövérségtõl."));
husuperobject.biblemap.put("b19_19_25", new husuperobject(19,19,25,"Sõt gyalázatossá lettem elõttök; ha látnak engem, fejöket csóválják."));
husuperobject.biblemap.put("b19_19_26", new husuperobject(19,19,26,"Segíts meg engem, Uram Isten; szabadíts meg engem a te kegyelmed szerint!"));
husuperobject.biblemap.put("b19_19_27", new husuperobject(19,19,27,"Hadd tudják meg, hogy a te kezed [munkája] ez, hogy te cselekedted ezt, Uram!"));
husuperobject.biblemap.put("b19_19_28", new husuperobject(19,19,28,"Átkozzanak õk, de te áldj meg! Feltámadnak, de szégyenüljenek meg és örvendezzen a te szolgád."));
husuperobject.biblemap.put("b19_19_29", new husuperobject(19,19,29,"Öltözzenek az én vádlóim gyalázatba, és burkolózzanak szégyenökbe, mint egy köpenybe!"));
husuperobject.biblemap.put("b19_19_30", new husuperobject(19,19,30,"Hálát adok az Úrnak felettébb az én számmal, és dicsérem õt a sokaság közepette!"));
husuperobject.biblemap.put("b19_19_31", new husuperobject(19,19,31,"Mert jobb keze felõl áll a szegénynek, hogy megszabadítsa azoktól, a kik elítélik annak lelkét."));
husuperobject.biblemap.put("b19_110_1", new husuperobject(19,110,1,"Dávidé; zsoltár."));
husuperobject.biblemap.put("b19_110_2", new husuperobject(19,110,2,"A te hatalmad pálczáját kinyújtja az Úr Sionból, [mondván:] Uralkodjál ellenségeid között!"));
husuperobject.biblemap.put("b19_110_3", new husuperobject(19,110,3,"A te néped készséggel siet a te sereggyûjtésed napján, szentséges öltözetekben; hajnalpir méhébõl leszen ifjaidnak harmatja."));
husuperobject.biblemap.put("b19_110_4", new husuperobject(19,110,4,"Megesküdt az Úr és meg nem másítja: Pap vagy te örökké Melkhisedek rendje szerint."));
husuperobject.biblemap.put("b19_110_5", new husuperobject(19,110,5,"Az Úr a te jobbod felõl; megrontja az õ haragja napján a királyokat;"));
husuperobject.biblemap.put("b19_110_6", new husuperobject(19,110,6,"Ítéletet tart a nemzetek között; telve lesz holttestekkel; összezúz messze földön minden fõt."));
husuperobject.biblemap.put("b19_110_7", new husuperobject(19,110,7,"Az út mellett való patakból iszik; ezért emeli fel az õ fejét."));
husuperobject.biblemap.put("b19_111_1", new husuperobject(19,111,1,"Dícsérjétek az Urat."));
husuperobject.biblemap.put("b19_111_2", new husuperobject(19,111,2,"Nagyok az Úrnak cselekedetei; kivánatosak mindazoknak, a kik gyönyörködnek azokban."));
husuperobject.biblemap.put("b19_111_3", new husuperobject(19,111,3,"Dicsõség és méltóság az õ cselekedete, és igazsága megmarad mindvégig."));
husuperobject.biblemap.put("b19_111_4", new husuperobject(19,111,4,"Emlékezetet szerzett az õ csudálatos dolgainak; kegyelmes és irgalmas az Úr."));
husuperobject.biblemap.put("b19_111_5", new husuperobject(19,111,5,"Eledelt ad az õt félõknek; megemlékezik az õ szövetségérõl örökké."));
husuperobject.biblemap.put("b19_111_6", new husuperobject(19,111,6,"Cselekedeteinek erejét tudtul adta az õ népének, nékik adván a pogányok örökségét."));
husuperobject.biblemap.put("b19_111_7", new husuperobject(19,111,7,"Kezeinek cselekedetei hûség és igazság; minden õ végzése tökéletes."));
husuperobject.biblemap.put("b19_111_8", new husuperobject(19,111,8,"Megingathatlanok örökké és mindvégig; hívségbõl és egyenességbõl származottak."));
husuperobject.biblemap.put("b19_111_9", new husuperobject(19,111,9,"Váltságot küldött az õ népének, elrendelte szövetségét örökre; szent és rettenetes az õ neve."));
husuperobject.biblemap.put("b19_111_10", new husuperobject(19,111,10,"A bölcseség kezdete az Úrnak félelme; jó belátása van mindenkinek, a ki ezt gyakorolja; annak dicsérete megmarad mindvégig."));
husuperobject.biblemap.put("b19_112_1", new husuperobject(19,112,1,"Dicsérjétek az Urat."));
husuperobject.biblemap.put("b19_112_2", new husuperobject(19,112,2,"Hõs lesz annak magva a földön; a hívek nemzedéke megáldatik."));
husuperobject.biblemap.put("b19_112_3", new husuperobject(19,112,3,"Gazdagság és bõség lesz annak házában, s igazsága mindvégig megmarad."));
husuperobject.biblemap.put("b19_112_4", new husuperobject(19,112,4,"Az igazakra világosság fénylik a sötétben: [attól a ki] irgalmas, kegyelmes és igaz."));
husuperobject.biblemap.put("b19_112_5", new husuperobject(19,112,5,"Jó annak az embernek, a ki könyörül és kölcsön ad; dolgait pedig igazán végezi."));
husuperobject.biblemap.put("b19_112_6", new husuperobject(19,112,6,"Mivelhogy soha sem ingadoz: örök emlékezetben lesz az igaz."));
husuperobject.biblemap.put("b19_112_7", new husuperobject(19,112,7,"Semmi rossz hírtõl nem fél; szíve erõs, az Úrban bizakodó."));
husuperobject.biblemap.put("b19_112_8", new husuperobject(19,112,8,"Rendületlen az õ szíve; nem fél, míglen ellenségeire lenéz."));
husuperobject.biblemap.put("b19_112_9", new husuperobject(19,112,9,"Osztogat, adakozik a szegényeknek; igazsága megmarad mindvégig; az õ szarva felemeltetik dicsõséggel."));
husuperobject.biblemap.put("b19_112_10", new husuperobject(19,112,10,"Látja [ezt] a gonosz és dühöng; fogait csikorgatja és eleped; a gonoszok kivánsága semmivé lesz."));
husuperobject.biblemap.put("b19_113_1", new husuperobject(19,113,1,"Dicsérjétek az Urat."));
husuperobject.biblemap.put("b19_113_2", new husuperobject(19,113,2,"Áldott legyen az Úr neve mostantól fogva és örökké!"));
husuperobject.biblemap.put("b19_113_3", new husuperobject(19,113,3,"Napkelettõl fogva napnyugotig dicsértessék az Úr neve!"));
husuperobject.biblemap.put("b19_113_4", new husuperobject(19,113,4,"Felmagasztaltatott az Úr minden pogány nép felett; dicsõsége túl van az egeken."));
husuperobject.biblemap.put("b19_113_5", new husuperobject(19,113,5,"Kicsoda hasonló az Úrhoz, a mi Istenünkhöz, a ki a magasságban lakozik?"));
husuperobject.biblemap.put("b19_113_6", new husuperobject(19,113,6,"A ki magát megalázva, tekint szét mennyen és földön;"));
husuperobject.biblemap.put("b19_113_7", new husuperobject(19,113,7,"A ki felemeli az alacsonyt a porból, és a szûkölködõt kivonszsza a sárból,"));
husuperobject.biblemap.put("b19_113_8", new husuperobject(19,113,8,"Hogy odaültesse õket a fõemberek közé, az õ népének fõemberei közé;"));
husuperobject.biblemap.put("b19_113_9", new husuperobject(19,113,9,"A ki beülteti a meddõt a házba, mint magzatoknak anyját, nagy örömre. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_114_1", new husuperobject(19,114,1,"Mikor Izráel népe kijöve Égyiptomból, Jákóbnak házanépe az idegen nép közül:"));
husuperobject.biblemap.put("b19_114_2", new husuperobject(19,114,2,"Júda lõn az õ szentséges [népe] és Izráel az õ királysága."));
husuperobject.biblemap.put("b19_114_3", new husuperobject(19,114,3,"A tenger látá õt és elfutamodék; a Jordán hátrafordula."));
husuperobject.biblemap.put("b19_114_4", new husuperobject(19,114,4,"A hegyek szöknek vala, mint a kosok, s a halmok, mint a juhoknak bárányai."));
husuperobject.biblemap.put("b19_114_5", new husuperobject(19,114,5,"Mi a bajod, te tenger, hogy megfutamodál, és te Jordán, hogy hátrafordulál?"));
husuperobject.biblemap.put("b19_114_6", new husuperobject(19,114,6,"Hegyek, hogy szöktök vala, mint a kosok? Ti halmok, mint a juhoknak bárányai?"));
husuperobject.biblemap.put("b19_114_7", new husuperobject(19,114,7,"Indulj meg te föld az Úr orczája elõtt, a Jákób Istene elõtt,"));
husuperobject.biblemap.put("b19_114_8", new husuperobject(19,114,8,"A ki átváltoztatja a kõsziklát álló tóvá, és a szirtet vizek forrásává."));
husuperobject.biblemap.put("b19_115_1", new husuperobject(19,115,1,"Nem nékünk Uram, nem nékünk, hanem a te nevednek adj dicsõséget, a te kegyelmedért és hívségedért!"));
husuperobject.biblemap.put("b19_115_2", new husuperobject(19,115,2,"Miért mondanák a pogányok: Hol van hát az õ Istenök?"));
husuperobject.biblemap.put("b19_115_3", new husuperobject(19,115,3,"Pedig a mi Istenünk az égben van, és a mit akar, azt mind megcselekszi."));
husuperobject.biblemap.put("b19_115_4", new husuperobject(19,115,4,"Azoknak bálványa ezüst és arany, emberi kezek munkája."));
husuperobject.biblemap.put("b19_115_5", new husuperobject(19,115,5,"Szájok van, de nem szólanak; szemeik vannak, de nem látnak;"));
husuperobject.biblemap.put("b19_115_6", new husuperobject(19,115,6,"Füleik vannak, de nem hallanak; orruk van, de nem szagolnak;"));
husuperobject.biblemap.put("b19_115_7", new husuperobject(19,115,7,"Kezeik vannak, de nem tapintanak, lábaik vannak, de nem járnak, nem szólanak az õ torkukkal."));
husuperobject.biblemap.put("b19_115_8", new husuperobject(19,115,8,"Hasonlók legyenek azokhoz készítõik, [és] mindazok, a kik bíznak bennök!"));
husuperobject.biblemap.put("b19_115_9", new husuperobject(19,115,9,"Izráel! te az Úrban bízzál; az ilyenek segítsége és paizsa õ."));
husuperobject.biblemap.put("b19_115_10", new husuperobject(19,115,10,"Áronnak háza! az Úrban bízzál; az ilyenek segítsége és paizsa õ."));
husuperobject.biblemap.put("b19_115_11", new husuperobject(19,115,11,"A kik félitek az Urat, az Úrban bízzatok; az ilyenek segítsége és paizsa õ."));
husuperobject.biblemap.put("b19_115_12", new husuperobject(19,115,12,"Az Úr megemlékezik mi rólunk [és] megáld [minket]; megáldja Izráel házát, megáldja Áronnak házát."));
husuperobject.biblemap.put("b19_115_13", new husuperobject(19,115,13,"Megáldja azokat, a kik félik az Urat, a kicsinyeket és a nagyokat."));
husuperobject.biblemap.put("b19_115_14", new husuperobject(19,115,14,"Szaporítson titeket az Úr, titeket és a ti fiaitokat."));
husuperobject.biblemap.put("b19_115_15", new husuperobject(19,115,15,"Áldottai vagytok ti az Úrnak, a ki teremtette a mennyet és a földet."));
husuperobject.biblemap.put("b19_115_16", new husuperobject(19,115,16,"Az egek az Úrnak egei, de a földet az ember fiainak adta."));
husuperobject.biblemap.put("b19_115_17", new husuperobject(19,115,17,"Nem a meghaltak dicsérik az Urat, sem nem azok, a kik alászállanak a csendességbe."));
husuperobject.biblemap.put("b19_115_18", new husuperobject(19,115,18,"De mi áldjuk az Urat mostantól fogva mindörökké. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_116_1", new husuperobject(19,116,1,"Szeretem az Urat, mert meghallgatja esedezéseim szavát."));
husuperobject.biblemap.put("b19_116_2", new husuperobject(19,116,2,"Mert az õ fülét felém fordítja, azért segítségül hívom õt egész életemben."));
husuperobject.biblemap.put("b19_116_3", new husuperobject(19,116,3,"Körülvettek engem a halál kötelei, és a pokol szorongattatásai támadtak meg engem; nyomorúságba és ínségbe jutottam."));
husuperobject.biblemap.put("b19_116_4", new husuperobject(19,116,4,"És az Úrnak nevét segítségül hívám: Kérlek Uram, szabadítsd meg az én lelkemet!"));
husuperobject.biblemap.put("b19_116_5", new husuperobject(19,116,5,"Az Úr kegyelmes és igaz, és a mi Istenünk irgalmas."));
husuperobject.biblemap.put("b19_116_6", new husuperobject(19,116,6,"Az Úr megõrzi az alázatosokat; én ügyefogyott voltam és megszabadított engem."));
husuperobject.biblemap.put("b19_116_7", new husuperobject(19,116,7,"Térj meg én lelkem a te nyugodalmadba, mert az Úr jól tett teveled."));
husuperobject.biblemap.put("b19_116_8", new husuperobject(19,116,8,"Minthogy megszabadítottad lelkemet a haláltól, szemeimet a könyhullatástól [és] lábamat az eséstõl:"));
husuperobject.biblemap.put("b19_116_9", new husuperobject(19,116,9,"Az Úr orczája elõtt fogok járni az élõknek földén."));
husuperobject.biblemap.put("b19_116_10", new husuperobject(19,116,10,"Hittem, azért szóltam; [noha] igen megaláztatott valék."));
husuperobject.biblemap.put("b19_116_11", new husuperobject(19,116,11,"Csüggedezésemben ezt mondtam én: Minden ember hazug."));
husuperobject.biblemap.put("b19_116_12", new husuperobject(19,116,12,"Mivel fizessek az Úrnak minden hozzám való jótéteményéért?"));
husuperobject.biblemap.put("b19_116_13", new husuperobject(19,116,13,"A szabadulásért való poharat felemelem, és az Úrnak nevét hívom segítségül."));
husuperobject.biblemap.put("b19_116_14", new husuperobject(19,116,14,"Az Úr iránt való fogadásaimat megadom az õ egész népe elõtt."));
husuperobject.biblemap.put("b19_116_15", new husuperobject(19,116,15,"Az Úr szemei elõtt drága az õ kegyeseinek halála."));
husuperobject.biblemap.put("b19_116_16", new husuperobject(19,116,16,"Uram! én bizonyára a te szolgád vagyok; szolgád vagyok én, a te szolgáló leányodnak fia, te oldoztad ki az én köteleimet."));
husuperobject.biblemap.put("b19_116_17", new husuperobject(19,116,17,"Néked áldozom hálaadásnak áldozatával, és az Úr nevét hívom segítségül."));
husuperobject.biblemap.put("b19_116_18", new husuperobject(19,116,18,"Az Úr iránt való fogadásaimat megadom az õ egész népe elõtt,"));
husuperobject.biblemap.put("b19_116_19", new husuperobject(19,116,19,"Az Úr házának tornáczaiban, te benned, oh Jeruzsálem! Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_117_1", new husuperobject(19,117,1,"Dicsérjétek az Urat mind, ti pogányok; magasztalják õt mind a népek!"));
husuperobject.biblemap.put("b19_117_2", new husuperobject(19,117,2,"Mert nagy az õ kegyelmessége mi hozzánk, és az Úrnak igazsága megmarad örökké. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_118_1", new husuperobject(19,118,1,"Magasztaljátok az Urat, mert jó, mert örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_118_2", new husuperobject(19,118,2,"Mondja hát Izráel, hogy örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_118_3", new husuperobject(19,118,3,"Mondja hát az Áron háza, hogy örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_118_4", new husuperobject(19,118,4,"Mondják hát, a kik félik az Urat, hogy örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_118_5", new husuperobject(19,118,5,"Szükségemben segítségül hívám az Urat, meghallgatott [és] tágas térre [tett] engem az Úr."));
husuperobject.biblemap.put("b19_118_6", new husuperobject(19,118,6,"Velem van az Úr, nem félek; mit árthat nékem ember?"));
husuperobject.biblemap.put("b19_118_7", new husuperobject(19,118,7,"Velem van az Úr az én segítõim közt, és nézni fogok az én gyûlölõimre."));
husuperobject.biblemap.put("b19_118_8", new husuperobject(19,118,8,"Jobb az Úrban bízni, mint emberekben reménykedni."));
husuperobject.biblemap.put("b19_118_9", new husuperobject(19,118,9,"Jobb az Úrban bízni, mint fõemberekben reménykedni."));
husuperobject.biblemap.put("b19_118_10", new husuperobject(19,118,10,"Körülvettek engem mind a pogányok, de az Úr nevében elvesztém õket."));
husuperobject.biblemap.put("b19_118_11", new husuperobject(19,118,11,"Körülvettek, bizony körülvettek engem, de az Úr nevében elvesztém õket."));
husuperobject.biblemap.put("b19_118_12", new husuperobject(19,118,12,"Körülvettek engem, mint méhek; eloltattak, mint tövis-tûz, mert az Úr nevében elvesztém õket."));
husuperobject.biblemap.put("b19_118_13", new husuperobject(19,118,13,"Igen taszítottál engem, hogy elessem; de az Úr megsegített engem."));
husuperobject.biblemap.put("b19_118_14", new husuperobject(19,118,14,"Erõsségem és énekem az Úr, és õ lõn nékem szabadulásul."));
husuperobject.biblemap.put("b19_118_15", new husuperobject(19,118,15,"Vígasságnak és szabadulásnak szava van az igazak sátoraiban: Az Úrnak jobbkeze hatalmasan cselekedett!"));
husuperobject.biblemap.put("b19_118_16", new husuperobject(19,118,16,"Az Úrnak jobbkeze felmagasztaltatott; az Úrnak jobbkeze hatalmasan cselekedett!"));
husuperobject.biblemap.put("b19_118_17", new husuperobject(19,118,17,"Nem halok meg, hanem élek, és hirdetem az Úrnak cselekedeteit!"));
husuperobject.biblemap.put("b19_118_18", new husuperobject(19,118,18,"Keményen megostorozott engem az Úr; de nem adott át engem a halálnak."));
husuperobject.biblemap.put("b19_118_19", new husuperobject(19,118,19,"Nyissátok meg nékem az igazságnak kapuit, hogy bemenjek azokon [és] dicsérjem az Urat!"));
husuperobject.biblemap.put("b19_118_20", new husuperobject(19,118,20,"Ez az Úrnak kapuja; igazak mennek be azon."));
husuperobject.biblemap.put("b19_118_21", new husuperobject(19,118,21,"Magasztallak téged, hogy meghallgattál, és szabadításomul lettél!"));
husuperobject.biblemap.put("b19_118_22", new husuperobject(19,118,22,"A kõ a melyet az építõk megvetettek, szegeletkõvé lett!"));
husuperobject.biblemap.put("b19_118_23", new husuperobject(19,118,23,"Az Úrtól lett ez, csodálatos ez a mi szemeink elõtt!"));
husuperobject.biblemap.put("b19_118_24", new husuperobject(19,118,24,"Ez a nap az, a melyet az Úr rendelt; örvendezzünk és vígadjunk ezen!"));
husuperobject.biblemap.put("b19_118_25", new husuperobject(19,118,25,"Oh Uram, segíts most; oh Uram, adj most jó elõmenetelt!"));
husuperobject.biblemap.put("b19_118_26", new husuperobject(19,118,26,"Áldott, a ki jõ az Úrnak nevében; áldunk titeket, a kik az Úr házából valók vagytok!"));
husuperobject.biblemap.put("b19_118_27", new husuperobject(19,118,27,"Isten az Úr és õ világosított meg minket. Kötelekkel kössétek az ünnepi áldozatot az oltár szarvához."));
husuperobject.biblemap.put("b19_118_28", new husuperobject(19,118,28,"Istenem vagy te, azért hálát adok néked! Én Istenem, magasztallak téged."));
husuperobject.biblemap.put("b19_118_29", new husuperobject(19,118,29,"Magasztaljátok az Urat, mert jó; mert örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_119_1", new husuperobject(19,119,1,"Boldogok, a kiknek útjok feddhetetlen, a kik az Úr törvényében járnak."));
husuperobject.biblemap.put("b19_119_2", new husuperobject(19,119,2,"Boldogok, a kik megõrzik az õ bizonyságait, [és] teljes szívbõl keresik õt."));
husuperobject.biblemap.put("b19_119_3", new husuperobject(19,119,3,"És nem cselekesznek hamisságot; az õ útaiban járnak."));
husuperobject.biblemap.put("b19_119_4", new husuperobject(19,119,4,"Te parancsoltad [Uram,] hogy határozataidat jól megõrizzük."));
husuperobject.biblemap.put("b19_119_5", new husuperobject(19,119,5,"Vajha igazgattatnának az én útaim a te rendeléseid megõrzésére!"));
husuperobject.biblemap.put("b19_119_6", new husuperobject(19,119,6,"Akkor nem szégyenülnék meg, ha figyelnék minden parancsolatodra!"));
husuperobject.biblemap.put("b19_119_7", new husuperobject(19,119,7,"Hálát adok néked tiszta szívbõl, hogy megtanítottál engem a te igazságod ítéleteire."));
husuperobject.biblemap.put("b19_119_8", new husuperobject(19,119,8,"A te rendeléseidet megõrzöm; soha ne hagyj el engem!"));
husuperobject.biblemap.put("b19_119_9", new husuperobject(19,119,9,"Mi módon õrizheti meg tisztán az ifjú az õ útát, ha nem a te beszédednek megtartása által?"));
husuperobject.biblemap.put("b19_119_10", new husuperobject(19,119,10,"Teljes szívbõl kerestelek téged: ne engedj eltévedeznem a te parancsolataidtól!"));
husuperobject.biblemap.put("b19_119_11", new husuperobject(19,119,11,"Szívembe rejtettem a te beszédedet, hogy ne vétkezzem ellened."));
husuperobject.biblemap.put("b19_119_12", new husuperobject(19,119,12,"Áldott vagy te, Uram! Taníts meg engem a te rendeléseidre."));
husuperobject.biblemap.put("b19_119_13", new husuperobject(19,119,13,"Ajkaimmal hirdetem a te szádnak minden ítéletét."));
husuperobject.biblemap.put("b19_119_14", new husuperobject(19,119,14,"Inkább gyönyörködöm a te bizonyságaidnak útjában, mint minden gazdagságban."));
husuperobject.biblemap.put("b19_119_15", new husuperobject(19,119,15,"A te határozataidról gondolkodom, és a te ösvényeidre nézek."));
husuperobject.biblemap.put("b19_119_16", new husuperobject(19,119,16,"Gyönyörködöm a te rendeléseidben; a te beszédedrõl nem feledkezem el."));
husuperobject.biblemap.put("b19_119_17", new husuperobject(19,119,17,"Tégy jól a te szolgáddal, hogy éljek és megtartsam a te beszédedet."));
husuperobject.biblemap.put("b19_119_18", new husuperobject(19,119,18,"Nyisd meg az én szemeimet, hogy szemléljem a te törvényednek csodálatos voltát."));
husuperobject.biblemap.put("b19_119_19", new husuperobject(19,119,19,"Jövevény vagyok e földön, ne rejtsd el tõlem a te parancsolataidat."));
husuperobject.biblemap.put("b19_119_20", new husuperobject(19,119,20,"Elfogyatkozik az én lelkem, a te ítéleteid után való szüntelen vágyódás miatt."));
husuperobject.biblemap.put("b19_119_21", new husuperobject(19,119,21,"Megdorgálod a kevélyeket; átkozottak, a kik elhajolnak parancsolataidtól."));
husuperobject.biblemap.put("b19_119_22", new husuperobject(19,119,22,"Fordítsd el rólam a szidalmat és gyalázatot, mert megõriztem a te bizonyságaidat!"));
husuperobject.biblemap.put("b19_119_23", new husuperobject(19,119,23,"Még ha fejedelmek összeülnek, ellenem beszélnek is; a te szolgád a te rendeléseidrõl gondolkodik."));
husuperobject.biblemap.put("b19_119_24", new husuperobject(19,119,24,"A te bizonyságaid én gyönyörûségem, [és] én tanácsadóim."));
husuperobject.biblemap.put("b19_119_25", new husuperobject(19,119,25,"Lelkem a porhoz tapad; eleveníts meg engem a te igéreted szerint."));
husuperobject.biblemap.put("b19_119_26", new husuperobject(19,119,26,"Útaimat elbeszéltem elõtted és te meghallgattál engem; taníts meg a te rendeléseidre!"));
husuperobject.biblemap.put("b19_119_27", new husuperobject(19,119,27,"Add értenem a te határozataidnak útát, hogy gondolkodjam a te csodálatos dolgaidról!"));
husuperobject.biblemap.put("b19_119_28", new husuperobject(19,119,28,"Sír a lelkem a keserûség miatt; vigasztalj meg a te igéd szerint!"));
husuperobject.biblemap.put("b19_119_29", new husuperobject(19,119,29,"A hamisságnak útját távoztasd el tõlem, és a te törvényeddel ajándékozz meg engem!"));
husuperobject.biblemap.put("b19_119_30", new husuperobject(19,119,30,"Az igazság útját választottam; a te ítéleteid forognak elõttem."));
husuperobject.biblemap.put("b19_119_31", new husuperobject(19,119,31,"Ragaszkodom a te bizonyságaidhoz; Uram, ne hagyj megszégyenülni!"));
husuperobject.biblemap.put("b19_119_32", new husuperobject(19,119,32,"A te parancsolataidnak útján járok, ha megvigasztalod az én szívemet!"));
husuperobject.biblemap.put("b19_119_33", new husuperobject(19,119,33,"Taníts meg Uram a te rendeléseidnek útjára, hogy megõrizzem azt mindvégig."));
husuperobject.biblemap.put("b19_119_34", new husuperobject(19,119,34,"Oktass, hogy megõrizzem a te törvényedet, és megtartsam azt teljes szívembõl."));
husuperobject.biblemap.put("b19_119_35", new husuperobject(19,119,35,"Vezérelj a te parancsolataidnak útján, mert gyönyörködöm abban."));
husuperobject.biblemap.put("b19_119_36", new husuperobject(19,119,36,"Hajtsd szívemet a te bizonyságaidhoz, és ne a telhetetlenségre."));
husuperobject.biblemap.put("b19_119_37", new husuperobject(19,119,37,"Fordítsd el az én szemeimet, hogy ne lássanak hiábavalóságot; a te útadon éltess engemet."));
husuperobject.biblemap.put("b19_119_38", new husuperobject(19,119,38,"Teljesítsd igéretedet a te szolgádnak, a ki fél téged."));
husuperobject.biblemap.put("b19_119_39", new husuperobject(19,119,39,"Fordítsd el tõlem a gyalázatot, a mitõl félek; hiszen jók a te ítéleteid."));
husuperobject.biblemap.put("b19_119_40", new husuperobject(19,119,40,"Ímé, kivánkozom a te határozataid után; éltess engem a te igazságod által."));
husuperobject.biblemap.put("b19_119_41", new husuperobject(19,119,41,"És szálljon reám, Uram, a te kegyelmed, a te szabadításod, a mint megigérted,"));
husuperobject.biblemap.put("b19_119_42", new husuperobject(19,119,42,"Hogy megfelelhessek az engem gyalázónak, hiszen bizodalmam van a te igédben!"));
husuperobject.biblemap.put("b19_119_43", new husuperobject(19,119,43,"És az igazságnak beszédét se vedd el soha az én számtól, mert várom a te ítéleteidet!"));
husuperobject.biblemap.put("b19_119_44", new husuperobject(19,119,44,"És megtartom a te törvényedet mindenkor és mindörökké."));
husuperobject.biblemap.put("b19_119_45", new husuperobject(19,119,45,"És tágas téren járok, mert a te határozataidat keresem."));
husuperobject.biblemap.put("b19_119_46", new husuperobject(19,119,46,"És a királyok elõtt szólok a te bizonyságaidról, és nem szégyenülök meg."));
husuperobject.biblemap.put("b19_119_47", new husuperobject(19,119,47,"És gyönyörködöm a te parancsolataidban, a melyeket szeretek."));
husuperobject.biblemap.put("b19_119_48", new husuperobject(19,119,48,"És felemelem kezeimet a te parancsolataidra, a melyeket szeretek, és gondolkodom a te rendeléseidrõl."));
husuperobject.biblemap.put("b19_119_49", new husuperobject(19,119,49,"Emlékezzél meg a te szolgádnak [adott] igédrõl, a melyhez nékem reménységet adtál!"));
husuperobject.biblemap.put("b19_119_50", new husuperobject(19,119,50,"Ez vigasztalásom nyomorúságomban, mert a te beszéded megelevenít engem."));
husuperobject.biblemap.put("b19_119_51", new husuperobject(19,119,51,"A kevélyek szerfelett gúnyoltak engem; nem hajlottam el a te törvényedtõl."));
husuperobject.biblemap.put("b19_119_52", new husuperobject(19,119,52,"Megemlékezem a te öröktõl fogva való ítéleteidrõl Uram, és vigasztalódom."));
husuperobject.biblemap.put("b19_119_53", new husuperobject(19,119,53,"Harag vett rajtam erõt az istentelenek miatt, a kik elhagyták a te törvényedet."));
husuperobject.biblemap.put("b19_119_54", new husuperobject(19,119,54,"Ének volt rám nézve minden parancsolatod bujdosásomnak hajlékában."));
husuperobject.biblemap.put("b19_119_55", new husuperobject(19,119,55,"Uram! a te nevedrõl emlékezem éjjel, és megtartom a te törvényedet."));
husuperobject.biblemap.put("b19_119_56", new husuperobject(19,119,56,"Ez jutott nékem, hogy a te határozataidat megõriztem."));
husuperobject.biblemap.put("b19_119_57", new husuperobject(19,119,57,"Azt mondám Uram, hogy az én részem a te beszédeidnek megtartása."));
husuperobject.biblemap.put("b19_119_58", new husuperobject(19,119,58,"Teljes szívbõl könyörgök a te színed elõtt: könyörülj rajtam a te igéreted szerint!"));
husuperobject.biblemap.put("b19_119_59", new husuperobject(19,119,59,"Meggondoltam az én útaimat, és lábaimat a te bizonyságaidhoz fordítom."));
husuperobject.biblemap.put("b19_119_60", new husuperobject(19,119,60,"Sietek és nem mulasztom el, hogy megtartsam a te parancsolataidat."));
husuperobject.biblemap.put("b19_119_61", new husuperobject(19,119,61,"Az istentelenek kötelei körülkerítettek engem; [de] a te törvényedrõl el nem feledkezem."));
husuperobject.biblemap.put("b19_119_62", new husuperobject(19,119,62,"Éjfélkor felkelek, hogy hálát adjak néked, igazságod ítéleteiért."));
husuperobject.biblemap.put("b19_119_63", new husuperobject(19,119,63,"Társok vagyok mindazoknak, a kik félnek téged, és a kik határozataidat megtartják."));
husuperobject.biblemap.put("b19_119_64", new husuperobject(19,119,64,"A te kegyelmeddel, oh Uram, teljes e föld: taníts meg engem rendeléseidre!"));
husuperobject.biblemap.put("b19_119_65", new husuperobject(19,119,65,"Jót cselekedtél a te szolgáddal, Uram, a te igéd szerint."));
husuperobject.biblemap.put("b19_119_66", new husuperobject(19,119,66,"Az okosságnak és tudománynak drága voltára taníts meg engem, mert hiszek a te parancsolataidnak."));
husuperobject.biblemap.put("b19_119_67", new husuperobject(19,119,67,"Minekelõtte megaláztattam, tévelyegtem vala; most pedig vigyázok a te szódra."));
husuperobject.biblemap.put("b19_119_68", new husuperobject(19,119,68,"Jó vagy te és jóltevõ, taníts meg engem a te rendeléseidre."));
husuperobject.biblemap.put("b19_119_69", new husuperobject(19,119,69,"A kevélyek hazugságot költöttek reám, [de] én teljes szívbõl megtartom a te parancsolataidat."));
husuperobject.biblemap.put("b19_119_70", new husuperobject(19,119,70,"Kövér az õ szívök, mint a háj; de én a te törvényedben gyönyörködöm."));
husuperobject.biblemap.put("b19_119_71", new husuperobject(19,119,71,"Jó nékem, hogy megaláztál, azért, hogy megtanuljam a te rendeléseidet."));
husuperobject.biblemap.put("b19_119_72", new husuperobject(19,119,72,"A te szádnak törvénye jobb nékem, mint sok ezer arany és ezüst."));
husuperobject.biblemap.put("b19_119_73", new husuperobject(19,119,73,"A te kezeid teremtettek és erõsítettek meg engem; oktass, hogy megtanuljam parancsolataidat."));
husuperobject.biblemap.put("b19_119_74", new husuperobject(19,119,74,"A kik téged félnek, látnak engem és örvendeznek, mivel a te igédben van az én reménységem."));
husuperobject.biblemap.put("b19_119_75", new husuperobject(19,119,75,"Tudom Uram, hogy a te ítéleteid igazak, és igazságosan aláztál meg engem."));
husuperobject.biblemap.put("b19_119_76", new husuperobject(19,119,76,"Legyen velem a te kegyelmed, hogy megvígasztalódjam a te szolgádnak tett igéreted szerint."));
husuperobject.biblemap.put("b19_119_77", new husuperobject(19,119,77,"Szálljon reám a te irgalmasságod, hogy éljek, mert a te törvényedben gyönyörködöm."));
husuperobject.biblemap.put("b19_119_78", new husuperobject(19,119,78,"Szégyenüljenek meg a kevélyek, a kik csalárdul elnyomtak engem, [holott] én a te határozataidról gondolkodom."));
husuperobject.biblemap.put("b19_119_79", new husuperobject(19,119,79,"Forduljanak hozzám, a kik téged félnek, és ismerik a te bizonyságaidat!"));
husuperobject.biblemap.put("b19_119_80", new husuperobject(19,119,80,"Legyen az én szívem feddhetetlen a te rendeléseidben, hogy meg ne szégyenüljek."));
husuperobject.biblemap.put("b19_119_81", new husuperobject(19,119,81,"Elfogyatkozik az én lelkem a te szabadításod [kivánása] miatt; a te igédben van az én reménységem."));
husuperobject.biblemap.put("b19_119_82", new husuperobject(19,119,82,"A te beszéded [kivánása] miatt elfogyatkoznak az én szemeim, mondván: mikor vígasztalsz meg engem?"));
husuperobject.biblemap.put("b19_119_83", new husuperobject(19,119,83,"Noha olyanná lettem, mint a füstön levõ tömlõ; a te rendeléseidrõl el nem feledkezem."));
husuperobject.biblemap.put("b19_119_84", new husuperobject(19,119,84,"Mennyi a te szolgádnak napja, [és] mikor tartasz ítéletet az én üldözõim felett?"));
husuperobject.biblemap.put("b19_119_85", new husuperobject(19,119,85,"Vermet ástak nékem a kevélyek, a kik nem a te törvényed szerint [élnek.]"));
husuperobject.biblemap.put("b19_119_86", new husuperobject(19,119,86,"Minden parancsolatod igaz; csalárdul üldöznek engem; segíts meg engem!"));
husuperobject.biblemap.put("b19_119_87", new husuperobject(19,119,87,"Csaknem semmivé tettek engem e földön, de én nem hagytam el a te határozataidat."));
husuperobject.biblemap.put("b19_119_88", new husuperobject(19,119,88,"A te kegyelmed szerint eleveníts meg engem, hogy megõrizhessem a te szádnak bizonyságait."));
husuperobject.biblemap.put("b19_119_89", new husuperobject(19,119,89,"Uram! örökké megmarad a te igéd a mennyben."));
husuperobject.biblemap.put("b19_119_90", new husuperobject(19,119,90,"Nemzedékrõl nemzedékre van a te igazságod, te erõsítetted meg a földet és áll az."));
husuperobject.biblemap.put("b19_119_91", new husuperobject(19,119,91,"A te ítéleteid szerint áll minden ma is; mert minden, a mi van, te néked szolgál."));
husuperobject.biblemap.put("b19_119_92", new husuperobject(19,119,92,"Ha nem a te törvényed lett volna az én gyönyörûségem, akkor elvesztem volna az én nyomorúságomban."));
husuperobject.biblemap.put("b19_119_93", new husuperobject(19,119,93,"Soha sem feledkezem el a te határozataidról, mert azok által elevenítettél meg engem."));
husuperobject.biblemap.put("b19_119_94", new husuperobject(19,119,94,"Tied vagyok, tarts meg engem, mert a te határozataidat keresem."));
husuperobject.biblemap.put("b19_119_95", new husuperobject(19,119,95,"Vártak rám a gonoszok, hogy elveszessenek, [de] én a te bizonyságaidra figyelek."));
husuperobject.biblemap.put("b19_119_96", new husuperobject(19,119,96,"Látom, minden tökéletes dolognak vége van, de a te parancsolatodnak nincs határa."));
husuperobject.biblemap.put("b19_119_97", new husuperobject(19,119,97,"Mely igen szeretem a te törvényedet, egész napestig arról gondolkodom!"));
husuperobject.biblemap.put("b19_119_98", new husuperobject(19,119,98,"Az én ellenségeimnél bölcsebbé teszel engem a te parancsolataiddal, mert mindenkor velem vannak azok."));
husuperobject.biblemap.put("b19_119_99", new husuperobject(19,119,99,"Minden tanítómnál értelmesebb lettem, mert a te bizonyságaid az én gondolataim."));
husuperobject.biblemap.put("b19_119_100", new husuperobject(19,119,100,"Elõrelátóbb vagyok, mint az öreg emberek, mert vigyázok a te határozataidra."));
husuperobject.biblemap.put("b19_119_11", new husuperobject(19,119,11,"Minden gonosz ösvénytõl visszatartóztattam lábaimat, hogy megtartsam a te beszédedet."));
husuperobject.biblemap.put("b19_119_12", new husuperobject(19,119,12,"Nem távoztam el a te ítéleteidtõl, mert te oktattál engem."));
husuperobject.biblemap.put("b19_119_13", new husuperobject(19,119,13,"Mily édes az én ínyemnek a te beszéded; méznél [édesbb] az az én számnak!"));
husuperobject.biblemap.put("b19_119_14", new husuperobject(19,119,14,"A te határozataidból leszek értelmes, gyûlölöm azért a hamisságnak minden ösvényét."));
husuperobject.biblemap.put("b19_119_15", new husuperobject(19,119,15,"Az én lábamnak szövétneke a te igéd, és ösvényemnek világossága."));
husuperobject.biblemap.put("b19_119_16", new husuperobject(19,119,16,"Megesküdtem és megállom, hogy megtartom a te igazságodnak ítéleteit."));
husuperobject.biblemap.put("b19_119_17", new husuperobject(19,119,17,"Felette nagy nyomorúságban vagyok; Uram, eleveníts meg a te igéd szerint."));
husuperobject.biblemap.put("b19_119_18", new husuperobject(19,119,18,"Szájamnak önkéntes áldozatai legyenek kedvesek elõtted Uram! és taníts meg a te ítéleteidre."));
husuperobject.biblemap.put("b19_119_19", new husuperobject(19,119,19,"Lelkem mindig veszedelemben van, mindazáltal a te törvényedrõl el nem feledkezem."));
husuperobject.biblemap.put("b19_119_110", new husuperobject(19,119,110,"Tõrt vetettek ellenem az istentelenek, de a te határozataidtól el nem tévelyedtem."));
husuperobject.biblemap.put("b19_119_111", new husuperobject(19,119,111,"A te bizonyságaid az én örökségem mindenha, mert szívemnek örömei azok."));
husuperobject.biblemap.put("b19_119_112", new husuperobject(19,119,112,"Az én szívem hajlik a te rendeléseid teljesítésére mindenha [és] mindvégig."));
husuperobject.biblemap.put("b19_119_113", new husuperobject(19,119,113,"Az állhatatlanokat gyûlölöm, de a te törvényedet szeretem."));
husuperobject.biblemap.put("b19_119_114", new husuperobject(19,119,114,"Menedékem és paizsom vagy te; igédben van az én reménységem."));
husuperobject.biblemap.put("b19_119_115", new husuperobject(19,119,115,"Távozzatok tõlem gonoszok, hogy megõrizzem az én Istenemnek parancsolatait."));
husuperobject.biblemap.put("b19_119_116", new husuperobject(19,119,116,"Támogass engem a te beszéded szerint, hogy éljek, és ne engedd, hogy megszégyenüljek reménységemben."));
husuperobject.biblemap.put("b19_119_117", new husuperobject(19,119,117,"Segélj, hogy megmaradjak, és gyönyörködjem a te rendeléseidben szüntelen."));
husuperobject.biblemap.put("b19_119_118", new husuperobject(19,119,118,"Megtapodod mindazokat, a kik rendeléseidtõl elhajolnak, mert az õ álnokságuk hazugság."));
husuperobject.biblemap.put("b19_119_119", new husuperobject(19,119,119,"Mint salakot mind elveted e földnek istenteleneit, azért szeretem a te bizonyságaidat."));
husuperobject.biblemap.put("b19_119_120", new husuperobject(19,119,120,"Borzad testem a tõled való félelem miatt, és félek a te ítéleteidtõl."));
husuperobject.biblemap.put("b19_119_121", new husuperobject(19,119,121,"Méltányosságot és igazságot cselekedtem; ne adj át nyomorgatóimnak!"));
husuperobject.biblemap.put("b19_119_122", new husuperobject(19,119,122,"Légy kezes a te szolgádért az õ javára, hogy a kevélyek el ne nyomjanak engem."));
husuperobject.biblemap.put("b19_119_123", new husuperobject(19,119,123,"Szemeim epekednek a te szabadításod és a te igazságod beszéde után."));
husuperobject.biblemap.put("b19_119_124", new husuperobject(19,119,124,"Cselekedjél a te szolgáddal a te kegyelmességed szerint, és a te rendeléseidre taníts meg engem!"));
husuperobject.biblemap.put("b19_119_125", new husuperobject(19,119,125,"Szolgád vagyok, oktass, hogy megismerjem a te bizonyságaidat!"));
husuperobject.biblemap.put("b19_119_126", new husuperobject(19,119,126,"Ideje, hogy az Úr cselekedjék; megrontották a te törvényedet."));
husuperobject.biblemap.put("b19_119_127", new husuperobject(19,119,127,"Inkább szeretem azért a te parancsolataidat, mint az aranyat, mint a legtisztább aranyat."));
husuperobject.biblemap.put("b19_119_128", new husuperobject(19,119,128,"Igaznak tartom azért minden határozatodat, és a hamisságnak minden ösvényét gyûlölöm."));
husuperobject.biblemap.put("b19_119_129", new husuperobject(19,119,129,"Csodálatosak a te bizonyságaid, azért az én lelkem megõrzi azokat."));
husuperobject.biblemap.put("b19_119_130", new husuperobject(19,119,130,"A te beszéded megnyilatkozása világosságot ad, [és] oktatja az együgyûeket."));
husuperobject.biblemap.put("b19_119_131", new husuperobject(19,119,131,"Szájamat feltátom és lihegek, mert kivánom a te parancsolataidat."));
husuperobject.biblemap.put("b19_119_132", new husuperobject(19,119,132,"Tekints reám és könyörülj rajtam, a miképen szoktál a te nevednek kedvelõin."));
husuperobject.biblemap.put("b19_119_133", new husuperobject(19,119,133,"Vezéreld útamat a te igéd szerint, és ne engedd, hogy valami hamisság uralkodjék rajtam!"));
husuperobject.biblemap.put("b19_119_134", new husuperobject(19,119,134,"Oltalmazz meg az emberek erõszakosságától, hogy megõrizzem a te határozataidat!"));
husuperobject.biblemap.put("b19_119_135", new husuperobject(19,119,135,"A te orczádat világosítsd meg a te szolgádon, és taníts meg a te rendeléseidre!"));
husuperobject.biblemap.put("b19_119_136", new husuperobject(19,119,136,"Víznek folyásai erednek az én szemeimbõl azok miatt, a kik nem tartják meg a te törvényedet."));
husuperobject.biblemap.put("b19_119_137", new husuperobject(19,119,137,"Igaz vagy Uram, és a te ítéleted igazságos."));
husuperobject.biblemap.put("b19_119_138", new husuperobject(19,119,138,"A te bizonyságaidat igazságban és hûségben jelentetted meg, és mindenek felett való egyenességben."));
husuperobject.biblemap.put("b19_119_139", new husuperobject(19,119,139,"Buzgóságom megemészt engem, mert elfeledkeztek a te beszédedrõl az én ellenségeim."));
husuperobject.biblemap.put("b19_119_140", new husuperobject(19,119,140,"Felettébb tiszta a te beszéded, és a te szolgád szereti azt."));
husuperobject.biblemap.put("b19_119_141", new husuperobject(19,119,141,"Kicsiny vagyok én és megvetett, [de] a te határozataidról el nem feledkezem."));
husuperobject.biblemap.put("b19_119_142", new husuperobject(19,119,142,"A te igazságod igazság örökké, és a te törvényed igaz."));
husuperobject.biblemap.put("b19_119_143", new husuperobject(19,119,143,"Nyomorúság és keserûség ért engem, [de] a te parancsolataid gyönyörûségeim nékem."));
husuperobject.biblemap.put("b19_119_144", new husuperobject(19,119,144,"A te bizonyságaidnak igazsága örökkévaló; oktass, hogy éljek!"));
husuperobject.biblemap.put("b19_119_145", new husuperobject(19,119,145,"Teljes szívbõl kiáltok hozzád, hallgass meg, Uram! megtartom a te rendeléseidet."));
husuperobject.biblemap.put("b19_119_146", new husuperobject(19,119,146,"Segítségül hívlak: tarts meg engem, és megõrzöm a te bizonyságaidat."));
husuperobject.biblemap.put("b19_119_147", new husuperobject(19,119,147,"Hajnal elõtt felkelek, kiáltok hozzád; a te beszédedben van reménységem."));
husuperobject.biblemap.put("b19_119_148", new husuperobject(19,119,148,"Szemeim megelõzik az éjjeli õrséget, hogy a te beszédedrõl gondolkodjam."));
husuperobject.biblemap.put("b19_119_149", new husuperobject(19,119,149,"Hallgasd meg az én szómat a te kegyelmességed szerint, Uram! Eleveníts meg a te jóvoltod szerint!"));
husuperobject.biblemap.put("b19_119_150", new husuperobject(19,119,150,"Közelgetnek [hozzám] az én gonosz háborgatóim, a kik a te törvényedtõl messze távoztak."));
husuperobject.biblemap.put("b19_119_151", new husuperobject(19,119,151,"Közel vagy te, Uram! és minden te parancsolatod igazság."));
husuperobject.biblemap.put("b19_119_152", new husuperobject(19,119,152,"Régtõl fogva tudom a te bizonyságaid felõl, hogy azokat örökké állandókká tetted."));
husuperobject.biblemap.put("b19_119_153", new husuperobject(19,119,153,"Lásd meg az én nyomorúságomat és szabadíts meg engem; mert a te törvényedrõl nem felejtkezem el!"));
husuperobject.biblemap.put("b19_119_154", new husuperobject(19,119,154,"Te perelj peremben és ments meg; a te beszéded szerint eleveníts meg engem!"));
husuperobject.biblemap.put("b19_119_155", new husuperobject(19,119,155,"Távol van a gonoszoktól a szabadítás, mert nem törõdnek a te rendeléseiddel."));
husuperobject.biblemap.put("b19_119_156", new husuperobject(19,119,156,"Nagy a te irgalmasságod, Uram! A te ítéletid szerint eleveníts meg engem."));
husuperobject.biblemap.put("b19_119_157", new husuperobject(19,119,157,"Sokan vannak az én háborgatóim és üldözõim, [de] nem térek el a te bizonyságaidtól."));
husuperobject.biblemap.put("b19_119_158", new husuperobject(19,119,158,"Láttam a hûteleneket és megundorodtam, hogy a te mondásodat meg nem tartják."));
husuperobject.biblemap.put("b19_119_159", new husuperobject(19,119,159,"Lásd meg Uram, hogy a te határozataidat szeretem; a te kegyelmességed szerint eleveníts meg engem!"));
husuperobject.biblemap.put("b19_119_160", new husuperobject(19,119,160,"A te igédnek summája igazság, és a te igazságod ítélete mind örökkévaló."));
husuperobject.biblemap.put("b19_119_161", new husuperobject(19,119,161,"A fejedelmek ok nélkül üldöztek engem; [de] a te igédtõl félt az én szívem."));
husuperobject.biblemap.put("b19_119_162", new husuperobject(19,119,162,"Gyönyörködöm a te beszédedben, mint a ki nagy nyereséget talált."));
husuperobject.biblemap.put("b19_119_163", new husuperobject(19,119,163,"A hamisságot gyûlölöm és útálom; a te törvényedet szeretem."));
husuperobject.biblemap.put("b19_119_164", new husuperobject(19,119,164,"Naponként hétszer dicsérlek téged, a te igazságodnak ítéleteiért."));
husuperobject.biblemap.put("b19_119_165", new husuperobject(19,119,165,"A te törvényed kedvelõinek nagy békességök van, és nincs bántódásuk."));
husuperobject.biblemap.put("b19_119_166", new husuperobject(19,119,166,"Várom a te szabadításodat, oh Uram! és a te parancsolataidat cselekszem."));
husuperobject.biblemap.put("b19_119_167", new husuperobject(19,119,167,"Az én lelkem megtartja a te bizonyságaidat, és azokat igen szeretem."));
husuperobject.biblemap.put("b19_119_168", new husuperobject(19,119,168,"Megtartom a te határozataidat és bizonyságaidat, mert minden útam nyilván van elõtted."));
husuperobject.biblemap.put("b19_119_169", new husuperobject(19,119,169,"Oh Uram! hadd szálljon az én könyörgésem a te színed elé; tégy bölcscsé engem a te igéd szerint."));
husuperobject.biblemap.put("b19_119_170", new husuperobject(19,119,170,"Jusson elõdbe az én imádságom; a te beszéded szerint szabadíts meg engem!"));
husuperobject.biblemap.put("b19_119_171", new husuperobject(19,119,171,"Ajkaim dicséretet zengjenek, mert megtanítasz a te rendeléseidre."));
husuperobject.biblemap.put("b19_119_172", new husuperobject(19,119,172,"Nyelvem a te beszédedrõl énekel, mert minden parancsolatod igaz."));
husuperobject.biblemap.put("b19_119_173", new husuperobject(19,119,173,"Legyen segítségemre a te kezed, mert a te határozataidat választottam!"));
husuperobject.biblemap.put("b19_119_174", new husuperobject(19,119,174,"Uram! vágyódom a te szabadításod után, és a te törvényed nékem gyönyörûségem."));
husuperobject.biblemap.put("b19_119_175", new husuperobject(19,119,175,"Éljen az én lelkem, hogy dicsérjen téged, és a te ítéleteid segítsenek rajtam!"));
husuperobject.biblemap.put("b19_119_176", new husuperobject(19,119,176,"Tévelygek, mint valami elveszett juh: keresd meg a te szolgádat; mert a te parancsolataidat nem felejtettem el!"));
husuperobject.biblemap.put("b19_120_1", new husuperobject(19,120,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_120_2", new husuperobject(19,120,2,"Mentsd meg, Uram, lelkemet a hazug ajaktól [és ]a csalárd nyelvtõl!"));
husuperobject.biblemap.put("b19_120_3", new husuperobject(19,120,3,"Mit adjanak néked, vagy mit nyujtsanak néked, te csalárd nyelv?!"));
husuperobject.biblemap.put("b19_120_4", new husuperobject(19,120,4,"Vitéznek hegyes nyilait fenyõfa parázsával."));
husuperobject.biblemap.put("b19_120_5", new husuperobject(19,120,5,"Jaj nékem, hogy Mésekben bujdosom és a Kédár sátrai közt lakom!"));
husuperobject.biblemap.put("b19_120_6", new husuperobject(19,120,6,"Sok ideje lakozik az én lelkem a békességnek gyûlölõivel!"));
husuperobject.biblemap.put("b19_120_7", new husuperobject(19,120,7,"Magam vagyok a békesség, de mihelyt megszólalok, õk viadalra [készek.]"));
husuperobject.biblemap.put("b19_121_1", new husuperobject(19,121,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_121_2", new husuperobject(19,121,2,"Az én segítségem az Úrtól van, a ki teremtette az eget és földet."));
husuperobject.biblemap.put("b19_121_3", new husuperobject(19,121,3,"Nem engedi, hogy lábad inogjon; nem szunnyad el a te õrizõd."));
husuperobject.biblemap.put("b19_121_4", new husuperobject(19,121,4,"Ímé, nem szunnyad és nem alszik az Izráelnek õrizõje!"));
husuperobject.biblemap.put("b19_121_5", new husuperobject(19,121,5,"Az Úr a te õrizõd, az Úr a te árnyékod a te jobbkezed felõl."));
husuperobject.biblemap.put("b19_121_6", new husuperobject(19,121,6,"Nappal a nap meg nem szúr téged, sem éjjel a hold."));
husuperobject.biblemap.put("b19_121_7", new husuperobject(19,121,7,"Az Úr megõriz téged minden gonosztól, megõrzi a te lelkedet."));
husuperobject.biblemap.put("b19_121_8", new husuperobject(19,121,8,"Megõrzi az Úr a te ki- és bemeneteledet, mostantól fogva mindörökké!"));
husuperobject.biblemap.put("b19_122_1", new husuperobject(19,122,1,"Grádicsok éneke, Dávidtól. Örvendezek, mikor mondják nékem: Menjünk el az Úr házába!"));
husuperobject.biblemap.put("b19_122_2", new husuperobject(19,122,2,"Ott álltak a mi lábaink a te kapuidban, oh Jeruzsálem!"));
husuperobject.biblemap.put("b19_122_3", new husuperobject(19,122,3,"Jeruzsálem, te [szépen] épült, mint a jól egybeszerkesztett város!"));
husuperobject.biblemap.put("b19_122_4", new husuperobject(19,122,4,"A hová feljárnak a nemzetségek, az Úrnak nemzetségei, bizonyságul Izráelnek, az Úr nevének tiszteletére."));
husuperobject.biblemap.put("b19_122_5", new husuperobject(19,122,5,"Mert ott ülnek az ítélõszékek, Dávid házának székei."));
husuperobject.biblemap.put("b19_122_6", new husuperobject(19,122,6,"Könyörögjetek Jeruzsálem békességéért; legyenek boldogok a téged szeretõk!"));
husuperobject.biblemap.put("b19_122_7", new husuperobject(19,122,7,"Békesség legyen a te várfalaid között, csendesség a te palotáidban."));
husuperobject.biblemap.put("b19_122_8", new husuperobject(19,122,8,"Atyámfiaiért és barátaimért hadd mondhassam: béke veled!"));
husuperobject.biblemap.put("b19_122_9", new husuperobject(19,122,9,"Az Úrnak, a mi Istenünknek házáért hadd kivánhassak jót tenéked!"));
husuperobject.biblemap.put("b19_123_1", new husuperobject(19,123,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_123_2", new husuperobject(19,123,2,"Ímé, mint a szolgák szemei uroknak kezére, mint a szolgalány szemei asszonya kezére: úgy [néznek] szemeink az Úrra, a mi Istenünkre, mígnem megkönyörül rajtunk!"));
husuperobject.biblemap.put("b19_123_3", new husuperobject(19,123,3,"Könyörülj rajtunk, Uram, könyörülj rajtunk! Mert igen elteltünk gyalázattal."));
husuperobject.biblemap.put("b19_123_4", new husuperobject(19,123,4,"Lelkünk igen eltelt a gazdagok csúfolkodásával, és a kevélyek gyalázkodásával."));
husuperobject.biblemap.put("b19_124_1", new husuperobject(19,124,1,"Grádicsok éneke, Dávidtól."));
husuperobject.biblemap.put("b19_124_2", new husuperobject(19,124,2,"Ha nem az Úr az, a ki velünk volt, mikor ránk támadtak az emberek:"));
husuperobject.biblemap.put("b19_124_3", new husuperobject(19,124,3,"Akkor elevenen nyeltek volna el minket, a mint felgerjedt haragjok ellenünk;"));
husuperobject.biblemap.put("b19_124_4", new husuperobject(19,124,4,"Akkor elborítottak volna minket a vizek, patak futott volna át felettünk;"));
husuperobject.biblemap.put("b19_124_5", new husuperobject(19,124,5,"Akkor átfutottak volna rajtunk a felbõszült vizek."));
husuperobject.biblemap.put("b19_124_6", new husuperobject(19,124,6,"Áldott az Úr, a ki nem adott minket fogaik prédájául!"));
husuperobject.biblemap.put("b19_124_7", new husuperobject(19,124,7,"Lelkünk megszabadult, mint a madár, a madarásznak tõrébõl. A tõr elszakadt, mi pedig megszabadultunk."));
husuperobject.biblemap.put("b19_124_8", new husuperobject(19,124,8,"A mi segítségünk az Úr nevében van, a ki teremtette az eget és földet."));
husuperobject.biblemap.put("b19_125_1", new husuperobject(19,125,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_125_2", new husuperobject(19,125,2,"Jeruzsálemet hegyek veszik körül, az Úr pedig körülveszi az õ népét mostantól fogva mindörökké."));
husuperobject.biblemap.put("b19_125_3", new husuperobject(19,125,3,"Mert nem pihen meg a gonoszság pálczája az igazak részén, hogy rosszra ne nyújtsák ki kezeiket az igazak."));
husuperobject.biblemap.put("b19_125_4", new husuperobject(19,125,4,"Tégy jól, Uram, a jókkal, és a szívök szerint igazakkal!"));
husuperobject.biblemap.put("b19_125_5", new husuperobject(19,125,5,"A görbe utakra tévedezõket pedig ragadtassa el az Úr, együtt a gonosztevõkkel; békesség legyen Izráelen!"));
husuperobject.biblemap.put("b19_126_1", new husuperobject(19,126,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_126_2", new husuperobject(19,126,2,"Akkor megtelt a szánk nevetéssel, nyelvünk pedig vígadozással. Akkor így szóltak a pogányok: Hatalmasan cselekedett ezekkel az Úr!"));
husuperobject.biblemap.put("b19_126_3", new husuperobject(19,126,3,"Hatalmasan cselekedett velünk az Úr, azért örvendezünk."));
husuperobject.biblemap.put("b19_126_4", new husuperobject(19,126,4,"Hozd vissza, Uram, a mi foglyainkat, mint patakokat a déli földön!"));
husuperobject.biblemap.put("b19_126_5", new husuperobject(19,126,5,"A kik könyhullatással vetnek, vígadozással aratnak majd."));
husuperobject.biblemap.put("b19_126_6", new husuperobject(19,126,6,"A ki vetõmagját sírva emelve megy tova, vígadozással jõ elõ, kévéit emelve."));
husuperobject.biblemap.put("b19_127_1", new husuperobject(19,127,1,"Grádicsok éneke Salamontól. Ha az Úr nem építi a házat, hiába dolgoznak azon annak építõi. Ha az Úr nem õrzi a várost, hiába vigyáz az õrizõ."));
husuperobject.biblemap.put("b19_127_2", new husuperobject(19,127,2,"Hiába néktek korán felkelnetek, késõn feküdnötök, fáradsággal szerzett kenyeret ennetek! Szerelmesének álmában ád eleget."));
husuperobject.biblemap.put("b19_127_3", new husuperobject(19,127,3,"Ímé, az Úrnak öröksége, a fiak; az anyaméh gyümölcse: jutalom."));
husuperobject.biblemap.put("b19_127_4", new husuperobject(19,127,4,"Mint a nyilak a hõsnek kezében, olyanok a serdülõ fiak."));
husuperobject.biblemap.put("b19_127_5", new husuperobject(19,127,5,"Boldog ember, a ki ilyenekkel tölti meg tegzét; nem szégyenülnek meg, ha ellenséggel szólnak a kapuban."));
husuperobject.biblemap.put("b19_128_1", new husuperobject(19,128,1,"Grádicsok éneke.  a ki az õ útaiban jár!"));
husuperobject.biblemap.put("b19_128_2", new husuperobject(19,128,2,"Bizony, kezed munkáját eszed! Boldog vagy és jól van dolgod."));
husuperobject.biblemap.put("b19_128_3", new husuperobject(19,128,3,"Feleséged, mint a termõ szõlõ házad belsejében; fiaid, mint az olajfacsemeték asztalod körül."));
husuperobject.biblemap.put("b19_128_4", new husuperobject(19,128,4,"Ímé, így áldatik meg a férfiú, a ki féli az Urat!"));
husuperobject.biblemap.put("b19_128_5", new husuperobject(19,128,5,"Megáld téged az Úr a Sionról, hogy boldognak lássad Jeruzsálemet életednek minden idejében;"));
husuperobject.biblemap.put("b19_128_6", new husuperobject(19,128,6,"És meglássad fiaidnak fiait; békesség legyen Izráelen!"));
husuperobject.biblemap.put("b19_129_1", new husuperobject(19,129,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_129_2", new husuperobject(19,129,2,"Sokat szorongattak engem ifjúságom óta, még sem bírtak velem."));
husuperobject.biblemap.put("b19_129_3", new husuperobject(19,129,3,"Szántók szántottak hátamon, hosszúra nyujtották barázdáikat."));
husuperobject.biblemap.put("b19_129_4", new husuperobject(19,129,4,"Igaz az Úr! Elszaggatja a gonoszok kötelét."));
husuperobject.biblemap.put("b19_129_5", new husuperobject(19,129,5,"Megszégyenülnek és hátraszorulnak mindazok, a kik gyûlölik a Siont."));
husuperobject.biblemap.put("b19_129_6", new husuperobject(19,129,6,"Olyanok lesznek, mint a háztetõn a fû, a mely kiszárad, mielõtt letépnék."));
husuperobject.biblemap.put("b19_129_7", new husuperobject(19,129,7,"A melyet sem arató nem szed markába, sem kévekötõ az ölébe."));
husuperobject.biblemap.put("b19_129_8", new husuperobject(19,129,8,"Az átutazók se mondják: Az Úr áldása rátok! Áldunk benneteket az Úrnak nevében!"));
husuperobject.biblemap.put("b19_130_1", new husuperobject(19,130,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_130_2", new husuperobject(19,130,2,"Uram, hallgasd meg az én szómat; legyenek füleid figyelmetesek könyörgõ szavamra!"));
husuperobject.biblemap.put("b19_130_3", new husuperobject(19,130,3,"Ha a bûnöket számon tartod, Uram: Uram, kicsoda maradhat meg?!"));
husuperobject.biblemap.put("b19_130_4", new husuperobject(19,130,4,"Hiszen te nálad van a bocsánat, hogy féljenek téged!"));
husuperobject.biblemap.put("b19_130_5", new husuperobject(19,130,5,"Várom az Urat, várja az én lelkem, és bízom az õ igéretében."));
husuperobject.biblemap.put("b19_130_6", new husuperobject(19,130,6,"[Várja] lelkem az Urat, jobban, mint az õrök a reggelt, az õrök a reggelt."));
husuperobject.biblemap.put("b19_130_7", new husuperobject(19,130,7,"Bízzál Izráel az Úrban, mert az Úrnál van a kegyelem, és bõséges nála a szabadítás!"));
husuperobject.biblemap.put("b19_130_8", new husuperobject(19,130,8,"Meg is szabadítja õ Izráelt minden õ bûnébõl."));
husuperobject.biblemap.put("b19_131_1", new husuperobject(19,131,1,"Grádicsok éneke; Dávidtól. Uram, nem fuvalkodott fel az én szívem, szemeim sem láttak magasra, és nem jártam nagy dolgok után, erõmet haladó csodadolgok után;"));
husuperobject.biblemap.put("b19_131_2", new husuperobject(19,131,2,"Sõt lecsendesítém és elnémítám lelkemet. A milyen az elválasztott gyermek az anyjánál; mint az elválasztott gyermek, olyan bennem az én lelkem."));
husuperobject.biblemap.put("b19_131_3", new husuperobject(19,131,3,"Bízzál Izráel az Úrban mostantól fogva mindörökké!"));
husuperobject.biblemap.put("b19_132_1", new husuperobject(19,132,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_132_2", new husuperobject(19,132,2,"A ki megesküdt az Úrnak, fogadást tõn a Jákób Istenének:"));
husuperobject.biblemap.put("b19_132_3", new husuperobject(19,132,3,"Nem megyek be sátoros házamba, nem hágok fel háló-nyoszolyámba;"));
husuperobject.biblemap.put("b19_132_4", new husuperobject(19,132,4,"Nem bocsátok álmot szemeimre s pilláimra szendert;"));
husuperobject.biblemap.put("b19_132_5", new husuperobject(19,132,5,"Míg helyet nem találok az Úrnak, Jákób Istenének hajlékot!"));
husuperobject.biblemap.put("b19_132_6", new husuperobject(19,132,6,"Ímé, hallottunk róla Efratában; rátaláltunk Jaar térségein:"));
husuperobject.biblemap.put("b19_132_7", new husuperobject(19,132,7,"Hadd menjünk be az õ hajlékaiba, boruljunk le lábainak zsámolyához!"));
husuperobject.biblemap.put("b19_132_8", new husuperobject(19,132,8,"Indulj Uram, a te nyugvóhelyedre: te és a te hatalmadnak ládája!"));
husuperobject.biblemap.put("b19_132_9", new husuperobject(19,132,9,"Papjaid öltözködjenek igazságba, kegyeltjeid pedig örvendezzenek!"));
husuperobject.biblemap.put("b19_132_10", new husuperobject(19,132,10,"Dávidért, a te szolgádért, ne fordulj el felkented színétõl!"));
husuperobject.biblemap.put("b19_132_11", new husuperobject(19,132,11,"Hûséget esküdött az Úr Dávidnak, nem tér el attól: Ágyékod gyümölcsét ültetem székedbe;"));
husuperobject.biblemap.put("b19_132_12", new husuperobject(19,132,12,"Ha megtartják fiaid szövetségemet és bizonyságomat, a melyekre megtanítom õket, fiaik is mindörökké székedben ülnek."));
husuperobject.biblemap.put("b19_132_13", new husuperobject(19,132,13,"Mert a Siont választotta ki az Úr, azt szerette meg magának lakhelyül:"));
husuperobject.biblemap.put("b19_132_14", new husuperobject(19,132,14,"Ez lesz nyugovóhelyem örökre; itt lakozom, mert ezt szeretem;"));
husuperobject.biblemap.put("b19_132_15", new husuperobject(19,132,15,"Eleséggel megáldom gazdagon, szegényeit jóltartom kenyérrel;"));
husuperobject.biblemap.put("b19_132_16", new husuperobject(19,132,16,"Papjait meg felruházom szabadítással, és vígan örvendeznek kegyeltjei."));
husuperobject.biblemap.put("b19_132_17", new husuperobject(19,132,17,"Megnövesztem ott Dávidnak hatalmát, szövétneket szerzek az én felkentemnek."));
husuperobject.biblemap.put("b19_132_18", new husuperobject(19,132,18,"Ellenségeire szégyent borítok, rajta pedig koronája ragyog."));
husuperobject.biblemap.put("b19_133_1", new husuperobject(19,133,1,"Grádicsok éneke Dávidtól. Ímé, mily jó és mily gyönyörûséges, a mikor együtt lakoznak az atyafiak!"));
husuperobject.biblemap.put("b19_133_2", new husuperobject(19,133,2,"Mint a drága olaj a fejen, a mely aláfoly a szakállon, az Áron szakállán; a mely lefoly köntöse prémjére;"));
husuperobject.biblemap.put("b19_133_3", new husuperobject(19,133,3,"Mint a Hermon harmatja, a mely leszáll Sion hegyeire. Csak oda küld áldást az Úr és életet örökké!"));
husuperobject.biblemap.put("b19_134_1", new husuperobject(19,134,1,"Grádicsok éneke."));
husuperobject.biblemap.put("b19_134_2", new husuperobject(19,134,2,"Emeljétek fel kezeiteket a szenthelyen, és áldjátok az Urat!"));
husuperobject.biblemap.put("b19_134_3", new husuperobject(19,134,3,"Áldjon meg téged az Úr a Sionról, a ki teremtette az eget és a földet!"));
husuperobject.biblemap.put("b19_135_1", new husuperobject(19,135,1,"Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_135_2", new husuperobject(19,135,2,"A kik álltok az Úrnak házában, Istenünk házának pitvaraiban."));
husuperobject.biblemap.put("b19_135_3", new husuperobject(19,135,3,"Dicsérjétek az Urat, mert jó az Úr; zengjétek nevét, mert gyönyörûséges!"));
husuperobject.biblemap.put("b19_135_4", new husuperobject(19,135,4,"Mert kiválasztá magának az Úr Jákóbot, Izráelt a saját örökségéül."));
husuperobject.biblemap.put("b19_135_5", new husuperobject(19,135,5,"Én bizony tudom, hogy nagy az Úr, és a mi Urunk minden istennél különb."));
husuperobject.biblemap.put("b19_135_6", new husuperobject(19,135,6,"Mind megteszi az Úr, a mit akar: az egekben és a földön, a vizekben és minden mélységben."));
husuperobject.biblemap.put("b19_135_7", new husuperobject(19,135,7,"Felemeli a felhõket a földnek szélérõl; villámlást készít, hogy esõ legyen, s szelet hoz elõ tárházaiból."));
husuperobject.biblemap.put("b19_135_8", new husuperobject(19,135,8,"A ki megverte Égyiptom elsõszülötteit, az emberétõl a baroméig."));
husuperobject.biblemap.put("b19_135_9", new husuperobject(19,135,9,"Jeleket és csodákat küldött rád, oh Égyiptom, Faraóra és összes szolgáira."));
husuperobject.biblemap.put("b19_135_10", new husuperobject(19,135,10,"A ki megvert sok népet, és megölt erõs királyokat:"));
husuperobject.biblemap.put("b19_135_11", new husuperobject(19,135,11,"Szíhont, az Emoreusok királyát, meg Ógot, a Básán királyát, és Kanaánnak minden királyát."));
husuperobject.biblemap.put("b19_135_12", new husuperobject(19,135,12,"És odaadta földüket örökségül; örökségül saját népének, Izráelnek."));
husuperobject.biblemap.put("b19_135_13", new husuperobject(19,135,13,"Uram! Örökkévaló a te neved; nemzedékrõl nemzedékre emlegetnek téged."));
husuperobject.biblemap.put("b19_135_14", new husuperobject(19,135,14,"Mert birája az Úr az õ népének, és könyörületes az õ szolgái iránt."));
husuperobject.biblemap.put("b19_135_15", new husuperobject(19,135,15,"A pogányok bálványai ezüst és arany, emberi kezek alkotásai."));
husuperobject.biblemap.put("b19_135_16", new husuperobject(19,135,16,"Szájok van, de nem beszélnek, szemeik vannak, de nem látnak;"));
husuperobject.biblemap.put("b19_135_17", new husuperobject(19,135,17,"Füleik vannak, de nem hallanak, és lehellet sincsen szájokban!"));
husuperobject.biblemap.put("b19_135_18", new husuperobject(19,135,18,"Hasonlók lesznek hozzájuk alkotóik is, [és] mindazok, a kik bíznak bennök."));
husuperobject.biblemap.put("b19_135_19", new husuperobject(19,135,19,"Izráel háznépe: áldjátok az Urat! Áronnak háznépe: áldjátok az Urat!"));
husuperobject.biblemap.put("b19_135_20", new husuperobject(19,135,20,"Lévinek háznépe: áldjátok az Urat! Kik félik az Urat: áldjátok az Urat!"));
husuperobject.biblemap.put("b19_135_21", new husuperobject(19,135,21,"Áldott az Úr a Sionon, a ki Jeruzsálemben lakozik! Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_136_1", new husuperobject(19,136,1,"Magasztaljátok az Urat, mert jó; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_2", new husuperobject(19,136,2,"Magasztaljátok az istenek Istenét; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_3", new husuperobject(19,136,3,"Magasztaljátok az uraknak Urát; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_4", new husuperobject(19,136,4,"A ki nagy csodákat mûvel egyedül; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_5", new husuperobject(19,136,5,"A ki teremtette az egeket bölcseséggel; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_6", new husuperobject(19,136,6,"A ki kiterjesztette a földet a vizek fölé; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_7", new husuperobject(19,136,7,"A ki teremtette a nagy világító testeket; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_8", new husuperobject(19,136,8,"A napot, hogy uralkodjék nappal; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_9", new husuperobject(19,136,9,"A holdat és csillagokat, hogy uralkodjanak éjszaka; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_10", new husuperobject(19,136,10,"A ki megverte az égyiptomiakat elsõszülötteikben; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_11", new husuperobject(19,136,11,"A ki kihozta Izráelt azok közül; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_12", new husuperobject(19,136,12,"Hatalmas kézzel és kifeszített karral; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_13", new husuperobject(19,136,13,"A ki kétfelé választotta a veres tengert; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_14", new husuperobject(19,136,14,"És átvitte Izráelt annak közepén; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_15", new husuperobject(19,136,15,"Faraót pedig és seregét a veres tengerbe meríté; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_16", new husuperobject(19,136,16,"A ki vezérlette népét a pusztában; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_17", new husuperobject(19,136,17,"A ki nagy királyokat vert le; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_18", new husuperobject(19,136,18,"És megvert hatalmas királyokat; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_19", new husuperobject(19,136,19,"Szíhont, az Emoreusok királyát; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_20", new husuperobject(19,136,20,"Meg Ógot, a Básán királyát; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_21", new husuperobject(19,136,21,"És örökségül adta az õ földjüket; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_22", new husuperobject(19,136,22,"Örökségül szolgájának, az Izráelnek; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_23", new husuperobject(19,136,23,"A ki megemlékezett rólunk alacsonyságunkban; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_24", new husuperobject(19,136,24,"És megszabadított minket elleneinktõl; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_25", new husuperobject(19,136,25,"A ki eledelt ad minden testnek; mert örökkévaló az õ kegyelme."));
husuperobject.biblemap.put("b19_136_26", new husuperobject(19,136,26,"Magasztaljátok az egek Istenét; mert örökkévaló az õ kegyelme!"));
husuperobject.biblemap.put("b19_137_1", new husuperobject(19,137,1,"Babilon folyóvizeinél, ott ültünk és sírtunk, mikor a Sionról megemlékezénk."));
husuperobject.biblemap.put("b19_137_2", new husuperobject(19,137,2,"A fûzfákra, közepette, [oda] függesztettük hárfáinkat,"));
husuperobject.biblemap.put("b19_137_3", new husuperobject(19,137,3,"Mert énekszóra nógattak ott elfogóink, kínzóink pedig víg dalra, [mondván]: Énekeljetek nékünk a Sion énekei közül!"));
husuperobject.biblemap.put("b19_137_4", new husuperobject(19,137,4,"Hogyan énekelnõk az Úrnak énekét idegen földön?!"));
husuperobject.biblemap.put("b19_137_5", new husuperobject(19,137,5,"Ha elfelejtkezem rólad, Jeruzsálem felejtkezzék el rólam az én jobbkezem!"));
husuperobject.biblemap.put("b19_137_6", new husuperobject(19,137,6,"Nyelvem ragadjon az ínyemhez, ha meg nem emlékezem rólad; ha nem Jeruzsálemet tekintem az én vígasságom fejének!"));
husuperobject.biblemap.put("b19_137_7", new husuperobject(19,137,7,"Emlékezzél meg, Uram, az Edom fiairól, a kik azt mondták Jeruzsálem napján: Rontsátok le, rontsátok le fenékig!"));
husuperobject.biblemap.put("b19_137_8", new husuperobject(19,137,8,"Babilon leánya, te pusztulóra vált! Áldott legyen a ki megfizet néked gonoszságodért, a melylyel te fizettél nékünk!"));
husuperobject.biblemap.put("b19_137_9", new husuperobject(19,137,9,"Áldott legyen, a ki megragadja és sziklához paskolja kisdedeidet!"));
husuperobject.biblemap.put("b19_138_1", new husuperobject(19,138,1,"Dávidé.  énekkel áldlak az istenek elõtt."));
husuperobject.biblemap.put("b19_138_2", new husuperobject(19,138,2,"Szent templomod felé hajolok, s magasztalom nevedet kegyelmedért és igazságodért; mert minden neveden felül felmagasztalád a te beszédedet."));
husuperobject.biblemap.put("b19_138_3", new husuperobject(19,138,3,"Mikor kiáltottam, meghallgattál engem, felbátorítottál engem, lelkemben erõ [támadt.]"));
husuperobject.biblemap.put("b19_138_4", new husuperobject(19,138,4,"Magasztal téged, Uram, e földnek minden királya, mikor meghallják szádnak beszédeit,"));
husuperobject.biblemap.put("b19_138_5", new husuperobject(19,138,5,"És énekelnek az Úrnak útairól, mert nagy az Úr dicsõsége!"));
husuperobject.biblemap.put("b19_138_6", new husuperobject(19,138,6,"Noha felséges az Úr, mégis meglátja az alázatost, a kevélyt pedig távolról ismeri."));
husuperobject.biblemap.put("b19_138_7", new husuperobject(19,138,7,"Ha nyomorúságban vergõdöm, megelevenítesz; ellenségeim haragja ellen kinyújtod kezedet, és a te jobbkezed megment engemet."));
husuperobject.biblemap.put("b19_138_8", new husuperobject(19,138,8,"Elvégzi értem az Úr. Uram, a te kegyelmed örökkévaló: ne hagyd el a te kezeidnek alkotásait!"));
husuperobject.biblemap.put("b19_139_1", new husuperobject(19,139,1,"Az éneklõmesternek, Dávid zsoltára."));
husuperobject.biblemap.put("b19_139_2", new husuperobject(19,139,2,"Te ismered ülésemet és felkelésemet, messzirõl érted gondolatomat."));
husuperobject.biblemap.put("b19_139_3", new husuperobject(19,139,3,"Járásomra és fekvésemre ügyelsz, minden útamat jól tudod."));
husuperobject.biblemap.put("b19_139_4", new husuperobject(19,139,4,"Mikor még nyelvemen sincs a szó, immár egészen érted azt Uram!"));
husuperobject.biblemap.put("b19_139_5", new husuperobject(19,139,5,"Elõl és hátul körülzártál engem, és fölöttem tartod kezedet."));
husuperobject.biblemap.put("b19_139_6", new husuperobject(19,139,6,"Csodálatos elõttem [e] tudás, magasságos, nem érthetem azt."));
husuperobject.biblemap.put("b19_139_7", new husuperobject(19,139,7,"Hová menjek a te lelked elõl és a te orczád elõl hova fussak?"));
husuperobject.biblemap.put("b19_139_8", new husuperobject(19,139,8,"Ha a mennybe hágok fel, ott vagy; ha a Seolba vetek ágyat, ott is jelen vagy."));
husuperobject.biblemap.put("b19_139_9", new husuperobject(19,139,9,"Ha a hajnal szárnyaira kelnék, és a tenger túlsó szélére szállanék:"));
husuperobject.biblemap.put("b19_139_10", new husuperobject(19,139,10,"Ott is a te kezed vezérelne engem, és a te jobbkezed fogna engem."));
husuperobject.biblemap.put("b19_139_11", new husuperobject(19,139,11,"Ha azt mondom: A sötétség bizonyosan elborít engem és a világosság körülöttem éjszaka lesz,"));
husuperobject.biblemap.put("b19_139_12", new husuperobject(19,139,12,"A sötétség sem borít el elõled, és fénylik az éjszaka, mint a nappal; a sötétség olyan, mint a világosság."));
husuperobject.biblemap.put("b19_139_13", new husuperobject(19,139,13,"Bizony te alkottad veséimet, te takargattál engem anyám méhében."));
husuperobject.biblemap.put("b19_139_14", new husuperobject(19,139,14,"Magasztallak, hogy csodálatosan megkülönböztettél. Csodálatosak a te cselekedeteid! és jól tudja ezt az én lelkem."));
husuperobject.biblemap.put("b19_139_15", new husuperobject(19,139,15,"Nem volt elrejtve elõtted az én csontom, mikor titokban formáltattam és idomíttattam, [mintegy] a föld mélyében."));
husuperobject.biblemap.put("b19_139_16", new husuperobject(19,139,16,"Látták szemeid az én alaktalan testemet, és könyvedben ezek mind be voltak írva: a napok is, a melyeken formáltatni fognak; holott egy sem volt még meg közülök."));
husuperobject.biblemap.put("b19_139_17", new husuperobject(19,139,17,"És nékem milyen kedvesek a te gondolataid, oh Isten! Mily nagy azoknak summája!"));
husuperobject.biblemap.put("b19_139_18", new husuperobject(19,139,18,"Számlálgatom õket: többek a fövénynél; felserkenek s mégis veled vagyok."));
husuperobject.biblemap.put("b19_139_19", new husuperobject(19,139,19,"Vajha elvesztené Isten a gonoszt! Vérszopó emberek, fussatok el tõlem!"));
husuperobject.biblemap.put("b19_139_20", new husuperobject(19,139,20,"A kik gonoszul szólnak felõled, [és nevedet] hiába veszik fel, a te ellenségeid."));
husuperobject.biblemap.put("b19_139_21", new husuperobject(19,139,21,"Ne gyûlöljem-é, Uram, a téged gyûlölõket? Az ellened lázadókat ne útáljam-é?"));
husuperobject.biblemap.put("b19_139_22", new husuperobject(19,139,22,"Teljes gyûlölettel gyûlölöm õket, ellenségeimmé lettek!"));
husuperobject.biblemap.put("b19_139_23", new husuperobject(19,139,23,"Vizsgálj meg engem, oh Isten, és ismerd meg szívemet! Próbálj meg engem, és ismerd meg gondolataimat!"));
husuperobject.biblemap.put("b19_139_24", new husuperobject(19,139,24,"És lásd meg, ha van-e nálam a gonoszságnak valamilyen útja? és vezérelj engem az örökkévalóság útján!"));
husuperobject.biblemap.put("b19_140_1", new husuperobject(19,140,1,"Az éneklõmesternek, Dávid zsoltára."));
husuperobject.biblemap.put("b19_140_2", new husuperobject(19,140,2,"Szabadíts meg engem, Uram, a gonosz embertõl; a zsarnok férfitól védj meg engemet!"));
husuperobject.biblemap.put("b19_140_3", new husuperobject(19,140,3,"A kik gonoszt gondolnak szívökben, [és] minden nap háborút kezdenek."));
husuperobject.biblemap.put("b19_140_4", new husuperobject(19,140,4,"Nyelvöket élesítik, mint a kígyó; áspiskígyó mérge van ajkaik alatt. Szela."));
husuperobject.biblemap.put("b19_140_5", new husuperobject(19,140,5,"Ments meg, oh Uram, a gonosz kezétõl; a zsarnok férfitól védj meg engemet! A kik megejteni szándékoznak lépéseimet."));
husuperobject.biblemap.put("b19_140_6", new husuperobject(19,140,6,"Tõrt hánytak elém titkon a kevélyek és köteleket; hálót terítettek ösvényem szélére, hurkokat vetettek elém! Szela."));
husuperobject.biblemap.put("b19_140_7", new husuperobject(19,140,7,"Mondám az Úrnak: Istenem vagy te! Hallgasd meg Uram könyörgésem szavát!"));
husuperobject.biblemap.put("b19_140_8", new husuperobject(19,140,8,"Én Uram, Istenem, szabadításom ereje: fedezd be fejemet a háború napján!"));
husuperobject.biblemap.put("b19_140_9", new husuperobject(19,140,9,"Ne add meg Uram, a mit a gonosz kíván; rossz szándékát ne segítsd elõ, mert felfuvalkodik! Szela."));
husuperobject.biblemap.put("b19_140_10", new husuperobject(19,140,10,"A körültem ólálkodóknak fejét borítsa be ajkaiknak átka."));
husuperobject.biblemap.put("b19_140_11", new husuperobject(19,140,11,"Eleven szenek hulljanak reájok; tûzbe vesse õket, örvényekbe, fel ne keljenek!"));
husuperobject.biblemap.put("b19_140_12", new husuperobject(19,140,12,"A nyelves ember meg ne maradjon e földön; a zsarnok embert ûzze a veszedelem, míg nyaka szakad."));
husuperobject.biblemap.put("b19_140_13", new husuperobject(19,140,13,"Tudom, hogy felfogja az Úr a szegények ügyét, a nyomorultaknak jogát. [ (Psalms 140:14) Csak az igazak magasztalják a te nevedet, [s] orczád elõtt lakoznak az igazságosak. ]"));
husuperobject.biblemap.put("b19_141_1", new husuperobject(19,141,1,"Dávid zsoltára.  figyelmezz szavamra, mikor hívlak téged."));
husuperobject.biblemap.put("b19_141_2", new husuperobject(19,141,2,"Mint jóillatú füst jusson elõdbe imádságom, [s] kezem felemelése estvéli áldozat [legyen.]"));
husuperobject.biblemap.put("b19_141_3", new husuperobject(19,141,3,"Tégy Uram závárt az én szájamra; õriztessed az én ajkaim nyílását!"));
husuperobject.biblemap.put("b19_141_4", new husuperobject(19,141,4,"Ne engedd szívemet rosszra hajlani, hogy istentelenül ne cselekedjem a gonosztevõ emberekkel egybe; és ne egyem azoknak kedvelt ételébõl!"));
husuperobject.biblemap.put("b19_141_5", new husuperobject(19,141,5,"Ha igaz fedd engem: jól van az; ha dorgál engem: mintha fejem kenné. Nem vonakodik fejem, sõt még imádkozom is értök nyavalyájokban."));
husuperobject.biblemap.put("b19_141_6", new husuperobject(19,141,6,"Ha sziklához paskoltatnak az õ bíráik, akkor hallgatják az én beszédeimet, mert gyönyörûségesek."));
husuperobject.biblemap.put("b19_141_7", new husuperobject(19,141,7,"Mint a ki a földet vágja és hányja, úgy szóratnak szét csontjaik a Seol torkában."));
husuperobject.biblemap.put("b19_141_8", new husuperobject(19,141,8,"De az én szemeim, Uram Isten, rajtad csüggenek; hozzád folyamodom: ne oltsd el életemet!"));
husuperobject.biblemap.put("b19_141_9", new husuperobject(19,141,9,"Õrizz meg a tõrtõl, a mit elém hánytak, és a gonosztevõknek hálóitól!"));
husuperobject.biblemap.put("b19_141_10", new husuperobject(19,141,10,"Essenek az álnokok saját tõreikbe; míg én egyben általmegyek!"));
husuperobject.biblemap.put("b19_142_1", new husuperobject(19,142,1,"Dávid tanítása; imádság a barlangban létekor."));
husuperobject.biblemap.put("b19_142_2", new husuperobject(19,142,2,"Fenszóval hívom az Urat, fenszóval könyörgök az Úrhoz."));
husuperobject.biblemap.put("b19_142_3", new husuperobject(19,142,3,"Kiöntöm elõtte panaszomat, kitárom elõtte nyomorúságomat,"));
husuperobject.biblemap.put("b19_142_4", new husuperobject(19,142,4,"Mikor elcsügged bennem a lelkem. Te pedig tudod az én ösvényemet, hogy az úton, a melyen járok, tõrt hánytak elém."));
husuperobject.biblemap.put("b19_142_5", new husuperobject(19,142,5,"Tekints jobbra és lásd meg, hogy senki sincsen, a ki ismerne; nincsen számomra menedék; senki sem tudakozódik felõlem."));
husuperobject.biblemap.put("b19_142_6", new husuperobject(19,142,6,"Hívlak téged, oh Uram; [s ezt] mondom: Te vagy oltalmam [és] örökségem az élõknek földén;"));
husuperobject.biblemap.put("b19_142_7", new husuperobject(19,142,7,"Figyelmezz esedezésemre, mert igen nyomorult vagyok! Szabadíts meg engem üldözõimtõl, mert hatalmasabbak nálamnál! [ (Psalms 142:8) Vezesd ki lelkemet a börtönbõl, hogy magasztaljam a te nevedet! Az igazak vegyenek engem körül, mikor jól teszel majd velem. ]"));
husuperobject.biblemap.put("b19_143_1", new husuperobject(19,143,1,"Dávid zsoltára.  hûséged [és] igazságod szerint hallgass meg engemet."));
husuperobject.biblemap.put("b19_143_2", new husuperobject(19,143,2,"Ne szállj perbe a te szolgáddal, mert egy élõ sem igaz elõtted!"));
husuperobject.biblemap.put("b19_143_3", new husuperobject(19,143,3,"Ímé, ellenség üldözi lelkemet, a földhöz paskolja éltemet; betaszít engem a sötétségbe a milyen a régen megholtaké!"));
husuperobject.biblemap.put("b19_143_4", new husuperobject(19,143,4,"Elcsügged bennem a lelkem, felháborodik bennem a szívem!"));
husuperobject.biblemap.put("b19_143_5", new husuperobject(19,143,5,"Megemlékezem a régi idõkrõl, elgondolom minden te dolgodat; kezed munkáiról elmélkedem."));
husuperobject.biblemap.put("b19_143_6", new husuperobject(19,143,6,"Feléd terjesztgetem kezeimet; lelkem, mint szomjú föld, úgy [eped] utánad. Szela."));
husuperobject.biblemap.put("b19_143_7", new husuperobject(19,143,7,"Siess, hallgass meg engem Uram! Elfogyatkozik az én lelkem. Ne rejtsd el orczádat elõlem, hogy ne legyek hasonló a sírba szállókhoz."));
husuperobject.biblemap.put("b19_143_8", new husuperobject(19,143,8,"Korán hallasd velem kegyelmedet, mert bízom benned! Mutasd meg nékem az útat, melyen járjak, mert hozzád emelem lelkemet!"));
husuperobject.biblemap.put("b19_143_9", new husuperobject(19,143,9,"Szabadíts meg engem ellenségeimtõl, Uram; hozzád menekülök!"));
husuperobject.biblemap.put("b19_143_10", new husuperobject(19,143,10,"Taníts meg engem a te akaratodat teljesítenem, mert te vagy Istenem! A te jó lelked vezéreljen engem az egyenes földön."));
husuperobject.biblemap.put("b19_143_11", new husuperobject(19,143,11,"Eleveníts meg engem, Uram, a te nevedért; vidd ki lelkemet a nyomorúságból a te igazságodért!"));
husuperobject.biblemap.put("b19_143_12", new husuperobject(19,143,12,"És kegyelmedbõl rontsd meg ellenségeimet, és veszítsd el mindazokat, a kik szorongatják lelkemet; mert szolgád vagyok."));
husuperobject.biblemap.put("b19_144_1", new husuperobject(19,144,1,"Dávidé."));
husuperobject.biblemap.put("b19_144_2", new husuperobject(19,144,2,"Jóltevõm és megoltalmazóm, mentõváram és szabadítóm nékem; paizsom, és az, a kiben én bízom: õ veti alám népemet."));
husuperobject.biblemap.put("b19_144_3", new husuperobject(19,144,3,"Uram! Micsoda az ember, hogy tudsz felõle, és az embernek fia, hogy gondod van reá?"));
husuperobject.biblemap.put("b19_144_4", new husuperobject(19,144,4,"Olyan az ember, mint a lehellet; napjai, mint az átfutó árnyék."));
husuperobject.biblemap.put("b19_144_5", new husuperobject(19,144,5,"Uram, hajlítsd meg egeidet és szállja alá; illesd meg a hegyeket, hogy füstölögjenek!"));
husuperobject.biblemap.put("b19_144_6", new husuperobject(19,144,6,"Lövelj villámot és hányd szerte õket; bocsásd ki nyilaidat és vedd el eszöket."));
husuperobject.biblemap.put("b19_144_7", new husuperobject(19,144,7,"Nyújtsd le kezeidet a magasból; ragadj ki és ments meg engem a nagy vizekbõl, az idegen-fiak kezébõl;"));
husuperobject.biblemap.put("b19_144_8", new husuperobject(19,144,8,"A kiknek szájok hazugságot beszél, s jobb kezök a hamisság jobb keze."));
husuperobject.biblemap.put("b19_144_9", new husuperobject(19,144,9,"Isten! Új éneket éneklek néked; tízhúrú hangszerrel zengedezlek téged;"));
husuperobject.biblemap.put("b19_144_10", new husuperobject(19,144,10,"Ki segítséget ád a királyoknak, [s] megmenti Dávidot, az õ szolgáját a gonosz szablyától."));
husuperobject.biblemap.put("b19_144_11", new husuperobject(19,144,11,"Ragadj ki és ments meg engem az idegen-fiak kezébõl, a kiknek szájok hazugságot beszél, s jobbkezök a hamisság jobbkeze."));
husuperobject.biblemap.put("b19_144_12", new husuperobject(19,144,12,"Hogy fiaink olyanok legyenek, mint a plánták, nagyokká nõve ifjú korukban; leányaink, mint a templom mintájára kifaragott oszlopok."));
husuperobject.biblemap.put("b19_144_13", new husuperobject(19,144,13,"Legyenek telve tárházaink, eledelt eledelre szolgáltassanak; juhaink százszorosodjanak, ezerszeresedjenek a mi legelõinken."));
husuperobject.biblemap.put("b19_144_14", new husuperobject(19,144,14,"Ökreink megrakodva legyenek; sem betörés, sem kirohanás, sem kiáltozás ne legyen a mi utczáinkon."));
husuperobject.biblemap.put("b19_144_15", new husuperobject(19,144,15,"Boldog nép az, a melynek így van dolga; boldog nép az, a melynek az Úr az õ Istene."));
husuperobject.biblemap.put("b19_145_1", new husuperobject(19,145,1,"Dávid dicsérõ éneke."));
husuperobject.biblemap.put("b19_145_2", new husuperobject(19,145,2,"Minden napon áldalak téged, és dicsérem neved örökkön örökké!"));
husuperobject.biblemap.put("b19_145_3", new husuperobject(19,145,3,"Nagy az Úr és igen dicséretes, és az õ nagysága megfoghatatlan."));
husuperobject.biblemap.put("b19_145_4", new husuperobject(19,145,4,"Nemzedék nemzedéknek dícséri mûveidet, s jelentgeti a te hatalmasságodat."));
husuperobject.biblemap.put("b19_145_5", new husuperobject(19,145,5,"A te méltóságod dicsõ fényérõl, és csodálatos dolgaidról elmélkedem."));
husuperobject.biblemap.put("b19_145_6", new husuperobject(19,145,6,"Rettenetes voltod hatalmát beszélik, és én a te nagyságos dolgaidat hirdetem."));
husuperobject.biblemap.put("b19_145_7", new husuperobject(19,145,7,"A te nagy jóságod emlékeirõl áradoznak, és a te igazságodnak örvendeznek."));
husuperobject.biblemap.put("b19_145_8", new husuperobject(19,145,8,"Irgalmas és könyörületes az Úr, késedelmes a haragra és nagy kegyelmû."));
husuperobject.biblemap.put("b19_145_9", new husuperobject(19,145,9,"Jó az Úr mindenki iránt, és könyörületes minden teremtményéhez."));
husuperobject.biblemap.put("b19_145_10", new husuperobject(19,145,10,"Dicsér téged, Uram minden teremtményed és áldanak téged a te kegyeltjeid."));
husuperobject.biblemap.put("b19_145_11", new husuperobject(19,145,11,"Országodnak dicsõségérõl szólnak, és a te hatalmadat beszélik."));
husuperobject.biblemap.put("b19_145_12", new husuperobject(19,145,12,"Hogy tudtul adják az ember fiainak az õ hatalmát, és az õ országának fényes dicsõségét."));
husuperobject.biblemap.put("b19_145_13", new husuperobject(19,145,13,"A te országod örökre fennálló ország, és a te uralkodásod nemzedékrõl nemzedékre."));
husuperobject.biblemap.put("b19_145_14", new husuperobject(19,145,14,"Az Úr megtámogat minden elesendõt, és felegyenesít minden meggörnyedtet."));
husuperobject.biblemap.put("b19_145_15", new husuperobject(19,145,15,"Mindenki szemei te reád vigyáznak, és te idejében megadod eledelöket."));
husuperobject.biblemap.put("b19_145_16", new husuperobject(19,145,16,"Megnyitod a te kezedet, és megelégítesz minden élõt ingyen."));
husuperobject.biblemap.put("b19_145_17", new husuperobject(19,145,17,"Igaz az Úr minden õ útában, és minden dolgában kegyelmes."));
husuperobject.biblemap.put("b19_145_18", new husuperobject(19,145,18,"Közel van az Úr minden õt hívóhoz; mindenkihez, a ki hûséggel hívja õt."));
husuperobject.biblemap.put("b19_145_19", new husuperobject(19,145,19,"Beteljesíti az õt félõknek kivánságát; kiáltásukat meghallgatja és megsegíti õket."));
husuperobject.biblemap.put("b19_145_20", new husuperobject(19,145,20,"Megõrzi az Úr mindazokat, a kik õt szeretik; de a gonoszokat mind megsemmisíti."));
husuperobject.biblemap.put("b19_145_21", new husuperobject(19,145,21,"Az Úr dicséretét beszélje ajkam, és az õ szent nevét áldja minden test örökkön örökké!"));
husuperobject.biblemap.put("b19_146_1", new husuperobject(19,146,1,"Dicsérjétek az Urat! Dicsérd én lelkem az Urat!"));
husuperobject.biblemap.put("b19_146_2", new husuperobject(19,146,2,"Dicsérem az Urat, a míg élek; éneklek az én Istenemnek, a míg vagyok."));
husuperobject.biblemap.put("b19_146_3", new husuperobject(19,146,3,"Ne bízzatok a fejedelmekben, emberek fiában, a ki meg nem menthet!"));
husuperobject.biblemap.put("b19_146_4", new husuperobject(19,146,4,"Kimegyen a lelke; visszatér földébe, [és] aznapon elvesznek az õ tervei."));
husuperobject.biblemap.put("b19_146_5", new husuperobject(19,146,5,"Boldog, a kinek segítsége a Jákób Istene, és reménysége van az Úrban, az õ Istenében;"));
husuperobject.biblemap.put("b19_146_6", new husuperobject(19,146,6,"A ki teremtette az eget és földet, a tengert és mindent, a mi bennök van. A ki megtartja a hûségét örökké;"));
husuperobject.biblemap.put("b19_146_7", new husuperobject(19,146,7,"Igazságot szolgáltat az elnyomottaknak, eledelt ád az éhezõknek. Az Úr megszabadítja az elfogottakat."));
husuperobject.biblemap.put("b19_146_8", new husuperobject(19,146,8,"Az Úr megnyitja a vakok szemeit, az Úr felegyenesíti a meggörnyedteket; szereti az Úr az igazakat."));
husuperobject.biblemap.put("b19_146_9", new husuperobject(19,146,9,"Megoltalmazza az Úr a jövevényeket; árvát és özvegyet megtart, és a gonoszok útját elfordítja."));
husuperobject.biblemap.put("b19_146_10", new husuperobject(19,146,10,"Uralkodni fog az Úr örökké, a te Istened, oh Sion, nemzedékrõl nemzedékre! Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_147_1", new husuperobject(19,147,1,"Dicsérjétek az Urat! Hiszen Istenünkrõl énekelni jó; hiszen õt dicsérni gyönyörûséges és illendõ dolog!"));
husuperobject.biblemap.put("b19_147_2", new husuperobject(19,147,2,"Az Úr építi Jeruzsálemet, összegyûjti Izráelnek elûzötteit;"));
husuperobject.biblemap.put("b19_147_3", new husuperobject(19,147,3,"Meggyógyítja a megtört szívûeket, és bekötözi sebeiket."));
husuperobject.biblemap.put("b19_147_4", new husuperobject(19,147,4,"Elrendeli a csillagok számát, és mindnyájokat nevérõl nevezi."));
husuperobject.biblemap.put("b19_147_5", new husuperobject(19,147,5,"Nagy a mi Urunk és igen hatalmas, s bölcseségének nincsen határa."));
husuperobject.biblemap.put("b19_147_6", new husuperobject(19,147,6,"Megtartja az Úr a nyomorultakat; a gonoszokat földig megalázza."));
husuperobject.biblemap.put("b19_147_7", new husuperobject(19,147,7,"Énekeljetek az Úrnak hálaadással, pengessetek hárfát a mi Istenünknek!"));
husuperobject.biblemap.put("b19_147_8", new husuperobject(19,147,8,"A ki beborítja az eget felhõvel, esõt készít a föld számára, [és] füvet sarjaszt a hegyeken;"));
husuperobject.biblemap.put("b19_147_9", new husuperobject(19,147,9,"A ki megadja táplálékát a baromnak, a holló-fiaknak, a melyek kárognak."));
husuperobject.biblemap.put("b19_147_10", new husuperobject(19,147,10,"Nem paripák erejében telik kedve, nem is a férfi lábszáraiban gyönyörködik;"));
husuperobject.biblemap.put("b19_147_11", new husuperobject(19,147,11,"Az õt félõkben gyönyörködik az Úr, a kik kegyelmében reménykednek."));
husuperobject.biblemap.put("b19_147_12", new husuperobject(19,147,12,"Dicsõitsd Jeruzsálem az Urat! Dicsérd, oh Sion, a te Istenedet!"));
husuperobject.biblemap.put("b19_147_13", new husuperobject(19,147,13,"Mert erõsekké teszi kapuid zárait, [s] megáldja benned a te fiaidat."));
husuperobject.biblemap.put("b19_147_14", new husuperobject(19,147,14,"Békességet ád határaidnak, megelégít téged a legjobb búzával."));
husuperobject.biblemap.put("b19_147_15", new husuperobject(19,147,15,"Leküldi parancsolatát a földre, nagy hirtelen lefut az õ rendelete!"));
husuperobject.biblemap.put("b19_147_16", new husuperobject(19,147,16,"Olyan havat ád, mint a gyapjú, [és] szórja a deret, mint a port."));
husuperobject.biblemap.put("b19_147_17", new husuperobject(19,147,17,"Darabokban szórja le jegét: ki állhatna meg az õ fagya elõtt?"));
husuperobject.biblemap.put("b19_147_18", new husuperobject(19,147,18,"Kibocsátja szavát s szétolvasztja õket; megindítja szelét s vizek folydogálnak."));
husuperobject.biblemap.put("b19_147_19", new husuperobject(19,147,19,"Közli igéit Jákóbbal, törvényeit s végzéseit Izráellel."));
husuperobject.biblemap.put("b19_147_20", new husuperobject(19,147,20,"Nem tesz így egyetlen néppel sem; végzéseit sem tudatja velök. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_148_1", new husuperobject(19,148,1,"Dicsérjétek az Urat!  dicsérjétek õt a magas helyeken!"));
husuperobject.biblemap.put("b19_148_2", new husuperobject(19,148,2,"Dicsérjétek õt angyalai mind; dicsérjétek õt minden õ serege!"));
husuperobject.biblemap.put("b19_148_3", new husuperobject(19,148,3,"Dicsérjétek õt: nap és hold; dicsérjétek õt mind: fényes csillagai!"));
husuperobject.biblemap.put("b19_148_4", new husuperobject(19,148,4,"Dicsérjétek õt egeknek egei, és ti vizek, a melyek az ég felett vagytok!"));
husuperobject.biblemap.put("b19_148_5", new husuperobject(19,148,5,"Dicsérjék õk az Úrnak nevét, mert parancsolt és elõállottak õk."));
husuperobject.biblemap.put("b19_148_6", new husuperobject(19,148,6,"Örök idõre állította fel õket; törvényt szabott és nem tér el attól."));
husuperobject.biblemap.put("b19_148_7", new husuperobject(19,148,7,"Dicsérjétek az Urat a földrõl: viziszörnyek és mély vizek [ti ]mind!"));
husuperobject.biblemap.put("b19_148_8", new husuperobject(19,148,8,"Tûz és jégesõ, hó és köd, szélvihar, a melyek az õ rendelését cselekszik;"));
husuperobject.biblemap.put("b19_148_9", new husuperobject(19,148,9,"Ti hegyek és halmok mindnyájan, minden gyümölcsfa s mind [ti ]czédrusok;"));
husuperobject.biblemap.put("b19_148_10", new husuperobject(19,148,10,"Vadak és minden barmok, férgek és szárnyas állatok;"));
husuperobject.biblemap.put("b19_148_11", new husuperobject(19,148,11,"Földi királyok és minden nemzet, fejedelmek és mind [ti] földi bírák!"));
husuperobject.biblemap.put("b19_148_12", new husuperobject(19,148,12,"Ifjak és szûzek, vének gyermekekkel:"));
husuperobject.biblemap.put("b19_148_13", new husuperobject(19,148,13,"Dicsérjék az Úrnak nevét, mert az õ neve dicsõ egyedül; az õ dicsõsége égre-földre [kihat!]"));
husuperobject.biblemap.put("b19_148_14", new husuperobject(19,148,14,"És felemelte az õ népének szarvát. Dicsõítse minden õ kegyeltje: Izráel fiai, a hozzá közel való nép. Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_149_1", new husuperobject(19,149,1,"Dicsérjétek az Urat! Énekeljetek az Úrnak új éneket; dicsérje õt a kegyesek gyülekezete!"));
husuperobject.biblemap.put("b19_149_2", new husuperobject(19,149,2,"Örvendezzen Izráel az õ teremtõjében: Sionnak fiai örüljenek az õ királyukban!"));
husuperobject.biblemap.put("b19_149_3", new husuperobject(19,149,3,"Dicsérjék az õ nevét tánczczal; dobbal és hárfával zengjenek néki."));
husuperobject.biblemap.put("b19_149_4", new husuperobject(19,149,4,"Mert kedveli az Úr az õ népét, a szenvedõket szabadulással dicsõíti meg."));
husuperobject.biblemap.put("b19_149_5", new husuperobject(19,149,5,"Vígadozzanak a kegyesek tisztességben; ujjongjanak nyugvó helyökön."));
husuperobject.biblemap.put("b19_149_6", new husuperobject(19,149,6,"Isten-dicsõítés legyen torkukban, kétélû fegyver kezeikben;"));
husuperobject.biblemap.put("b19_149_7", new husuperobject(19,149,7,"Hogy bosszút álljanak a pogányokon, [és] megfenyítsék a nemzeteket!"));
husuperobject.biblemap.put("b19_149_8", new husuperobject(19,149,8,"Hogy lánczra fûzzék királyaikat, fõembereiket pedig vas-bilincsekbe."));
husuperobject.biblemap.put("b19_149_9", new husuperobject(19,149,9,"Hogy végrehajtsák rajtok a megírott ítéletet. Dicsõség ez az õ minden kegyeltjére! Dicsérjétek az Urat!"));
husuperobject.biblemap.put("b19_150_1", new husuperobject(19,150,1,"Dicsérjétek az Urat!  dicsérjétek õt az õ hatalmának boltozatán!"));
husuperobject.biblemap.put("b19_150_2", new husuperobject(19,150,2,"Dicsérjétek õt hõsi tetteiért, dicsérjétek õt nagyságának gazdagsága szerint!"));
husuperobject.biblemap.put("b19_150_3", new husuperobject(19,150,3,"Dicsérjétek õt kürt-zengéssel; dicsérjétek õt hárfán és cziterán;"));
husuperobject.biblemap.put("b19_150_4", new husuperobject(19,150,4,"Dicsérjétek õt dobbal és tánczczal, dicsérjétek õt hegedûkkel és fuvolával;"));
husuperobject.biblemap.put("b19_150_5", new husuperobject(19,150,5,"Dicsérjétek õt hangos czimbalommal, dicsérjétek õt harsogó czimbalommal."));
husuperobject.biblemap.put("b19_150_6", new husuperobject(19,150,6,"Minden lélek dicsérje az Urat! Dicsérjétek az Urat!"));

}

}